UPDATE `broadcast_text_locale` SET `Text1_lang`='Ich habe unsere bisherigen Reisen genossen, $p. Ich spüre, dass sie nur die ersten Schritte in einer langen Freundschaft sind.\n\nIhr habt mich jetzt schon dazu gebracht, viele neue Ideen und Möglichkeiten zu bedenken. Hoffentlich konnte ich Eure Augen ebenfalls für neue Ideen öffnen.\n\nIch weiß, Ihr könnt nicht lange bleiben. Das ist der Weg $gdes Schlundgängers:der Schlundgängerin;.\n\nAber bleibt auch nicht zu lange weg. Mein Hain wäre nicht derselbe ohne Euch.', `VerifiedBuild`=39653 WHERE (`ID`=206314 AND `locale`='deDE');
UPDATE `broadcast_text_locale` SET `Text_lang`='Unsere Rolle in der Vorsehung kann man derzeit nicht sicher bestimmen.\n\nIhr seid diesen Zustand womöglich gewohnt, $gSchlundgänger:Schlundgängerin;, doch für uns ist das ein sehr unvertrautes Gefühl.', `VerifiedBuild`=39653 WHERE (`ID`=204543 AND `locale`='deDE');
