UPDATE `broadcast_text_locale` SET `Text_lang`='Zwerge sind für die Allianz unentbehrlich, weil sie Kriegsmaschinen bauen. Schon allein aus diesem Grund müssen sie alle getötet werden. Zeigt keine Gnade, denn Euch wird auch keine zuteilwerden.$B$BDer Pfad, der vor Euch liegt, wird auf allen Seiten von denjenigen gesäumt sein, die Euch von Eurer gerechten Mission abhalten wollen. Es kann nur ein Ergebnis geben: Sieg oder Tod.$B$BSeid Ihr von Eurer Wahl überzeugt?', `VerifiedBuild`=39653 WHERE (`ID`=88739 AND `locale`='deDE');
UPDATE `broadcast_text_locale` SET `Text_lang`='Möge der Segen der Naaru Euch zuteilwerden.$B$BIst es nicht seltsam, wieder in Draenor zu sein? Ich hätte mir wirklich nicht träumen lassen, jemals wieder hierher zurückzukehren.', `VerifiedBuild`=39653 WHERE (`ID`=83349 AND `locale`='deDE');
