UPDATE `broadcast_text_locale` SET `Text_lang`='<Corastraszas Augen weiten sich.>$B$BIhr?! IHR habt Rheastrasza geholfen und überlebt?$B$BIch habe Euch unterschätzt, $R. Kein Wunder, dass Lord Devrestrasz Euch zu mir geschickt hat.$B$BIhr wisst sicher noch, was als Nächstes geschah. Rheastrasza wurde von Todesschwinge getötet, aber dank ihres Opfers konnte ein einziges geläutertes Schwarzdrachenei weggebracht und versteckt werden.', `VerifiedBuild`=39653 WHERE (`ID`=54338 AND `locale`='deDE');
