UPDATE `broadcast_text_locale` SET `Text1_lang`='Ihr ehrt uns, indem Ihr uns diese Information bringt. Es scheint, als hätten wir endlich den Spion in der Stadt gefunden... ein heimatloser Mann, den wir in Kürze hinrichten werden. Nehmt Eure Belohnung an, Ihr habt sie Euch verdient.', `VerifiedBuild`=39653 WHERE (`ID`=48182 AND `locale`='deDE');
UPDATE `broadcast_text_locale` SET `Text1_lang`='Diese Dokumente belasten verschiedene Trollspione. Unsere besten Attentäter werden für diesen Verrat auf sie angesetzt. Nehmt Euren Lohn und legt ihn weise an... er wird von den Steuerzahlern von Sturmwind getragen.', `VerifiedBuild`=39653 WHERE (`ID`=48181 AND `locale`='deDE');
