INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(212669, 'deDE', 'Ihr seht... ein wenig mitgenommen aus, $gmein Freund:meine Liebe;. Vielleicht wärt Ihr an meinen Diensten interessiert?', 'Ihr seht... ein wenig mitgenommen aus, $gmein Freund:meine Liebe;. Vielleicht wärt Ihr an meinen Diensten interessiert?', 39653),
(212629, 'deDE', 'Ich glaube, diese hier wird Euch passender erscheinen.', '', 39653),
(212607, 'deDE', '', 'Die Zukunft der Kyrianer liegt in den Händen jedes Einzelnen von uns. Mit dem neuen Tempel der Hingabe werden wir daran arbeiten, einen neuen Pfad zu ebnen, einen Pfad, bei dem jeder eine Stimme auf seinen eigenen Wegen hat.', 39653),
(212606, 'deDE', 'Ich werde alles, was ich habe und bin, dafür einsetzen, um den Verschmähten und den Kyrianern zu helfen, zu wahrer Einheit zurückzufinden.', '', 39653),
(212591, 'deDE', 'Wir müssen den Angriff auf das Sanktum des Kerkermeisters vorantreiben.', '', 39653),
(212589, 'deDE', 'Ich bin jetzt auf dem Weg zur Heilung. Durch meine Vergangenheit bin ich würdig für dieses Leben nach dem Tod. Ich werde so viel wie möglich aus seinen Lektionen lernen.', '', 39653),
(212588, 'deDE', 'Viele Schlundgänger, wenig Saft! Kommt später wieder, ja?', 'Viele Schlundgänger, wenig Saft! Kommt später wieder, ja?', 39653),
(212586, 'deDE', '', 'Wenn Ihr wünscht, kann ich Euch zur Elysischen Feste eskortieren.', 39653),
(212580, 'deDE', '', 'Sika liebt Arbeit. Organisieren, planen, Ressourcen finden, alles am Laufen halten!\n\nFreunde sagen \"Sika macht zu viel\", aber Sika sagt immer, ist gut so! Sika liebt das!\n\nAber jetzt versteht Sika. Freunde haben Sika nach Revendreth geschickt, zum Feiern! Maldraxxusfreund in Korthia sagt, Pausen sind wichtig.\n\nFrüher vielleicht zu viel selbst gemacht. Sika lernt, Arbeit abzugeben! Lässt Freunde jetzt helfen. Bringt den anderen Provosten bei, wie Sika zu sein! Dann machen wir alle Pause. Leben ist mehr als nur Arbeit!', 39653),
(212579, 'deDE', '', 'In meiner Schmiede war in letzter Zeit so viel los! Der Vorstoß nach Korthia hat uns mehr als genug Arbeit beschert, um die Kyrianer für die dortigen Operationen entsprechend auszurüsten.\n\nAls Nächstes müssen wir uns auf die Rückkehr der Aspiranten der Verschmähten vorbereiten und alles schmieden, was für neue Prüfungen des Pfades erforderlich sein könnte.\n\nUnd mehr Arbeit bedeutet natürlich mehr Chaos. Provosten und Aspiranten helfen mir gleichermaßen, so gut sie können. Vielleicht werden eines Tages wieder neue Aspiranten hereinströmen... aber im Moment haben wir mehr als genug zu tun.', 39653),
(212577, 'deDE', 'Ich erinnere mich daran, dass Ihr da wart, als ich fiel.\n\nEs ist weder Eure noch Uthers und auch nicht Eridias Schuld. Es ist noch nicht einmal meine eigene Schuld.\n\nKein Pfad kann für alle Ewigkeit Gültigkeit haben. Nur allzu oft handeln Wesen auf eine bestimmte Weise, weil es Tradition ist oder schon immer so gemacht wurde, anstatt den Grund zu hinterfragen, warum ihre Vorgänger auf diese Weise zu handeln begannen.\n\nIch agierte so, wie ich dachte, dass es gerecht sei. Stellt Euch mein Entsetzen vor, als ich die Wahrheit sah und Zeuge wurde, wie meine Gefährten zu Schlundgebundenen wurden. Ihr habt mir geholfen, alle zu retten, die wir konnten, aber als wir hier ankamen, schien sich nichts geändert zu haben.\n\nDanke für alles, was Ihr alle getan habt. Als Jünger der Hingabe werde ich nun tun, was ich kann, um zu helfen.', '', 39653),
(212574, 'deDE', 'Ich bin so unglaublich stolz auf mein Seelenband, wie sie in den Rängen aufsteigt, um Adrestes zu helfen, eine neue Ära für die Kyrianer einzuleiten. Wenn irgendjemand wahre Hingabe für unser Ziel verkörpert, dann sie.\n\nVorerst werde ich helfen, wo meine Hilfe gebraucht wird. Ich werde der Erste sein, der sich dem neuen Tempel verschreibt, und ein Akolyth der Hingabe werden. Vielleicht kann ich gemeinsam mit Nikolon für einen Dialog zwischen den Verschmähten und den Kyrianern sorgen, damit wir wirklich ein Volk werden können.\n\nIch habe den Verdacht, dass meine Geschichte noch lange nicht beendet ist und freue mich auf alles, was mein Pfad für mich bereithält.', '', 39653),
(212573, 'deDE', 'Ganz ehrlich, ich weiß nicht wirklich, wie ich so tief in solch bedeutende Ereignisse hineingezogen wurde. Ich bin doch nur ein Aspirant! Ich mühe mich immer noch unablässig mit Läuterungen und Prüfungen ab und bin noch weit vom Aufstieg entfernt.\n\nIch habe Kleia Unterstützung angeboten, lange nachdem ihr erstes Seelenband schon aufgestiegen war und sie keinerlei Kontakt mehr mit ihr hatte. Wir sind uns nähergekommen und selbst eine Seelenbindung eingegangen, um jede Herausforderung gemeinsam anzugehen! Wer hätte voraussehen können, was uns erwartet oder was wir bewirken?\n\nEs war mir die größtmögliche Ehre, $n.', '', 39653),
(212571, 'deDE', 'Auf das Unbekannte kann man nicht vorbereitet sein. Wir müssen offen für Veränderung sein und uns gegenseitig unterstützen. Wenn man an jene glaubt, die einem nahestehen, kann einen keine Zukunft schrecken.', '', 39653),
(212570, 'deDE', '', 'Was uns erwartet, hat noch niemand getan. Glaubt Ihr, dass wir bereit sind, eine solche Veränderung anzuführen?', 39653),
(212569, 'deDE', 'Es ist schon lange her, dass ich mich vom Aspiranten zum Jünger der Loyalität hochgearbeitet habe. In den darauffolgenden Äonen diente ich der Archon in ihrer Abwesenheit bereitwillig als Aufseher und Stimme.\n\nIn all dieser Zeit hat sich die Bastion nie verändert.\n\nDie Kyrianer hatten schon früher mit ihrem Pfad zu kämpfen. Entweder wurden sie für weitere Ausbildung in einen Tempel geschickt oder zur Richterin, um ein anderes Leben im Jenseits zu finden. Die Verschmähten schienen zunächst nichts Ungewöhnliches zu sein, bis sich ihre Flügel verdunkelten und es immer mehr wurden.\n\nIhr und Eure Freunde habt uns die Fehler in unserem Pfad aufgezeigt. Und Ihr habt uns geholfen, unseren neuen, mitfühlenden Pfad zu finden.\n\nIch bin jetzt bereit, diesen neuen Pfad zu unterstützen und für eine stärkere, gesündere Bastion zu arbeiten.', '', 39653),
(212568, 'deDE', '', 'Meine Zeit in Maldraxxus begann grausam. Meine kyrianischen Gefährten wurden gefoltert. Ich musste mitansehen, wie Thales geblendet wurde. Das Haus der Konstrukte hielt mich für Zwecke am Leben, die ich nie erfahren wollte.\n\nJeden Tag zerbrach ich etwas mehr. Ich fand Trost im Gebet um unsere Rettung mit Thales und den Provosten. Wir hatten beinahe aufgegeben, als Ihr uns gerettet habt, $gSchlundgänger:Schlundgängerin;. Wir sind Euch auf ewig dankbar.\n\nDas Haus der Auserwählten hat sich als anders erwiesen. Toleranter. Nachdem die weißen Schwingen eintrafen, um an unserer Seite zu kämpfen, und ich mit meiner Liebe wiedervereint war, wusste ich, dass ich bleiben und jenen helfen muss, die uns aufgenommen hatten.\n\nAber jetzt, wo sie auf den Pfad zurückgefunden haben, sind wir zurückgekehrt. Und ich bin froh, zurück zu sein.', 39653),
(212567, 'deDE', 'Als Aspiranten bildeten Artemede und ich schnell eine Verbindung, die der von Geschwistern glich. Es ist offensichtlich, dass das Schicksal uns als Seelenband zusammenbrachte und wir immer am stärksten sind, wenn wir zusammenarbeiten.\n\nAber in der Zeit, in der ich von meiner Schwester getrennt war, hatte Kynthia mein Herz erobert. Wir schlichen uns davon, um gemeinsam den Fluss der Anima zu beobachten, und verbrachten zärtliche Momente zusammen.\n\nAls sie verschwand, befürchtete ich das Schlimmste. Artemede gemahnte mich daran, Vertrauen in Kynthia und ihre Stärke zu haben. Als ich sie während unserer Mission in Maldraxxus fand, eilten wir aufeinander zu, um uns kurz zu umarmen, bevor wir Seite an Seite kämpften.', '', 39653),
(212561, 'deDE', '', 'Und, seid Ihr bereit, $gSchlundgänger:Schlundgängerin;? Wir müssen uns vorsichtig und flink bewegen.', 39653),
(212560, 'deDE', '', 'Vor dem Tageslicht verborgen ruht eine schlafende Flamme in der Spitze des sechsten Baumes.', 39653),
(212559, 'deDE', '', 'Hoffnung. Verrat. Opfer. Gesichter ändern sich. Die Geschichte ändert sich nicht.', 39653),
(212558, 'deDE', '', 'Der Siebte begehrt, woran die Sechs festhalten. Der Angelpunkt wankt. Alles wird sich auflösen.', 39653),
(212557, 'deDE', '', 'Auf wie viele Stimmen hört Ihr? Wie viele davon sind real?', 39653),
(212556, 'deDE', '', 'Eine Stadt der Geheimnisse. Eine Geschichte voller Lügen.', 39653),
(212552, 'deDE', 'Ich bin immer gerne bereit, meine Fähigkeiten einzusetzen, um dem Ardenwald zu helfen. Zusätzliche Nachtkrieger zu finden, erwies sich als eine hervorragende Herausforderung!\n\nNun, da die Angelegenheit mit Tyrande geklärt ist, freue ich mich auf die nächste Jagd, wie auch immer sie aussehen mag. Allerdings würde es mich nicht überraschen, wenn die Wilde Jagd gerufen wird, um dem Kerkermeister zu folgen. Er hat unserer Königin geschadet und die Schattenlande bedroht. Wir alle können es kaum erwarten, ihn zu Fall zu bringen.', '', 39653),
(212547, 'deDE', 'Gemeinsam werden wir bedeutende Dinge herstellen, Lehrling. Unglaubliche Werke und Verbesserungen wie die Schattenlande sie noch nie erlebt haben!', '', 39653),
(212546, 'deDE', '', 'Ich werde hingehen, wo immer meine Königin es verlangt. Ihr alter Feind, der Kerkermeister, ist immer noch da draußen und bereitet allen Kummer. Und wenn ich ihm keine Unannehmlichkeiten bereiten kann, dann werdet Ihr das sicher für mich übernehmen!\n\n<Mondbeere grinst.>\n\nVon dem Moment an, als Ihr hier aufgetaucht seid, wusste ich, dass Ihr etwas Besonderes seid, $n. Aber ich muss gestehen, dass Ihr sogar mehr getan habt, als ich erwartet habe! Ich liebe solche Überraschungen!\n\nFür alles, was Ihr für uns getan habt und noch tun werdet, habt Ihr meinen Dank. Ich hoffe, ich kann diese Gefälligkeiten eines Tages erwidern.', 39653),
(212545, 'deDE', '<Ihr seht die Entschlossenheit in Hipokos\' Augen, während er seine Aufregung kaum zügeln kann. Als Ihr Euch ihm nähert, lächelt er, bevor er beginnt, eine freudige Melodie zu summen.>', '', 39653),
(212544, 'deDE', 'Unzählige Jahre arbeite ich nun schon in der Bastion. Unzählige Verbesserungen und Neuerungen zum Schutze der Bastion sind mir zu verdanken und dank mir läuft auch alles viel glatter! Doch leider können selbst dem großen Obersten Schmied die Ideen ausgehen.\n\nKorthia war fantastisch! Andere Handwerker treffen und mit ihnen ein gemeinsames Ziel verfolgen! Haben viel unglaubliche Sachen gebaut, sogar Gargoyles geheilt! Hab viel gelernt und bin wieder bis oben hin inspiriert.\n\nIch brauche mehr Zusammenarbeit! Hipokos ist mein neuer Lehrling. Mit seiner Erfahrung in Maldraxxus und seiner Leidenschaft fürs Handwerk wird er Wunder vollbringen... mit meiner Hilfe natürlich.\n\nAußerdem ist er ein guter Zuhörer. Und ich bin ein großer Redner.', '', 39653),
(212539, 'deDE', 'Seltsamerweise... hat sich das gut angefühlt.\n\nIch habe mich an den Frieden erinnert, den ich in ihrer Gegenwart immer spürte, die tröstliche Ruhe, die sie mir verlieh, als wir dem Dunklen Gott gegenübertraten. Ich habe mich daran erinnert, wie ich an der Seite der anderen Champions diesen letzten verzweifelten Kampf kämpfte. Wie ich Elunes Kraft für meine Verbündeten und gegen die dunklen Diener einsetzte. Wie schön ihre Kraft war, als sie das Böse wegbrannte, das so viele von uns getötet hatte. Die bittere Genugtuung, als ich mit ihrem Licht meine Welt befreite.\n\nAber... noch mehr habe ich mich an ihre Liebe erinnert und an die bittersüße Trauer, die sie empfand, als ich um ihre dunklen Kräfte bat.\n\nSie wusste wohl, dass ich hier landen und heilen würde.\n\nDanke, $n. Das hat mir den Abschluss verschafft, den ich gebraucht habe.', '', 39653),
(212535, 'deDE', '', 'Ich bin nicht sicher, $n.\n\nIch war schon einmal an den Traum gebunden. Und nun bin ich durch Kräfte, die ich nicht ganz begreifen kann, an dieses Reich gefesselt.\n\nDie Winterkönigin gab ihre eigene Essenz, um mich zu retten, und ich werde ihre Güte zurückzahlen, so gut ich kann. Aber darüber hinaus frage ich mich, wann ich zu meiner Familie in Azeroth zurückkehren kann... falls eine solche Wiedervereinigung überhaupt jemals stattfinden kann.\n\n<Ysera lächelt Euch an.>\n\nAber dank Euch habe ich Hoffnung. Ihr habt nicht nur geholfen, den Ardenwald wiederherzustellen, sondern auch meine geliebte Tyrande vor einer Wut gerettet, die sie fast verzehrt hätte.\n\nDie Zukunft mag ungewiss sein, und der Kerkermeister bedroht alles, was uns lieb und teuer ist. Aber was auch immer kommen mag, ich weiß, dass Ihr Euch allem tapfer stellen werdet.', 39653),
(212523, 'deDE', '', 'Ich würde mir nicht anmaßen, die Wege uralter Wesen wie der Winterkönigin und ihrer Schwester zu ergründen. Aber da gibt es offensichtlich eine lange und schmerzvolle Vorgeschichte.\n\nDoch unsere Königin ist stark und ich bin mir sicher, dass sie finden wird, was wir brauchen.\n\nTyrande mag gerettet sein, doch es besteht immer noch ein Ungleichgewicht. Wir werden weiter kämpfen, um zu retten, was noch zu retten ist.\n\nDas schwören wir.', 39653),
(212522, 'deDE', 'Ich habe keine Sekunde daran gezweifelt, dass die Winterkönigin und die anderen sie retten können.\n\nThiernax und die anderen Nachtkrieger haben zu Lebzeiten so viel gegeben und hier dann noch mehr. Wo auch immer sie in den Schattenlanden dienen.\n\nIhr Mut inspiriert mich!', '', 39653),
(212520, 'deDE', '', 'Bei dieser ungezügelten Macht dachte ich, dass sie bestimmt verloren sein würde! Und die Winterkönigin... so habe ich sie noch nie gesehen!\n\nAber jetzt haben wir zum ersten Mal seit langer Zeit echte Hoffnung. Für den Ardenwald.\n\nIch wünschte nur, dass Ara\'lon... Derawyn, Korenth... diesen Moment miterleben könnten.', 39653),
(212516, 'deDE', 'Mit Eurer Hilfe haben wir so viele Geister im Ardenwald gerettet. Ihre Träume werden fortbestehen und wunderschön sein.', '', 39653),
(212515, 'deDE', '', 'Wir haben Verluste erlitten, doch gemeinsam sind wir stärker denn je.', 39653),
(212514, 'deDE', '', 'Ich werde für die Wilde Jagd kämpfen und den Schutz aller Haine zu meiner Aufgabe machen.\n\nIch hoffe, dass der Ardenwald eines Tages vollständig wiederhergestellt sein wird.', 39653),
(212513, 'deDE', 'Ich wurde angekettet. Mit unbarmherzigen Qualen gepeinigt.\n\nDoch mithilfe eines Champions aus Azeroth bin ich wieder frei.\n\nDieser verfluchte Ort... er ist die Qual selbst. Noch nie habe ich mich so allein gefühlt. So hoffnungslos.', '', 39653),
(212512, 'deDE', '', 'Die Diener des Kerkermeisters haben meine Wahrnehmung getrübt. Ich kann kaum noch Freund von Feind unterscheiden.\n\nWas für ein Glück, dass $gein anderer Schlundgänger:eine andere Schlundgängerin; gekommen ist, um mir bei der Flucht aus dem dunklen Turm zu helfen.\n\nJetzt müssen wir nur Anduin vor einem noch schlimmeren Schicksal bewahren.', 39653),
(212489, 'deDE', 'Es ist lange her, dass ich die lebendige Weite von Maldraxxus gesehen habe. Während die Bewohner zum Chaos neigen, hat sich das Land nicht verändert.', '', 39653),
(212447, 'deDE', '', 'Als Hand der Reinheit obliegt es mir, zu dienen. Ich habe die Aspiranten angeleitet, die Reinigung ihrer vergangenen Leben durchzuführen und ihre Erinnerungen loszulassen.\n\nDas ist jetzt Vergangenheit.\n\nIch verstehe die Verschmähten jetzt mehr denn je. Lysonias Verrat und ihr Wahnsinn verfolgen mich jeden Tag. Mein Seelenband... Ich höre immer noch ihre Stimme meinen Namen rufen.\n\nIn der Vergangenheit hätte ich diese Erinnerung vielleicht getilgt und meinem Verstand diese Bürde genommen. Aber Lysonias Anwesenheit ist tief in meinen schönsten Erinnerungen verankert. Wie könnte ich sie vergessen, ohne einen Teil von mir selbst zu verlieren?\n\nIch könnte sie nie willentlich vergessen. Auch wenn mich die Erinnerung an sie jetzt schmerzt, muss ich mich diesen Gefühlen stellen. Ich werde mich wie alle bemühen, neue Stärke zu finden.', 39653),
(212446, 'deDE', 'Als ich in der Bastion ankam, konnte ich nur daran denken, was mir angetan worden war. Ich ließ zu, dass Bitterkeit, Schmerz und Rache mich verzehrten, und ich tat das Unverzeihliche. Ich sehe jetzt, wie falsch ich lag, und ich wünschte, meine Handlungen könnten rückgängig gemacht werden. Leider muss ich mit den Folgen leben. Und schlimmer noch: Arthas auch.\n\nIch weiß nicht, ob ich mir das selbst jemals vergeben kann.\n\nAber die Kyrianer sind auf Versöhnung bedacht, und die Verschmähten sind bereit, ihre Differenzen beizulegen. Die Kluft zwischen ihnen wird geringer, und diese neu gefundene Einigkeit wird eine neue Ära einleiten. Auch Ihr habt mich auf den Weg der Heilung gebracht, den ich bis zum Ende gehen muss, so sehr es auch schmerzen mag.\n\nIhr habt mir geholfen, das Licht wiederzufinden, und dafür bin ich Euch ewig dankbar.', '', 39653),
(212445, 'deDE', 'Ich kann Eure Gefühle auf meine eigene Weise verstehen, Eridia. Aber die Heilung wird kommen, und schließlich wird sich Euer Herz erholen. Es wird nur Zeit brauchen... für uns beide.', '', 39653),
(212444, 'deDE', '', 'Dies sollte ein freudiger Anlass sein. Aber ich denke immer noch jeden Tag an Lysonia... Es fühlt sich an, als wäre mir ein Stück meiner Selbst für immer genommen worden.', 39653),
(212442, 'deDE', 'Ich möchte Euch meinen Dank aussprechen, $gSchlundgänger:Schlundgängerin;. Wäret Ihr nicht gewesen, hätte ich es vielleicht nie aus Maldraxxus heraus geschafft.\n\nIch habe gelitten, das ist wahr, aber ich habe nie aufgegeben. Das lag teilweise auch an Eurem Beispiel. Ihr wolltet keinen von uns zurücklassen und Eure unerschütterliche Entschlossenheit hat mich beflügelt.\n\nObwohl er es nicht sagen kann, weiß ich, dass es Hipokos genauso empfindet. Wir beide haben uns verbunden. Ich vermute, dass er weiterhin meine Augen sein wird und ich seine Stimme.', '', 39653),
(212437, 'deDE', 'Der Oberste Schmied hält große Stücke auf Euch. Ich werde mich bemühen, die Bastion in Eurer Abwesenheit weiter zu verteidigen.', '', 39653),
(212436, 'deDE', 'Die Freude über den Aufstieg lässt sich kaum in Worte fassen. Die Kyrianer erfahren langsam Heilung, ebenso wie die Verschmähten.\n\nAuch wenn es einigen nicht leicht fällt, ihre Taten zu vergessen, denke ich, dass unser aller Herzen zur Vergebung fähig sind.', '', 39653),
(212435, 'deDE', 'Ah, die Ikone der Sterblichen! Ohne Euch wären wir immer noch Aspiranten.\n\nIch werde nie vergessen, was Ihr für uns getan habt, $gSchlundgänger:Schlundgängerin;. Ich danke Euch.', '', 39653),
(212431, 'deDE', '', 'Mich überwältigt, dass Ihr uns so viel Eurer Zeit und Hilfe zuteil werden lasst, Schlundgänger. Von Kyrianern erwartet man solche Hingabe, doch von Sterblichen? Ihr ehrt uns alle.', 39653),
(212430, 'deDE', 'Pelagos, Ihr habt Euch als der Mitfühlendste von uns allen bewiesen. Ich danke Euch.', '', 39653),
(212429, 'deDE', 'Was immer auch geschehen sein mag, ich bin froh, dass Ihr zu uns zurückgekehrt seid, Nikolon.', '', 39653),
(212428, 'deDE', '', 'Versucht es noch einmal.', 39653),
(212427, 'deDE', '', 'Interessant! Ich habe das Gerät eingestellt, um die Zielkoordinaten anzupassen.', 39653),
(212424, 'deDE', '', 'Die Verstärkung der Verteidigung läuft gut. Ich hoffe, die Schlundgebundenen greifen eher früher als später an. Ich könnte ein paar Schwertübungen brauchen.', 39653),
(212423, 'deDE', '', 'Maldraxxus hat ein paar Spione, die die Schlüsselpunkte der Bewegungen der Schlundgebundenen innerhalb Korthias überwachen. Meine Partnerin in der Gegend hätte schon vor einer Weile zurückkehren sollen. Ich bin zunehmend... besorgt.', 39653),
(212422, 'deDE', 'Die Tierwelt hier ist faszinierend! Sie ist unglaublich widerstandsfähig, trotz der großen Veränderungen des Ökosystems. Aber die Pflanzen haben damit zu kämpfen.', '', 39653),
(212421, 'deDE', '', 'Erhebung kann derzeit nicht beendet werden. Chance auf Fehlschlag aufgrund feindseliger Lebewesen bei 95%. Wächtereinheit wird benötigt.', 39653),
(212420, 'deDE', '', 'Ich hätte nie gedacht, dass der Polemarch und ich uns einmal so nahestehen würden. Und jetzt schaut uns an. Schaut ihn an! Es ist eine Ehre, dabei zu sein, wenn mein Freund eine solche Ehre erfährt, und in den kommenden Äonen mit ihm zusammenzuarbeiten.', 39653),
(212419, 'deDE', '', 'Die Verschmähten haben sich uns wieder angeschlossen und ein neuer Pfad öffnet sich. Adrestes und ich werden einen neuen Tempel erschaffen und die Kyrianer anleiten, Beziehungen und Vertrauen wiederherzustellen und ihre Denkweisen neu zu gestalten...\n\nIch bin von all dem ganz überwältigt.\n\nAufgrund der Dürre war ich viel zu lange eine Aspirantin. Als wir uns trafen, schien alles zu verschwimmen. Wir haben getan, wozu andere Kyrianer, ob Aufgestiegene oder Aspiranten, zuvor noch nie imstande waren. Wir haben gegen Paragons gekämpft! Wir sind dem Schlund entkommen, mehrere Male! Wir haben sogar Beziehungen zu den anderen Reichen aufgebaut.\n\nBin ich wirklich würdig, eine Hand zu werden und das Kämpfen nach all dieser Zeit einzustellen?\n\nZusammen mit unseren Freunden werde ich mein Bestes geben, damit wir Erfolg haben.', 39653),
(212417, 'deDE', '', 'Vor langer Zeit habe ich mich der Förderung der Aspiranten verschrieben. Am Anfang war ich nicht die Einzige... aber als die Dürre anhielt, wurden meine Gefährten an anderer Stelle gebraucht, bis ich die Einzige war, die übrig blieb.\n\nMeine Befehle lauteten, die Aspiranten weiter auszubilden und abzuwarten, bis die Dürre vorüber sein würde. Ich sollte ihnen nicht sagen, dass jede einzelne Seele direkt in den Schlund geschickt wurde und die Schattenlande in Trümmern lagen. Ich habe ihnen gesagt, was ich konnte... aber ich war allein und musste die Ruhe bewahren.\n\nDass meine harte Arbeit zunächst durch mein Mitwirken am Pfad des Aufstiegs und jetzt erneut durch meine Stellung als Polemarchin der Bastion gewürdigt würde... Ich wüsste keine größere Ehre.\n\nHabt meinen Dank. Und es tut mir leid, dass wir so einen schlechten Start hatten.', 39653),
(212414, 'deDE', '', 'So viele Geheimnisse, so wenig Zeit, um sie zu teilen.', 39653),
(212413, 'deDE', '', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich werde alles andere koordinieren.', 39653),
(212412, 'deDE', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich werde alles andere vorbereiten.', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich werde alles andere vorbereiten.', 39653),
(212411, 'deDE', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich kümmere mich um alles andere.', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich kümmere mich um alles andere.', 39653),
(212410, 'deDE', '', 'Nutzt den Befehlstisch, wenn Ihr bereit für die Suche nach der Animaquelle seid. Ich kümmere mich um alles andere.', 39653),
(212400, 'deDE', '%s schnauft zur Antwort und stürmt los in Richtung Schlund.', '', 39653),
(212399, 'deDE', 'Wir müssen $uden Schlundgänger:die Schlundgängerin; unverzüglich zu Baronin Draka in der Verdammnisfestung bringen!', 'Wir müssen $uden Schlundgänger:die Schlundgängerin; unverzüglich zu Baronin Draka in der Verdammnisfestung bringen!', 39653),
(212398, 'deDE', '%s wiehert zur Antwort und stürmt los in Richtung Schlund.', '', 39653),
(212397, 'deDE', 'Wir müssen $uden Schlundgänger:die Schlundgängerin; unverzüglich zu Prinz Renathal im Tremaculum bringen!', 'Wir müssen $uden Schlundgänger:die Schlundgängerin; unverzüglich zu Prinz Renathal im Tremaculum bringen!', 39653),
(212386, 'deDE', 'Wie schrecklich vorhersehbar.', '', 39653),
(212385, 'deDE', 'Schreit für mich!', '', 39653),
(212380, 'deDE', 'Ah, $gSchlundgänger:Schlundgängerin;... das nenne ich eine interessante Wendung der Ereignisse.\n\nBitte folgt mir.', '', 39653),
(212378, 'deDE', 'Gut gemacht, treuer Diener. Ich werde zurückkehren.', '', 39653),
(212376, 'deDE', 'Ich muss schon sagen, äußerst enttäuschend.', '', 39653),
(212375, 'deDE', 'Eure Eitelkeit kostet Euch alles.', '', 39653),
(212374, 'deDE', 'Einigermaßen beeindruckend. Dennoch, ich freue ich mich darauf, Euch auszulöschen.', '', 39653),
(212373, 'deDE', 'Die Vision von Graf Denathrius lacht, als ihr das Dessert vom Gesicht trieft.', '', 39653),
(212361, 'deDE', 'Ah, es ist gut, dass Ihr da seid, $gSchlundgänger:Schlundgängerin;.', '', 39653),
(212349, 'deDE', 'Nur zusammen können die Pakte gegen Zovaal bestehen.', '', 39653),
(212347, 'deDE', 'Dank Euch wurden die Pakte an ihre heiligen Pflichten erinnert. Mit den neu manifestierten Siegeln kann ich einen Schlüssel schmieden, um Zovaal in das Land der Ersten zu folgen.\n\nSeid Ihr bereit anzufangen?', '', 39653),
(212342, 'deDE', 'Ich habe Sylvanas Windläufer im Kampf gesehen. Sie war schon immer eine ehrfurchtgebietende Gegnerin.\n\nAber ich habe noch nie gesehen, dass sie über solche Kräfte verfügt.', '', 39653),
(212341, 'deDE', '', 'Ich dachte, ich wüsste, wozu Sylvanas fähig ist. Ich habe geglaubt, wir könnten sie aufhalten und Anduin retten.\n\nAber der Kerkermeister hatte die ganze Zeit die Oberhand.', 39653),
(212323, 'deDE', 'Seht Euch vor. Verwechselt seine Sturheit nicht mit Torheit. Vertraut seinen Instinkten, $p...', '', 39653),
(212322, 'deDE', '', 'Und wenn Ihr Euch nicht um sie kümmert, wird sie sich selbst um Euch kümmern... und dann zu mir zurückkehren.', 39653),
(212321, 'deDE', 'Geht und dient, $p. Möge Euer Aquilon Euch immer begleiten.', 'Geht und dient, $p. Möge Euer Aquilon Euch immer begleiten.', 39653),
(212308, 'deDE', '<Stanikos sieht Euch mit großen Augen an. Ihr bemerkt, dass er vor Aufregung und Furcht am ganzen Körper zittert.>\n\nIch... d-danke Euch. Ihr tut Gutes. Ihr seid $gmein Held:meine Heldin;.', '', 39653),
(212307, 'deDE', '', 'Flieg, Larvi, Flieg! Fühle den Wind unter deinen... Mandibeln!', 39653),
(212306, 'deDE', 'Wir kümmern uns um Larvi, bis seine Flügel da sind. Und jetzt gewöhnen wir ihn schon einmal an das Gefühl des Fliegens!', '', 39653),
(212299, 'deDE', '<Das scheint ein verlegter Venthyrfoliant zu sein.>', '', 39653),
(212295, 'deDE', '', 'Aber ich bin sicher, hier gibt es nichts, über das wir uns Sorgen machen müssten...', 39653),
(212294, 'deDE', '', 'Im Gegenzug werde ich Euch informieren, falls ich in Ve\'rayns Aufzeichnungen irgendwelche Kommentare zu Eurer Unterhaltung mit ihr finde.', 39653),
(212293, 'deDE', '', 'Das Kartell Ve wird weiter Agenten auf mich ansetzen, aber Ve\'rayns Ende verschafft mir deutlich mehr Zeit.', 39653),
(212291, 'deDE', '', 'Ihr habt mir einen großen Gefallen getan. Ve\'rayn erweist sich schon länger als... etwas problematisch.', 39653),
(212289, 'deDE', 'Nein! Die Kutsche! Alles versaut...', '', 39653),
(212287, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Gorakklauenfetisch', 39653),
(212285, 'deDE', 'Animanachschub aus Korthia!', '', 39653),
(212284, 'deDE', 'Danke für die Hilfe. Und jetzt ab und schön die Welt retten und so.', '', 39653),
(212283, 'deDE', 'Aber nicht weiter Anima trinken, wenn wir fast da sind... Findet der Prinz gar nicht lustig, wenn Passagiere so was machen, alles klar?', '', 39653),
(212282, 'deDE', 'Aber gut, dass Ihr da wart. Wegen all der Bösen und so. Hier, ein Schluck Anima. Habt Ihr verdient!', '', 39653),
(212281, 'deDE', 'Der Prinz und seine Armee sind irgendwo ganz am Rand vom Schlund. Hab ihnen aber gesagt: \"Anima bis da raus? Kein Problem!\"', '', 39653),
(212280, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Holzschnitzerei der Familie Lang', 39653),
(212279, 'deDE', 'Ich hab heute extra mehr Anima mit, nur für den Fall, dass das doch kein Witz war... War\'s aber, oder?', '', 39653),
(212278, 'deDE', 'Die ist echt zum Totlachen. Haha!', '', 39653),
(212277, 'deDE', 'Sie hat gesagt, wenn ich noch mal ohne Anima ankomme, haut sie mich in der Mitte durch...', '', 39653),
(212276, 'deDE', 'Ob Emeni wohl im Lager ist, wenn wir da sind...', '', 39653),
(212271, 'deDE', 'Immer rauf mit Euch, wenn Ihr zum Angriff mitfahren wollt. Ansonsten, bis dann mal.', '', 39653),
(212270, 'deDE', 'Genug im Dreck gespielt. Ab jetzt wird nicht mehr angehalten!', '', 39653),
(212269, 'deDE', 'Das!', '', 39653),
(212268, 'deDE', 'Dochtschleck zeigt auf das riesige Konstrukt, das die Brücke blockiert.', '', 39653),
(212267, 'deDE', 'Das ist ja noch schlimmer als kaputte Räder...', '', 39653),
(212266, 'deDE', 'Oh, Dreck.', '', 39653),
(212265, 'deDE', 'Egal, was ich eigentlich meine, ist...', '', 39653),
(212264, 'deDE', 'Und was soll das überhaupt? Alle Leute einsperren, die er nicht leiden kann? Ich kann Laurent auch nicht leiden, aber sperr ich den irgendwo ein?', '', 39653),
(212263, 'deDE', 'Ich mein, all die rumschwebenden Glühlichter sind ja ganz nett, aber die Straßen? Echt nix für Kutschen!', '', 39653),
(212262, 'deDE', 'Der Schlund ist schlimmer als die Schlammlache, aus der sie mich gezogen haben. Wenn das hier alles der Kerkermeister war, dann haben alle recht: Der muss weg!', '', 39653),
(212261, 'deDE', 'Na also! Vier Räder, nix kaputt, weiter gehts. Alles einsteigen!', '', 39653),
(212260, 'deDE', 'Ich wette, Steinkopf hat mal wieder auf den Kutschen gesessen! Ich sag noch, die gehen am Ende noch kaputt, sag ich...', '', 39653),
(212259, 'deDE', 'Noch ein Rad kaputt?!', '', 39653),
(212258, 'deDE', 'Passiert bestimmt nicht noch mal. Kein Stück! Niemals!', '', 39653),
(212257, 'deDE', 'Einfach Pech aus\'m Drech, hm?', '', 39653),
(212256, 'deDE', 'Ist das zu fassen? Geht hier draußen doch einfach so ein Rad kaputt?', '', 39653),
(212255, 'deDE', 'Also gut, Pferdchen. Nix wie weg hier!', '', 39653),
(212254, 'deDE', 'So! Rad ist wieder heil. Alles einsteigen!', '', 39653),
(212253, 'deDE', 'Schön die Augen auf. Ich reparier mal das Rad, alles klar?', '', 39653),
(212252, 'deDE', 'Immer langsam, Pferdchen! Ein Rad ist grade gesprungen...', '', 39653),
(212251, 'deDE', 'Wenn wir da mal Zeit für uns haben, kann Steinkopf mich in die Luft werfen. Vielleicht komm ich ja bis an den Turm, haha!', '', 39653),
(212250, 'deDE', 'Prinz Renathal macht bei dem Angriff auf das Tremaculum keine halben Sachen. Anima, Gräber, Tee... Alles da.', '', 39653),
(212249, 'deDE', 'Aber die Nekrolords sind voll in Ordnung. Die wollen was, ich besorg\'s ihnen. Kein Problem.', '', 39653),
(212248, 'deDE', 'Keine Ahnung, warum ich für die Maldraxxi die ganze Anima bis hier raus schleppen soll... Die haben doch ihre Nekropole mitgebracht. Da oben im Himmel!', '', 39653),
(212247, 'deDE', 'Hab gehört, die kämpfen da mit Lulatschkonstrukten. Hoffentlich werden wir nicht plattgetrampelt, haha!', '', 39653),
(212246, 'deDE', 'Mein Kumpel Theotar arbeitet mit den Kyrianern vor dem großen Schmiedegebiet.', '', 39653),
(212245, 'deDE', 'Schätze mal, die brauchen die Anima hier für ihre großen schicken Zauber und so.', '', 39653),
(212244, 'deDE', 'Die Feen wollen rausfinden, warum ne unheimliche Dunkelheit sich über den Tiegel ausbreitet.', '', 39653),
(212243, 'deDE', 'Hoffe, Ihr habt Eure Waffen mitgebracht... Das hier wird echt hart.', '', 39653),
(212242, 'deDE', 'Alles gut festgezurrt. Alle Mann an Bord! Nächster Halt: der Schlund!', '', 39653),
(212234, 'deDE', 'Möge unser Handel uns beiden zum Vorteil gereichen.', '', 39653),
(212231, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Schattenschnittkurzschwert', 39653),
(212230, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Ring der Selbstreflexion', 39653),
(212229, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Geheimnisvolles Entschlüsselungsgerät', 39653),
(212228, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Buch der Bindung: Der gepeinigte Zauberer', 39653),
(212227, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Obelisk düsterer Kunde', 39653),
(212226, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Ewiglebende Statuette', 39653),
(212224, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Sack voller fremdartiger Erde', 39653),
(212223, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Trommel des Todesloas', 39653),
(212222, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Chiffre der Erkenntnis', 39653),
(212221, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Instabile Sprengstoffkugel', 39653),
(212220, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Der Netherstern', 39653),
(212219, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Tarnung des Wechselbalgs', 39653),
(212218, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Bollwerk der göttlichen Absicht', 39653),
(212217, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Runenmarke', 39653),
(212216, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Singstahlbarren', 39653),
(212215, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Himmelskarte der Schattenlande', 39653),
(212214, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Buch der Bindung: Die wahnsinnige Hexe', 39653),
(212213, 'deDE', '', 'Die Übernahme von Korthia durch den Schlund beschert uns jede Menge Gelegenheiten, mehr über dieses Reich zu erfahren.\n\nNatürlich ist das mit gewissen Risiken verbunden, aber Geheimnisse haben nun mal ihren Preis und liegen nicht einfach so auf der Straße.\n\nWas wir hier alles lernen, könnte sich als unbezahlbar erweisen.', 39653),
(212211, 'deDE', 'Dieses Relikt muss noch geborgen werden.', 'RELIKT FEHLT - Talisman des ewigen Gelehrten', 39653),
(212209, 'deDE', 'Der Kerkermeister darf die Ewige Stadt nicht erobern!', '', 39653),
(212201, 'deDE', '', 'Verstehe. Das ist ja zu schade. Kommt einfach wieder zurück zu mir, wenn Ihr Zeit habt.', 39653),
(212200, 'deDE', '', 'Vergesslich... Interessant.\n\n<Ve\'rayn legt ihre Notizen beiseite.>\n\nAlso, wo finde ich Ve\'nari? Sie hat um ein mächtiges Artefakt gebeten, und ich habe keine Mühen gescheut, es für sie besorgen.', 39653),
(212199, 'deDE', '', 'Geistige Verwirrung... Interessant.\n\n<Ve\'rayn legt ihre Notizen beiseite.>\n\nAlso, wo finde ich Ve\'nari? Sie hat um ein mächtiges Artefakt gebeten, und ich habe keine Mühen gescheut, es für sie zu besorgen.', 39653),
(212198, 'deDE', '', 'Trotz meiner Bedenken haben sich Kael\'thas und die Baronin anscheinend gut ergänzt.\n\nOb das nun an Eurer Beteiligung lag oder an ihrer Eigeninitiative, ist irrelevant. Am Ende zählt nur, dass Kael\'thas einen Teil der Lasten ablegen konnte, die seine Seele einfach nicht loslassen wollte.\n\nEr ist wirklich vielversprechend. Und mächtig.', 39653),
(212197, 'deDE', '', 'Täuschung oder möglicherweise auch Wahnsinn... Interessant.\n\n<Ve\'rayn legt ihre Notizen beiseite.>\n\nAlso, wo finde ich Ve\'nari? Sie hat um ein mächtiges Artefakt gebeten, und ich habe keine Mühen gescheut, es für sie zu besorgen.', 39653),
(212174, 'deDE', '', '<Ve\'rayns Ton wird schärfer und ihre Stimme immer lauter.>\n\nSchluss mit Euren Täuschungen, $gSchlundgänger:Schlundgängerin;.\n\nAntwortet mir.\n\nWo. Ist. Ve\'nari?', 39653),
(212173, 'deDE', '', 'Verlässt sich auf das Glück... Interessant.\n\n<Ve\'rayn legt ihre Notizen beiseite.>\n\nAlso, wo finde ich Ve\'nari? Sie hat um ein mächtiges Artefakt gebeten, und ich habe keine Mühen gescheut, es für sie zu besorgen.', 39653),
(212172, 'deDE', '', 'Und nun, was viel wichtiger ist... Wie habt Ihr mich wieder gefunden?', 39653),
(212171, 'deDE', '', 'Ist vermerkt. Frage zwei:\n\nWas, glaubt Ihr, sucht der Kerkermeister in diesem Land?', 39653),
(212170, 'deDE', '', 'Wirklich nett von Euch, dass Ihr Euer Wissen um Korthia mit uns teilt.\n\nFrage eins:\n\nFindet Ihr es schwierig, inmitten der unerwarteten und unbekannten Geheimnisse in diesem seltsamen Land zu überleben?', 39653),
(212168, 'deDE', '', 'Bin ich froh, dass Ihr hier seid, $gSchlundgänger:Schlundgängerin;.\n\nIch habe zu unserer letzten Untersuchung noch eine Reihe von Fragen an Euch.\n\nWenn Ihr alle beantwortet, werdet Ihr selbstverständlich auch angemessen entschädigt.', 39653),
(212162, 'deDE', '', 'Viele Gelegenheiten warten hier nur auf uns. Vorausgesetzt, man weiß, wo man suchen muss.', 39653),
(212145, 'deDE', 'Zovaal mag die Schlacht gewonnen haben, nicht aber den Krieg. Ein Ziel vereint uns, und gemeinsam wird der Sieg unser sein.', '', 39653),
(212144, 'deDE', 'Ich habe die Pakte aufgerufen, ihre Siegel hierher nach Korthia zu bringen. Sie sind der Schlüssel zu unserem Sieg... so wie Ihr auch, Schlundgänger.', '', 39653),
(212143, 'deDE', 'Kyrestia war immer die standhafteste von uns. Dass die Archon bereit ist, einen neuen Weg einzuschlagen, beweist ihre Hingabe zu den Kyrianern.', '', 39653),
(212142, 'deDE', 'Kummer und Verständnis haben das Siegel der Nachtfae neu geboren. Und vielleicht auch ihr Band miteinander.', '', 39653),
(212140, 'deDE', 'Die Winterkönigin ist an ihr Gegenstück im Reich des Lebens gebunden. Zusammen verkörpern sie die Balance des großen Kreislaufs.', '', 39653),
(212138, 'deDE', 'Ihr müsst dennoch wachsam bleiben. Die Rückkehr der Nathrezim verheißt für uns alle nichts Gutes.', '', 39653),
(212136, 'deDE', 'Nun da Renathal die Medaillons versammelt hat, können die Venthyr das Siegel ersetzen, das Denathrius Zovaal ausgeliefert hat.', '', 39653),
(212135, 'deDE', 'Mit einer gemeinsamen Aufgabe vor uns schmiede ich das Siegel der Nekrolords neu. Draka soll es verwahren, bis ich es brauche.', '', 39653),
(212134, 'deDE', 'Vyraz hat für seinen Verrat gebüßt. Erneut stehen die Häuser Maldraxxus\' Seite an Seite.', '', 39653),
(212131, 'deDE', 'Vielleicht gehört Ihr hierher. Für immer.', '', 39653),
(212122, 'deDE', '<Der Fetisch wurde unverkennbar von den Drust gefertigt und strotzt nur so vor der verderbten Magie von Thros. Ihr wisst nicht, wie er nach Korthia gekommen ist oder ob den Drust bewusst ist, dass er sich hier befindet.\n\nIn Anbetracht dessen, was Ihr über die Drust wisst, wäre es vielleicht das Beste, den Fetisch nicht zu lange zu untersuchen.>', '', 39653),
(212121, 'deDE', '<Diese Schnitzerei ist sehr abgenutzt und weist schwachen Gravuren auf, die einst tief und scharf waren und ein unbekanntes Ereignis an einer Art verziertem Tempel zeigen. Die Architektur weist auf die Pandaren hin, aber Ihr wisst, dass ein solcher Tempel nicht existiert.\n\nIst dies die Darstellung eines Gebäudes, das längst verfallen ist... oder eines, das erst noch gebaut werden muss?>', '', 39653),
(212120, 'deDE', '<Die auf den ersten Blick unscheinbare Klinge fängt das Licht zuweilen so ein, dass man von ihrem Glanz kurzzeitig geblendet wird.\n\nDie Schatten selbst scheinen vor dem Schwert zurückzuweichen, als fürchteten sie seine Macht. Ihr bemerkt, dass einer von ihnen sich irgendwie an der Schneide der Klinge geschnitten zu haben scheint.\n\nNeben anderen Qualitäten ist diese Waffe vermutlich hervorragend geeignet, um die Dunkelheit selbst zu bekämpfen.>', '', 39653),
(212119, 'deDE', '<Dieses auf den ersten Blick eher unscheinbare Ring erzeugt ein Reflexion wie eine schimmernde Fata Morgana in der Wüste, wenn man den Edelstein aus einem schrägen Winkel betrachtet.\n\nIhr habt nicht erwartet, dass der Name dieses Relikts so wörtlich zu verstehen sei.>', '', 39653),
(212118, 'deDE', '<Das Gerät scheint von den Mittlern entwickelt, aber unendlich viel komplexer zu sein. Roh-Suir verwies auf die beabsichtigte Verwendung zur Erkennung der \"wahren Absicht\" einer bestimmten Äußerung.\n\nIhr seid nicht sicher, wer dieses Gerät hergestellt haben könnte, aber Ihr vermutet, dass es sich in den richtigen Händen als außerordentlich wertvoll erweisen könnte.>', '', 39653),
(212117, 'deDE', '<Als Ihr dieses Buch gefunden habt, sprach die gedämpfte Stimme mit eher ruhiger Stimme. Jetzt ist es bis auf eine Seite wiederhergestellt und schreit Euch geradezu an.\n\nDer Foliant raschelt mit jedem gesprochenen Wort.>\n\n\"Seid ihr hier, um mich freizulassen? Ihr müsst es tun!\n\nBergt nur noch diese eine azurblaue Seite...\n\nUnd denkt daran: nicht die blutroten Seiten anfassen und nicht das andere Buch öffnen. Sie will Euch nur mit ihren Lügen verführen! Ich habe Euch gewarnt!\"', '', 39653),
(212116, 'deDE', '<In Gegenwart dieses seltsamen Totems könnt Ihr eine leise Stimme hören, die verführerische Lügen und verrückte Wahrheiten murmelt. Oder vielleicht verführerische Wahrheiten und verrückte Lügen? Möglicherweise sind sie alle wahr... oder möglicherweise alle falsch.\n\nAls Dunkelheit Eure Sicht zu trüben beginnt, tretet Ihr schnell von dem Totem zurück.>', '', 39653),
(212115, 'deDE', '<Es ist schwierig, das Alter der Statuette zu bestimmen, aber etwas an ihr fühlt sich älter an, als man sich vorstellen kann. Wer weiß, welche Ereignisse sie im Laufe der Äonen miterlebt hat.\n\nRoh-Suir hat Euch davor gewarnt, ihren Einflüsterungen zu trauen. Die Weisheiten, die sie mitzuteilen versucht, sind Teil einer Täuschung.>', '', 39653),
(212114, 'deDE', '<Die Erde in diesem Sack zeigt ein tiefes, sattes Braun... fast schwarz. Von ihr geht ein deftiger Geruch aus, der nach Erde und Frühling duftet.\n\nRoh-Suir hat erwähnt, dass jeder Samen, der in dieser Erde gepflanzt wird, unabhängig von dem Klima, das ihn umgibt, vorzüglich wächst und gedeiht. Vielleicht könnte man damit beizeiten Korthias Vegetation wieder zum Leben erwecken.>', '', 39653),
(212113, 'deDE', '<Bwonsamdis Gesicht prangt mit einem grellen, aufgeblasenen Grinsen auf dem Fell der Trommel. Ihr könntet schwören, dass Ihr aus dem Augenwinkel sehen könnt, wie es Euch hin und wieder zuzwinkert.\n\nDie Trommel fühlt sich kalt an und erzeugt einen dumpfen Klang, als würde man sie durch einen dichten Nebel hören. Als er verklingt, kann man gerade noch ein leises Lachen darunter hören.>', '', 39653),
(212112, 'deDE', '<In den Stein sind mehrere Textblöcke in unterschiedlichen Sprachen geätzt. Obwohl die Schrift jetzt lesbar ist, erkennt Ihr keine dieser Sprachen. Und dennoch kommt Euch der Text irgendwie bekannt vor.\n\nVielleicht könnt Ihr ein oder zwei Wörter erkennen, wenn Ihr die Augen etwas zusammenkneift...\n\n...oder Ihr bekommt davon lediglich Kopfschmerzen.>', '', 39653),
(212111, 'deDE', '<Eine gewaltige Menge explosiver Energie brummt im Inneren der Kugel. Ihr könnt keinen physikalischen Mechanismus erkennen, der die Magie kontrolliert.\n\nDieses Relikt befindet sich seit Äonen im Archiv. Wäre es wirklich so instabil, dass es jeden Moment explodieren könnte, hätten die Archivare sicherlich Maßnahmen ergriffen, um es sicher zu lagern.\n\nIhr hofft einfach mal, dass diese Maßnahmen immer noch wirksam sind.>', '', 39653),
(212110, 'deDE', '<Egal, wie lange Ihr die Karte betrachtet, erkennt Ihr doch keinen Sinn darin. Die verzauberte Projektion des Zwischenraums wirbelt in ständiger Bewegung, und die Myriaden der darin befindlichen jenseitigen Leben sind kaum voneinander zu unterscheiden.\n\nDie Geographie der Schattenlande scheint jenseits des Verständnisses Sterblicher zu liegen.>', '', 39653),
(212109, 'deDE', '<Eine eindringliche Choralmelodie erklingt aus dem Barren, als Ihr Euch ihm nähert. Man könnte sie fast als hypnotisch bezeichnen, wären da nicht die gelegentlichen grellen und unharmonischen Töne, welche die Musik in scheinbar zufälligen Abständen zu unterbrechen scheinen.\n\nZumindest verzichtet das Lied des Barrens auf Text... vorerst.>', '', 39653),
(212108, 'deDE', '<Das Gerät knistert aufgrund der immensen Menge sich selbst regenerierender Energie. Solange es sich im Besitz des Archivars befindet, kann es den Leitstab mit ausreichend Energie versorgen, um die noch nicht geborgenen Reliquien zu lokalisieren.\n\nWie es ununterbrochen eine solche Energie erzeugen kann, bleibt Euch ein Rätsel.>', '', 39653),
(212107, 'deDE', '<Die Maske scheint von den Shal\'dorei angefertigt worden zu sein... Aber sie wurde mittels einer Art Magie verändert, die Euch nicht geläufig ist. Die darauf liegende Verzauberung scheint verschachtelter und komplizierter zu sein als selbst die aufwendigste Handarbeit der versiertesten Arkanisten.\n\nEs ist nur schwer einschätzbar, was sich hinter dieser Illusion verbergen mag.>', '', 39653),
(212106, 'deDE', '<In die Oberflächen der Runenmarken wurden mit feiner Hand esoterische Runen eingeritzt. In den Aufzeichnungen des Archivars steht, dass ein geübter Runenmeister ein Frage stellen und dann die Runenmarken werfen kann, um anschließend aus ihrer Ausrichtung eine Antwort zu erschließen.\n\nEs ist durchaus möglich, dass die Runenmarken keinerlei Wahrsagekraft bieten, obwohl Ihr bezweifelt, dass sie dann ihren Weg ins Archiv gefunden hätten.>', '', 39653),
(212093, 'deDE', 'Ich verspreche Euch, nicht alle Mitglieder meines Kartells sind so aggressiv und territorial bei ihren Akquisitionen.\n\nKorthia bietet uns allen so viele Möglichkeiten.\n\nIch versichere Euch, ich weiß eine Partnerschaft mit Euch sehr zu schätzen, $gSchlundgänger:Schlundgängerin;. Und davon profitieren wir beide.', '', 39653),
(212071, 'deDE', '<Der Schild scheint unkörperlich zu sein, fühlt sich aber fest an. Schmale Risse auf der Oberfläche deuten darauf hin, dass er intensiv benutzt wurde. Obwohl sie nicht repariert wurden, scheinen die Risse durch irgendeine Form von Magie versiegelt zu sein.\n\nRoh-Suir erwähnte, dass das Bollwerk seine Widerstandsfähigkeit aus dem Geist seiner Benutzer bezieht. Es ist möglich, dass die Absichten derer, die den Schild einst verwendeten, in ihm weiterleben.\n\nEs fällt Euch schwer, zu verstehen, wie ein solcher Gegenstand hergestellt werden konnte.>', '', 39653),
(212068, 'deDE', '', 'Die Schwarze Klinge fürchtet die Vergessenheit nicht.', 39653),
(212066, 'deDE', 'Das Glück ist mit den Ehrgeizigen.', '', 39653),
(212064, 'deDE', 'Sucht in der Umgebung nach Leichen von rastlosen Totenbeschwörern und bringt sie hierher zum Leichenhaufen zurück.\n\nSobald wir genug gesammelt haben, werde ich sie mit einem Ritual endgültig vernichten.', '', 39653),
(212063, 'deDE', 'Vergebt meine plumpe Art, $gSchlundgänger:Schlundgängerin;, aber ich kann mir zur Zeit keine Ablenkung erlauben.\n\nSollte die Verstärkung aus Maldraxxus nicht eintreffen, muss ich dieses Ritual vielleicht selbst vollenden... Und ich weiß nicht, ob ich dieser Herausforderung gewachsen bin.', '', 39653),
(212062, 'deDE', 'Ein Krieger mag ja das Schlachtfeld schätzen, aber ein Totenbeschwörer weiß, der wahre Preis IST das Schlachtfeld.\n\nDie zurückgelassenen Leichen warten nur darauf, dass sie jemand ruft, um erneut die Waffen zu erheben.\n\nDie Totenbeschwörer der Schlundgebundenen in diesem Gebiet haben ihre gefallenen Kameraden von den Toten zurückgeholt.\n\nEin Lich wie Markgräfin Sin\'dane könnte stark genug sein, um die gefallenen Schlundgebundenen auf unsere Seite zu ziehen.\n\nAber heute müssen wir zunächst dafür sorgen, dass sie dem Feind nicht in die Hände fallen.\n\nWürdet Ihr Leichen sammeln, damit wir sie in meinem Ritual verbrennen?', '', 39653),
(212061, 'deDE', 'Wenn Ihr das macht, werfe ich EUCH auf den Haufen, Drusi! Wartet auf meinen Befehl.', '', 39653),
(212060, 'deDE', 'Das müsste reichen. Ich sollte sie jetzt verbrennen!', 'Das müsste reichen. Ich sollte sie jetzt verbrennen!', 39653),
(212059, 'deDE', '%s murmelt etwas Unverständliches.', '%s murmelt etwas Unverständliches.', 39653),
(212058, 'deDE', 'Mein Ritual ist fast vollendet! Beeilung mit den Leichen, Lurik!', '', 39653),
(212057, 'deDE', 'Ihr seid bloß neidisch, weil ICH nicht so leicht in Flammen aufgehe!', 'Ihr seid bloß neidisch, weil ICH nicht so leicht in Flammen aufgehe!', 39653),
(212056, 'deDE', 'Ihr wisst schon, dass es noch andere und weitaus überlegenere Waffen gibt, oder?', 'Ihr wisst schon, dass es noch andere und weitaus überlegenere Waffen gibt, oder?', 39653),
(212055, 'deDE', 'Wie könnten wir, Drusi? Ihr redet doch pausenlos von nichts anderem...', 'Wie könnten wir, Drusi? Ihr redet doch pausenlos von nichts anderem...', 39653),
(212054, 'deDE', 'Und mehr Fackeln! Vergesst nicht die Fackeln!', 'Und mehr Fackeln! Vergesst nicht die Fackeln!', 39653),
(212053, 'deDE', 'Kehren wir zum Lager zurück und holen uns neue Befehle und Ritualvorräte.', '', 39653),
(212052, 'deDE', 'Das sollte die Verstärkung für die Schlundgebundenen in dieser Region für eine Weile schwächen.', '', 39653),
(212051, 'deDE', 'Gibt es auch noch eine andere Art von Aufmerksamkeit?', 'Gibt es auch noch eine andere Art von Aufmerksamkeit?', 39653),
(212050, 'deDE', 'Nein... Es scheint, als hätte unser Ritual einige unerwünschte Aufmerksamkeit erregt.', '', 39653),
(212049, 'deDE', '%s richtet seinen Blick gen Himmel.', '', 39653),
(212048, 'deDE', '...Gehört dieses Summen auch zum Ritual?', '...Gehört dieses Summen auch zum Ritual?', 39653),
(212047, 'deDE', 'Endlich! Brennt, brennt, brennt!', 'Endlich! Brennt, brennt, brennt!', 39653),
(212046, 'deDE', 'Jetzt, Drusi! Schließt das Ritual ab!', '', 39653),
(212045, 'deDE', 'Hier in der Nähe gibt es schon jede Menge Leichen. Ihr müsst nicht noch ein paar Neue produzieren.', '', 39653),
(212044, 'deDE', 'Ich helfe Euch, die Leichen einzusammeln, $gSchlundgänger:Schlundgängerin;.', 'Ich helfe Euch, die Leichen einzusammeln, $gSchlundgänger:Schlundgängerin;.', 39653),
(212043, 'deDE', 'Wenn Ihr die Leichen einsammelt, werde ich sie zerstören, auf dass sie sich nie wieder erheben.', '', 39653),
(212042, 'deDE', 'Ich bin selbst ein wenig bewandert in der Totenbeschwörung und weiß daher, wie gefährlich diese Leichen der Schlundgebundenen sind...', '', 39653),
(212029, 'deDE', '<Uther fasst sich an die Wunde unter seinem Brustpanzer.>\n\nAls Arthas mich traf, zerschmetterte Frostgram meine Seele. Aber sie wurde nicht in einen edlen und einen grausamen Teil geteilt.\n\nVielmehr war es so, als ob ein Teil meines Bewusstseins in der Zeit eingefroren blieb, während der Rest meiner Seele voranschritt.\n\nDas Gefühl, dieses fehlende Fragment wiederhergestellt zu haben... Nun, es hat mich veranlasst, über viele der Entscheidungen nachzudenken, die ich getroffen habe.', '', 39653),
(212017, 'deDE', '', 'Anduin... Ich schwöre bei dem Licht, wir werden ihn nicht an den Kerkermeister verlieren.', 39653),
(212016, 'deDE', 'Das Schicksal zu sehen, das sterbliche Seelen in den Schattenlanden erwartet... die Chance, meine Mutter kennenzulernen... all dies hat mich dazu gebraucht, gründlich über meine Entscheidungen der Vergangenheit nachzudenken.', '', 39653),
(211981, 'deDE', '', 'Freunde jetzt sicher. Ich braue sofort mehr Tränke. Für alle Freunde!', 39653),
(211980, 'deDE', '', 'Kommt raus! Stellt Euch Popoe, großer blauer Rüpel!', 39653),
(211979, 'deDE', '', 'Ich halte ihn auf. Keine verletzten Freunde mehr.', 39653),
(211978, 'deDE', '', 'Ein tobender Verschlinger gleich den Weg entlang. Niemand kann ihn aufhalten!', 39653),
(211977, 'deDE', '', 'Nehmt alle Tränke. Für alle Freunde. Wer hat ihnen wehgetan?', 39653),
(211976, 'deDE', '', 'Ich tue, was ich kann, Popoe, aber in diesem Bataillon sind viele schwer verwundet worden.', 39653),
(211975, 'deDE', '', 'Marylis unverletzt, aber so viele brauchen Hilfe...', 39653),
(211974, 'deDE', '', 'Danach zum Lager zurück! Abenteuergeschichten austauschen. Und jetzt los, Marylis hefen!', 39653),
(211973, 'deDE', 'Euer Trank hat all meine Kraft zurückgebracht. Ich werde diese Stellung halten. Auch gegen einhundert Feinde!', '', 39653),
(211972, 'deDE', 'Gerade richtig, Popoe. Meine Wachsamkeit lässt langsam nach.', '', 39653),
(211971, 'deDE', '', 'Deos verletzt? Ich bringe Tränke. Schnelle Hilfe!', 39653),
(211970, 'deDE', '', 'Ich mache Tränke. Heilen und beschützen. Für meine Freunde!', 39653),
(211969, 'deDE', '', 'Beide groß und stark. Aber auch Große und Starke brauchen Hilfe. Ich kann helfen!', 39653),
(211968, 'deDE', '', 'Marylis und Deos auch da. Haben zusammen in der Bastion trainiert.', 39653),
(211963, 'deDE', '', 'Schön vorsichtig, $gSchlundgänger:Schlundgängerin;. Überall Schlundgebundene!\n\nIch warte hier. Kyrianer schicken Hilfe.\n\nSie denken an Popoe.', 39653),
(211962, 'deDE', '', '$p ist da. Wie schön!\n\nSchlundgebundene greifen an. Ich bringe Freunden Vorräte.\n\nIch töte viele. Aber immer mehr kommen.\n\nKommt Ihr mit? Wir liefern Vorräte?', 39653),
(211949, 'deDE', 'Wir können nur mutmaßen, wie viele Geheimnisse für immer verloren gingen, als der Kerkermeister Korthia im Schlund festgesetzt hat.\n\nDer Preis für seine Untaten wächst wirklich immer weiter.', '', 39653),
(211943, 'deDE', 'Der Wildling widersteht uns noch immer. $gSchlundgänger:Schlundgängerin;, Ihr müsst sein Vertrauen gewinnen.', '', 39653),
(211942, 'deDE', '', 'Viel Spaß mit Euren schmutzigen Hufen. Ich bleibe hier oben...', 39653),
(211941, 'deDE', 'Solidarität. Wir jagen zusammen, wir laufen zusammen.', 'Solidarität. Wir jagen zusammen, wir laufen zusammen.', 39653),
(211940, 'deDE', '', 'Ich verstehe immer noch nicht, warum ich ihn nicht reiten kann, bloß weil Ihr es nicht könnt, Karras...', 39653),
(211939, 'deDE', 'Die Jagd ist abgeschlossen. Lasst uns diesen Wildling zum Lager zurückbringen.', '', 39653),
(211938, 'deDE', 'Konzentration! Die Jagd beginnt.', '', 39653),
(211937, 'deDE', '', 'Ich werde so hart auf diese Trommel schlagen, dass es sogar die Winterkönigin im Ardenwald hört!', 39653),
(211936, 'deDE', '', 'Der Wildling reagiert auf unsere Musik. Spielt lauter!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(211923, 'deDE', 'Die Königin segne Euch, $p.\n\nFalls Ihr einen Moment Zeit habt, wir könnten Eure Hilfe bei der Jagd auf einen Wildling brauchen, der aus unserem Lager entkommen ist.\n\nSpielt einfach auf der verlockenden Trommel hier ganz in der Nähe, damit wir ihn auf diesen Vorsprung locken können. Aber haltet Euch bereit.\n\nDas ist kein zahmer Wildling.', '', 39653),
(211921, 'deDE', 'Seid gegrüßt, $gSchlundgänger:Schlundgängerin;. Ich hoffe, Eure Jagd geht gut voran.\n\nUnsere eigene Jagd muss noch etwas warten, bis die Verstärkung von den Nachtfae eintrifft.', '', 39653),
(211919, 'deDE', 'Pssst, $p! Hier drüben!', '', 39653),
(211918, 'deDE', 'Juhuuuuuuuuuuu!', '', 39653),
(211917, 'deDE', '', 'Danke, Steinbruder. Führt uns dahin, wo wir gebraucht werden.', 39653),
(211916, 'deDE', 'Erhebt Euch, Torbrecher! Der Ruf erfolgt, Euer Dienst bricht wieder an!', '', 39653),
(211915, 'deDE', 'Aaah! $gSchlundgänger:Schlundgängerin;, haltet das Riesenkristallmonsterding auf!', '', 39653),
(211914, 'deDE', '', 'Er wollte Euch NICHT beißen. Aber Ihr könntet mit dem Meißel ruhig etwas vorsichtiger sein...', 39653),
(211913, 'deDE', 'Ich glaube, er wollte mich beißen!', '', 39653),
(211912, 'deDE', '', 'Immer langsam, Steinbruder... Wir sind noch nicht fertig...', 39653),
(211911, 'deDE', 'Konzentriert Euch, Tröpfchen. Ich werde Anima in Eure Gravuren lenken.', '', 39653),
(211910, 'deDE', 'Hab doch gesagt, das wird den Schlundgebundenen nich\' gefallen...', '', 39653),
(211909, 'deDE', 'Ein solches Gemetzel bringt mich auf Trab. Schlachtet alle Gegner in Sichtweite ab!', '', 39653),
(211907, 'deDE', 'Zorn hat meine Schmiede und den Amboss erfüllt, auf dass der Feind meine Rache stillt!', '', 39653),
(211906, 'deDE', 'Wieder ein Schlundgebundener getötet und wieder einmal das süße Gefühl der Rache!', '', 39653),
(211905, 'deDE', 'Keine Sorge, Kashaa. Ich habe genug Anima mitgebracht, um seine Energie vollständig wiederherzustellen.', '', 39653),
(211904, 'deDE', '', 'Dieser Steinbruder braucht mehr als nur einfaches Gräberwerkzeug.', 39653),
(211903, 'deDE', 'Folgt mir, Leute!', '', 39653),
(211895, 'deDE', '', 'Ich nehme Mal\'Ganis in Gewahrsam und sichere die Herrschaftsburg gegen Fremde. Ihr solltet diesen Ort lieber für eine Weile meiden.\n\nIch werde meine Streitkräfte nach Korthia schicken, aber wir müssen unbedingt so viele Informationen wie möglich aus Mal\'Ganis herausholen, und Renathals Methoden sind etwas... sanfter... im Vergleich zu meinen.\n\nWenn ich mit ihm fertig bin, kann Renathal Mal\'Ganis zurückhaben und ihn auf den Pfad der Sühne führen, den er einem Schreckenslord zutraut. Aber erst, nachdem ich mit ihm fertig bin.', 39653),
(211893, 'deDE', 'Passt einfach auf uns auf, während wir den Steingeborenen wieder flott machen!', '', 39653),
(211892, 'deDE', 'Zieht Leine, $gSchlundgänger:Schlundgängerin;.\n\nDas hier ist \'ne wichtige Mission für die Steinhauerin höchstpersönlich.\n\nNur für Venthyr, klar?', '', 39653),
(211891, 'deDE', 'Bin hin und Dreck, Euch zu sehen, $gSchlundgänger:Schlundgängerin;!\n\nIch und die Jungs sollen uns den dicken fetten Steingeborenen da vornehmen.\n\nProblem ist nur: Hier rennen zu viele Schlundgebundene rum. So können wir nicht arbeiten.\n\nHabt Ihr Zeit, uns zu helfen?', '', 39653),
(211889, 'deDE', 'Zweifellos, aber dafür braucht es Zeit und die richtigen... Kandidaten.\n\nIch glaube, das ist das richtige Wort. Wir haben noch nie einen neuen Ernter formell eingeführt. Sie wurden immer von Denathrius ernannt, oft erst nach Jahrzehnten der intensiven Vorbereitung auf diese Rolle.\n\nWir werden nach Seelen und Venthyr suchen, die über die nötigen Fertigkeiten und das erforderliche Talent verfügen. Jene, die unsere Werte teilen und auch über die Macht verfügen, sie zu beschützen. Mir fallen eine Menge ein, die sich dafür eignen könnten.\n\nNehmt zum Beispiel den jungen Kael\'thas. Wäre er schon weiter auf dem Pfad der Sühne, käme er durchaus infrage...', '', 39653),
(211885, 'deDE', '', 'Ein anderes Schlachtfeld, ein anderer Feldzug... und doch bleibt alles gleich.', 39653),
(211884, 'deDE', 'Es gibt viel zu tun und wir haben wenig Zeit. Wir müssen befestigen, was wir schon erobert haben, die Animareserven sichern, die nicht von Denathrius gestohlen wurden, und in ganz Revendreth nach Unterstützung Ausschau halten.\n\nUnabhängig davon, was wir hier erreichen, werden die Schattenlande erst dann vollständig sein, wenn die Richterin wieder Seelen in das Jenseits entsendet.\n\nAber setzt Euren Krieg gegen den Kerkermeister fürs Erste fort. Wir werden dafür alle Ressourcen aufbieten, die wir erübrigen können.', '', 39653),
(211883, 'deDE', 'Unsere Vorhaben in Korthia sind besonders anspruchsvoll. Wir brauchen jede Hilfe, die wir bekommen können.', '', 39653),
(211881, 'deDE', '', 'Diese alten Knochen sind müde.', 39653),
(211879, 'deDE', 'Passt auf Eure Kniescheiben auf.', '', 39653),
(211876, 'deDE', 'Nach meiner Zeit in Revendreth ist mir jegliche Abwechslung willkommen. Selbst eine öde Umgebung wie diese hier.', '', 39653),
(211871, 'deDE', 'Für eine Weile.\n\nAls wir die Macht der Medaillons in der Krone vereint haben, habe ich ein paar Sicherheitsvorkehrungen eingeflochten, damit niemand allein die Krone für längere Zeit tragen kann.\n\nUnd sollten die anderen Ernter es wollen, ob nun mit Medaillons oder ohne, könnten sie mit den ihnen anvertrauten uralten Worten der Krone wieder ihre Macht entziehen.\n\nWas wir gemeinsam geschaffen haben, bleibt nur stark, solange wir weiter zusammenarbeiten.', '', 39653),
(211870, 'deDE', 'Keine Sorge! Der beste Baumeister und Oberste Schmied ist hier, um zu helfen.', '', 39653),
(211867, 'deDE', 'Ich hatte gehofft, dass unsere Brüder aus den richtigen Gründen zu uns zurückgekehrt sind.$b$bIhr Verrat gegen Revendreth, die Schattenlande und die gesamte Realität entzieht sich meiner Vorstellungskraft.', '', 39653),
(211864, 'deDE', '', 'Güte ist unabdingbar, selbst... nein, vor allem in solchen Zeiten.', 39653),
(211863, 'deDE', 'Weisheit erfordert Wissen, Kontext und klares Denken.', '', 39653),
(211858, 'deDE', '', 'Die Asche des Schlunds breitet sich in alle Ecken des Waldes aus.', 39653),
(211857, 'deDE', '', 'Die Wilde Jagd wird es zu Ende bringen.', 39653),
(211852, 'deDE', '', 'Als ich zur Nachtkriegerin wurde, geschah dies in vollem Bewusstsein, dass ich eines Tages vielleicht auch mein Leben opfern muss, damit den Kaldorei Gerechtigkeit widerfährt. Allzu oft ist dies der Preis, wenn man sich Elunes ungebändigtem Zorn hingibt.\n\nDie Macht der Göttin erfüllt mich noch immer, aber sie droht nicht mehr, mich zu zerreißen. Ich weiß noch nicht, wie ich diese Macht in Zukunft einsetzen werde... Nur, dass es zum Wohl meines Volkes sein muss.', 39653),
(211813, 'deDE', '', 'Ich bin sicher, Maelie und Ihr seid bereits die besten $gFreunde:Freundinnen;!', 39653),
(211812, 'deDE', '', 'Dem Himmel sei Dank, Maelie ist zurück!\n\nDanke für all Eure Hilfe, $p.', 39653),
(211774, 'deDE', '', 'Das ist tatsächlich eine gute Frage, $gSchlundgänger:Schlundgängerin;!\n\nVielleicht könnt Ihr bei Eurem Aufenthalt in Korthia ja Ausschau nach ihr halten? Solltet Ihr sie finden, bringt sie bitte zurück zu mir.', 39653),
(211772, 'deDE', '', 'Ich trainiere Maelie, damit sie das schnellste und beste Ross aller Zeiten wird und ihren Reiter furchtlos hinaus in das Unbekannte tragen kann!\n\nAber sie ist von Natur aus so neugierig. Ständig reißt sie aus und wandert einfach so umher. Sie muss endlich lernen, bei der Sache zu bleiben!', 39653),
(211704, 'deDE', '', 'Mein Volk wurde geschunden. Ausgebeutet. Also flehte ich Elune um Rache an. Die zweischneidige Klinge wurde mir gewährt.\n\nIch wurde zum wandelnden Schrecken aller in der Nacht. Ich habe meine Stadt beschützt. Eine gewisse Zeit.\n\nSolch eine Macht war niemals für Sterbliche gedacht. Die Klinge schnitt in beide Richtungen.\n\nIn Maldraxxus habe ich dann mein Können perfektioniert.', 39653),
(211702, 'deDE', '', 'Letztendlich gab es für mein Volk nur noch eine einzige Bedrohung. Mich selbst.\n\nIch fiel durch einen Freund, der ebenfalls unser Volk beschützen wollte.\n\nErst in Revendreth und nach langem... Nachsinnen wurden mir das Ausmaß meines Zorns und die schwere Last meiner Sünden bewusst. Aus meiner Erfahrung habe ich gelernt, anderen mit ihren Sünden zu helfen.', 39653),
(211701, 'deDE', '', 'Nachdem ich Elunes dunkle Gabe erhalten hatte, nährten zuerst all meine Verluste meinen Zorn. Und dann meine Siege. Ich habe mein Volk beschützt. Ich habe jeden getötet, der uns Leid zufügen wollte. Und dann ihre Verbündeten. Dann jene, die unsere Feinde nicht aufhielten oder tatenlos zusahen. Dann jene, die nach meinem Geschmack nicht schnell genug handeln wollten. Und so weiter...\n\nIch habe ganze Zivilisationen ausgelöscht und nichts als Tod und Zerstörung auf meinem Weg hinterlassen. Denn wenn niemand mehr da war, um uns zu quälen, würden wir nie wieder leiden.', 39653),
(211699, 'deDE', '', 'Selbstverständlich. Sonst wäre ich jetzt kaum hier, um Euch zu helfen.\n\n<Die Steinhauerin zieht eine Augenbraue hoch.>\n\nIch vermute, Ihr würdet gern wissen, wie es mich nach Revendreth verschlagen hat?', 39653),
(211693, 'deDE', '', 'Hier ist es wirklich sehr... blau.', 39653),
(211689, 'deDE', 'Ein Schrei der Dankbarkeit erschallt von oben.', '', 39653),
(211620, 'deDE', 'Während ihr Übermut in Furcht umschlägt, werden unsere Gegner innehalten... kurzfristig.', '', 39653),
(211619, 'deDE', 'Unsere Feinde sammeln sich vor Burg Helgarde. Lichtet ihre Reihen, bevor sie zuschlagen können.', '', 39653),
(211618, 'deDE', '', 'Egal, was dazu nötig ist.', 39653),
(211591, 'deDE', '', '<Ysera lächelt Euch herzlich an.>', 39653),
(211578, 'deDE', '', 'Und? Seid Ihr bereit oder nicht?', 39653),
(211577, 'deDE', '', 'Das Gemetzel geht weiter!', 39653),
(211572, 'deDE', '', 'Der Wind der Veränderung ist da.', 39653),
(211566, 'deDE', '', 'Ihr verwechselt meine Gastlichkeit mit Schwäche.', 39653),
(211565, 'deDE', '', 'Lebt wohl.', 39653),
(211564, 'deDE', '', 'Genießt Ihr Euer Getränk?', 39653),
(211563, 'deDE', '', 'Ich erwarte Eure Rückkehr sehnlichst.', 39653),
(211562, 'deDE', '', 'Kommt gern wieder.', 39653),
(211561, 'deDE', '', 'Friede sei mit Euch.', 39653),
(211560, 'deDE', '', 'Willkommen in Myzas Oase.', 39653),
(211559, 'deDE', 'Ganz ruhig!', '', 39653),
(211558, 'deDE', 'Heh?', '', 39653),
(211557, 'deDE', 'Hm?', '', 39653),
(211556, 'deDE', 'Pah.', '', 39653),
(211555, 'deDE', 'Hm.', '', 39653),
(211550, 'deDE', '', 'Ihr wisst nicht... welche Mächte... Ihr jagt...', 39653),
(211549, 'deDE', '', 'Das hat mir Elune nicht gesagt, Tochter. Noch nicht.', 39653),
(211548, 'deDE', '', 'Die Winterkönigin erwähnte eine Rolle für die Seelen unseres Volkes. Was hat sie gemeint?', 39653),
(211547, 'deDE', '', 'War so sehr meine wie ihre.', 39653),
(211546, 'deDE', '', 'So viel Schönheit in ihrer Stimme. Und auch Trauer. Die Träne...', 39653),
(211545, 'deDE', '', 'Ich war jeden Moment anwesend, und doch... stand ich neben mir. Eine Zeugin wie Ihr es wart.', 39653),
(211544, 'deDE', '', 'Was ich heute gesehen habe, kann ich kaum glauben.', 39653),
(211543, 'deDE', '', 'Ich bin wieder ich selbst.', 39653),
(211542, 'deDE', '', 'Mutter... seid Ihr das?', 39653),
(211541, 'deDE', 'Oribos ist in Reichweite.', '', 39653),
(211539, 'deDE', '', 'Blätter fallen mit dem Wandel der Jahreszeiten.', 39653),
(211534, 'deDE', '', 'Ein neues Siegel erhebt sich, um die Zukunft unseres Paktes zu verkörpern.', 39653),
(211533, 'deDE', '', 'Der Kreislauf beginnt erneut. Tod und Leben harmonieren wieder.', 39653),
(211532, 'deDE', '', 'Und mit ihm unsere Herzen.', 39653),
(211531, 'deDE', '', 'Heute wird das Herz des Waldes wieder gesund.', 39653),
(211530, 'deDE', '', 'Mit Standhaftigkeit und Gemeinschaft kehrt die Hoffnung in unsere Haine zurück.', 39653),
(211529, 'deDE', '', 'Doch gemeinsam haben wir unsere Heimat vor entsetzlicher Finsternis gerettet.', 39653),
(211523, 'deDE', 'Ihr seid nicht lustig.', '', 39653),
(211522, 'deDE', 'Ich habe keine Zeit für Spielchen.', '', 39653),
(211521, 'deDE', 'Möge die ewige Sonne auf Euch herabscheinen.', '', 39653),
(211520, 'deDE', 'Geht in Frieden.', '', 39653),
(211519, 'deDE', 'Mögen die Winde Euch leiten.', '', 39653),
(211518, 'deDE', 'Grüße, Reisender.', '', 39653),
(211508, 'deDE', '', 'Ich hoffe, wir sind noch nicht zu spät für Tyrande.', 39653),
(211501, 'deDE', 'Prinz Renathal bittet um Eure Hilfe an der Front gegen den Kerkermeister, $p.\n\nDie Armeen von Sündensturz haben ein Basislager im Schlund errichtet und bereiten einen Vorstoß tief in die feindlichen Verteidigungsanlagen vor.\n\nMeldet Euch, sobald Ihr könnt, beim Prinzen auf der anderen Seite dieses Spiegels.', 'Prinz Renathal bittet um Eure Hilfe an der Front gegen den Kerkermeister, $p.\n\nDie Armeen von Sündensturz haben ein Basislager im Schlund errichtet und bereiten einen Vorstoß tief in die feindlichen Verteidigungsanlagen vor.\n\nMeldet Euch, sobald Ihr könnt, bei Prinz Renathal auf der anderen Seite dieses Spiegels.', 39653),
(211500, 'deDE', 'Für den Moment sollten wir nach Korthia zurückkehren. Hoffen wir, dass der Primus den Plan des Kerkermeisters erklären kann... und wie man ihn aufhält.', '', 39653),
(211498, 'deDE', 'Meine Ritter werden sie hier in Oribos gefangen halten. Wenn sie erwacht, beginnen wir mit dem Verhör.', '', 39653),
(211497, 'deDE', '', 'Ja. Sylvanas hat etwas gesagt, bevor sie zusammengebrochen ist, aber es war undeutlich.', 39653),
(211496, 'deDE', 'Vielleicht weiß sie es.', '', 39653),
(211495, 'deDE', '', 'Verflucht sei der Kerkermeister! Er hat Anduin. Egal, wohin er verschwunden ist, wir finden ihn!', 39653),
(211494, 'deDE', 'Als hätte ihre Macht - und das Siegel - ihm schon immer gehört.', '', 39653),
(211493, 'deDE', 'Wir dachten, der Kerkermeister wollte die Richterin töten. Aber er... hat ihre Essenz aufgenommen.', '', 39653),
(211492, 'deDE', 'Der Kerkermeister ist fort. Wohin das Portal auch führt, es hat sich hinter ihm geschlossen.', '', 39653),
(211489, 'deDE', 'Verbündete, macht euch bereit!', '', 39653),
(211487, 'deDE', 'Nehmt Kah-Bär mit. Sie hat eine ausgezeichnete Spürnase und wird Euch helfen, diese Bestie aufzuspüren!', 'Nehmt Kah-Bär mit. Sie hat eine ausgezeichnete Spürnase und wird Euch helfen, diese Bestie aufzuspüren!', 39653),
(211485, 'deDE', 'Eine große Splitterfellbestie reißt immer wieder Tiere aus unserem Stall. Wir müssen sie beschützen.\n\nBitte helft mir, dieses Ungetüm zu suchen und zu erlegen!', 'Eine große Splitterfellbestie reißt immer wieder Tiere aus unserem Stall. Wir müssen sie beschützen.\n\nBitte helft mir, dieses Ungetüm zu suchen und zu erlegen!', 39653),
(211479, 'deDE', '', 'Wir retten dich, Anduin.', 39653),
(211478, 'deDE', 'Wehrt Euch! Lasst den Kerkermeister nicht gewinnen!', '', 39653),
(211473, 'deDE', 'Wir dürfen nicht länger warten! Die Zeit zum Handeln ist jetzt gekommen!', '', 39653),
(211471, 'deDE', 'Uther und ich helfen Adrestes. Alle anderen: bleibt standhaft!', '', 39653),
(211468, 'deDE', '', 'Hmpf. Schöner \"Hüter der Geheimnisse\".', 39653),
(211465, 'deDE', '', 'Er hat es getan. die Richterin fällt...', 39653),
(211464, 'deDE', 'Nein! Der Kerkermeister wird die Richterin vernichten!', '', 39653),
(211462, 'deDE', 'Jaina, wir brauchen ein Portal!', '', 39653),
(211461, 'deDE', 'Nein. Wir halten Euch auf!', '', 39653),
(211460, 'deDE', 'Eure Mühen sind vergebens.', '', 39653),
(211458, 'deDE', 'Euer Kreuzzug endet hier, Banshee!', '', 39653),
(211457, 'deDE', 'Unser Schicksalsschreiber... entführt. Vorsehung tröste ihn in der Finsternis.', '', 39653),
(211456, 'deDE', '', 'Ihr müsst das nicht tun! Ergebt Euch!', 39653),
(211454, 'deDE', 'Für Saurfang! Für die Horde!', '', 39653),
(211453, 'deDE', 'Ergebt Euch, Sylvanas!', '', 39653),
(211452, 'deDE', '', 'Es sind zu viele!', 39653),
(211450, 'deDE', 'Nehmen diese Kreaturen nie ein Ende?!', '', 39653),
(211449, 'deDE', 'Ihre Truppen sind zahllos!', '', 39653),
(211439, 'deDE', '<Der General nickt anerkennend, als er den Leichnam von Gothra sieht.>\n\nAls Prinz Renathal diesen Plan vorschlug, hatte ich meine Bedenken, aber jetzt erkenne ich seine Weisheit.\n\nViele Steingeborene wären in diesem Kampf gefallen, aber das mit Bedacht gelenkte Licht hat nur ein einziges Todesopfer gefordert?\n\nFaszinierend...', '', 39653),
(211438, 'deDE', 'Der heutige Sieg ist nicht nur für Revendreth oder den Ardenwald. Jeder Sieg ist ein gemeinsamer Triumph für alle, die das Beste für die Schattenlande wollen.\n\nWir werden nicht eher ruhen, bis unser Kampf beendet ist.', '', 39653),
(211437, 'deDE', '', '<Lady Mondbeere betrachtet den qualmenden Leichnam von Gothra und lächelt.>\n\nIch habe Prinz Renathals Stil schon immer gemocht... Wir sollten das irgendwann mal wiederholen.', 39653),
(211436, 'deDE', '', '<Nadjia pariert weiterhin jeden Angriff, während sie zu Euch spricht.>\n\nVerschwendet bloß keine Zeit oder Ressourcen an unserer Ostflanke. Ich kann sie dort mit Leichtigkeit aufhalten, während Ihr Euch mit den anderen auf das Primärziel konzentriert.\n\nGebt mir einfach Bescheid, wenn Ihr mich woanders benötigt. Obschon Ihr dann natürlich eine ganze Brigade herschicken müsstet, um mich zu ersetzen.\n\n<Nadjia lächelt, als sie sich wieder mit voller Aufmerksamkeit den Schlundgebundenen zuwendet.>', 39653),
(211434, 'deDE', '', '<Niya krault den Kopf ihres Gormlings, der daraufhin freudig zappelt.>\n\nIch muss zugeben, wenn man ihre etwas gefährlicheren Impulse in den Griff bekommt, sind diese kleinen Kerlchen ziemlich süß.\n\nKeine Sorge, ich halte ihn ganz fest.', 39653),
(211433, 'deDE', '', '<Lady Mondbeere flüstert leise.>\n\nKein Wort zu Prinz Renathal, aber ich zähle bei jedem unserer Zauber mit.\n\nInsgesamt liegt er vorn, aber ich halte gerade den Rekord für die meisten Gegner, die auf einen Schlag zu Boden gegangen sind!\n\nOh, und meine stinken jetzt auch ganz furchtbar, nur damit sie den Schlundgebundenen so richtig auf die Nerven gehen!\n\n<Lady Mondbeere kichert.>', 39653),
(211431, 'deDE', 'Ah, willkommen im Schlund, $p!\n\nIch freue mich, dass Ihr hier seid.\n\nObwohl, eigentlich sollte unsere Begrüßung wohl umgekehrt verlaufen.\n\nIn diesem Reich kennt Ihr Euch aus, und ich bin lediglich ein Gast.\n\n<Theotar verneigt sich vor Euch und fragt mit leiser Stimme.>\n\nWar es hier schon immer so... rustikal? Ich habe in diesem ganzen Reich noch nicht einen Stuhl gefunden.', '', 39653),
(211430, 'deDE', 'Es war mir eine Ehre, dass Prinz Renathal mich gebeten hat, seinen Angriff auf den Schlund zu unterstützen.\n\nObwohl Temel heute einen etwas anderen Titel bevorzugt...\n\n<Grufthüter Kassir wirft Temel einen genervten Blick zu.>\n\n...schätze ich, er kann als \"Festherold\" immer noch seinen Beitrag leisten, wenn auch auf etwas ungewöhnliche Weise.\n\nAber unsere Feinde hier haben viele Sünden auf sich geladen, die ein geschickter Sündenherold wie Temel hervorragend ausnutzen könnte.', '', 39653),
(211429, 'deDE', '', 'Selbst hier, umzingelt von Feinden und in den finstersten Tiefen des Schlunds, dürfen wir unsere Aufgabe nicht vergessen.\n\nEs ist nicht die Aufgabe der Venthyr, zu zerstören. Unsere Aufgabe ist, jede Möglichkeit auszuloten, mit der sich Zerstörung vermeiden lässt.\n\nIm Schlund gibt es durchaus Seelen, die ihren Platz hier verdient haben. Ich weiß es, weil ich viele davon selbst hierhergeschickt habe.\n\nAber der Kerkermeister hat weit mehr Seelen beansprucht als rechtens ist, und wir dürfen erst ruhen, wenn alle zu Unrecht verurteilten Seelen gerettet sind.\n\nRevendreths Aufgabe war niemals leicht, aber sie war stets wichtig.\n\nIch glaube, das versteht Ihr inzwischen.', 39653),
(211428, 'deDE', 'Wir werden so viele Seelen wie möglich retten.\n\nJeder verdient die gleiche Chance, die mir die Anklägerin gewährt hat.', '', 39653),
(211427, 'deDE', 'Wir setzen heute auf eine für mich etwas unkonventionelle Armee.\n\nMit ein paar Steingeborenen mehr würde ich mich bedeutend wohler fühlen, aber wir schaffen es auch so.\n\nRevendreth ist ungebrochen.', '', 39653),
(211426, 'deDE', '', 'Oh, äh, hallo.\n\nKann ich Euch irgendwie helfen? Oder habt Ihr mir schon bei irgendetwas geholfen?\n\nIch fürchte, ich bin gerade etwas zerstreut.', 39653),
(211425, 'deDE', '<Rendel jubelt dem Gräbergrobian unten zu.>\n\nAuf sie, Zahnbrecher! Ihr seid mein Held!', '', 39653),
(211424, 'deDE', 'Zahnbrecher ist im Nu wieder da und haut allen die Schädel platt!', '', 39653),
(211423, 'deDE', 'Nehmt einen Schluck und setzt Euch, $p. Wir haben genug Zeit.', '', 39653),
(211415, 'deDE', 'Ich erschuf ich diese Kiste zu meinem Ruhm, damit sie mir die Macht verleiht, unbeschadet durch diese Hallen zu reisen.\n\nIn meinem Hochmut erschuf ich sie leider so, dass nur jemand die darin enthaltenen Wunder nutzen kann, der sich an diesem Ort ihrer würdig erweist.\n\nMir wäre im Traum nicht eingefallen, dass ich zu den Unwürdigen gehöre...', 'Ich erschuf ich diese Kiste zu meinem Ruhm, damit sie mir die Macht verleiht, unbeschadet durch diese Hallen zu reisen.\n\nIn meinem Hochmut erschuf ich sie leider so, dass nur jemand die darin enthaltenen Wunder nutzen kann, der sich an diesem Ort ihrer würdig erweist.\n\nMir wäre im Traum nicht eingefallen, dass ich zu den Unwürdigen gehöre...', 39653),
(211389, 'deDE', '', 'Nehmt Euren Platz unter uns ein, Adrestes, und wir schmieden das Siegel unseres Paktes neu.', 39653),
(211388, 'deDE', '', 'Eines Weges der Einheit zwischen Kyrianern und Verschmähten.', 39653),
(211387, 'deDE', 'Seid gegrüßt, $gSchlundgänger:Schlundgängerin;. Kann ich Euch irgendwie helfen?', '', 39653),
(211386, 'deDE', '', 'Adrestes. Tretet vor.', 39653),
(211385, 'deDE', '', 'Noch mehr, seit wir einen neuen Tempel erschaffen haben.', 39653),
(211383, 'deDE', 'Unsere Mission war unveränderlich. Über Äonen haben wir dem Meister in zahllosen Realitäten heimlich gedient.', '', 39653),
(211377, 'deDE', '', 'Sie hat die Wahrheit gesprochen, aber ich habe nicht zugehört.', 39653),
(211376, 'deDE', '', 'Ab jetzt sollen alle Kyrianer die Wahl haben, ihre Erinnerungen zu behalten oder loszulassen.', 39653),
(211375, 'deDE', '', 'Und Ihr, Kleia, sollt als seine Hand dienen.', 39653),
(211374, 'deDE', '', 'Niemand verdient diese Ehre mehr als Ihr.', 39653),
(211369, 'deDE', '', 'Seid Ihr bereit, mich zu begleiten und Odyn zu warnen? Der Ruhm der Himmelsfeste erwartet uns!', 39653),
(211367, 'deDE', '', 'Ich bevorzuge es, wenn sich Investitionen auch auszahlen.', 39653),
(211357, 'deDE', '', 'Deckung, drehen, parieren, ausweichen, Pirouette, zustoßen...', 39653),
(211356, 'deDE', 'Der Verbannte sucht unseren kostbarsten Schatz... und ist bereit, uns vollständig zu vernichten, um ihn zu bekommen.', '', 39653),
(211355, 'deDE', 'Oh, verzeiht. Ich bin Tal-Galan, Hüter der Geheimnisse.', '', 39653),
(211349, 'deDE', '', 'Ich helfe Euch, aber seid gewarnt... Elunes Zorn ist nicht leicht zu besänftigen.', 39653),
(211337, 'deDE', '', 'Eure Rolle ist erfüllt, Schlundgänger. Kommt.', 39653),
(211336, 'deDE', '', 'Schlagt zu, Schwestern! Für Odyn!', 39653),
(211334, 'deDE', 'wirft seine |Hitem:186686|h|cFFFFFFFF[Bleichen Orakelknochen]|r|h, um einen Blick in seine Zukunft zu werfen...', 'wirft ihre |Hitem:186686|h|cFFFFFFFF[Bleichen Orakelknochen]|r|h, um einen Blick in ihre Zukunft zu werfen...', 39653),
(211327, 'deDE', 'Ich fürchte, es ist zu spät.', '', 39653),
(211310, 'deDE', '', 'Hier ist nichts mehr auszurichten. Kehrt nach Oribos zurück, Sterblicher. Eure heutigen Taten werden in den Ringen verewigt.', 39653),
(211285, 'deDE', 'Stellt Euch, Uther, und ich lasse Euch schnell sterben.', '', 39653),
(211284, 'deDE', '', 'Ich versuche es noch einmal, aber... Äh... Macht Euch auf alles gefasst. In Ordnung?', 39653),
(211282, 'deDE', '', 'Ihr habt den defekten Zyklus von Leben und Tod selbst erlebt und wollt uns doch daran hindern, dieses fehlerhafte System neu zu ordnen. Ein Jammer.', 39653),
(211274, 'deDE', '', 'Will der Kerkermeister aus dem Schlund ausbrechen... oder etwas anderes?', 39653),
(211271, 'deDE', '', 'Wir haben keine Zeit! Oribos wird vom Schlund verschlungen!', 39653),
(211267, 'deDE', 'Sylvanas will unsere Köpfe! Haltet sie auf!', '', 39653),
(211266, 'deDE', '', 'Hört die Klänge des Leidens!', 39653),
(211265, 'deDE', 'Beim Licht! Er dehnt den Schlund um Oribos aus!', '', 39653),
(211264, 'deDE', 'Drängt vorwärts! Der Kerkermeister muss gestoppt werden.', '', 39653),
(211262, 'deDE', '', 'Finsternis verschlinge Euch!', 39653),
(211261, 'deDE', 'Thrall, geht voraus. Helden, wir unterstützen die Admiralin!', '', 39653),
(211259, 'deDE', 'Die Banshee zielt auf unsere Köpfe!', '', 39653),
(211258, 'deDE', '', 'Stürzt ins Vergessen!', 39653),
(211252, 'deDE', 'Ein wohlverdienter Sieg. Ihr habt bewiesen, dass keine von Zovaals Waffen Euch überwinden kann.', '', 39653),
(211250, 'deDE', 'Dem Sieger die Anima. Nehmt Eure Macht an Euch, Schlundgänger.', '', 39653),
(211249, 'deDE', 'Gut gekämpft. Nehmt nun seine Macht an Euch.', '', 39653),
(211248, 'deDE', 'Nehmt die Macht der Bestie. Ihr braucht sie für die kommenden Gefahren.', '', 39653),
(211247, 'deDE', 'Die Kreatur ist tot. Nehmt nun ihre Macht an Euch.', '', 39653),
(211246, 'deDE', 'Einer der skrupelloseren Schlundgebundenen nähert sich. Seid bereit.', '', 39653),
(211245, 'deDE', 'Hier verdichtet sich die dunkle Magie des Schlunds. Lasst ihre Quelle versiegen.', '', 39653),
(211244, 'deDE', 'Bleibt wachsam. Ihr nähert Euch einem mächtigen Diener des Kerkermeisters.', '', 39653),
(211243, 'deDE', 'Ein großes Übel weilt in der Nähe. Vertreibt es schnell.', '', 39653),
(211240, 'deDE', '', 'Meine Königin! Wir brauchen Eure Hilfe!', 39653),
(211238, 'deDE', 'Habt Dank, $gSchlundgänger:Schlundgängerin;! Nun beginnt die Jagd.', '', 39653),
(211237, 'deDE', 'Ihr da, haltet Euch gerade. Eure Haltung ist ja furchtbar.\n\nEntschuldigt, manchmal lasse ich mich von meinem Beruf zu sehr hinreißen. Einige der wirklich üblen lokalen Zeitgenossen haben mich überfallen und meine unverzichtbare Ausrüstung gestohlen.\n\nDiese Ketten sind absolutes Gift für meine Haltung. Könntet Ihr mir vielleicht bei meinen Bemühungen etwas unter die Arme greifen?', '', 39653),
(211235, 'deDE', 'Suchen wir mein Tablett und verabreichen diesen Schmierlappen eine ordentliche Tracht Prügel.', '', 39653),
(211234, 'deDE', 'He!\n\nWer seid Ihr?\n\nIch? Ich bin hier gelandet, weil ich mein Tablett verloren habe.\n\nIch denke aber, ich wurde reingelegt. Ich habe ein paar dieser Typen gesehen, wie sie mit meinem Tablett herumschmeißen als wär\'s eine Wurfscheibe.', '', 39653),
(211230, 'deDE', '', 'Ich bin sicher, einer dieser Unholde hier ganz in der Nähe hat das Amulett.', 39653),
(211226, 'deDE', '', 'Initiiere Suche nach fehlender Energiequelle.', 39653),
(211225, 'deDE', '', 'Einheit festgesetzt.\n\nPrimäre Energiequelle fehlt.\n\nVerringertes Kampfpotenzial.\n\nErbitte Unterstützung.', 39653),
(211222, 'deDE', '', 'Hallo, $gSchlundgänger:Schlundgängerin;.\n\nEs war dumm von mir, zu glauben, ich könnte das hier ganz allein erledigen.\n\nIch suche ein Amulett, das die Erinnerungen einer meiner Aspirantinnen enthält. Jemand hat es ihr gestohlen und ich bin direkt in diese Falle getappt.\n\nWürdet Ihr mir helfen?', 39653),
(211220, 'deDE', 'Ella gurrt, als würde sie Euch auffordern, weiterzumachen.', '', 39653),
(211219, 'deDE', '<Die Kreatur scheint in Not zu sein.>', '', 39653),
(211204, 'deDE', 'Nur weiter so, dann mach\' ich Euch zu Geröll.', 'Nur weiter so, dann mach\' ich Euch zu Geröll.', 39653),
(211202, 'deDE', 'Stört mich nicht wieder.', 'Stört mich nicht wieder.', 39653),
(211201, 'deDE', 'Seid Ihr fertig?', 'Seid Ihr fertig?', 39653),
(211198, 'deDE', 'Fort mit Euch.', 'Fort mit Euch.', 39653),
(211197, 'deDE', 'Das ist hoffentlich wichtig.', 'Hoffentlich ist das wichtig.', 39653),
(211195, 'deDE', 'Was gibt es?', 'Was gibt es?', 39653),
(211194, 'deDE', 'Nun macht schon.', 'Nun macht schon.', 39653),
(211188, 'deDE', 'Ah, willkommen. Habt Ihr gewusst, dass die Passage nach Tazavesh wieder geöffnet ist?\n\nSeht Euch dort besser vor. Die Leute sind nicht sehr freundlich zu Fremden. Aber sie haben viele Dinge zum Handeln.\n\nWertvolle Dinge, glitzernde Dinge.\n\nIch konnte mir einige ihrer Waren besorgen. Habt Ihr je einen Klunkerwurm gesehen? Auf ihrer Haut wachsen Edelsteine, die mit einem inneren Licht leuchten. Aber sobald die Kreatur stirbt, verblassen und zerspringen sie.\n\nSehr selten, sehr wertvoll.\n\nMeine Bitte an Euch: Verkauft mir ein paar der Dinge, an die man auf Eurer Welt besonders hängt. Wir haben da ein paar ganz bestimmte Objekte im Auge...', '', 39653),
(211184, 'deDE', 'Ewigwährende Qual!', '', 39653),
(211183, 'deDE', 'Das Schicksal entfaltet sich! Eintausend zerfranste Fäden, zerrissen!', '', 39653),
(211182, 'deDE', 'Ich sehe jetzt! Mir ist alles offenbart!', '', 39653),
(211181, 'deDE', 'Seht meine neueste Schöpfung und verzweifelt!', '', 39653),
(211180, 'deDE', 'Eure Qualen werden Ewigkeiten überdauern!', '', 39653),
(211179, 'deDE', 'Loten wir Eure Schmerztoleranz aus!', '', 39653),
(211177, 'deDE', 'Der Untergang wartet!', '', 39653),
(211176, 'deDE', 'Mehr Schreie für meine Sammlung.', '', 39653),
(211175, 'deDE', 'Meine Macht ist unendlich!', '', 39653),
(211174, 'deDE', 'Der Tod naht!', '', 39653),
(211173, 'deDE', 'Mich... hält kein... Käfig...', '', 39653),
(211172, 'deDE', 'Eure Seelen gehören mir!', '', 39653),
(211171, 'deDE', 'Und so gehört das Tremaculum uns. Für die Schattenlande!', '', 39653),
(211167, 'deDE', 'Schon gut. Die Rettung Korthias vor den Streitkräften des Schlunds kann wohl warten.', '', 39653),
(211166, 'deDE', 'Gehabt Euch wohl.', '', 39653),
(211165, 'deDE', 'Geht mit der Vorsehung.', '', 39653),
(211164, 'deDE', 'Es gibt so viel zu lernen.', '', 39653),
(211163, 'deDE', 'Was bringt Ihr für Neuigkeiten?', '', 39653),
(211162, 'deDE', 'Es gibt viel zu tun.', '', 39653),
(211161, 'deDE', 'Ich erinnere mich an Euch.', '', 39653),
(211160, 'deDE', '', '[DNT] I have studied five thousand four hundred and seventeen ways to dismember your kind.', 39653),
(211159, 'deDE', '', 'Beschützt die Geheimnisse. Immer.', 39653),
(211156, 'deDE', '', 'Vorsehung leite uns.', 39653),
(211155, 'deDE', '', 'Ich bin bei Euch.', 39653),
(211154, 'deDE', '', 'Wie kann ich dienen?', 39653),
(211153, 'deDE', '', 'Erzählt mir Eure Geheimnisse.', 39653),
(211152, 'deDE', '', 'Seid gegrüßt, Schlundgänger.', 39653),
(211148, 'deDE', '|TInterface\\ICONS\\INV_BrokerMount_Light.BLP:20|t Zo\'phex platziert $n in einer |cFFFF0404|Hspell:348006|h[Eindämmungszelle]|h|r!', '|TInterface\\ICONS\\INV_BrokerMount_Light.BLP:20|t Zo\'phex platziert $n in einer |cFFFF0404|Hspell:348006|h[Eindämmungszelle]|h|r!', 39653),
(211144, 'deDE', 'Vielleicht ist manchen nie zu verzeihen... Doch Ihr habt mir gezeigt, dass sie doch Mitgefühl verdienen.', '', 39653),
(211143, 'deDE', 'Eure Hilfe ist mehr als willkommen. Wie Ihr seht, ertrinke ich momentan in Aufgaben.', '', 39653),
(211142, 'deDE', '', 'Habt Ihr etwas gesagt, Schlundgänger?', 39653),
(211141, 'deDE', 'Sind wir bald da?', '', 39653),
(211124, 'deDE', 'Eure Seelen verrotten in den Eisigen Weiten!', '', 39653),
(211121, 'deDE', 'Niemand widersteht meiner Macht!', '', 39653),
(211120, 'deDE', 'Die eisigen Winde heulen nach Eurem Untergang!', '', 39653),
(211116, 'deDE', 'Es ist tragisch, wie viele treue Archivare nicht mehr bei uns sind.', '', 39653),
(211115, 'deDE', '', 'Mit der Zeit werdet Ihr verstehen.', 39653),
(211114, 'deDE', '', 'Sie haben der Vorsehung gedient wie erwartet, und ihre Weisheit hilft uns noch.', 39653),
(211113, 'deDE', '', 'Das Auge ist verwundbar!', 39653),
(211112, 'deDE', '', 'Die kleineren Augen schützen es, Schlundgänger. Holt sie mit meinem Speer zu Boden... und zerstört sie!', 39653),
(211111, 'deDE', '', 'Dass Odyns Auge zu etwas so Abscheulichem verderbt werden konnte... Vernichtet dieses Ungetüm!', 39653),
(211106, 'deDE', '', 'Das ist der Runenmetz?! Nicht sehr beeindruckend.', 39653),
(211103, 'deDE', 'Die Medaillons, Revendreth, der Prinz und sein Plan. Allesamt kurzsichtig.\n\nGraf Denathrius hat bei all seinen Plänen auch immer weit in die Zukunft gedacht.', '', 39653),
(211102, 'deDE', 'Am einfachsten bleiben wir unerkannt, indem wir helfen.', '', 39653),
(211101, 'deDE', '', 'Bald ist Eure Seele an den Kerkermeister gebunden.', 39653),
(211100, 'deDE', 'Wir... sind alle... Gefangene...', 'Wir... sind alle... Gefangene...', 39653),
(211099, 'deDE', 'In Ketten... sollt Ihr... verrotten...', 'In Ketten... sollt Ihr... verrotten...', 39653),
(211097, 'deDE', 'Die gesamte Struktur der Puzzlebox verbiegt sich unter dem Druck der Mächte, die ganz offensichtlich aus ihrem Inneren entfliehen möchten.', 'Die gesamte Struktur der Puzzlebox verbiegt sich unter dem Druck der Mächte, die ganz offensichtlich aus ihrem Inneren entfliehen möchten.', 39653),
(211094, 'deDE', 'Ihr fangt an. Und macht schnell!', 'Ihr fangt an. Und macht schnell!', 39653),
(211093, 'deDE', 'Ihr seid spät dran! Wir haben Anima zu entziehen und die Steinhauerin hat zu tun.', 'Ihr seid spät dran! Wir haben Anima zu entziehen und die Steinhauerin hat zu tun.', 39653),
(211092, 'deDE', 'Äh, klar! Dann mal los!', '', 39653),
(211084, 'deDE', 'Der Schlund... kriegt... jeden...', 'Der Schlund... kriegt... jeden...', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(211082, 'deDE', 'Nun gut. Ich kann den Weg zur Zuflucht des Hüters öffnen. Hoffentlich kehre ich eines Tages wieder...', '', 39653),
(211081, 'deDE', '', 'Das Siegel ist wichtiger. Holt uns hier raus!', 39653),
(211077, 'deDE', 'So viel Wissen. Wir dürfen das nicht zurücklassen!', '', 39653),
(211076, 'deDE', 'Nehmt sie. Schnell.', 'Nehmt sie. Schnell.', 39653),
(211075, 'deDE', 'Der steingeborene Wächter schaudert.', 'Der steingeborene Wächter schaudert.', 39653),
(211074, 'deDE', 'Oh, die Steinhauerin will das sicher lagern. Wir woll\'n sie ja nich\' wütend machen, oder? Hm?', '', 39653),
(211073, 'deDE', 'Was macht Ihr da, Dreckgeborener?', 'Was macht Ihr da, Dreckgeborener?', 39653),
(211072, 'deDE', '', 'Die lassen sie hier einfach herumliegen?', 39653),
(211068, 'deDE', 'Nehmt Euch die Lektion zu Herzen, Uther. Das Vergangene steht fest. Die Zukunft ist ein unbeschriebenes Blatt.', '', 39653),
(211064, 'deDE', '', 'Eh. Dieses Tote-Mutter-Klischee ist so abgedroschen.', 39653),
(211063, 'deDE', 'Ihr macht das ganz schön gut, Frollein Flügel!', '', 39653),
(211062, 'deDE', 'Schon fertig? Beeindruckend!', 'Schon fertig? Beeindruckend!', 39653),
(211061, 'deDE', '', 'Nun, ich glaube, wir haben einen Durchbruch erreicht! Gute Sitzung.', 39653),
(211060, 'deDE', '', 'Ich... Ja, war ich.', 39653),
(211059, 'deDE', '', 'Wart Ihr eventuell selbst für eine beträchtliche Anzahl toter Mütter verantwortlich?', 39653),
(211058, 'deDE', '', 'V-Vielleicht? Ich habe... ARGH!', 39653),
(211057, 'deDE', '', 'Und glaubt Ihr, ihr Verlust hat Euch in ein Leben mörderischer Wut getrieben?', 39653),
(211056, 'deDE', 'Ja, genau so!', '', 39653),
(211055, 'deDE', '', 'Ich bin leidend aufgewachsen! Ich hatte sonst keinen!', 39653),
(211054, 'deDE', '', 'Würdet Ihr sagen, der Verlust Eurer Mutter macht Euch wütend?', 39653),
(211053, 'deDE', 'Mannomann, das hat funktioniert! Weiter!', '', 39653),
(211052, 'deDE', '', 'Sie war meine Welt und wurde vor meinen Augen ermordet!', 39653),
(211051, 'deDE', '', 'Also... erzählt mir von Eurer Mutter.', 39653),
(211050, 'deDE', '', 'Alles klar!', 39653),
(211049, 'deDE', 'Gut, probieren wir\'s noch mal.', '', 39653),
(211044, 'deDE', '', 'Oh. Das ergibt viel mehr Sinn.', 39653),
(211043, 'deDE', 'Deren Zorn, nich\' Eurer.', '', 39653),
(211042, 'deDE', '', 'Genau! Aufsässige Spriggans! Heimtückische hainmordende Drust! Szeneriefressende Gorm!', 39653),
(211041, 'deDE', 'Äh, nicht ganz. Hier geht\'s um Zorn. Wut!', '', 39653),
(211040, 'deDE', '', 'Niemals!', 39653),
(211039, 'deDE', '', 'Erzählt mir, was Ihr Schlimmes getan habt! Sonst setzt\'s was!', 39653),
(211038, 'deDE', 'Also, die Blutsauger konfrontieren sie damit, weshalb sie in Revendreth sind.', '', 39653),
(211035, 'deDE', '', 'Also... wie genau funktioniert das?', 39653),
(211033, 'deDE', '', 'Oh, äh, hallo.\n\nBitte seid so freundlich und beseitigt diese Schreckenslordbedrohung so rasch wie möglich. Die langfristigen Auswirkungen der Jagd, die die Ernterin des Zorns auf sie macht, bedeutet mehr Zerstörung, als wir nach Denathrius\' Verrat handhaben können.\n\nUnd wenn Ihr wieder mit der Naaru sprecht, sagt ihr, dass ihre fortwährende freiwillige Präsenz in unserem Reich zur Manifestation ihres eigenen Sündensteins führen kann. Auch wenn dies bei Wesen aus anderen Ebenen eher selten ist, sollte sie nur für den Fall, dass er wirklich auftaucht, solch einen Gegenstand doch lieber verstecken, damit niemand eventuelle Indiskretionen aus ihrer Vergangenheit gegen sie verwenden kann.', 39653),
(211032, 'deDE', '', 'Ich wusste es, kaum dass ich Euch gesehen hatte. Glaubt Ihr wirklich, ich würde Durotans Augen nicht erkennen?', 39653),
(211031, 'deDE', 'Ihr... wusstet es?', '', 39653),
(211030, 'deDE', '', 'Gut gekämpft... Go\'el. Kommt, lasst uns reden.', 39653),
(211029, 'deDE', 'He! Der zitternde da hat ganz sicher die Steinhauerin gesehen.', '', 39653),
(211028, 'deDE', '', 'Gehabt Euch wohl, Freund des Blätterdachs.', 39653),
(211027, 'deDE', 'Oh! Zeit zu gehen.', '', 39653),
(211026, 'deDE', 'Für die Bäume!', '', 39653),
(211025, 'deDE', '', 'Seht die Farben des Waldes. Entdeckt ihre Macht.', 39653),
(211024, 'deDE', '', 'Der Wald singt. Wir sind seine Melodie.', 39653),
(211023, 'deDE', 'Zum Baum, zum Baum! Beim Baum sind wir alle sicher.', '', 39653),
(211022, 'deDE', '', 'Wir haben keine Zeit zu verlieren.', 39653),
(211021, 'deDE', 'Hoch und rein, wo die Quetschies, äh... bearbeitet werden.', '', 39653),
(211019, 'deDE', '', 'Nicht mein Problem, dass er keinen Spaß versteht. Also, wohin jetzt?', 39653),
(211018, 'deDE', 'He, sollten wir uns um den Sorgen machen?', '', 39653),
(211017, 'deDE', 'Nutzloser Narr. Diesen Verrat werdet Ihr bald bereuen.', '', 39653),
(211016, 'deDE', '', 'Für die Archon!', 39653),
(211002, 'deDE', '', 'Ich muss nur diese Teile verbinden...', 39653),
(211000, 'deDE', '', 'Pah! Amateurarbeit!', 39653),
(210999, 'deDE', '', 'Dieser Leiter ist reinste Schluderei!', 39653),
(210996, 'deDE', 'Und die sagt uns, wo Euer Kerl ist. Ihr denkt wie die Blutsauger, Frollein Flügel.', '', 39653),
(210995, 'deDE', '', 'Exzellent! Jetzt sagen wir der netten Wache genau, wie leicht wir die bekommen haben.', 39653),
(210993, 'deDE', 'Ich... Beim Meißel der Steinhauerin! Für seine Flucht hätte sie mich glatt in Schutt verwandelt. Vielen Dank!', 'Ich... Beim Meißel der Steinhauerin! Für seine Flucht hätte sie mich glatt in Schutt verwandelt. Vielen Dank!', 39653),
(210969, 'deDE', '', 'Konzentriert Euch auf die Mission. Wir reden später.', 39653),
(210968, 'deDE', 'Draka, Ihr solltet etwas wissen. Ich bin...', '', 39653),
(210965, 'deDE', '', 'Denkt daran, sie zuerst mit dem Speer zu treffen, um sie aus dem Himmel zu holen. Das ist unsere Jagdstrategie.', 39653),
(210955, 'deDE', 'Oh, Arthas...', '', 39653),
(210951, 'deDE', '', 'Natürlich nicht! Wir werden nur etwas Spaß haben.', 39653),
(210950, 'deDE', 'Helfen wir ihm echt zu fliehen?', '', 39653),
(210949, 'deDE', '', 'Da seid Ihr ja. Sehr gut.', 39653),
(210940, 'deDE', '', 'Das sollte sie beschäftigen, bis die Wilde Jagd die Schlundgebundenen zurückdrängen und sich dann auf sie konzentrieren kann. Ich hoffe, das reicht...', 39653),
(210939, 'deDE', '', 'Einige Nachtfae haben sich freiwillig gemeldet, um sich als die Winterkönigin zu tarnen. Diese Attrappen verteilen sich im Wald und lenken die Banshee ab.', 39653),
(210938, 'deDE', '', 'Sylvanas Windläufer persönlich führt den Angriff der Schlundgebundenen! Sie darf das Paktsiegel nicht stehlen!', 39653),
(210937, 'deDE', '', 'Eure Taten werden in Odyns großer Methalle besungen werden. Jeder wird von Eurer Tapferkeit wissen!', 39653),
(210936, 'deDE', '', 'Ich danke Euch für alles, was Ihr getan habt.', 39653),
(210935, 'deDE', '', 'Odyn wird zufrieden sein. Und Eure Verbündeten sind sicher auch erfreut. Das Fehlen des Auges sollte ihren Vorstoß stärken.', 39653),
(210934, 'deDE', '', 'Helya mag noch Pläne und Ränke schmieden, doch wenigstens ist ihr das Auge genommen.', 39653),
(210933, 'deDE', '', 'Unwichtig. Gemeinsam haben wir einen mächtigen Feind besiegt. Meine Schwestern sind gerächt!', 39653),
(210932, 'deDE', '', 'Euch hat das Glück oder das Schicksal zu mir geführt, $n. Welches, weiß ich nicht.', 39653),
(210931, 'deDE', 'Nein. Dürft Ihr nicht.', 'Nein. Dürft Ihr nicht.', 39653),
(210930, 'deDE', 'Ich bin beschäftigt. Seht Ihr nicht, dass ich mich mit einem gefangenen Schreckenslord herumschlage? Sucht Euch eine sinnvolle Aufgabe.', 'Ich bin beschäftigt. Seht Ihr nicht, dass ich mich mit einem gefangenen Schreckenslord herumschlage? Sucht Euch eine sinnvolle Aufgabe.', 39653),
(210929, 'deDE', '', 'Es ist, als würde ich Euch bei der Erkundung begleiten... ohne jegliches Risiko für mich.', 39653),
(210918, 'deDE', '', 'Tugenden, die Euch als Paragon der Hingabe dienlich sein werden.', 39653),
(210902, 'deDE', 'Ah, Uther. Ihr seid endlich da.', '', 39653),
(210901, 'deDE', 'Uther! Habt Ihr einen Moment?', '', 39653),
(210900, 'deDE', 'Ich tue, was ich muss, für Lordaeron.', '', 39653),
(210899, 'deDE', 'Möge das Licht Euch segnen.', '', 39653),
(210898, 'deDE', 'Heute ist ein Glückstag.', '', 39653),
(210897, 'deDE', 'Mein Vertrauen in die Archon war bereits erschüttert. Ihr habt mir nur geholfen, die Wahrheit zu akzeptieren.', '', 39653),
(210896, 'deDE', 'Nikolon, mir tut leid, dass ich Euch vom Pfad abgebracht habe. Ohne mich wärt Ihr nie zu den Verschmähten gekommen.', '', 39653),
(210894, 'deDE', 'Lasst uns wieder vereint sein! Nicht aus Loyalität, sondern aus Hingabe! Die Bastion beschreitet einen neuen Weg!', '', 39653),
(210893, 'deDE', 'Niemand soll gezwungen werden, seine Erinnerungen zu opfern. Alle Kyrianer werden Eure Entscheidung respektieren.', '', 39653),
(210892, 'deDE', 'Eure Klagen wurden gehört, Euer Leid anerkannt. Wir bitten nicht um Loyalität, sondern bieten eine Wahl.', '', 39653),
(210891, 'deDE', 'Meine Mitkyrianer, ich überbringe Euch eine Botschaft des Mitgefühls.', '', 39653),
(210890, 'deDE', 'Nun, da ich den Schlund selbst gesehen habe... kann ich nicht behaupten, dass irgendeine Seele solche Qual verdient.', '', 39653),
(210889, 'deDE', 'Ich werde es nie erfahren. Es stand mir nicht zu. Devos hat mich auf Abwege geführt.', '', 39653),
(210888, 'deDE', 'Ohne Wissen der Richterin? Also... hätte er noch eine Chance auf Sühne gehabt?', '', 39653),
(210887, 'deDE', 'Im Moment seines Todes haben Devos und ich seine Seele genommen... und in den Schlund gestürzt.', '', 39653),
(210886, 'deDE', 'So soll es sein.', '', 39653),
(210885, 'deDE', 'Schlundgebundene! Nährt Euch von ihrem Schmerz!', '', 39653),
(210883, 'deDE', 'Schlundgebundene! Beweist die Macht der Agonie!', '', 39653),
(210882, 'deDE', '', 'Heute vielleicht nicht. Eines Tages sicher. Und wenn dieser Tag kommt, freue ich mich auf unsere Geschäfte.', 39653),
(210881, 'deDE', 'Ich gebe zu, es gibt viele Theorien zu erkunden... so viele Entdeckungen zu machen... Nein! Daran ist nicht zu denken. Hinfort, Mittlerin! Ich brauche nichts.', '', 39653),
(210880, 'deDE', '', 'Seid Ihr nicht wegen Eurer Intelligenz in Korthia? Eurer Neugier? Vielleicht ist für Euch \"vorgesehen\", Freund, Wissen nicht zu horten sondern mit denen zu teilen, die es nutzen können.', 39653),
(210879, 'deDE', 'Vielleicht eines Tages, so die Vorsehung will.', '', 39653),
(210878, 'deDE', '', 'Wollt Ihr das Reich der Ersten nicht mit eigenen Augen sehen?', 39653),
(210877, 'deDE', 'Und Ihr mehr als die meisten, nach allem, was ich höre. Ich gehe davon aus, dass dieses Gespräch ein Vorwand ist, damit Ihr nach Zereth Mortis fragen könnt.', '', 39653),
(210876, 'deDE', '', 'Das ist nur traurige, üble Nachrede! Ich kann eine gute Freundin sein, eine nützliche, in der Not. Und jeder benötigt etwas.', 39653),
(210875, 'deDE', 'Freund? Die unnahbare Ve\'nari hat keine Freunde.', '', 39653),
(210874, 'deDE', '', 'Seid gegrüßt, mein Freund.', 39653),
(210872, 'deDE', 'Selbst Verschlinger dienen der Vorsehung. Wir nehmen uns die Anima, von der sie sich nähren, um den Leitstab zu stärken.', '', 39653),
(210871, 'deDE', 'Nein. Es gibt einen anderen Weg.', '', 39653),
(210869, 'deDE', 'Wenn du mich tötest, ist mein Siegel für dich auf ewig verloren!', '', 39653),
(210868, 'deDE', 'Aber du bist nur bösartiger geworden.', '', 39653),
(210867, 'deDE', 'Dass du deine Sünden bereust.', '', 39653),
(210866, 'deDE', 'Einst hatte ich gehofft, dass die Äonen im Schlund dich verändern könnten.', '', 39653),
(210865, 'deDE', 'Uther, entschuldigt die Frage, aber... was ist schließlich aus Arthas geworden?', '', 39653),
(210864, 'deDE', '', 'Trefft uns bei der Vesperglocke, wenn Ihr bereit seid. Viel Glück, Freunde.', 39653),
(210861, 'deDE', 'Dies ist erst der Anfang, Kleia. Eine strahlende Zukunft erwartet uns alle.', '', 39653),
(210856, 'deDE', '', 'Verschmähte und Kyrianer, Seite an Seite!', 39653),
(210853, 'deDE', '', 'DNT?!', 39653),
(210852, 'deDE', 'Ihr habt unsere Unterstützung. Ich versammle meine Verbündeten. Wir treffen uns an der Provostenrast.', '', 39653),
(210849, 'deDE', 'Wir müssen nicht nur den Tempel wiedergewinnen. Wir müssen die übrigen Verschmähten bitten, sich uns anzuschließen.', '', 39653),
(210848, 'deDE', 'Der Tod greift nach der Seele Eurer Welt, Sterblicher. Doch gemeinsam könnten wir sie retten.', '', 39653),
(210847, 'deDE', 'Greift die Schlundgebundenen weiter an. Wenn der Schlüssel fertig ist, rufe ich Euch.', '', 39653),
(210846, 'deDE', 'Vier Siegel repräsentieren die erneuerte Hoffnung der Pakte. Ich werde sie verwenden, um einen Schlüssel zu schmieden... obwohl ich etwas finden muss, um das Siegel der Richterin zu ersetzen.', '', 39653),
(210845, 'deDE', 'Zovaal sucht die Geheimnisse des Grabmals. Wenn er das Wissen findet, das er sucht, wird alles, was Ihr kennt, untergehen.', '', 39653),
(210844, 'deDE', 'Was hat er nun vor?', '', 39653),
(210843, 'deDE', 'Ich hätte ahnen sollen, dass er den Kampf um seine Macht nie aufgeben würde... und seine Pläne bis zum bitteren Ende verfolgen würde.', '', 39653),
(210842, 'deDE', 'Mit Zovaals Anima schufen wir eine neue Richterin, leidenschaftslos und gerecht.', '', 39653),
(210841, 'deDE', 'Ich hatte eine Vision davon, wo sich solche Gefäße befinden. Aber es wird gefährlich, sie zu holen. Der Kerkermeister hütet seine Schätze sorgfältig.', '', 39653),
(210840, 'deDE', 'Für seine Vergehen nahmen wir unserem Bruder seine Macht und banden ihn an den Schlund. Ich selbst schrieb die Runen der Herrschaft in sein Fleisch.', '', 39653),
(210839, 'deDE', 'Die Gramklinge hat Uthers Seele ein Fragment entrissen. Ohne es könnte er nie gesunden.', '', 39653),
(210838, 'deDE', 'Einst stand Zovaal als Richter in unserer Mitte. Und doch trotzte er dem Willen der Ersten und wollte das Gleichgewicht des Kosmos stürzen.', '', 39653),
(210837, 'deDE', 'Primus, was wir in der Kammer der Richterin gesehen haben... übersteigt sterbliche Vorstellungskraft.', '', 39653),
(210836, 'deDE', 'Vier Pakte, vereint. Unsere Hoffnung ist erneuert.', '', 39653),
(210835, 'deDE', '', 'Revendreth bietet demütig unsere Einheit und Entschlossenheit.', 39653),
(210834, 'deDE', '', 'Mein Primus, wir bieten Euch die Macht von Maldraxxus.', 39653),
(210833, 'deDE', '', 'Die Winterkönigin schickt Euch die Standhaftigkeit des Ardenwalds.', 39653),
(210832, 'deDE', 'Unserem Ziel biete ich die Hingabe der Bastion.', '', 39653),
(210831, 'deDE', 'Pakte der Schattenlande, tretet vor.', '', 39653),
(210826, 'deDE', '', 'Wir plagen uns bereits mit Kel\'Thuzads Plänen. Was hat er noch ausgelöst?', 39653),
(210824, 'deDE', 'Tretet vor!', '', 39653),
(210823, 'deDE', 'Das Licht... Arthas... Was habe ich getan?', '', 39653),
(210822, 'deDE', 'Wir sind für Euch da, Uther. Verzweifelt nicht.', '', 39653),
(210821, 'deDE', '', 'Zumindest ist Tyrande dem Schlund entkommen... auf ihre Art.\n\nIch hoffe, Ysera kann sie lange genug stabilisieren, um sie zu retten.', 39653),
(210819, 'deDE', '', 'Wir lassen Euch nicht fallen, Uther!', 39653),
(210818, 'deDE', '', 'Meine Jägerin, gut gemacht. Der ganze Ardenwald steht in Eurer Schuld.', 39653),
(210817, 'deDE', '', 'Mein Jäger, gut gemacht. Der ganze Ardenwald steht in Eurer Schuld.', 39653),
(210816, 'deDE', '', 'Für all Eure Taten, $p, danke ich Euch.', 39653),
(210814, 'deDE', '', 'Durch Dürre und Verlust hat der Ardenwald gelitten.', 39653),
(210798, 'deDE', 'Odyn will also, dass wir ein Horn schmieden, was? Es gibt einige spezielle Bestandteile auf dem Tisch dort drüben.', '', 39653),
(210797, 'deDE', '', 'Ich spüre es auch. Sehr klug, Anduin! Was wolltest du uns zeigen...', 39653),
(210796, 'deDE', 'Der Kompass ist mit einer Erinnerung versehen.', '', 39653),
(210795, 'deDE', 'Natürlich, Jaina.', '', 39653),
(210794, 'deDE', '', 'Bolvar, helft Ihr uns, den Kompass zu untersuchen?', 39653),
(210793, 'deDE', '', 'Mehr als das, glaube ich. I spüre eine Verzauberung am Kompass. Vielleicht hat Anduin uns mithilfe des Lichts eine Botschaft geschickt.', 39653),
(210792, 'deDE', 'Als Zeichen, dass ihn die Macht des Kerkermeisters nicht ganz übernommen hat?', '', 39653),
(210791, 'deDE', '', 'Ich glaube nicht, dass Anduin ihn versehentlich fallenlassen hat. Er muss gewollt haben, dass wir ihn finden.', 39653),
(210790, 'deDE', '', 'Einen Kompass. Er war ein Geschenk an seinen Vater. Varian hatte ihn bei sich, kurz bevor... wir die Legion an der Verheerte Küste bekämpften.', 39653),
(210789, 'deDE', 'Jaina, was hat Anduin da zurückgelassen?', '', 39653),
(210788, 'deDE', 'Der Tag, den ich so lange gefürchtet hatte, ist schließlich gekommen.', '', 39653),
(210787, 'deDE', '', 'Der Kerkermeister ist fort. Und er hat Anduin mitgenommen.', 39653),
(210786, 'deDE', 'Wir haben versucht, sie aufzuhalten. Beide. Wir haben versagt.', '', 39653),
(210784, 'deDE', 'Da kommen Eure Verbündeten, Sterblicher.', '', 39653),
(210783, 'deDE', '', 'Kommt. Ich möchte mehr über Euer Leben hören. Alles.', 39653),
(210782, 'deDE', 'Danke... Mutter. Ich werde Euch stolz machen.', '', 39653),
(210781, 'deDE', '', 'Ich sehe mit Freude, wie weit Ihr gekommen seid. Und ich weiß, dass noch viel vor Euch liegt.', 39653),
(210780, 'deDE', '', 'Einst dachte ich, der Tod wäre das Ende. Aber jetzt, als Kriegerin von Maldraxxus, sehe ich, dass er erst der Anfang war.', 39653),
(210779, 'deDE', '', 'Dann also eine Lektion. Nicht von Mutter zu Kind, zwischen verwandten Seelen. Erinnert Euch daran, wer Ihr wart, aber seid stolz darauf, wer Ihr seid.', 39653),
(210778, 'deDE', 'Ich bin... nicht sicher. Es ist viel geschehen. Ich weiß nicht, wohin mein Leben als Nächstes führt.', '', 39653),
(210777, 'deDE', '', 'Das wart Ihr. Wer seid Ihr jetzt?', 39653),
(210776, 'deDE', 'Ich war einst Kriegshäuptling der Horde, ein Schamane des Irdenen Rings...', '', 39653),
(210775, 'deDE', '', 'Ihr wart ein Säugling, als ich starb. Sagt, zu wem seid Ihr herangewachsen?', 39653),
(210774, 'deDE', '', 'Missbraucht diese Macht, und ich erinnere Euch daran, warum ich nach Revendreth geschickt wurde.', 39653),
(210773, 'deDE', '', 'Wisst, dass ich Euch dieses Medaillon gebe, damit ich frei sein kann, die Schreckenslords aus den Schattenlanden zu tilgen.', 39653),
(210772, 'deDE', '', 'Wir löschen Eure Seuche aus... jetzt!', 39653),
(210770, 'deDE', '', 'Die Winterkönigin hört schweigend zu.', 39653),
(210769, 'deDE', '', 'Dann werde ich mich mühen, es zu verdienen. Wacht aus den Wipfeln über uns, Astarii. Elune-adore.', 39653),
(210768, 'deDE', '', 'Als Nachtkriegerin oder Hohepriesterin, ich habe Vertrauen in Eure Führung der Kaldorei.', 39653),
(210767, 'deDE', '', 'Wie der Neumond dem Vollmond weicht, schwindet die Dunkelheit im Licht.', 39653),
(210766, 'deDE', '', 'Ich sehe jetzt, dass viele unseres Volkes nach Rache verlangen, doch dass wir Erneuerung brauchen.', 39653),
(210765, 'deDE', '', 'Danke, Kind... doch das hätte ich beinahe. Die Flammen der Rache haben mich so verzehrt, dass ich die Asche zu unseren Füßen nicht sehen konnte.', 39653),
(210764, 'deDE', '', 'Hohepriesterin! Selbst im tiefsten Schlund konnte ich Eure Anwesenheit spüren. Ich wusste, Ihr würdet uns nicht im Stich lassen.', 39653),
(210758, 'deDE', 'Ihr seid in meinen Hallen willkommen, $n.', '', 39653),
(210757, 'deDE', '', 'Die Macht in Tyrandes Händen droht, sie zu verschlingen... sie wird den Hain noch zerstören!', 39653),
(210756, 'deDE', '', 'Die Macht meiner Schwester... in meinem Wald? Ich will Antworten!', 39653),
(210755, 'deDE', '', 'ASH ROHK ILISAR! THANDAE!', 39653),
(210754, 'deDE', '', 'Das ist überhaupt nicht gut!', 39653),
(210752, 'deDE', 'Nein! Sie absorbiert noch mehr von Elunes Macht!', '', 39653),
(210751, 'deDE', '', 'Das ist nicht gut!', 39653),
(210749, 'deDE', '', 'Ihre Kraft wächst - sie überwältigt sie!', 39653),
(210748, 'deDE', '', 'Champion, helft mir!', 39653),
(210747, 'deDE', '', 'Die Rage der Nachtkriegerin wird uns vernichten! Zügelt sie!', 39653),
(210746, 'deDE', '', 'Ich glaube, sie hört nicht zu!', 39653),
(210745, 'deDE', '', 'Ash\'al theradas!', 39653),
(210744, 'deDE', '', 'Tyrande, verliert Euch nicht im Zorn!', 39653),
(210743, 'deDE', '', 'Anu dorini ash\'ka!', 39653),
(210742, 'deDE', '', 'Minn\'do, bitte! Ihr müsst Euch beruhigen!', 39653),
(210741, 'deDE', 'Shandris, haltet sie fest!', '', 39653),
(210740, 'deDE', '', 'Elune! Arama sh\'nala fasima nemelia boranna!', 39653),
(210739, 'deDE', '', 'Ich habe solche Wut selten in sterblichen Händen erlebt.', 39653),
(210738, 'deDE', 'Es ist Zeit. Fangen wir an.', '', 39653),
(210737, 'deDE', '', 'Die Vorbereitungen sind abgeschlossen, Thiernax.', 39653),
(210729, 'deDE', 'Halt. Nur Bürger und registrierte Klienten dürfen diesen Eingang passieren.', 'Halt. Nur Bürger und registrierte Klienten dürfen diesen Eingang passieren.', 39653),
(210722, 'deDE', '', 'Besser, aber sehr verzerrt. Versucht einen anderen, niedrigeren Standort.', 39653),
(210720, 'deDE', '', 'Ah! Ich empfange etwas. Das Signal ist sehr schwach. Findet eine andere Stelle für das Relais.', 39653),
(210718, 'deDE', '', 'Danke, Uther. Könntet Ihr ein Weilchen bleiben und reden? Ich habe so viel zu erzählen...', 39653),
(210717, 'deDE', 'Ich auch. Nehmt diese Liebe mit, Jaina. Lasst sie Euch in finsteren Zeiten stärken.', '', 39653),
(210716, 'deDE', '', 'Ich habe ihn geliebt, wisst Ihr?', 39653),
(210715, 'deDE', 'Erinnerungen sind wie Spiegel. Sie zeigen uns Aspekte unserer selbst, die wir manchmal gern vergessen würden. Aber Ihr könnt wählen, welche Lehren Ihr daraus zieht, und was Ihr zurücklasst.', '', 39653),
(210714, 'deDE', '', 'Ich habe versucht, die Vergangenheit hinter mir zu lassen. Jetzt, bei dem, was Anduin angetan wird... kommen die schmerzhaften Erinnerungen wieder.', 39653),
(210713, 'deDE', 'Ich erinnere mich. Ihr denkt auch noch an ihn, oder? Auch all die Jahre später.', '', 39653),
(210712, 'deDE', '', 'Stratholme. Nach der Ausmerzung.', 39653),
(210711, 'deDE', 'Ich habe Euch kaum erkannt, Jaina. Zuletzt haben wir gesprochen, als...', '', 39653),
(210710, 'deDE', '', 'Uther? Uther! Ein... Kyrianer?! Natürlich. Das... passt zu Euch.', 39653),
(210709, 'deDE', 'Beim Licht! Jaina Prachtmeer, seid Ihr das?', '', 39653),
(210706, 'deDE', '', 'Sucht nach Verstecken in der Nähe von Kreaturen von Interesse... aber nicht direkt vor ihren Augen.', 39653),
(210694, 'deDE', 'Weiter... ja. Es gibt viel zu tun. Ich danke Euch, Mutter.', '', 39653),
(210693, 'deDE', '', 'Ihr habt ihm eine Wahl geboten, nicht sie für ihn getroffen. Trauert, wenn Ihr müsst, aber seine Entscheidungen fallen Euch nicht zur Last. Sein Weg ist am Ende. Eurer geht weiter.', 39653),
(210692, 'deDE', 'Aber ich habe ihn auf ihn gebracht.', '', 39653),
(210691, 'deDE', '', 'Euer Vater hat immer gesagt, dass ein Wolf entscheidet, ob er auf Zuruf kommt oder seinen Meister angreift. Es gibt keine Schuld, nur den Lauf der Natur. Garrosh hat seinen Weg gewählt, mein Sohn.', 39653),
(210690, 'deDE', 'Ich habe ihn aus Nagrand geholt. Ihn zum Kriegshäuptling gemacht. Aber als er mich am meisten brauchte, habe ich ihn straucheln lassen. Und am Ende ist er durch meine Hand gefallen.', '', 39653),
(210689, 'deDE', '', 'Das Schicksal zeigt jedem von uns einen Weg. Inwiefern tragt Ihr die Schuld an seiner Bestimmung?', 39653),
(210688, 'deDE', 'Ja. Ich sprach von Garrosh, Sohn von Grommash Höllschrei. Ich wollte ihm die Finsternis seines Vaters ersparen, doch stattdessen... fürchte ich, dass ich die Schuld an seinen Verbrechen trage.', '', 39653),
(210687, 'deDE', '', 'Ihr habt mir viel aus Eurem Leben erzählt, Go\'el. Einige der Erinnerungen scheinen Euch zu bedrücken.', 39653),
(210686, 'deDE', '', 'Ah, ja! Das Projektionsgerät beweist bereits seinen Nutzen. Was Euren Reiseversuch angeht...', 39653),
(210685, 'deDE', '', 'Wir müssen wachsam sein.', 39653),
(210684, 'deDE', '', 'Ihr habt meinen Prinzen vorm Schlund gerettet. Das vergesse ich nicht.', 39653),
(210683, 'deDE', '', 'Der Prinz wird geschützt.', 39653),
(210682, 'deDE', '', 'Spitzel sind hier überall. Seid auf der Hut.', 39653),
(210676, 'deDE', 'Vielleicht... habt Ihr Recht, Anklägerin. Ich habe wohl Arbeit vor mir.', '', 39653),
(210675, 'deDE', '', 'Tut für alles andere Buße... aber verzeiht Euch dafür.', 39653),
(210674, 'deDE', '', 'Ihr habt im Leben viele Sünden begangen, Kael\'thas Sonnenwanderer. Der Fall Eures Königreichs ist nicht unter ihnen.', 39653),
(210673, 'deDE', '', 'Dann seid Ihr nicht auf Rache aus, sondern auf Sühne.', 39653),
(210672, 'deDE', '', 'Ich beobachte unsere Verbündeten nicht weniger als unsere Feinde.', 39653),
(210670, 'deDE', 'Ich... Ich war nicht dabei, als Silbermond fiel. In seiner schwersten Stunde abwesend. Mein Versagen verfolgt mich seitdem.', '', 39653),
(210669, 'deDE', '', 'Also hätte diese Rache nicht ihnen gedient. Sondern nur Euch.', 39653),
(210668, 'deDE', '', 'Mein Leben für meinen Meister.', 39653),
(210667, 'deDE', 'Nein... Ich dachte...', '', 39653),
(210666, 'deDE', '', 'Und wozu hätte das geführt? Hätte es das Schicksal Eures Volkes verändert?', 39653),
(210665, 'deDE', 'Kel\'Thuzad ist zerstört. Nein! Ich bin es, der Rache für die Sin\'dorei hätte üben sollen!', '', 39653),
(210664, 'deDE', '', 'Ein Symbol unseres neuen Weges.', 39653),
(210663, 'deDE', '', 'Fünf Tempel. Fünf Paragons.', 39653),
(210662, 'deDE', '', 'In schweren Zeiten habt Ihr Geduld und Mitgefühl verkörpert.', 39653),
(210661, 'deDE', '', 'Viele Zeitalter sind vergangen, seit ein Paragon geweiht wurde.', 39653),
(210649, 'deDE', '', 'Wirklich eine sehr profitable Leistung.', 39653),
(210636, 'deDE', 'Meine Tage als Prinz sind vorüber. Eine von vielen Änderungen, die ich ertragen musste.', '', 39653),
(210635, 'deDE', '', 'Hier tut Ihr also Eure Buße. Es passt zu Euch, kleiner Prinz.', 39653),
(210631, 'deDE', 'Nein, Kleia. Das muss er allein bewältigen.', '', 39653),
(210629, 'deDE', '', 'Keine Sorge, Schlundgänger. Ich habe Euch.', 39653),
(210628, 'deDE', 'Doch keine Angst! Ich weiß einen Weg, an Eurer Seite unerkannt zu bleiben. Wir treffen uns auf der Fähre.', '', 39653),
(210627, 'deDE', 'Vielleicht sollte ich jetzt doch erwähnen, dass ich in Tazavesh nicht sehr herzlich willkommen bin.', '', 39653),
(210626, 'deDE', 'Da wird wohl Gewaltanwendung nötig sein. Ich freue mich darauf, Euch in Aktion zu sehen.', '', 39653),
(210624, 'deDE', 'Mal\'Ganis, wir müssen keine Feinde sein. Rettet mit uns Revendreth. Beendet Euer Exil.', '', 39653),
(210621, 'deDE', '', 'Ist das ein Hauch von Reue? Wie untypisch für Euch.', 39653),
(210620, 'deDE', 'Allein der Gedanke, dass ich mit diesen Monstern verbündet war...', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(210619, 'deDE', '', 'Ihr geht davon aus, dass er sowohl tot als auch sterblich ist. Ich bin da nicht so sicher.', 39653),
(210618, 'deDE', 'Illidan hätte das genossen. Was glaubt Ihr, welches Schicksal für ihn gewählt wurde?', '', 39653),
(210614, 'deDE', '', 'Der Verbannte ist nicht aufzuhalten!', 39653),
(210609, 'deDE', 'Es gibt kein Entrinnen!', '', 39653),
(210606, 'deDE', 'Ihr werdet brechen!', '', 39653),
(210604, 'deDE', 'Kein Problem, wir ändern einfach den Plan.', '', 39653),
(210603, 'deDE', 'Wenn Ihr darauf besteht. Auf zum Zoll. Folgt mir, Schlundgänger.', '', 39653),
(210602, 'deDE', 'Alle Nichtbürger müssen die vorschriftsmäßige Zollüberprüfung durchlaufen!', '', 39653),
(210601, 'deDE', 'Wir haben drinnen sehr Wichtiges zu erledigen. Vielleicht ist eine Ausnahme möglich?', '', 39653),
(210600, 'deDE', 'Alle Nichtbürger müssen die vorschriftsmäßige Zollüberprüfung durchlaufen.', '', 39653),
(210599, 'deDE', 'Schlundgänger! Meine Freunde hier sind ungewohnt schweigsam. Vielleicht habt Ihr mehr Glück.', '', 39653),
(210595, 'deDE', 'Tazavesh kann schwer zu erreichen sein. Aber jemand vom Nachtmarkt hilft uns sicher bei der Reise.', '', 39653),
(210579, 'deDE', 'Kartell Al dankt der werten Kundschaft.', '', 39653),
(210578, 'deDE', 'Viel Glück auf Euren Abenteuern.', '', 39653),
(210577, 'deDE', 'Auf Wiedersehen, mein Freund.', '', 39653),
(210576, 'deDE', 'Lasst es mich wissen, wenn Ihr etwas braucht.', '', 39653),
(210575, 'deDE', 'Vertraut mir. Ich bin ein Profi.', '', 39653),
(210574, 'deDE', 'Ich bringe Euch zu allem, was Ihr sucht.', '', 39653),
(210573, 'deDE', 'Braucht Ihr einen Reiseführer?', '', 39653),
(210572, 'deDE', 'Euer Wunsch ist mir Befehl.', '', 39653),
(210571, 'deDE', '', 'Eure Steingeborenen können uns nicht alle finden. Wir sind überall!', 39653),
(210570, 'deDE', '', 'Ich habe mehr als genug Zorn, um Euch zu beseitigen.', 39653),
(210569, 'deDE', '', 'Eine Ernterin ohne ihr Medaillon. Ihr seid nur ein Schatten Eures früheren Zorns.', 39653),
(210565, 'deDE', 'Mein Gefängnis... jetzt Eures!', '', 39653),
(210564, 'deDE', 'Ein Vorgeschmack... auf Freiheit!', '', 39653),
(210563, 'deDE', 'Eure Hände... werden ihm dienen!', '', 39653),
(210562, 'deDE', 'Fesseln... reißen!', '', 39653),
(210561, 'deDE', 'Spürt die Last... meiner Krone!', '', 39653),
(210560, 'deDE', 'Endlich... eine Atempause...', '', 39653),
(210557, 'deDE', 'Die Ringe bersten!', '', 39653),
(210556, 'deDE', 'Seht Ihr das Unendliche?!', '', 39653),
(210555, 'deDE', 'Götter fallen im Schlüsselumdrehen!', '', 39653),
(210554, 'deDE', 'Der Webstuhl webt Euren Untergang!', '', 39653),
(210551, 'deDE', 'Die große Konjunktion beginnt!', '', 39653),
(210550, 'deDE', 'Schicksalsfäden, aufgelöst!', '', 39653),
(210549, 'deDE', 'Die Ewigkeit verschlingt sich selbst!', '', 39653),
(210548, 'deDE', 'Starrt in die Unendlichkeit!', '', 39653),
(210547, 'deDE', 'Seht Ihr?!', '', 39653),
(210546, 'deDE', 'Er weiß... er weiß es... wegen mir...', '', 39653),
(210545, 'deDE', 'Endlich... Stille...', '', 39653),
(210544, 'deDE', '', 'Oh, und macht es kurz. Als Zeichen der Dankbarkeit.', 39653),
(210543, 'deDE', '', 'Tötet den Schlundgänger.', 39653),
(210542, 'deDE', 'Sie sind vereint! Die Tür öffnet sich!', '', 39653),
(210541, 'deDE', '', 'Ihr könnt ihn selbst fragen, wenn wir in Torghast ankommen. Er brennt darauf, Euch zu treffen.', 39653),
(210540, 'deDE', 'Wie viele? Wie viele Spione hat der Verbannte unter uns gebracht?', '', 39653),
(210539, 'deDE', '', 'Danke für Eure wertvolle Hilfe, Sterblicher.', 39653),
(210538, 'deDE', '', 'In der Tat.', 39653),
(210537, 'deDE', 'Nein! Sie haben mich gefunden!', '', 39653),
(210528, 'deDE', '', 'Nikolon, bitte begleitet uns. Wir müssen einen Weg finden, unser Volk wieder zu vereinen.', 39653),
(210527, 'deDE', 'Ich verstehe jetzt, und entschuldige mich aufrichtig. Uther hat mich heute viel gelehrt. Die Bastion braucht einen neuen Weg.', '', 39653),
(210522, 'deDE', 'Hmm. Beachtet die Krallenspuren auf dem Einband...', '', 39653),
(210521, 'deDE', 'Unsere Beute weiß Gifte und Säuren wohl zu schätzen...', '', 39653),
(210520, 'deDE', 'Das Buch ist von Überresten eines Spinnennetzes umgeben...', '', 39653),
(210518, 'deDE', '', 'Ich erschaffe den Anker. Geht jetzt und findet den Portalstein. Vorsehung führe uns alle.', 39653),
(210517, 'deDE', '', 'Zu schade, dass Ihr unseren Sieg nicht erleben werdet. Doch wenn Ihr ein Ende sucht, dann tretet ihm entgegen!', 39653),
(210516, 'deDE', '', 'Der Schütze trauert nicht um den Verlust seiner Pfeile, Hochlord.', 39653),
(210515, 'deDE', 'Euch schützen keine Val\'kyr mehr, Sylvanas. Ihr sterbt hier. Zum letzten Mal.', '', 39653),
(210514, 'deDE', '', 'Ich glaube, dass Eure Pakttruppen mit dieser Verbindung den Schlund verlassen können, so wie Ihr.', 39653),
(210513, 'deDE', '', 'Ich erschaffe hier in Oribos einen Anker für Eure Anima. Wenn Ihr den zweiten Portalstein aktiviert, sollte er sich damit verbinden.', 39653),
(210512, 'deDE', '', 'Champions von Azeroth. Endlich seid Ihr hier.', 39653),
(210509, 'deDE', 'Kel\'Thuzad war einer der gehorsamsten Diener des Kerkermeisters. Ich will versuchen, die Reste seiner Macht zu beugen, um ein Portal direkt zu seinem Meister zu öffnen.', '', 39653),
(210508, 'deDE', 'Ritter! Sichert die Kammer!', '', 39653),
(210505, 'deDE', 'Unsere Wahl war... schlecht.', '', 39653),
(210504, 'deDE', 'Jemand möchte nicht gefunden werden.', '', 39653),
(210503, 'deDE', 'Die hätte nicht einmal ich vorhersehen können.', '', 39653),
(210502, 'deDE', 'Noch ein Falle. Hmm.', '', 39653),
(210501, 'deDE', 'Eine Falle, wie erwartet. Vorsicht, $p.', '', 39653),
(210500, 'deDE', 'Die Zeit ist gekommen, Euch für die Demütigungen von Naxxramas büßen zu lassen! Nun, endlich, werdet Ihr vor Kel\'Thuzad knien!', '', 39653),
(210499, 'deDE', 'Ich habe meine wahren Ziele zu lange verstecken müssen. Vorgetäuscht, falschen Meistern zu dienen. Wo es doch ich war, der den Untergang Azeroths mitgestaltet hat!', '', 39653),
(210498, 'deDE', 'Wie passend, dass wir wir uns hier gegenüberstehen, an der Schwelle zum Sieg des Todes.', '', 39653),
(210497, 'deDE', 'Das habe ich nicht gesagt!', '', 39653),
(210496, 'deDE', 'Was macht Ihr denn?!', '', 39653),
(210495, 'deDE', 'Er hat es aus meinem Geist gerissen... Nur Schatten bleiben...', '', 39653),
(210494, 'deDE', 'Ringe in Ringen in Ringen... Es versteckt sich...', '', 39653),
(210493, 'deDE', 'Ein ordentlicher Schlag auf den Kopf hilft immer!', '', 39653),
(210492, 'deDE', 'Es gibt keine Anleitungen! Haut doch mal drauf!', '', 39653),
(210491, 'deDE', 'Benutzt den Hebel, Schlundgänger!', '', 39653),
(210490, 'deDE', 'Zieht an einem der Hebel!', '', 39653),
(210489, 'deDE', 'Knöpfe! Schnell, die Knöpfe!', '', 39653),
(210488, 'deDE', 'Drückt ein paar Knöpfe!', '', 39653),
(210487, 'deDE', 'Ich habe Baupläne von einem der Schmuggler beschafft. Mal sehen...', '', 39653),
(210486, 'deDE', 'Es kann fliegen!?', '', 39653),
(210484, 'deDE', 'Ich zerquetsche Eure Schädel!', '', 39653),
(210483, 'deDE', 'Eure Knochen werden brechen!', '', 39653),
(210482, 'deDE', 'Aberrationen versuchen, Chiffren zum Grabmal zu erlangen. Wächter, Ihr werdet sie auslöschen.', '', 39653),
(210481, 'deDE', 'Zerstört alles! Hinterlasst keine Spuren, die die Sterblichen finden können!', '', 39653),
(210480, 'deDE', 'Was sucht der Kerkermeister noch?', '', 39653),
(210479, 'deDE', 'Diese Gerätschaften scheinen andere Reiche in den Schlund zu ziehen, genau wie Korthia.', '', 39653),
(210478, 'deDE', 'Fast an der Spitze. Seid auf der Hut.', '', 39653),
(210476, 'deDE', '', 'Schicksalsschreiber Roh-Tahl hat das Entstehen eines zweiten Portalsteins im Schlund gespürt, doch er weiß nicht, wo genau.', 39653),
(210475, 'deDE', 'Die Schattenlande sollen Eure Schreie hören!', '', 39653),
(210474, 'deDE', '', 'Eure Anima hat den ersten Portalstein erweckt. So konntet Ihr einige Eurer Verbündeten in Sicherheit bringen.', 39653),
(210473, 'deDE', 'Ich habe mit viel Mühe eine Ewigkeit der Qualen für Euch erschaffen. Ich hoffe, Ihr wisst das zu schätzen.', '', 39653),
(210472, 'deDE', 'Willkommen, verehrte Gäste.', '', 39653),
(210471, 'deDE', 'Lasst mich frei, Wurm, und ich zeige Euch wahren Zorn!', '', 39653),
(210470, 'deDE', 'Euer Zorn ist exquisit, Höllschrei. Er allein könnte unsere Seelenschmieden für Äonen befeuern.', '', 39653),
(210443, 'deDE', 'Schwarze Klinge! Sichert das Portal!', '', 39653),
(210440, 'deDE', '', 'Wie Ihr befehlt, Dunkle Fürstin!', 39653),
(210439, 'deDE', '', 'Val\'kyr! Ihr seid an mich gebunden! Streckt meine Feinde nieder!', 39653),
(210438, 'deDE', '', 'Fordragon. Ein gefallener König ohne Thron. Nun büßt Ihr für Euren Trotz!', 39653),
(210437, 'deDE', 'Wir halten Euch auf, Sylvanas!', '', 39653),
(210436, 'deDE', '', 'Narren. Ihr bestreitet eine verlorene Schlacht.', 39653),
(210435, 'deDE', 'Kämpft, um unsere Welt zu retten!', '', 39653),
(210434, 'deDE', '', 'Licht, beschütze uns!', 39653),
(210433, 'deDE', 'Für Azeroth!', '', 39653),
(210432, 'deDE', 'Wir ziehen ihre Haupttruppen auf uns! Champions, vereitelt die Pläne des Kerkermeisters!', '', 39653),
(210429, 'deDE', 'Ich kenne mich recht gut mit den Prophezeiungen aus. Wenn Ihr wirklich $gder Schlundgänger:die Schlundgängerin; seid, werde ich es erkennen.', '', 39653),
(210428, 'deDE', 'Macht Euch bereit! Das Sanktum der Herrschaft wartet.', '', 39653),
(210427, 'deDE', 'Der Kerkermeister wird seinen Zorn auf uns entfesseln. Wir dürfen nicht straucheln.', '', 39653),
(210426, 'deDE', '', 'Die Essenz des Tarragrue ist noch mit seinem Meister verbunden. Mit dieser Verbindung können wir den Weg in die Festung öffnen.', 39653),
(210425, 'deDE', '', 'Aber gewiss, Hochlord.', 39653),
(210424, 'deDE', 'Lady Prachtmeer, wir brauchen Eure Expertise.', '', 39653),
(210423, 'deDE', 'Sichert das Gebiet! Verstärkt unsere Verteidigung!', '', 39653),
(210422, 'deDE', 'Erlegt die Bestien! Ihr braucht ihre Macht, um den Tarragrue zu besiegen.', '', 39653),
(210420, 'deDE', 'Der Tarragrue versperrt uns den Weg. Es wird Zeit, den Diener des Kerkermeisters zu beseitigen.', '', 39653),
(210419, 'deDE', '', 'Die Dunkelheit erwartet Euch!', 39653),
(210418, 'deDE', 'Das Sanktum des Kerkermeisters ist über uns. Wie brechen wir durch?', '', 39653),
(210417, 'deDE', '', 'Ich kenne diese Magie...', 39653),
(210416, 'deDE', 'Schwarze Klinge, Position halten!', '', 39653),
(210415, 'deDE', 'Es ist wahr... Ihr seid der Schlundgänger! Und Eure Anima ist jetzt stärker denn je. Wir von Korthia stehen Euch zur Verfügung.', '', 39653),
(210414, 'deDE', '', 'Lasst sofort den Schlundgänger los oder erlebt die Konsequenzen.', 39653),
(210413, 'deDE', 'Die Schriften sagen ausdrücklich, der wahre Schlundgänger muss gestärkt werden. Es ist meine Pflicht.', '', 39653),
(210412, 'deDE', '', 'Beendet diese lächerliche Untersuchung... bevor Ihr Eure einzige Rettung umbringt!', 39653),
(210411, 'deDE', 'Aber hat sie Euch auf das Kommende vorbereitet? Wir müssen es herausfinden.', '', 39653),
(210409, 'deDE', 'Ah, ja... Ihr seid mit einer einzigartigen Weltenseele verbunden, wie prophezeit!', '', 39653),
(210408, 'deDE', 'Viel meines Wissens ist rein theoretisch. Ich muss Eure Anima erkunden, um mehr zu erfahren. Haltet still.', '', 39653),
(210407, 'deDE', 'Was ist das für ein grausiger Horror?', '', 39653),
(210403, 'deDE', 'Falscher Hebel!', '', 39653),
(210402, 'deDE', '', 'Eure Leben enden hier!', 39653),
(210401, 'deDE', '', 'Der Tod erwartet Euch!', 39653),
(210399, 'deDE', 'Bis jetzt habe ich mir um das Konzept der Sterblichkeit eigentlich noch nie Gedanken gemacht.', '', 39653),
(210391, 'deDE', 'Wir haben Eure Spiele satt, Sylvanas!', '', 39653),
(210390, 'deDE', 'Diese Macht liegt nicht in Euren Händen!', '', 39653),
(210387, 'deDE', 'Unserer Beute hinterher. Helden, zu mir!', '', 39653),
(210386, 'deDE', 'Meine Verteidigung fällt!', '', 39653),
(210383, 'deDE', 'Ich stehe in Eurer Schuld, Hochlord.', '', 39653),
(210382, 'deDE', 'Blut und Donner!', '', 39653),
(210381, 'deDE', 'Wieso seid Ihr in Maldraxxus, Vashj? Euch fehlt es nicht an Sünden.', '', 39653),
(210379, 'deDE', 'Lebt wohl, Tal-Inara. Bis zu unserer Rückkehr verteidigt die Schwarze Klinge Oribos.', '', 39653),
(210378, 'deDE', '', 'Lebt wohl, Bolvar Fordragon. Möge die Vorsehung Euch leiten.', 39653),
(210375, 'deDE', 'Helden, zu mir! Wir sammeln uns um Jaina!', '', 39653),
(210373, 'deDE', 'Zu mir, Champions! Jaina braucht unsere Kraft!', '', 39653),
(210371, 'deDE', 'Ich habe den Weg geöffnet! Los! Haltet Sylvanas auf!', '', 39653),
(210370, 'deDE', '', 'Geschafft! Eilt Euch!', 39653),
(210369, 'deDE', '', 'Haltet sie noch einen Moment zurück. Das Portal ist fast offen!', 39653),
(210368, 'deDE', '', 'Etwas schränkt meine Magie ein. Wo sind wir?', 39653),
(210367, 'deDE', '', 'Danke, Bolvar.', 39653),
(210366, 'deDE', '', 'Helden! Ich brauche Hilfe!', 39653),
(210359, 'deDE', '', 'Schnell! Thrall braucht uns!', 39653),
(210358, 'deDE', '', 'Schnell, Champions! Haltet Sylvanas auf!', 39653),
(210354, 'deDE', '', 'Der Tod beugt sich meinem Willen!', 39653),
(210346, 'deDE', '', 'Ihr werdet büßen. Ihr alle werdet büßen!', 39653),
(210344, 'deDE', '', 'Ich habe Euren Thron zerschmettert. Jetzt breche ich Euch!', 39653),
(210342, 'deDE', '', 'Spürt meinen Zorn!', 39653),
(210339, 'deDE', '', 'Ich treffe immer ins Schwarze.', 39653),
(210338, 'deDE', '', 'Alle Hoffnung ist dahin!', 39653),
(210337, 'deDE', 'Ein Geheimnis ist nur so mächtig wie die, die es fürchten.', '', 39653),
(210336, 'deDE', '', 'Nichts entgeht meinem Zorn!', 39653),
(210332, 'deDE', '', 'Sucht Weisheit, doch neidet sie niemandem.', 39653),
(210329, 'deDE', '', 'Ihr seid nicht würdig, gegen mich zu kämpfen!', 39653),
(210328, 'deDE', '', 'Die Vergangenheit fesselt Euch!', 39653),
(210327, 'deDE', '', 'Ich verfehle nie!', 39653),
(210326, 'deDE', '', 'In den Tod!', 39653),
(210324, 'deDE', '', 'Keine Gnade!', 39653),
(210319, 'deDE', '', 'Nun gut. Also der Tod!', 39653),
(210318, 'deDE', 'Jede Menge neue Gesichter hier.', '', 39653),
(210317, 'deDE', 'Mein Boss meint, ich muss noch drei Spiegel polieren, dann werd ich zum mittleren Spiegelpolierer befördert. Geht doch nix über ein Ziel im Leben.', '', 39653),
(210315, 'deDE', 'Also, ähm, seid Ihr sicher, der Meister kommt nicht aus dieser Falle raus? Nix gegen den Protz da vorn, aber der Herr hat hier echten Heimvorteil.', '', 39653),
(210310, 'deDE', 'Hey, ähm... $gSchlundgänger:Schlundgängerin;, Euer Hochwohlgeboren und so. Meint Ihr, Ihr könnt mit irgendwem reden, damit ich den Job hier vom Hals hab?\n\nSo als Gefallen und so.\n\nIch hab da nämlich dieses Leiden. Nennt sich \"Existenzsucht\", und ich glaub, die Arbeit hier lässt sich damit irgendwie nicht gut vereinbaren.', '', 39653),
(210309, 'deDE', 'Wenn mich irgendein Job noch mehr Nerven kostet als der Endmorast, dann der hier.', '', 39653),
(210308, 'deDE', 'Ladung erschöpft. Kernschmelze läuft.', '', 39653),
(210307, 'deDE', 'Verbindung hergestellt. Der Wächter wird verstärkt.', '', 39653),
(210302, 'deDE', 'Ich bin kein Schoßhund, den man herumkommandiert. Merkt Euch das.', '', 39653),
(210300, 'deDE', '', 'Drohne materialisiert.', 39653),
(210299, 'deDE', '', 'Dissektion.', 39653),
(210298, 'deDE', '', 'Desintegration.', 39653),
(210297, 'deDE', '', 'Eliminierung... initiiert.', 39653),
(210296, 'deDE', '', 'Kerne... leer...', 39653),
(210295, 'deDE', '', 'Chiffren verteidigt. Rückkehr in... Ruhezustand.', 39653),
(210292, 'deDE', '', 'Chiffren... verteidigen.', 39653),
(210289, 'deDE', 'Ich bin ewig!', '', 39653),
(210288, 'deDE', 'Ich kehre immer und immer wieder!', '', 39653),
(210286, 'deDE', 'Ihr könnt mich nicht besiegen!', '', 39653),
(210283, 'deDE', 'Schreit vor eiskaltem Entsetzen!', '', 39653),
(210277, 'deDE', 'Ergebt Euch der kalten Finsternis!', '', 39653),
(210276, 'deDE', 'Euer Blut wird in den Adern gefrieren!', '', 39653),
(210274, 'deDE', '', 'Für die Vorsehung!', 39653),
(210273, 'deDE', 'Roh-Senara, nein! Wir brauchen Euch!', '', 39653),
(210272, 'deDE', '', 'Und... Archivarin Roh-Senara. Möge meine Weisheit in unserer finstersten Stunde Führung bieten, auf dass Korthia wieder den Morgen dämmern sehe.', 39653),
(210270, 'deDE', '', 'Archivar Roh-Mah!', 39653),
(210269, 'deDE', '', 'Archivarin Roh-Kiel!', 39653),
(210268, 'deDE', '', 'Archivar Roh-Luda!', 39653),
(210267, 'deDE', '', 'Archivarin Roh-Gema!', 39653),
(210265, 'deDE', 'Die Schatten rufen!', '', 39653),
(210264, 'deDE', 'Lernt den Abgrund kennen!', '', 39653),
(210262, 'deDE', 'Euch erwarten nur Reif und Eis!', '', 39653),
(210261, 'deDE', 'Friert ein und zerspringt!', '', 39653),
(210260, 'deDE', '', 'Archivare aus alten Zeiten! Verleiht dem Leitstab all Euer Wissen! Eure Echos sind für immer verhallt, doch Eure Opfer bleiben unvergessen!', 39653),
(210259, 'deDE', '', 'Der Leitstab, von Anima befeuert, von Weisheit geführt, wird seinen Träger zu jedem Relikt führen, das je im Archiv war. Unsere heilige Pflicht überdauert.', 39653),
(210258, 'deDE', 'Die Kälte zertrümmert Euch!', '', 39653),
(210257, 'deDE', 'Spürt Ihr die Kälte in den Knochen?', '', 39653),
(210255, 'deDE', 'Halt! Wartet! Ich kann Euch unvorstellbare Macht bieten!', '', 39653),
(210254, 'deDE', 'Ich werfe Euch in die tiefste Grube des Schlunds!', '', 39653),
(210253, 'deDE', 'Mein Phylakterium!', '', 39653),
(210252, 'deDE', 'Der Tod ist mein Reich!', '', 39653),
(210251, 'deDE', 'Meine Herrschaft über den Tod ist vollkommen!', '', 39653),
(210250, 'deDE', 'Durch den Tod wächst meine Macht!', '', 39653),
(210249, 'deDE', 'Ihr habt nicht die Macht, mich zu besiegen!', '', 39653),
(210248, 'deDE', 'Ihr wollt mich töten? Ich befehlige den Tod!', '', 39653),
(210247, 'deDE', 'Dachtet Ihr wirklich, Ihr hättet gewonnen? Ignorante Narren!', '', 39653),
(210246, 'deDE', 'Nein! Unmöglich! Der Tod... gehorcht... mir!', '', 39653),
(210245, 'deDE', 'Narren. Ihr könnt einen Lich nicht töten.', '', 39653),
(210242, 'deDE', 'Das war Eure letzte Einmischung in meine Pläne!', '', 39653),
(210233, 'deDE', 'So\'leah vom Kartell So will ein gefährliches Relikt erlangen. Es wäre für uns beide von Vorteil, das zu verhindern.', '', 39653),
(210232, 'deDE', 'Ich bin Al\'dalil, ein bescheidener Sammler von Artefakten, hier mit einem Angebot für Euch.', '', 39653),
(210231, 'deDE', 'Ah, Ihr seid angekommen.', '', 39653),
(210230, 'deDE', 'Ihr da! Das ist Eigentum von Kartell So!', '', 39653),
(210229, 'deDE', '', 'In der Tat, mein Freund.', 39653),
(210228, 'deDE', '', 'Vielleicht können wir, nachdem unsere Pflichten erfüllt sind, Geschichten des Ruhms austauschen.', 39653),
(210227, 'deDE', 'Interessant. Hätten wir Zeit, würde ich gern mehr darüber von Euch erfahren.', '', 39653),
(210224, 'deDE', '', 'Wie auch Ihr. Als Odyns Auge den Schleier durchblickte, sprach er von geflügelten Wesen, die sterbliche Seelen zur ewigen Ruhe geleiteten.', 39653),
(210223, 'deDE', '', 'Ihr habt etwas... seltsam Vertrautes an Euch.', 39653),
(210221, 'deDE', 'Ich freue mich darauf, das Heer von Maldraxxus in Aktion zu erleben, Baronin.', '', 39653),
(210220, 'deDE', '', 'Vyraz ist ein rückgratloser Verräter. Ich werde ihn töten und Markgraf Krexus rächen.', 39653),
(210219, 'deDE', 'Das Auge des Kerkermeisters ist vertrieben... gut. Und Ihr habt wertvolle Informationen über Desmotaeron gesammelt. Doch die Nachrichten zu Helya und Vyraz sind besorgniserregend.', '', 39653),
(210218, 'deDE', 'Kartell Ba beachtet niedere Kartelle nicht. Worüber auch immer sich Kartell Al und Kartell So zanken geht uns nichts an.', '', 39653),
(210216, 'deDE', '', 'Man hat Euch mit Al\'dalil gesehen. Ich warne Euch: Wählt Eure Freunde sorgfältig und Eure Feinde noch sorgfältiger.', 39653),
(210212, 'deDE', 'Ich lese Spuren, nicht Folianten. Mal sehen, was wir über unsere Beute herausfinden können.', '', 39653),
(210211, 'deDE', 'Kartell Ta mischt sich nie in die Angelegenheiten anderer ein. Um das Geschäft zu schützen. Ihr versteht das sicher.', '', 39653),
(210210, 'deDE', '', 'Trotz der Tapferkeit der Pakte bei der Verteidigung des Ardenwalds hat Zovaal seine Beute bekommen.', 39653),
(210208, 'deDE', '', 'Anduin! Nein!', 39653),
(210205, 'deDE', 'Und ich bin stolz auf dich, mein Sohn.', '', 39653),
(210204, 'deDE', 'Du hast mich gelehrt, zu verteidigen, was ich liebe. Dieses Erbe führe ich mit Stolz fort.', '', 39653),
(210202, 'deDE', 'Wie es scheint, hat das Schicksal sich anders entschieden. Das sollte nicht mein Erbe an dich sein, Darion.', '', 39653),
(210201, 'deDE', '', 'Mein Zorn vernichtet alles!', 39653),
(210200, 'deDE', 'Wir brauchten einen vierten Reiter, einen, der die anderen führte. Er schien die richtige Wahl zu sein.', '', 39653),
(210199, 'deDE', '', 'Der Tod jagt Euch!', 39653),
(210198, 'deDE', 'Ich habe Tirion einst gesagt, dass nur eine Silberne Hand eine Schwarze Klinge führen kann.', '', 39653),
(210197, 'deDE', 'Und doch wolltest du ihn in den Untod erheben. Weshalb willst du ihm die verdiente Ruhe verwehren?', '', 39653),
(210196, 'deDE', '', 'Ich werde Euch zerquetschen!', 39653),
(210195, 'deDE', 'In der Tat. Er hat sich dem Lichkönig im Kampf gestellt und Frostgram selbst zerschmettert.', '', 39653),
(210194, 'deDE', 'Tirion Fordring hat also in meiner Abwesenheit den Aschenbringer aufgenommen? Kaum einer wäre würdiger.', '', 39653),
(210193, 'deDE', '', 'Jetzt reicht es.', 39653),
(210192, 'deDE', '', 'Ihr seid alle unterlegen!', 39653),
(210191, 'deDE', '', 'Nein... etwas viel Bedrohlicheres kommt näher.', 39653),
(210190, 'deDE', '', 'Ist das, was Ihr gespürt hattet, Lady Mondbeere?', 39653),
(210188, 'deDE', '', 'Mein Schild versagt nie!', 39653),
(210187, 'deDE', '', 'Fallt durch meine Klinge!', 39653),
(210186, 'deDE', '', 'Schlagt jetzt zu, Schwestern!', 39653),
(210185, 'deDE', '', 'Val\'kyr! Tötet sie alle!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(210184, 'deDE', '', 'Ihr seid uns unterlegen!', 39653),
(210183, 'deDE', '', 'Erbärmlich!', 39653),
(210182, 'deDE', '', 'Unwürdig!', 39653),
(210181, 'deDE', 'Für Königin und Hain!', '', 39653),
(210180, 'deDE', '', 'Erbärmliche Fae! Ihr habt bereits verloren.', 39653),
(210179, 'deDE', '', 'Wir werden... alles... neu formen...', 39653),
(210176, 'deDE', '', 'Lauscht meinem Lied und verzweifelt!', 39653),
(210175, 'deDE', '', 'Hört meine Worte, Sterbliche!', 39653),
(210173, 'deDE', '', 'Meine Stimme... hallt... ewig wider...', 39653),
(210172, 'deDE', 'Rufen wir das Echo des Archivars.', '', 39653),
(210171, 'deDE', 'Ich habe über diesen Archivar gelesen.', '', 39653),
(210170, 'deDE', 'Einen Moment, bitte.', '', 39653),
(210169, 'deDE', 'Wenn Ihr gestattet.', '', 39653),
(210164, 'deDE', '', 'Sterbt zu meinen Füßen!', 39653),
(210163, 'deDE', '', 'Kommt! Stellt Euch!', 39653),
(210162, 'deDE', '', 'Ich gehe... zu meinen Schwestern...', 39653),
(210161, 'deDE', '', 'Schwestern, leiht uns Kraft!', 39653),
(210159, 'deDE', '', 'Das Auge zieht sich zu seinem Meister zurück.', 39653),
(210158, 'deDE', '', 'Unser Feind flieht. Hinterher, Schwestern!', 39653),
(210157, 'deDE', '', 'Wir hören den Ruf des Ilskahorns, $n! Das Auge wird gezwungen sein, sich auf uns zu richten. Macht Euch für die glorreiche Schlacht bereit!', 39653),
(210156, 'deDE', 'Vergesst Eure Pflicht nicht.', '', 39653),
(210155, 'deDE', 'Der Krieg beginnt.', '', 39653),
(210154, 'deDE', 'Der Feind ist unerbittlich.', '', 39653),
(210153, 'deDE', 'Die Stunde der Schlacht hat geschlagen.', '', 39653),
(210152, 'deDE', 'Die Pakte müssen vereint sein.', '', 39653),
(210151, 'deDE', 'Wir kämpfen, um die Schattenlande zu retten.', '', 39653),
(210150, 'deDE', 'Wenn wir versagen, ist alles verloren.', '', 39653),
(210149, 'deDE', 'Ihr dürft nicht straucheln.', '', 39653),
(210148, 'deDE', 'Das Schicksal führt Euch her.', '', 39653),
(210147, 'deDE', 'Gemeinsam erringen wir den Sieg.', '', 39653),
(210146, 'deDE', 'Ah, der Schlundgänger.', '', 39653),
(210145, 'deDE', 'Sprecht, Sterblicher.', '', 39653),
(210144, 'deDE', 'Seht wahre Macht!', '', 39653),
(210143, 'deDE', 'Ihr seid nicht bereit, mich zu bekämpfen!', '', 39653),
(210142, 'deDE', 'Seht den Untergang, der lauert!', '', 39653),
(210138, 'deDE', 'Ich werde Euer Ende sehen!', '', 39653),
(210137, 'deDE', 'Ich werde nie besiegt!', '', 39653),
(210134, 'deDE', 'Mein Zorn, entfesselt!', '', 39653),
(210133, 'deDE', 'Seht! Euer Ende naht!', '', 39653),
(210128, 'deDE', 'Was geöffnet ist... ist nicht... zu schließen...', '', 39653),
(210123, 'deDE', 'In einem Augenblick tot!', '', 39653),
(210122, 'deDE', 'Mir entgeht nichts!', '', 39653),
(210121, 'deDE', '', 'Macht Euch bereit! Auf der anderen Seite dieses großen Tors spüre ich entsetzliche Finsternis!', 39653),
(210120, 'deDE', '$gSchlundgänger:Schlundgängerin;! Lasst mich sofort frei.\n\nEines der Scheusale hier hat mir etwas sehr Wichtiges weggenommen. Ich brauche Eure Hilfe, um es aufzuspüren.\n\nHelft Ihr mir? Ihr werdet natürlich belohnt.', '$gSchlundgänger:Schlundgängerin;! Lasst mich sofort frei.\n\nEines der Scheusale hier hat mir etwas sehr Wichtiges weggenommen. Ich brauche Eure Hilfe, um es aufzuspüren.\n\nHelft Ihr mir? Ihr werdet natürlich belohnt.', 39653),
(210119, 'deDE', 'Die Schlundgebundenen sammeln sich zum letzten Angriff! Alle Truppen zu mir!', '', 39653),
(210109, 'deDE', 'Nicht genügend Schreie. Ich muss mein Werk verbessern.', '', 39653),
(210105, 'deDE', 'Eure Schmerzensschreie werden diese Hallen füllen!', '', 39653),
(210103, 'deDE', 'Ihr seid die idealen Opfer meiner Kammer.', '', 39653),
(210100, 'deDE', 'Der Tod kommt von unten!', '', 39653),
(210098, 'deDE', 'Gestachelter Tod wird Euch holen!', '', 39653),
(210097, 'deDE', 'Lasst das Instrument los!', '', 39653),
(210081, 'deDE', 'Welcher Schmerz... wartet auf mich...', '', 39653),
(210080, 'deDE', 'Welche Geheimnisse werden wir von den alten Archivaren erfahren?', '', 39653),
(210078, 'deDE', 'Ihr seid mir direkt in die Falle getappt.', '', 39653),
(210077, 'deDE', '', 'Ich habe dieses Portal so abgestimmt, dass es Euch direkt zu unseren Streitkräften im Schlund bringt.', 39653),
(210076, 'deDE', 'Perfekte Ausführung.', '', 39653),
(210075, 'deDE', 'Diesen Geist werden sie nicht stehlen!', 'Diesen Geist werden sie nicht stehlen!', 39653),
(210074, 'deDE', 'Für jeden geretteten werden noch mehr neue entführt!', 'Für jeden geretteten werden noch mehr neue entführt!', 39653),
(210073, 'deDE', 'Wir halten Euch den Rücken frei! Aber sie rauben die Wildsamen schneller, als wir sie retten können!', 'Wir halten Euch den Rücken frei! Aber sie rauben die Wildsamen schneller, als wir sie retten können!', 39653),
(210072, 'deDE', 'Bereit für den Wachdienst!', '', 39653),
(210071, 'deDE', 'Gut gejagt! Wir werden diesen hier in Sicherheit bringen. Geht und findet mehr!', 'Gut gejagt! Wir werden diesen hier in Sicherheit bringen. Geht und findet mehr!', 39653),
(210070, 'deDE', 'Eure Schreie werden durch die Ewigkeit hallen!', '', 39653),
(210068, 'deDE', '', 'Odyn verlangt nach Eurer Anwesenheit, $n.', 39653),
(210066, 'deDE', 'Gut, da seid Ihr. Benutzt das Horn der Herausforderung, um anzufangen.', '', 39653),
(210065, 'deDE', '', 'Ich war nicht sicher, ob ich Odyns Hallen wiedersehen würde, Schlundgänger. Meine armen Schwestern...', 39653),
(210059, 'deDE', 'Seit still! Es ist aufrührerisch, diese Befehle anzuzweifeln!', 'Seit still! Es ist aufrührerisch, diese Befehle anzuzweifeln!', 39653),
(210058, 'deDE', 'Ich habe Vyraz als Markgrafen der Auserwählten unterstützt. Aber wir sollten darum kämpfen, Maldraxxus zu kontrollieren, nicht den Schlund.', 'Ich habe Vyraz als Markgrafen der Auserwählten unterstützt. Aber wir sollten darum kämpfen, Maldraxxus zu kontrollieren, nicht den Schlund.', 39653),
(210057, 'deDE', 'Ins Leichendepot. Er hat zu viele Fragen gestellt.', 'Ins Leichendepot. Er hat zu viele Fragen gestellt.', 39653),
(210056, 'deDE', 'Versetzt? Warum? Wohin?', 'Versetzt? Warum? Wohin?', 39653),
(210055, 'deDE', 'Der Hauptmann wurde... versetzt.', 'Der Hauptmann wurde... versetzt.', 39653),
(210054, 'deDE', 'Ich dachte, Hauptmann Tk\'ahn leitet die heutigen Patrouillen.', 'Ich dachte, Hauptmann Tk\'ahn leitet die heutigen Patrouillen.', 39653),
(210053, 'deDE', 'Tja, lieber er als ich!', 'Tja, lieber er als ich!', 39653),
(210052, 'deDE', 'Vyraz scheint viel Zeit mit der Meereshexe zu verbringen.', 'Vyraz scheint viel Zeit mit der Meereshexe zu verbringen.', 39653),
(210051, 'deDE', 'Wie ich gehört habe, hat Krexus um sein Leben gefleht. Erbärmlicher Feigling!', 'Wie ich gehört habe, hat Krexus um sein Leben gefleht. Erbärmlicher Feigling!', 39653),
(210050, 'deDE', 'Ich wünschte, ich hätte sehen können, wie Vyraz Krexus niedergestreckt hat. Es muss ein großartiger Kampf gewesen sein!', 'Ich wünschte, ich hätte sehen können, wie Vyraz Krexus niedergestreckt hat. Es muss ein großartiger Kampf gewesen sein!', 39653),
(210049, 'deDE', 'Ja, nur hat er nicht gesagt, dass es dafür in den Schlund geht.', 'Ja, nur hat er nicht gesagt, dass es dafür in den Schlund geht.', 39653),
(210048, 'deDE', 'Nun? Er hat beides geliefert, oder etwa nicht?', 'Nun? Er hat beides geliefert, oder etwa nicht?', 39653),
(210047, 'deDE', 'Ich habe mich Vyraz angeschlossen, weil er Chaos und Macht versprochen hat.', 'Ich habe mich Vyraz angeschlossen, weil er Chaos und Macht versprochen hat.', 39653),
(210046, 'deDE', 'Führt einfach die Befehle aus, Soldat. Ihr wisst, was mit jenen geschieht, die Vyraz\' Befehle infrage stellen.', 'Führt einfach die Befehle aus, Soldat. Ihr wisst, was mit jenen geschieht, die Vyraz\' Befehle infrage stellen.', 39653),
(210045, 'deDE', 'Habt Ihr die neuesten Befehle von Vyraz gehört? Burg Helgarde ist Sperrgebiet. Frage mich, was dort vor sich geht.', 'Habt Ihr die neuesten Befehle von Vyraz gehört? Burg Helgarde ist Sperrgebiet. Frage mich, was dort vor sich geht.', 39653),
(210044, 'deDE', '', 'Da seid Ihr ja! Mein Beutel ist Euch doch nicht zu schwer? Na, kommt schon. Wir haben viel zu tun.', 39653),
(210042, 'deDE', '', 'Wir brauchen Platz... aber für neugierige Blicke nicht zu einsehbar.', 39653),
(210038, 'deDE', '', 'Haltet Euch gut fest!', 39653),
(210037, 'deDE', '', 'Skyja! Bringt sie hinaus.', 39653),
(210036, 'deDE', '', 'Möge sie Asche in seiner Kehle sein!', 39653),
(210035, 'deDE', '', 'Jetzt bringt diese Nachricht Eurem Meister, Vögelchen.', 39653),
(210033, 'deDE', '', 'Annhylde wird bald bei ihren Schwestern sein.', 39653),
(210032, 'deDE', '', 'Das Ritual ist fast abgeschlossen...', 39653),
(210031, 'deDE', '', 'Und ich auch nicht!', 39653),
(210030, 'deDE', '', 'So naiv. So blind gegenüber Odyns Fehlern...', 39653),
(210028, 'deDE', '', 'Leere Drohungen einer leeren Seele.', 39653),
(210027, 'deDE', '', 'Gebt mir das Siegel, sonst sterben die Wildsamen.', 39653),
(210026, 'deDE', 'Hättet Ihr einfach gehorcht...', '', 39653),
(210025, 'deDE', 'Behaltet Euren Tand und Euer Reich. Im Angesicht der wahren Ziele unseres Grafen sind sie Staub.', '', 39653),
(210024, 'deDE', 'Die Legion, die Geißel, Argus... alles Schachfiguren in einem Spiel, das Ihr nie verstehen werdet. Eins, das bald endet.', '', 39653),
(210023, 'deDE', 'Während Ihr Euch auf ein armseliges Medaillon konzentriert, haben wir den wahren Schatz: Remornia, mit der Essenz des Grafen darin.', '', 39653),
(210022, 'deDE', 'Wir waren nie im Exil, leichtgläubiger Narr! Alles war Teil des Meisters Plans!', '', 39653),
(210019, 'deDE', 'Tal-Xuhl. Euer Erbe bleibt in Erinnerung.', '', 39653),
(210018, 'deDE', 'Es sind verzweifelte Zeiten.', '', 39653),
(210017, 'deDE', '', 'Ist es klug, diesem Kampf beizutreten, Tal-Galan?', 39653),
(210016, 'deDE', 'Kommt, mein Freund.', '', 39653),
(210015, 'deDE', 'Die Fäden des Schicksals überraschen uns alle.', '', 39653),
(210014, 'deDE', 'Tal-Galan? Ich hatte eine Vision vom Schlundgänger, aber nicht von Euch...', '', 39653),
(210013, 'deDE', 'Wie gut, dass Ihr in Sicherheit seid!', '', 39653),
(210012, 'deDE', '', 'Sie stehlen die Wildsamen! Schlundgänger, wir müssen sie aufhalten!', 39653),
(209980, 'deDE', 'Wissen ohne Verstehen ist wertlos.', '', 39653),
(209979, 'deDE', '', 'Die Geschichte vergisst weit mehr, als sie in Erinnerung behält.', 39653),
(209978, 'deDE', '', 'Nein! Das war die letzte Attrappe...', 39653),
(209977, 'deDE', '<Huln keucht und windet sich>', '', 39653),
(209974, 'deDE', '', 'Zur Burg Helgarde! Die Zerekriss wird Feuerschutz bieten!', 39653),
(209972, 'deDE', '', 'Nun macht schon. Wir haben viel zu besprechen.', 39653),
(209971, 'deDE', '', 'Das wird reichen. Jetzt, Schlundgänger, aktiviert das Gerät bitte mit einer Spur Eurer Anima.', 39653),
(209967, 'deDE', '', 'Ihr scheint nicht zu ahnen, in welcher Gefahr Ihr Euch befindet.', 39653),
(209966, 'deDE', '', 'Wir müssen den Schicksalsschreiber finden.', 39653),
(209965, 'deDE', '', 'Es ist recht dringend.', 39653),
(209964, 'deDE', '', 'Wir haben zu tun.', 39653),
(209963, 'deDE', '', 'Wir können einander helfen.', 39653),
(209962, 'deDE', '', 'Ja, Sterblicher?', 39653),
(209961, 'deDE', '', 'Armes Korthia. Was für eine Katastrophe.', 39653),
(209959, 'deDE', 'Ja. Vielleicht für immer.', '', 39653),
(209958, 'deDE', '', 'Eure Wunde... schmerzt sie noch?', 39653),
(209955, 'deDE', 'Schlundgänger, ich werde Euch rufen, wenn ich bereit bin. Das Glück sei mit uns allen.', '', 39653),
(209954, 'deDE', 'Hochlord, weist Eure Verbündeten in Oribos an: Sie müssen das Siegel der Richterin um jeden Preis verteidigen.', '', 39653),
(209953, 'deDE', 'Knochenschmiedin, kehrt nach Maldraxxus zurück. Ruft die Nekrolords zusammen. Zwischen den Häusern muss Ordnung einkehren.', '', 39653),
(209952, 'deDE', 'Dann können neue Siegel geschmiedet werden. Sie werden nötig sein, um Zovaal zu verfolgen, falls unser Angriff scheitert.', '', 39653),
(209951, 'deDE', 'Die Pakte sind stärker geworden, sind aber noch nicht heil. Jeder muss seinen Zweck wiederfinden... und seine Zukunft.', '', 39653),
(209950, 'deDE', 'dnt', '', 39653),
(209949, 'deDE', 'Die Sterblichen müssen Zovaal in seinem Sanktum stellen. Aber Ihr wisst: der weise Stratege behält alle Eventualitäten im Auge.', '', 39653),
(209948, 'deDE', 'Es ist eine Ehre, Euch unter uns zu haben, Primus. Wie fahren wir jetzt fort, da der Kerkermeister Euer Siegel hat?', '', 39653),
(209947, 'deDE', 'Ich bin nicht zu brechen! Ich bin HÖLLSCHREI!', '', 39653),
(209946, 'deDE', 'Kommt. Die Pakte müssen von meiner Rückkehr erfahren.', '', 39653),
(209944, 'deDE', '', 'Hinfort, Diener des Schlunds!', 39653),
(209943, 'deDE', 'Möchtet Ihr etwas verschicken?', '', 39653),
(209942, 'deDE', 'Gebrochen. In Ketten. Das ist, was Zovaal für jede Existenz vorsieht.', '', 39653),
(209941, 'deDE', 'Es gibt noch solche, die die Fertigkeiten des Runenmetzes benötigen. Ich lasse ein Echo dessen, was ich war, hier, um zu helfen.', '', 39653),
(209939, 'deDE', '', 'Keine Angst, Roh-Suir. Meine Entschlossenheit hat gesiegt.', 39653),
(209937, 'deDE', 'Festhalten!', '', 39653),
(209936, 'deDE', 'Seid auf der Hut, Schlundgänger. Sie könnten... überall sein.', '', 39653),
(209935, 'deDE', 'Die Schreckenslords sind Meister der Infiltration und Illusion. Die Pakttruppen müssen wachsam bleiben.', '', 39653),
(209933, 'deDE', 'Verstümmelung ist meine Spezialität!', '', 39653),
(209932, 'deDE', 'Ihr werdet leiden!', '', 39653),
(209931, 'deDE', 'Ich bringe Ruin!', '', 39653),
(209930, 'deDE', 'Ihr seid meine Schlachtopfer!', '', 39653),
(209929, 'deDE', 'Der Duft von brennendem Fleisch ist berauschend.', '', 39653),
(209927, 'deDE', 'Entfesselt jede Last, alles Bedauern in Eurer Seele, Höllschrei!', '', 39653),
(209926, 'deDE', 'Erlebt ein Meisterwerk der Qual!', '', 39653),
(209925, 'deDE', 'Ihr glaubt, Ihr kennt Folter?!', '', 39653),
(209924, 'deDE', 'Ich zertrete Euren Schädel!', '', 39653),
(209923, 'deDE', 'Ihr habt nicht das Zeug dazu, mich zu brechen!', '', 39653),
(209922, 'deDE', 'Ich werde Euer Ende sein!', '', 39653),
(209921, 'deDE', 'Euer Schmerz gehört mir!', '', 39653),
(209920, 'deDE', 'Solch geringe Toleranz für Folter.', '', 39653),
(209919, 'deDE', 'Ich hatte mehr erwartet.', '', 39653),
(209918, 'deDE', 'So leicht zerbreche ich nicht.', '', 39653),
(209917, 'deDE', 'Eine kleine Ablenkung. Fahren wir damit fort, Euch Qualen aus der Seele zu reißen, Orc.', '', 39653),
(209916, 'deDE', 'So sei es. Viel Glück Euch beiden.', '', 39653),
(209915, 'deDE', '', 'Ich komme mit, Schlundgänger. Ich sorge schon dafür, dass dieser Runenmetz gute Arbeit leistet.', 39653),
(209914, 'deDE', 'Das ist der einzige Ausweg. Wir müssen es versuchen.', '', 39653),
(209913, 'deDE', 'Torghast!? Unmöglich. Ihr könntet es dem Kerkermeister auch gleich in die Hände geben!', '', 39653),
(209912, 'deDE', 'Sie ähnelt den Erinnerungen, die Ihr dem Runenmetz in Torghast wiedergebracht habt. Wenn Ihr ihm das bringt, kann er das Siegel vielleicht herauslösen.', '', 39653),
(209911, 'deDE', 'Die Magie, die an das Siegel des Primus gebunden ist... kennt Ihr sie, Schlundgänger?', '', 39653),
(209910, 'deDE', 'Kompromissbereitschaft und Verständnis zeigen. Ich könnte dabei helfen.', '', 39653),
(209909, 'deDE', 'Viele Verschmähte besetzen noch den Tempel. Was sollen wir tun?', '', 39653),
(209908, 'deDE', 'Ohne ein Paragon der Loyalität können wir kein neues Siegel schmieden.', '', 39653),
(209907, 'deDE', 'Hier, um mich leiden zu sehen, Helden? Zu schade. Ihr werdet mich nie brechen sehen!', '', 39653),
(209905, 'deDE', 'Wir müssen den Kerkermeister um jeden Preis aufhalten.', '', 39653),
(209904, 'deDE', 'Exzellent! Mehr Schreie hallen in meiner Kammer.', '', 39653),
(209903, 'deDE', 'Mehr bleibt nicht von der Nachricht. Nehmt das Siegel, Schlundgänger.', '', 39653),
(209902, 'deDE', '', 'Ich erkenne die Magie nicht, die an das Siegel gebunden ist. Vielleicht kennt Hochlord Fordragon sie.', 39653),
(209901, 'deDE', 'Ich binde es mit einer anderen Magie. Einer, die nicht einmal Zovaal...', '', 39653),
(209900, 'deDE', '...genug, um es zu schützen. Weiterer Schutz ist nötig.', '', 39653),
(209899, 'deDE', 'Hier ist eine letzte Aufzeichnung. Sie scheint an das Siegel gebunden zu sein.', '', 39653),
(209898, 'deDE', '', 'Ich erinnere mich an diese Macht... eine zweischneidige Klinge.', 39653),
(209897, 'deDE', '', 'Meine Träume hier haben mir vieles offenbart: die Gefahren, in denen Tyrande Wisperwind schwebt, doch auch, dass gerade sie irgendwie für das Überleben des Ardenwalds von Bedeutung ist.\n\nDie Nachtfae haben in den Reichen der Schattenlande nach ehemaligen Nachtkriegern gesucht. Wir glauben, dass jene, die einst Elunes Macht innehatten, einen Teil davon übernehmen und Tyrande so vor dem sicheren Tod bewahren können. Einer von ihnen namens Thiernax war hier im Ardenwald und hat uns geholfen.\n\nHuln Hochberg, ein tapferer Krieger aus vergangenen Zeiten Azeroths, ist nun ein Fährtenleser der Wilden Jagd und hat uns bei der Suche nach den ehemaligen Nachtkriegern geholfen. Er glaubt, dass er zwei weitere aufgespürt hat, und er erwartet Eure Unterstützung in Maldraxxus.\n\nEilt Euch. Tyrande bleibt nicht viel Zeit.', 39653),
(209896, 'deDE', '', 'Nach Eurem... Auftritt am Hof haben wir über meine Sorgen um Tyrande Wisperwind gesprochen. Ich glaube, sie ist für das Überleben des Ardenwalds von Bedeutung. Und wenn auch meine Träume keine Einzelheiten offenbart haben, sind wir auf der Suche nach einer Möglichkeit, ihr Leben zu retten.\n\nWir haben einen Verbündeten gefunden, Thiernax, ein Nachtkrieger aus einer anderen Welt, der hinter den Schleier getreten ist. Er vermutet, dass wir Tyrande helfen könnten, indem andere, die einst Elunes Macht innehatten, ihr einen Teil ihrer Last nehmen.\n\nHuln Hochberg, ein Fährtenleser der Wilden Jagd, hat die Reiche der Schattenlande nach diesen anderen Nachtkriegern durchsucht. Er hat eine Spur von zweien entdeckt und erwartet Euch in Maldraxxus mit weiteren Informationen.\n\nEilt Euch, $n. Ich fürchte, Tyrande bleibt nicht mehr viel Zeit.', 39653),
(209894, 'deDE', 'Ist das... das Ende?', '', 39653),
(209893, 'deDE', '', 'Deckung, Hüter! Das ist unser Kampf!', 39653),
(209891, 'deDE', '', 'Durchhalten, ich schütze Euch!', 39653),
(209890, 'deDE', 'Nein! Ich bin... stärker! Ich kann nicht... verlieren!', '', 39653),
(209889, 'deDE', 'Für Azeroth!', '', 39653),
(209888, 'deDE', '', 'Für Krexus! Für Akarek!', 39653),
(209887, 'deDE', 'Die Bande geteilter Qualen stärken uns!', '', 39653),
(209886, 'deDE', 'So sei es. Möge das Gemetzel beginnen!', '', 39653),
(209885, 'deDE', 'So leicht ist der Hüter der Geheimnisse nicht zu besiegen!', '', 39653),
(209884, 'deDE', 'Nein, Zauberin. Ihr überschätzt Euch!', '', 39653),
(209883, 'deDE', '', 'Eure Zeit ist längst um, tatteriger Narr. Ich ertränke Euch mit Freuden!', 39653),
(209882, 'deDE', 'Der Primus ist gefallen! Jetzt nimmt der Verbannte sein Siegel an sich!', '', 39653),
(209881, 'deDE', '', 'Das Siegel gehört dem Primus!', 39653),
(209880, 'deDE', 'Das Siegel im Archiv gehört dem Kerkermeister. Wir enttäuschen unseren Meister nicht!', '', 39653),
(209879, 'deDE', 'Das Archiv öffnet sich!', '', 39653),
(209878, 'deDE', '', 'RRRrrrrAAAAAaaahhhh!', 39653),
(209877, 'deDE', 'GENUG!', '', 39653),
(209876, 'deDE', '', 'Dienerin?! Helya dient niemandem! Ich lasse mich nicht mundtot machen! Ich lasse mich nicht einsperren! Mein Zorn wird...', 39653),
(209873, 'deDE', 'Zeit, dem Kerkermeister seine Dienerin zu nehmen.', '', 39653),
(209861, 'deDE', '', 'Reißt die Nekropole vom Himmel! Zieht sie herunter!', 39653),
(209852, 'deDE', 'Mein Schicksal... ist Folter. Aber ich trage... diese Krone... nicht allein!', '', 39653),
(209851, 'deDE', 'Die Archive... verstreut...', '', 39653),
(209850, 'deDE', 'Ich habe... viele Türen geöffnet. Alle führten... zu Schmerz.', '', 39653),
(209849, 'deDE', 'Er sagte... ich habe versagt. Ein fehlerhafter Herold... von einem anderen ersetzt.', '', 39653),
(209848, 'deDE', 'Sehe... dich nicht. Meine Augen... verschlungen.', '', 39653),
(209847, 'deDE', 'Rulkan... bist du das? Es ist... so lange her...', '', 39653),
(209845, 'deDE', '', 'Roh-Suir muss Euch schicken. Ich suche ihn sofort auf.', 39653),
(209844, 'deDE', 'Niemand entkommt... dem Kerkermeister!', '', 39653),
(209843, 'deDE', 'Geht... in den Abgrund!', '', 39653),
(209842, 'deDE', 'Wunden... heilen nie!', '', 39653),
(209841, 'deDE', 'Jeder Moment... Folter!', '', 39653),
(209839, 'deDE', 'Ergebt Euch dem Schmerz!', '', 39653),
(209836, 'deDE', 'Ahhh... Rulkan... ich komme... heim...', '', 39653),
(209835, 'deDE', 'Mein Leid... wird Eures!', '', 39653),
(209833, 'deDE', 'Mischt Euch nicht ein, Sterblicher!', '', 39653),
(209827, 'deDE', 'Ja, natürlich. Erst das Siegel. Andere Relikte später.', '', 39653),
(209826, 'deDE', '', 'Öffnet das Archiv, SOFORT!', 39653),
(209825, 'deDE', 'Aber ich sollte doch sicher ein paar dieser Schätze bergen...', '', 39653),
(209823, 'deDE', '', 'Keine Zeit zum Gaffen! Wir müssen das Siegel sichern!', 39653),
(209822, 'deDE', 'Selbst in diesem Zustand ist das Archiv prächtig, nicht wahr?', '', 39653),
(209820, 'deDE', 'Ihr... gehört nicht zu ihnen? Bitte, ich brauche Hilfe!', '', 39653),
(209818, 'deDE', '', 'Gehen wir. Das ist kein Ort zum Verweilen.', 39653),
(209817, 'deDE', 'Der Weg ist frei! Kommt, Schlundgänger.', '', 39653),
(209816, 'deDE', 'Beginnen wir das Ritual, Freunde.', '', 39653),
(209814, 'deDE', 'Bald werden wir die Geheimnisse von Korthia sehen.', '', 39653),
(209809, 'deDE', '', 'Also... das war gar nicht so toll.', 39653),
(209808, 'deDE', '', 'Jetzt! Ergreift das Medaillon! Beseitigt die Eindringlinge!', 39653),
(209800, 'deDE', 'Törichter... Sterblicher...', '', 39653),
(209799, 'deDE', 'Ihr hättet fliehen sollen, als Ihr noch konntet.', '', 39653),
(209794, 'deDE', '', 'In die Lüfte! Unsere Verbündeten zählen auf uns!', 39653),
(209793, 'deDE', 'Kommt, zeigen wir ihnen Revendreths Macht.', '', 39653),
(209792, 'deDE', 'Wer dem Kerkermeister nicht dienen will, wird auf ewig verrotten!', '', 39653),
(209791, 'deDE', 'Wilde Jagd, wir reiten in die Schlacht!', '', 39653),
(209790, 'deDE', 'Angriff, Nekrolords! Äschert die Verräter ein!', '', 39653),
(209785, 'deDE', '', 'Nathrezimabschaum. Ihr könnt das Haus der Augen nicht täuschen.', 39653),
(209784, 'deDE', '', 'Champion! Schnell, wir müssen den Primus aufhalten, bevor es zu spät ist.', 39653),
(209783, 'deDE', '', 'Das ist... nett. Fahren wir fort.', 39653),
(209782, 'deDE', '', 'Oh, ich Dummerchen. Hier, schon viel besser!', 39653),
(209781, 'deDE', '', 'Nur keine Umstände...', 39653),
(209780, 'deDE', '', 'Bitte, nehmt dieses Willkommensgeschenk vom Hof der Nacht!', 39653),
(209779, 'deDE', 'Der Malleus zermalmt Euren Körper und verbrennt Eure Seele!', '', 39653),
(209778, 'deDE', '', 'Bitte, hier entlang.', 39653),
(209774, 'deDE', '', 'Ihr würdet gut nach Maldraxxus passen, Beschützerin!', 39653),
(209773, 'deDE', '', 'Ich habe meine gesamte Existenz lang hierfür trainiert... für diese Schlacht. Ich folge Euch, Schlundgänger!', 39653),
(209770, 'deDE', '', 'Verstärkung! Genau zur rechten Zeit. Wir wollten gerade zum Archiv vorstoßen.', 39653),
(209766, 'deDE', '', 'In der Nähe ist ein Fledderflügel für Euch angebunden, Schlundgänger. Er bringt Euch direkt ins Maldraxxilager beim Archiv.', 39653),
(209765, 'deDE', 'Die Pakte verteidigen das Archiv noch gegen die Schlundgebundenen, aber wir müssen uns beeilen.', '', 39653),
(209763, 'deDE', 'Lasst den Seelenverschlinger los! Lasst ihn den Sterblichen fressen!', '', 39653),
(209762, 'deDE', 'Fliegt schnell, Geflügelte. Bringt mir die Seele dieses Sterblichen!', '', 39653),
(209751, 'deDE', '', 'Marileth, wartet! Wir müssen gemeinsam fliegen!', 39653),
(209750, 'deDE', '', 'Auf die Reparatur bin ich nicht gerade stolz, aber sie wird reichen. Gehen wir zu Tal-Galan zurück.', 39653),
(209749, 'deDE', '', 'Kümmert Euch um den Verschlinger, während ich repariere!', 39653),
(209748, 'deDE', '', 'Hmm. Das ist schlecht.', 39653),
(209747, 'deDE', '', 'Schlundgebundene, Verschlinger... hier will wohl jeder ein Stück abbekommen.', 39653),
(209745, 'deDE', '', 'Diese Verschlinger werden uns das Leben schwer machen.\n\nIch fasse das Ding nicht an, bis Ihr mir sagt, dass Ihr bereit seid, $n.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(209743, 'deDE', '', 'So sei es. Mit ihrer Stimme habe ich gesprochen.', 39653),
(209741, 'deDE', 'Wir versammeln die Pakttruppen zur Schlacht und stellen uns.', '', 39653),
(209740, 'deDE', 'Die Venthyr stehen Euren Truppen zur Seite, Draka.', '', 39653),
(209738, 'deDE', '', 'Die Nekrolords werden die Eindringlinge aus dem Ardenwald treiben!', 39653),
(209737, 'deDE', '', 'Nein. Schon jetzt spüre ich, wie seine Boshaftigkeit meine Haine bedroht.', 39653),
(209735, 'deDE', 'Aber das wird nicht das einzige Ziel des Kerkermeisters sein.', '', 39653),
(209734, 'deDE', 'Die Schwarze Klinge wird helfen, die Ewige Stadt zu verteidigen.', '', 39653),
(209731, 'deDE', '', 'Die Essenz der Richterin ist noch hier. Sie benötigt Schutz.', 39653),
(209730, 'deDE', '', 'Im Sanktum des Primus haben wir kein solches Siegel gefunden.', 39653),
(209729, 'deDE', 'Graf Denathrius hat sein Siegel dem Verbannten zweifellos freiwillig gegeben.', '', 39653),
(209728, 'deDE', 'Doch selbst im Schlund gefangen fand er Verbündete.', '', 39653),
(209727, 'deDE', '', 'Zovaal wurde für seinen Verrat auf ewig verbannt.', 39653),
(209726, 'deDE', '', 'Doch der Primus führte uns endlich zum Sieg.', 39653),
(209724, 'deDE', '', 'Als wir seine Häresie zurückwiesen, wollte er sie mit Gewalt nehmen.', 39653),
(209722, 'deDE', '', 'Doch Zovaal sah die Siegel als Schlüssel zu verbotenem Wissen.', 39653),
(209720, 'deDE', '', 'Vor langer Zeit hat jeder der Ewigen ein Symbol der Rolle unseres Paktes erhalten.', 39653),
(209719, 'deDE', '', 'Was wollte der Kerkermeister?', 39653),
(209718, 'deDE', '', 'Nein. Aber im Vergleich zu dem, was gestohlenen wurde, ist sie unwichtig.', 39653),
(209716, 'deDE', '', 'Ist Eure Wunde geheilt, Kyrestia?', 39653),
(209714, 'deDE', '', 'Dieser dreiste Angriff auf die Bastion schreit nach Rache.', 39653),
(209713, 'deDE', '', 'Im Namen der Richterin, wir folgen dem Ruf der Ewigen.', 39653),
(209712, 'deDE', '', 'Wir sind dankbar, Steinhauerin. Tyrande braucht dringend Hilfe.', 39653),
(209708, 'deDE', 'Das Grabmal ist... geheimzuhalten. Selbst vor Verbündeten.', '', 39653),
(209707, 'deDE', '', 'Noch ein Fragment. Der Primus hat dieses Grabmal schon früher erwähnt. Wisst Ihr, was es ist? Oder wo?', 39653),
(209705, 'deDE', 'Der Feind rückt vor! Zeigt keine Gnade!', '', 39653),
(209704, 'deDE', 'Wir dürfen nicht scheitern. Schon gar nicht, nachdem wir Sylvanas aus dem Ardenwald vertrieben haben.', '', 39653),
(209703, 'deDE', '', 'Wir haben Anduin überhaupt nicht auf dem Schlachtfeld gesehen. Wo könnte er nur sein?', 39653),
(209702, 'deDE', '', 'Zovaal hat gewagt, die Seelen, die ich schütze, zu bedrohen. Er hat seine Antwort.', 39653),
(209701, 'deDE', '', 'Aber unsere Feinde sind verschlagen. Geht, sorgt dafür, dass es so bleibt.', 39653),
(209700, 'deDE', '', 'Mein Siegel habe ich im Herz des Waldes verborgen, wo es am besten geschützt ist.', 39653),
(209698, 'deDE', '', 'Der Kerkermeister hat gedroht, diese Geister zu vernichten, doch wir können sie vielleicht retten. Er hat unterschätzt, mit welcher Kraft die Natur kämpft, um das Gleichgewicht zu bewahren.', 39653),
(209692, 'deDE', '', 'Bringt mir Knochen und ich mache daraus einen Wurfhaken und Ankerpunkte. Wir sind im Handumdrehen drüben!', 39653),
(209690, 'deDE', 'Die Schlundgebundenen greifen unsere Stellung an. Löscht sie aus!', '', 39653),
(209686, 'deDE', 'Selbst mein Siegel hier einzuschließen, könnte nicht reichen, um...', '', 39653),
(209685, 'deDE', '... das Grabmal zu erreichen. Das darf nicht geschehen.', '', 39653),
(209661, 'deDE', '', 'Ich muss Euch bitten, seinen Gefahren zu trotzen und mir Reste der Geister dort zu bringen.', 39653),
(209660, 'deDE', '', 'Ihr müsst zum Fluss der Seelen. Der Gorgoa fließt durch den Schlund und führt verdammte Seelen ihrem Schicksal zu.', 39653),
(209658, 'deDE', '', 'Fasst Euch kurz.', 39653),
(209656, 'deDE', '<Der uralte Foliant wurde mühevoll restauriert und bis auf eine fehlende Seite wieder zusammengesetzt. Als Ihr das Buch öffnet, schreit Euch die zuvor so ruhige Stimme geradezu zornerfüllt an.>\n\n\"Habt ihr meine Anweisungen nicht verstanden? Wo ist die letzte blutrote Seite?!\n\nIhr müsst mich aus diesem Gefängnis befreien!\n\nUnd hört auf meine Warnung... Was immer Ihr tut, egal, was er Euch sagt... Berührt nicht die azurblauen Seiten! Lasst den anderen nicht frei! Was immer er Euch gesagt hat, es waren Lügen!\"', '', 39653),
(209655, 'deDE', '', 'Erklärt Euch.', 39653),
(209654, 'deDE', 'Wir suchen Nachtkrieger, die hinter den Schleier gekommen sind.', '', 39653),
(209653, 'deDE', '', 'Der Ardenwald? Wieso seid Ihr in Revendreth?', 39653),
(209652, 'deDE', '', 'Wir wollen Euch nicht täuschen! Wir sind für den Ardenwald hier!', 39653),
(209651, 'deDE', '', 'Ich töte Euch alle persönlich!', 39653),
(209650, 'deDE', '', 'Mehr Eurer erbärmlichen Art?!', 39653),
(209649, 'deDE', '', 'Bitte! Das ist ein entsetzliches Missverständnis!', 39653),
(209648, 'deDE', '', 'Was will Euer Meister, Schreckenslord?! Redet!', 39653),
(209647, 'deDE', '', 'Seht! Da ist Huln!', 39653),
(209646, 'deDE', '', 'Eine bewundernswert spezifische Frage... zu deren Antwort ich nur spekulieren kann.', 39653),
(209644, 'deDE', 'Raaagh!', '', 39653),
(209642, 'deDE', 'Brennt im Licht des Glutviertels, erbärmliches Monster!', '', 39653),
(209639, 'deDE', '$n! Ihr tragt das Ilskahorn in den Schlund. Gebt ihm die Stimme, den Schleier zu durchdringen und meine Rache zu entfesseln!', '', 39653),
(209638, 'deDE', 'Danica, Ihr führt. Werdet zum Zorn Odyns und verkörpert meine Rage. Führt sie gegen meine Feinde!', '', 39653),
(209637, 'deDE', 'Wenn die Stimme des Ilskahorns meine erwählten Val\'kyr ruft, wird sich mein Auge auf sie richten müssen.', '', 39653),
(209633, 'deDE', 'Die Nathrezim... dienen dem Kerkermeister? Aber sie gehörten zur Brennenden Legion. Wenigstens schien es uns so.', '', 39653),
(209606, 'deDE', 'Hört alle her! Seht das Ilskahorn, erschaffen in den Feuern meiner Schmiede und durchdrungen vom Knochenstaub der Helden.', '', 39653),
(209605, 'deDE', 'Du und alle anderen werdet Zeugen meines Sieges.', '', 39653),
(209604, 'deDE', 'Anduin gibt dem Kerkermeister das Siegel.', 'Anduin gibt dem Kerkermeister das Siegel, während er spricht.', 39653),
(209603, 'deDE', 'Eine Gramklinge!', '', 39653),
(209602, 'deDE', 'Anduin beginnt, dem Primus das Siegel zu entziehen.', 'Anduin beginnt, dem Primus das Siegel zu entziehen. Der Primus schreit vor Schmerz.', 39653),
(209601, 'deDE', 'Ich bekämpfe dich bis zum Ende, Zovaal!', '', 39653),
(209600, 'deDE', 'Der Primus ist von Schlundgebundenen umgeben. Anduin geht auf ihn zu, während der Kerkermeister stillsteht und zusieht.', 'Der Primus ist von Schlundgebundenen umgeben. Anduin geht auf ihn zu, während der Kerkermeister stillsteht und zusieht.', 39653),
(209599, 'deDE', '', 'Sie verdunkeln schon den Himmel...', 39653),
(209591, 'deDE', '[DNT]Z', '', 39653),
(209590, 'deDE', 'DNT', 'DNT', 39653),
(209589, 'deDE', '[DNT] What... what have you done!', '', 39653),
(209588, 'deDE', '', 'DNT', 39653),
(209587, 'deDE', 'DNT', 'DNT', 39653),
(209586, 'deDE', 'Ihr kommt mir... bekannt vor...', '', 39653),
(209585, 'deDE', 'DNT', 'DNT', 39653),
(209584, 'deDE', 'Was für ein schönes Reich! Aber wo sind nur die Schleime? Keine Sorge, das kann ich richten!', '', 39653),
(209582, 'deDE', '', 'Gute Nachrichten, $p! Ich habe weitere Abscheulichkeiten für Euch zum Töten gefunden!', 39653),
(209526, 'deDE', 'Zu schade, dass sie auf ewig verloren ist. Nathrezim! Bringt mir ihre Fangzähne.', '', 39653),
(209525, 'deDE', 'Die Ernterin des Zorns. Wie ich die Reinheit Eurer Überzeugung vermisst habe.', '', 39653),
(209524, 'deDE', '', 'Zeigt Euch, Mal\'Ganis!', 39653),
(209523, 'deDE', '', 'Wir haben keine Zeit für einen Plausch, Schlundgänger. Kommt, wir haben viel zu tun.', 39653),
(209514, 'deDE', 'Eure Ankunft läutet unseren Sieg ein. Führt unseren Sturm auf die Festung!', '', 39653),
(209513, 'deDE', 'Ich werf Euch hin, $p!', '', 39653),
(209512, 'deDE', 'Dem Stein sei Dank, dass Ihr da seid, $gSchlundgänger:Schlundgängerin;. Prinz Renathal wartet oben bei der Barrikade auf Euch.', '', 39653),
(209481, 'deDE', '', 'Seid gegrüßt, $n. Wie kann ich zu Diensten sein?', 39653),
(209479, 'deDE', 'Dennoch habt Ihr durch meine Handlungen sehr gelitten. Das lasse ich nie wieder zu.', '', 39653),
(209464, 'deDE', 'Mit den Legionen unter meinem Befehl lasse ich Euch für Euren Widerstand büßen!', '', 39653),
(209463, 'deDE', 'Ihr wagt es, hier herumzuschleichen?!', 'Ihr wagt es, hier herumzuschleichen?!', 39653),
(209462, 'deDE', 'Hinfort, Fremdlinge!', 'Hinfort, Fremdlinge!', 39653),
(209461, 'deDE', 'Die Steinhauerin duldet keine Eindringlinge!', 'Die Steinhauerin duldet keine Eindringlinge!', 39653),
(209460, 'deDE', 'Verschwindet sofort!', 'Verschwindet sofort!', 39653),
(209459, 'deDE', 'Die Auserwählten des Kerkermeisters sorgen dafür, dass Euer armseliger Trotz hier endet!', '', 39653),
(209458, 'deDE', 'Öffnet die Tore Torghasts und kommt herbei, Kaltherzjünger!', '', 39653),
(209456, 'deDE', '', 'Heute tun wir beides.', 39653),
(209455, 'deDE', 'Kein Sterblicher verhindert den Sieg des Kerkermeisters! Für Zovaal! Für Kel\'Thuzad!', '', 39653),
(209454, 'deDE', 'Erntet ihr Fleisch! Zerreißt ihre Seelen! Im Namen Kel\'Thuzads!', '', 39653),
(209453, 'deDE', 'Erhebt Euch, Diener! Bringt die Hülle des Sterblichen zu mir!', '', 39653),
(209452, 'deDE', 'Ihr habt mich mit Herrschaft gebunden. Jetzt dient sie mir als Waffe.', '', 39653),
(209451, 'deDE', 'Der Sieg wird dir heute nicht zuteil, Bruder. Sieh selbst.', '', 39653),
(209450, 'deDE', 'Ihr werdet für alle Ewigkeit brennen, während Kel\'Thuzad an der Seite des Kerkermeisters steht!', '', 39653),
(209449, 'deDE', 'Schlundgebundene! Entfesselt die Flammen der Seelenschmieden auf den Eindringling!', '', 39653),
(209447, 'deDE', 'Die Flammen der Seelenschmieden werden Euch verzehren!', '', 39653),
(209446, 'deDE', 'Voran, Schlundgebundene! Bringt den Sterblichen zum mächtigen Kel\'Thuzad!', '', 39653),
(209443, 'deDE', 'Auf, Schlundgebundene! Der Verbannte ruft Euch in den Dienst.', '', 39653),
(209431, 'deDE', 'Erhebt Euch, Getreue. Entfesselt den Zorn des Kerkermeisters!', '', 39653),
(209423, 'deDE', 'Danica! Werdet zum Instrument meines Zorns! Kämpft an der Seite dieses Sterblichen und siegt in meinem Namen!', '', 39653),
(209422, 'deDE', '', 'Das werde ich, großer Odyn. Ich schwöre, meine Schwestern zu rächen!', 39653),
(209421, 'deDE', 'Mein edles, allsehendes Auge ist zu einer Waffe der Finsternis geworden. Diese Schmähung darf nicht ungesühnt bleiben!', '', 39653),
(209420, 'deDE', 'Nach ihrer Niederlage dachte ich, wir wären Helyas Verrat los. Doch ihre giftigen Worte und Taten plagen mich weiterhin!', '', 39653),
(209386, 'deDE', 'Meine Aufmerksamkeit ist ganz bei Euch, Schlundgänger.', 'Ihr habt meine Aufmerksamkeit, Schlundgänger.', 39653),
(209385, 'deDE', 'Euer Wunsch ist mir Befehl.', 'Euer Wunsch ist mir Befehl.', 39653),
(209384, 'deDE', 'Mögen all Eure Transaktionen profitabel sein.', 'Mögen all Eure Transaktionen profitabel sein.', 39653),
(209383, 'deDE', 'Das Vergnügen war ganz meinerseits.', 'Gern geschehen.', 39653),
(209382, 'deDE', '', 'Gemeinsam werden wir erfolgreich sein. Ich bin mir sicher, dass wir den Schicksalsschreiber finden werden.', 39653),
(209381, 'deDE', 'Den Schlund? Oh, wir sollten besser dalli machen, wenn wir den Kerl retten wollen. Na los!', '', 39653),
(209380, 'deDE', 'Sie hat gedroht, ihn in den Schlund zu werfen. Lieber er als ich!', 'Sie hat gedroht, ihn in den Schlund zu werfen. Lieber er als ich!', 39653),
(209375, 'deDE', 'Muss in der Nähe sein. Das Reich wird knapp!', '', 39653),
(209368, 'deDE', '', '$gSchlundgänger:Schlundgängerin;. Welch eine Freude, Euch wiederzusehen.\n\nIch gedenke, diesen kleinen Ausflug zu genießen, und es ist mir solch eine Freude, jemanden wie Euch... ein so \"einzigartiges\" Wesen... auf einer solchen Versammlung anzutreffen.\n\nIhr werdet es mir doch sicher nicht verübeln, wenn ich weiterhin alle vergangenen oder zukünftigen Allianzen zwischen uns leugne. Eine Dame muss schließlich darauf achten, welchen öffentlichen Eindruck sie erweckt, nicht wahr?', 39653),
(209366, 'deDE', '', 'Ich habe den Primus gerade zurückbekommen. Ich verliere ihn nicht wieder! FÜR MALDRAXXUS!', 39653),
(209365, 'deDE', 'Schlundgebundene. Ergreift sie.', '', 39653),
(209364, 'deDE', 'Du wirst versagen... erneut.', '', 39653),
(209363, 'deDE', 'Nein. Ich widersetze mich!', '', 39653),
(209362, 'deDE', 'Dein Siegel wird mir gehören.', '', 39653),
(209361, 'deDE', 'Wehrt seine Streitkräfte ab, während ich einen Fluchtweg finde!', '', 39653),
(209360, 'deDE', 'Ich werde Euch mit der Macht der Anima stärken, die durch Torghast fließt.', '', 39653),
(209358, 'deDE', 'Zovaal wird jeden Moment hier sein. Wir müssen uns vorbereiten.', '', 39653),
(209355, 'deDE', 'Was?', 'Was?', 39653),
(209352, 'deDE', 'Der Moment zur Umwidmung ist gekommen. Seid Ihr bereit, dieses heilige Ritual zu beschützen?', '', 39653),
(209351, 'deDE', 'Dieser Zorn, diese Feindseligkeit... Wir müssen sie beiseitelegen.\n\nDie Verschmähten verdienen, angehört zu werden, respektiert zu werden. Genau wie die Kyrianer.', '', 39653),
(209332, 'deDE', '', 'Euer Trotz ist sinnlos. Ich habe bereits, was ich brauche!', 39653),
(209331, 'deDE', '', 'Odyn lässt das nicht zu!', 39653),
(209330, 'deDE', '', 'Meine Rache kann nicht warten. Wir greifen jetzt an.', 39653),
(209329, 'deDE', '', 'Endlich! Ich wusste, dass Hilfe kommen würde!', 39653),
(209328, 'deDE', '', 'Wer ist da? Wenn Ihr mich quälen wollt, wisst, dass Ihr dafür büßen werdet!', 39653),
(209327, 'deDE', 'Kommt, meine Miternter. Rufen wir den Zorn, um Zorn zu finden.', '', 39653),
(209326, 'deDE', '', 'Ein einfacher Trick. Niemand kann uns sehen, wenn wir es nicht wollen!', 39653),
(209325, 'deDE', 'Lady Mondbeere, wärt Ihr so freundlich, unser Vorrücken in die Festung zu verbergen?', '', 39653),
(209324, 'deDE', '', 'Immerhin ist er jetzt leichter zu treffen!', 39653),
(209323, 'deDE', 'Aber ich hatte mir den Koloss doch nicht ganz so groß vorgestellt...', '', 39653),
(209322, 'deDE', 'Vor der vereinten Macht von Revendreth und dem Ardenwald fallen auch die furchtbarsten Bestien des Kerkermeisters!', '', 39653),
(209319, 'deDE', '', 'Feigling! Kommt aus den Schatten!', 39653),
(209318, 'deDE', '', 'Ihr stellt kaum eine Bedrohung dar.', 39653),
(209317, 'deDE', '', 'Ich... habe Euch unterschätzt...', 39653),
(209316, 'deDE', 'Ihr... wisst nichts... von Macht...', '', 39653),
(209315, 'deDE', 'Ihr haltet meine Suche nicht auf!', '', 39653),
(209312, 'deDE', '', 'Wahre... Agonie...', 39653),
(209311, 'deDE', '', 'Euer Blut gehört mir, Schlundgänger!', 39653),
(209302, 'deDE', '', 'Möge die Vorsehung Euch leiten, Archivar.', 39653),
(209301, 'deDE', 'Ich werde tun, was ich kann, Roh-Senara. Möge die Vorsehung uns leiten.', '', 39653),
(209300, 'deDE', '', 'Bergt die Relikte. Baut das Archiv wieder auf. Und setzt Vertrauen in die Sterblichen, die Euch helfen wollen.', 39653),
(209299, 'deDE', '', 'Das seid Ihr. Deutlich mehr, als es Euch bewusst ist. Von diesem Augenblick an seid Ihr der Archivar von Korthia.', 39653),
(209297, 'deDE', 'Es muss jemand anderen geben. Ich bin noch nicht bereit.', '', 39653),
(209296, 'deDE', '', 'Gelehrter Roh-Suir, mein Echo verhallt und ich gebe das Archiv in Eure Hände.', 39653),
(209287, 'deDE', '', 'Dachtet Ihr wirklich, ich hätte Euch nicht bemerkt?', 39653),
(209283, 'deDE', '', 'Interessant! Sind diese glänzenden Objekte... Federn?', 39653),
(209281, 'deDE', '', 'Ihr wurdet transferiert, ja?', 39653),
(209280, 'deDE', '', '$n, wir treffen uns beim Refugium der Weisung. Eilt Euch!', 39653),
(209279, 'deDE', '', 'Hmm... Hier erwähnt er, dass er um Führung beten will.', 39653),
(209278, 'deDE', '', 'Wirres Gekritzel und paranoide Anwandlungen. Er vermutet, es gäbe geheime Saboteure. Lächerlich!', 39653),
(209277, 'deDE', '', 'Räucherwerk. Das kommt aus dem Refugium der Weisung. Ich wette, dahin ist er unterwegs.', 39653),
(209276, 'deDE', '', 'Verflucht! Hoffen wir, dass weiteres Suchen Hinweise liefert.', 39653),
(209275, 'deDE', '', 'Wir treffen uns in den Ruinen. Ich danke Euch für Eure Hilfe, $n.', 39653),
(209274, 'deDE', 'Schicksalsschreiber zählen zu den wichtigsten Bediensteten der Richterin. Sie werden in ihrer Pflicht gegenüber der Vorsehung geehrt.', 'Schicksalsschreiber zählen zu den wichtigsten Bediensteten der Richterin. Sie werden in ihrer Pflicht gegenüber der Vorsehung geehrt.', 39653),
(209271, 'deDE', '', 'Nehmt Euren Platz an meiner Seite ein, Sterblicher.', 39653),
(209249, 'deDE', 'Das Archiv steht in Eurer Schuld, Schlundgänger.', '', 39653),
(209248, 'deDE', 'Ah, ja. Einen Schritt näher am wiederhergestellten Archiv!', '', 39653),
(209247, 'deDE', 'Noch eins für die Sammlung. Was täte ich nur ohne Eure Hilfe?', '', 39653),
(209246, 'deDE', 'Knochen?! Gute Güte!', '', 39653),
(209245, 'deDE', '', 'Unsinn! Wir haben hier alles, was wir brauchen. Dazu sind nur ein paar starke Knochen nötig!', 39653),
(209244, 'deDE', '<Die Oberfläche des Talismans ist durch die Zeit und die Berührung unzähliger Hände ganz glatt geworden. Laut Roh-Suir wurde er ohne Unterbrechung von einem Archivar zum nächsten weitergegeben, seit die ersten Bediensteten in Korthia ankamen.\n\nDie Macht, die dem Talisman möglicherweise einst innewohnte, ist längst verbraucht. Er bietet nur noch sentimentalen Wert.\n\nAber vielleicht ist das allein schon ausreichend.>', '', 39653),
(209243, 'deDE', 'Unser Plan ist ruiniert! Diese Schlucht ist nicht zu überqueren.', '', 39653),
(209242, 'deDE', 'Verstanden.', '', 39653),
(209241, 'deDE', '', 'Sagt das noch einmal, dann bleibt von Euch auch nichts übrig. Verstanden?', 39653),
(209240, 'deDE', 'Wenn er den Kerkermeister gestellt hat, ist vielleicht nichts von Eurem Meister übrig.', '', 39653),
(209239, 'deDE', '', 'Das Verschwinden des Primus hat Maldraxxus in finstere Zeiten gestürzt... und die Schattenlande mit ihm. Wir müssen ihn finden!', 39653),
(209238, 'deDE', 'So scheint es. Wenn wir mehr Aufzeichnungen ausfindig machen, könnten wir darin Antworten finden.', '', 39653),
(209237, 'deDE', '', 'Aus Maldraxxus ist der Primus also nach Korthia gekommen... Er muss geahnt haben, dass der Kerkermeister einen Ausbruch plante.', 39653),
(209236, 'deDE', 'Aufzeichnungshüter, kehrt zur Rast zurück. Dort seid Ihr sicher.', '', 39653),
(209235, 'deDE', 'Ein Weiterer sucht Ruhm. Macht Euch bereit!', '', 39653),
(209234, 'deDE', 'Euch fehlt Disziplin. Heute siegt Ihr nicht.', '', 39653),
(209233, 'deDE', 'Gut gekämpft! Ihr seid erwählt, Odyns Zorn zu dienen. Tretet an seine Seite.', '', 39653),
(209231, 'deDE', '', 'Sündensturz. Dieser Ort birgt kaum noch einen Bruchteil der Macht, die er einst hatte.\n\nEin Grund mehr, die Schreckenslords und ihre arroganten Machenschaften gegen das Licht zu verachten.\n\nIch hatte fest damit gerechnet, dass Graf Denathrius mir befehlen würde, diesen Ort in Schutt und Asche zu legen, mitsamt Euch und dem Prinzen. Er tat es nicht.\n\nDie Beziehung zwischen Denathrius und Renathal lässt sich augenscheinlich nicht durch bloßen Verrat oder versuchten Vatermord lösen.', 39653),
(209229, 'deDE', '', 'Der Schicksalsschreiber! Wir haben ihn!', 39653),
(209228, 'deDE', '', 'Eine Illusion? Wie drollig.', 39653),
(209227, 'deDE', '', 'Wozu braucht er die Anima? So ein nervtötender Plan!', 39653),
(209226, 'deDE', 'Ich werde sie umbringen, ich werde sie alle mit bloßen Händen umbringen!', '', 39653),
(209225, 'deDE', 'Ewige, leitet mich und leiht mir Eure Weisheit.', '', 39653),
(209224, 'deDE', 'Möge die Vorsehung mich schützen. Und mögen sie mich nie finden.', '', 39653),
(209223, 'deDE', 'Eine Illusion... das könnte gehen. Mich vor aller Augen verbergen, ihre Taktiken gegen sie richten.', '', 39653),
(209222, 'deDE', 'Ich brauche eine Schriftrolle aus dem Archiv und die Anima, ihre Magie zu nähren...', '', 39653),
(209221, 'deDE', 'Er hat uns gefunden! Korthia ist in ernster Gefahr!', '', 39653),
(209220, 'deDE', 'Richterin, vergebt mir... aber ich brauche diese Anima...', '', 39653),
(209219, 'deDE', 'Ich verstehe, Jaina. Wir brechen sofort auf.', '', 39653),
(209218, 'deDE', '', 'Ich begleite Euch zum Ardenwald, Bolvar. Wenn es möglich ist, Anduin zu retten...', 39653),
(209217, 'deDE', 'Baine und ich unterstützen sie. Wir überlassen das Siegel der Richterin nicht dem Kerkermeister.', '', 39653),
(209216, 'deDE', 'So soll es sein.', '', 39653),
(209215, 'deDE', 'Sowohl der Ardenwald als auch Oribos könnten angegriffen werden. Darion, die Schwarze Klinge muss die Stadt schützen.', '', 39653),
(209213, 'deDE', '', 'Ich richte das Wort an die geehrten Versammelten.', 39653),
(209211, 'deDE', 'Wir müssen das Archiv erreichen, bevor die Truppen des Kerkermeisters durchbrechen.', '', 39653),
(209210, 'deDE', 'Mehr haben wir nicht. Wenn wir weitere Aufzeichnungen finden, könnte ich mehr von der Nachricht des Primus rekonstruieren.', '', 39653),
(209209, 'deDE', '', 'Wovon abhalten? Zeigt den Rest der Nachricht!', 39653),
(209208, 'deDE', 'Wenn Zovaal alle fünf Siegel findet, kann ihn nichts davon abhalten...', '', 39653),
(209207, 'deDE', 'Sollte ich Recht behalten, ist mein Siegel in Gefahr. Ich muss es Euren Archiven anvertrauen. Schützt es um jeden Preis.', '', 39653),
(209206, 'deDE', '', 'Bei den fünf Häusern... der Primus!', 39653),
(209205, 'deDE', 'Die Nachricht ist zusammengestellt. Spiele sie jetzt ab.', '', 39653),
(209201, 'deDE', '', 'Nein! Wir müssen uns beeilen!', 39653),
(209200, 'deDE', 'Dann habt Ihr Arbeit vor Euch. So wütend habe ich die Steinhauerin noch nie gesehen.', 'Dann habt Ihr Arbeit vor Euch. So wütend habe ich die Steinhauerin noch nie gesehen.', 39653),
(209199, 'deDE', 'Äh... Wir sind natürlich die Reinigungsbrigade! Ist immer so \'ne Sauerei, Eindringlinge zu verhören.', '', 39653),
(209198, 'deDE', 'Den Eindringling? Wieso wollt Ihr das wissen?', 'Den Eindringling? Wieso wollt Ihr das wissen?', 39653),
(209194, 'deDE', '', 'Ich werde Euch und den Hochlord zur Kammer der Richterin bringen.', 39653),
(209193, 'deDE', '', 'Wir treffen uns in der Kammer der Richterin, um unsere nächsten Schritte zu planen.', 39653),
(209191, 'deDE', '', 'Nicht mein elegantestes Werk, aber es wird halten. Wir sehen uns oben.', 39653),
(209190, 'deDE', 'Wenn wir uns wiedersehen, werdet Ihr weniger Glück haben!', '', 39653),
(209189, 'deDE', 'Der Kerkermeister belohnt uns, wenn wir den Schlundgänger töten!', '', 39653),
(209188, 'deDE', '', 'Das sollte nicht lange dauern. Haltet mir nur die Schlundgebundenen von der Pelle!', 39653),
(209187, 'deDE', '', 'Ihr wart ja wirklich sehr beschäftigt, $gSchlundgänger:Schlundgängerin;.\n\nIch habe Euch ein wenig im Blick behalten. Natürlich im Auftrag des Prinzen.', 39653),
(209186, 'deDE', '', 'Jämmerlicher Sterblicher. Ihr kommt zu spät.', 39653),
(209185, 'deDE', '', 'Nicht mit meinen Preisen zufrieden? Ha ha ha!', 39653),
(209183, 'deDE', 'Steiniger Bimbam. Den haben sich wohl die ganz großen Flattermänner geschnappt.', '', 39653),
(209182, 'deDE', '', 'Was benötigt Ihr?', 39653),
(209181, 'deDE', '', 'Vielen Da... äh, danke.', 39653),
(209180, 'deDE', 'Es gab wohl ein Handgemenge auf der Mauer, aber die Steinhauerehrenwache hat es beendet.', 'Es gab wohl ein Handgemenge auf der Mauer, aber die Steinhauerehrenwache hat es beendet.', 39653),
(209176, 'deDE', '', 'Ich glaube, wir müssen genauer sein.', 39653),
(209175, 'deDE', '', 'Ich wurde von der Steinhauerin ausgesandt, um sicherzustellen, dass weiterhin Ruhe und Entspannung unter jenen herrscht, die sich vor den Dolchen und Krallen der Nathrezim fürchten.\n\nDementsprechend bin ich auch mit dem Auftrag gekommen, sämtliche in Sündensturz verbleibenden Nathrezim unter Zurschaustellung äußerster Gewalt zu beseitigen.\n\nNur damit es keine Missverständnisse gibt, würdet Ihr Euch selbst als Nathrezim bezeichnen?', 39653),
(209174, 'deDE', 'Ja! Auf sie, Zahnbrecher! Ha ha!', '', 39653),
(209173, 'deDE', 'Ich habe einen Großen erwischt!', '', 39653),
(209164, 'deDE', 'Ich liebe Euch, Zahnbrecher!', 'Ich liebe Euch, Zahnbrecher!', 39653),
(209163, 'deDE', 'Schnappt Euch diesmal einen Großen, Zahnbrecher!', '', 39653),
(209162, 'deDE', 'Schnapp sie dir, Zahnbrecher!', '', 39653),
(209161, 'deDE', 'Kommt raus zum Spielen, kleine Schleicher!', '', 39653),
(209160, 'deDE', 'Mal sehen, wer sich da drin versteckt...', '', 39653),
(209159, 'deDE', 'Silithus ist weit, weit weg.', '', 39653),
(209157, 'deDE', 'Kein Gegner kann den vereinten Schattenlanden standhalten.', '', 39653),
(209156, 'deDE', '', 'Beim Licht... Adrestes, das kann nicht sein!', 39653),
(209155, 'deDE', 'Oh, klar doch, werden wir unbedingt! Umbringen! Weitermachen!', '', 39653),
(209154, 'deDE', '', 'Oh je. Ich habe meine Tasche in der modrigen Höhle zurückgelassen. Holt sie mir, dann reisen wir ab.', 39653),
(209153, 'deDE', '', 'Ahh, es hat funktioniert! Wie es auch sollte.', 39653),
(209152, 'deDE', 'He. Der da drüben könnte was wissen.', '', 39653),
(209151, 'deDE', '', 'Hallo, werte Mitsteingeborene! Dürften wir wohl eine Frage stellen?', 39653),
(209150, 'deDE', 'Nein. Aber wir bringen alle Eindringlinge sofort um!', 'Nein. Aber wir bringen alle Eindringlinge sofort um!', 39653),
(209146, 'deDE', 'Nee nee nee nee. Sowas machen wir hier nicht.', '', 39653),
(209145, 'deDE', '', 'Los geht\'s. Nicht auffallen. Nicht auffallen, nicht...', 39653),
(209144, 'deDE', 'Aufgepasst. Das ist einer von denen, die die Verkleidung durchschauen können.', '', 39653),
(209138, 'deDE', 'Ihr bekommt natürlich Euren Anteil. Abzüglich geringer Bearbeitungskosten...', '', 39653),
(209137, 'deDE', 'Wenigstens bringt mir mein Schmerz jetzt etwas Profit ein.', '', 39653),
(209136, 'deDE', 'Ausgezeichnet! Alles noch in einem Stück!', '', 39653),
(209133, 'deDE', 'Ich weigere mich, diesen Turm mit leeren Händen zu verlassen. Das versteht Ihr, ja?', '', 39653),
(209132, 'deDE', 'Was... wollen sie von ihm?', 'Was... wollen sie von ihm?', 39653),
(209131, 'deDE', 'Solcher... Schrecken...', 'Solcher... Schrecken...', 39653),
(209130, 'deDE', 'Ich muss... Sicherheit finden...', 'Ich muss... Sicherheit finden...', 39653),
(209129, 'deDE', 'So viel... Schmerz...', 'So viel... Schmerz...', 39653),
(209128, 'deDE', 'Ich habe gesagt... ich weiß nichts...', 'Ich habe gesagt... ich weiß nichts...', 39653),
(209127, 'deDE', 'Sie... suchen den Schicksalsschreiber... ich wusste nichts.', 'Sie... suchen den Schicksalsschreiber...', 39653),
(209120, 'deDE', 'Passt Ihr nur auf die scharfäugigen von denen auf. Die durchschauen Euch sofort.', '', 39653),
(209119, 'deDE', '', 'Wir fragen, ob jemand Huln gesehen hat. Er muss hier doch auffallen wie eine bunte Kuh!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(209115, 'deDE', '', 'Wir dürfen nicht auffallen, also werdet Ihr Eure fantabulösen Schauspielkünste einsetzen!', 39653),
(209114, 'deDE', '', 'Ihr kämpft und ich repariere. Je schneller ich nach Hause an meine Schmiede kann, desto besser!', 39653),
(209111, 'deDE', 'Ich verstehe, Knochenschmiedin. Sobald das Archiv geöffnet ist, könnt Ihr gehen.', '', 39653),
(209110, 'deDE', '', 'Gut, da seid Ihr ja! Bringen wir\'s hinter uns. Ich will keinen Moment länger im Schlund bleiben als nötig!', 39653),
(209109, 'deDE', 'Secutor Mevix, sammelt Eure Truppen. Sichert das äußere Archiv, bis der Schlundgänger mit Tal-Galan kommt.', '', 39653),
(209108, 'deDE', 'Ich treffe Euch und unsere Freundin weiter vorn, Schlundgänger. Vorsehung leite uns.', '', 39653),
(209107, 'deDE', '', 'Wir dürfen nicht auffallen, also werden Ihr und ich uns ein bisschen verkleiden!', 39653),
(209106, 'deDE', '', '$p! Hier unten!', 39653),
(209103, 'deDE', 'Seid gegrüßt.', '', 39653),
(209089, 'deDE', 'Ich gebe zu, ein Zögern zu verspüren, das mir lange Zeit fremd war, $n.\n\nIch muss es überwinden, um das tun zu können, was für die Zukunft der Kyrianer und der Schattenlande am besten ist.\n\nSteht Ihr mir bei?', '', 39653),
(209088, 'deDE', 'Die Verschmähten wollten keinen Krieg. Aber unsere eigenen Brüder haben uns verstoßen und wollten nicht hören.', '', 39653),
(209086, 'deDE', '', 'Ich entstelle weiter jede Val\'kyr, die Ihr entsendet, Odyn, wie Ihr mich vor so langer Zeit. Euer eigenes Auge verrät sie alle. Süße Ironie.', 39653),
(209085, 'deDE', '', 'Hier entlang! Schnell!', 39653),
(209084, 'deDE', '', 'Schlundgebundene. Verschlinger. Dieser Ort ist oft genug entweiht worden.', 39653),
(209073, 'deDE', '', 'Schlundgänger, zu mir. Ihr anderen, nach Sündensturz. Ich will noch in dieser Stunde das Medaillon zurück und Mal\'ganis\' Kopf auf einer Pike.', 39653),
(209070, 'deDE', 'Die Fäulnis, die Maldraxxus heimgesucht hat, wurde getilgt. Es war eine Herausforderung, doch wir werden alles wieder aufbauen.\n\nZuvor müssen wir uns aber anderen Ländern zuwenden, die dringend Hilfe benötigen. Meine Ehre verbietet es mir, derartige Probleme zu ignorieren.', '', 39653),
(209069, 'deDE', '', 'Seit dem Verschwinden des Primus wurde kein Markgraf mehr ernannt. Eine solche Ehre hatte ich nicht erwartet.\n\nIch werde das Vermächtnis von Krexus und Akarek weiterführen.', 39653),
(209067, 'deDE', '', 'Wir sind mit einer Armee in den Schlund eingedrungen und zurückgekehrt. Ein denkwürdiger Augenblick für Maldraxxus.\n\nMan wird sich an Euren Namen erinnern, $gSchlundgänger:Schlundgängerin;. Ich freue mich schon auf die Geschichten, die da noch kommen werden.', 39653),
(209066, 'deDE', 'Erhebt Euch, Draka, und führt Euer Haus zum Sieg.', '', 39653),
(209065, 'deDE', 'Maldraxxi! Diese Kriegerin hat sicher immer und immer wieder bewiesen. Von jetzt bis zu ihrer letzten Schlacht ernenne ich sie zur Markgräfin der Auserwählten!', '', 39653),
(209064, 'deDE', 'Draka von den Auserwählten, tretet vor!', '', 39653),
(209063, 'deDE', 'Die letzten Verräter sind vernichtet. Jetzt gilt es, unsere verlorene Ehre wiederherzustellen.', '', 39653),
(209062, 'deDE', 'Soldaten von Maldraxxus, hört zu.', '', 39653),
(209050, 'deDE', 'Es ist lange her, dass ich in den Krieg gegen Schreckenslords gezogen bin. Ich habe vergessen, wie trügerisch sie sein können.\n\nSelbst die Gräfin wäre von ihrem Talent für Doppelzüngigkeit beeindruckt.', '', 39653),
(209035, 'deDE', 'Haltet den Feind weiter auf. Der Plan ist fast erfüllt.', '', 39653),
(209034, 'deDE', '', 'Ah, Illidans Lakaien. Anetheron lässt Euch grüßen.', 39653),
(209033, 'deDE', '', 'Der Weg vor uns wird sehr gefährlich. Ich muss mich auf meine Verbündeten verlassen, um zu siegen. Vielleicht ist Eurer ihm ähnlich, mein Sohn.', 39653),
(209032, 'deDE', '', 'Zu führen ist mir vertraut. Nur eine weitere Herausforderung, die ich bestehen werde. Maldraxxus erwartet es.', 39653),
(209031, 'deDE', 'Ich kenne die Prüfungen, die solche Macht mit sich bringt. Sie können eine schwere Last sein.', '', 39653),
(209029, 'deDE', 'Markgräfin. Ein Titel, in dem Autorität und Erwartungen mitschwingen. Wie \"Kriegshäuptling\".', '', 39653),
(209025, 'deDE', 'Der Tod... beherrscht... alles...', 'Der Tod... beherrscht... alles...', 39653),
(209022, 'deDE', 'Er wird... es finden...', 'Er wird... es finden...', 39653),
(209000, 'deDE', 'Ah, das Läuten des Hammers muss Euch zu mir gebracht haben. Es ist schön, einen weiteren Schmied zu treffen!', '', 39653),
(208999, 'deDE', 'Ihr seht gut aus, $gSchlachtenfürst:Schlachtenfürstin; $n.', '', 39653),
(208998, 'deDE', 'Seid gegrüßt, $C. Da habt Ihr aber eine interessante Waffe bei Euch.', '', 39653),
(208996, 'deDE', '', 'Ich bin froh, dass wir uns gefunden haben, $n.', 39653),
(208995, 'deDE', '', 'Ich sehe gern zu, wir Ihr die Schlundgebundenen so effizient... entfernt.', 39653),
(208994, 'deDE', '', 'Eure Fähigkeit, Eure Gegner zu besiegen, ist inspirierend.', 39653),
(208993, 'deDE', '', 'Unglaublich! Hattet Ihr schon immer solche Macht? Oder habt Ihr sie irgendwo erlernt?', 39653),
(208982, 'deDE', 'Sie... WAGT es? Bei meinem Barte, dafür wird Helya büßen!', '', 39653),
(208968, 'deDE', '', 'Schön, Euch wiederzusehen!', 39653),
(208967, 'deDE', '', 'Bereit für ein wenig Spaß, $n?', 39653),
(208966, 'deDE', '', 'Meine Schwestern und ich wurden von Helyas Schlundgebundenen überfallen. Nur ich habe überlebt. Wir bringen eine Botschaft der verfluchten Hexe.', 39653),
(208965, 'deDE', 'Grüße, Schlachtenfürst $n. Es ist zu lange her, dass Ihr uns besucht habt. Danica, wer wagt, meine Val\'kyr zu bedrohen?', '', 39653),
(208964, 'deDE', '', 'Ich hatte schon so lange keine Gelegenheit mehr, an solch einem Angriff teilzunehmen, dass ich vergessen hatte, wie aufregend das eigentlich ist.\n\nDurch die Rückkehr des Primus wird es noch mehr solcher Aktivitäten geben, und darauf freue ich mich sehr.', 39653),
(208963, 'deDE', 'Willkommen in meinen Hallen. Danica, erzählt von diesem Sieg und dem Feind, der gewagt hat, eine meiner Val\'kyr festzuhalten!', '', 39653),
(208957, 'deDE', '', 'Mächtiger Odyn! Vor Euch steht Euer Schlachtenfürst, $n. Seine Macht wurde erneut erprobt und bewiesen, als er mich aus der Gefangenschaft befreit hat.', 39653),
(208955, 'deDE', '', 'Odyn! Ich bringe Euch diesen Sterblichen, $n, dessen Mut mich aus der Gefangenschaft befreit hat.', 39653),
(208947, 'deDE', 'Mischt Euch nicht ein, Sterblicher!', 'Mischt Euch nicht ein, Sterblicher!', 39653),
(208939, 'deDE', '', 'Immer so clever. Nur... bin ich nicht der Eindringling. Ich bin die Ablenkung.', 39653),
(208937, 'deDE', 'Wir werden... es finden...', 'Wir werden... es finden...', 39653),
(208934, 'deDE', 'Er... ist... unaufhaltsam...', 'Er... ist... unaufhaltsam...', 39653),
(208930, 'deDE', '', 'Zeigt Euch, Eindringling.', 39653),
(208929, 'deDE', '', 'Beeindruckend, wenn man bedenkt, dass Denathrius Euch köpfen ließ, nachdem er Renathal in den Schlund geworfen hat.', 39653),
(208928, 'deDE', '', 'Steinmutter. Eure Frage ehrt mich. Ich bin wohlauf.', 39653),
(208927, 'deDE', '', 'Chelra der Klingenwall. Wie ist es Euch ergangen, mein Kind?', 39653),
(208926, 'deDE', 'Liebe Steinhauerin, Ernterin des Zorns, Führerin von Elu...', '', 39653),
(208924, 'deDE', '', 'Wir sehen uns im Ardenwald wieder, $p. Eilt Euch.', 39653),
(208921, 'deDE', '', 'Ich glaube, ich weiß, wo wir unser Ziel finden. Lassen wir ihn nicht warten.', 39653),
(208920, 'deDE', '', 'Kel\'Thuzads Diener scheinen seine Pläne sogar ohne ihn auszuführen. Wir müssen sie alle abschlachten.', 39653),
(208919, 'deDE', '', 'Alle Verräter Akareks werden leiden. Nachtkriegerin oder nicht, ich ruhe erst, wenn der letzte Feind tot ist.', 39653),
(208918, 'deDE', '', 'Unter Kel\'Thuzads Befehl hätten diese Lichs das Haus der Augen fast ausgelöscht. Das vergesse ich nicht.', 39653),
(208917, 'deDE', '', 'Im Leben wurde ich zur Nachtkriegerin, um mein Volk zu rächen. Ganz so wie jetzt.', 39653),
(208916, 'deDE', '', 'Mein Flüstern ist das letzte, was Ihr hören werdet.', 39653),
(208915, 'deDE', '', 'Ewige Stille erwartet Euch.', 39653),
(208914, 'deDE', '', 'Ihr erntet, was Ihr gesät habt!', 39653),
(208912, 'deDE', '', 'In das Vergessen!', 39653),
(208911, 'deDE', '', 'Verräterblut... so köstlich...', 39653),
(208910, 'deDE', '', 'Rache für Akarek!', 39653),
(208909, 'deDE', '', 'Ein ruhiger Rückzugsort. Und doch ist er nicht hier...', 39653),
(208908, 'deDE', '', 'Die Katastrophe hat alles zerstört. Keine Spur vom Schicksalsschreiber. Wir sollten uns hier nicht aufhalten.', 39653),
(208907, 'deDE', '', 'Das hier war ein Ort der Meditation und Ruhe. Hier haben Bedienstete sich versammelt und ausgetauscht.', 39653),
(208906, 'deDE', '', 'Dieses Artefakt ist... nun, dieses hat einen gewissen Wert. Aber helfen wird es uns nicht.', 39653),
(208905, 'deDE', '', 'Ah, das ist es! Genau das, was wir brauchen.', 39653),
(208904, 'deDE', '', 'Kaum mehr als Müll.', 39653),
(208903, 'deDE', '', 'Hmpf. Das ist offensichtlich nutzlos.', 39653),
(208889, 'deDE', '', 'Hört auf die Worte der Archivare, Roh-Suir. Der Stab benötigt sowohl Anima als auch Weisheit.', 39653),
(208880, 'deDE', '', 'Gewiss, Baronin. Ich stehe mit Stolz an Eurer Seite.', 39653),
(208879, 'deDE', '', 'Der Weg einer, die ihrem ersten Haus den Rücken gekehrt hat, kümmert uns nicht. Ich werde meinen Titel durch Unerbittlichkeit und List verdienen, wie es unsere Art ist.', 39653),
(208878, 'deDE', 'Ich bin Euer Untergang!', 'Ich bin Euer Untergang!', 39653),
(208877, 'deDE', '', 'Draka mag die Auserwählten anführen, Herrin, aber meine Loyalität gilt Euch. Ich bin sicher: Der Primus wird das Haus der Augen mit Euch als Markgräfin wiederherstellen.', 39653),
(208876, 'deDE', 'Kniet, Schlundgänger!', 'Kniet, Schlundgänger!', 39653),
(208872, 'deDE', 'Der Kerkermeister wird siegen!', 'Der Kerkermeister wird siegen!', 39653),
(208871, 'deDE', 'Es war dumm, hierher zu kommen!', 'Es war dumm, hierher zu kommen!', 39653),
(208868, 'deDE', '', 'Ich würde ja helfen, aber der Kampf ist nicht meine Stärke.', 39653),
(208866, 'deDE', 'Es gibt nur eine geringe Chance auf Erfolg und eine noch geringere, dass wir überleben. Unsere Zukunft liegt in Euren Händen.', '', 39653),
(208864, 'deDE', 'Ich danke Euch. Die Schlundgebundenen wollen unsere Geheimnisse plündern.', '', 39653),
(208863, 'deDE', 'Gut, dann sparen wir uns die Vorstellung. Wir sind hier, um die Truppen des Kerkermeisters zu bekämpfen.', '', 39653),
(208859, 'deDE', '', 'Ich bleibe besser versteckt, wenn Ihr den Portalstein aktiviert. Vergesst nicht, dass unsere Abmachung noch gilt, Schlundgänger.', 39653),
(208855, 'deDE', 'Korthia war tief im Zwischenraum verborgen, sicher und außer Reichweite... bis die Ketten des Kerkermeisters uns gefunden haben.', '', 39653),
(208850, 'deDE', 'Ihr hättet es zu Glanzzeiten erleben sollen, Mittler. Korthia ist... oder war... die Stadt der Geheimnisse.', '', 39653),
(208849, 'deDE', 'Es war der Auftrag meines Ordens, Wissen und Artefakte zu schützen. Dinge, die zu kostbar sind, um in böswillige Hände zu fallen.', '', 39653),
(208848, 'deDE', '', 'Das ist also Korthia. Ich hatte etwas leicht... Prächtigeres erwartet.', 39653),
(208846, 'deDE', 'Kommt. Wir haben viel zu besprechen.', '', 39653),
(208845, 'deDE', 'Ein Schlundgänger? Faszinierend! Ich habe die Prophezeiungen studiert, aber...', '', 39653),
(208844, 'deDE', '', 'Halt! Das ist ein lebender Sterblicher, der Schlundgänger! Kein Diener des Kerkermeisters!', 39653),
(208843, 'deDE', 'Noch ein Scherge des Kerkermeisters?! Schlagt ihn nieder!', '', 39653),
(208842, 'deDE', 'Verstärkt die Patrouillen. Die Schlundgebundenen dürfen nie ins...', '', 39653),
(208841, 'deDE', '', 'Nur eine fallengelassene Seite, aber keine Spur von ihm. Wo seid Ihr hin, Schicksalsschreiber?', 39653),
(208830, 'deDE', 'Ein Schleim für Euch! Und ein Schleim für Euch!', '', 39653),
(208827, 'deDE', 'Ich hoffe, Ihr findet Euren Tod einsam in Eis und Finsternis, Arthas.', '', 39653),
(208826, 'deDE', '', '$gSchlundgänger:Schlundgängerin;. Ich bin bereit, der Bitte der Baronin nachzukommen und Kael\'thas mit Euch auf diese Mission auszusenden.\n\nDoch behaltet die beiden gut im Blick. Ich bezweifle, dass sie einen guten Einfluss ausübt, und sie könnte Kael\'thas dazu bringen, wieder in seine alten Verhaltensmuster zu verfallen.\n\nMan sieht inzwischen sein Potenzial, doch ich würde mich besser fühlen, wenn er erst noch ein oder zwei Jahrhunderte sühnen würde.', 39653),
(208825, 'deDE', 'Bolvar Fordragon. Ich habe Euer Gesicht in den Animaströmen des Schlundgängers gesehen.', '', 39653),
(208824, 'deDE', 'Gute Arbeit, Schlundgänger.', '', 39653),
(208823, 'deDE', '', 'Der Schlundgänger kehrt zurück. Der zweite Portalstein ist gefunden.', 39653),
(208822, 'deDE', 'Denathrius hat mir nie erzählt, was aus den Nathrezim geworden ist. Erst später habe ich erfahren, dass die Sterblichen sie als \"Schreckenslords\" kennen.', '', 39653),
(208821, 'deDE', 'Der Konflikt wurde durch Denathrius beendet, der sagte, er würde sie in eine Welt außerhalb der Schattenlande verbannen.', '', 39653),
(208820, 'deDE', 'Nachdem die Naaru vertrieben waren, richtete sich der Zorn der Steinhauerin über ihre vielen verlorenen Kinder auf die Nathrezim.', '', 39653),
(208818, 'deDE', 'Das Heer von Maldraxxus erhob sich nicht, um uns zu verteidigen, also meißelte die Steinhauerin ihre Steinlegion, um gegen das Licht zurückzuschlagen.', '', 39653),
(208817, 'deDE', 'Trotz ihrer Raffinesse wurde einer ihrer Vorstöße entdeckt.', '', 39653),
(208816, 'deDE', 'Zu ultimativen Spionen geschmiedet trugen sie den Einfluss des Todes in die Reiche unserer Rivalen... und die der Lebenden.', '', 39653),
(208815, 'deDE', 'Daraufhin ergriff der ganze Zorn des Lichts Revendreth, und der einstige Distrikt der Nathrezim ging in Flammen auf.', '', 39653),
(208814, 'deDE', 'Vor unzähligen Äonen, kurz nach der Erschaffung der ersten Venthyr, enthüllte Denathrius eine andere Schöpfung. Die Nathrezim.', '', 39653),
(208813, 'deDE', 'Ein Mensch. Er wollte einen Gladiator. Er hat einen Feind bekommen.', '', 39653),
(208810, 'deDE', '', 'Wer weiß, welche Geheimnisse dieser Ort verbirgt? Es gibt nur einen Weg, es herauszufinden...', 39653),
(208809, 'deDE', '', 'Geht Ihr nur vor. Ich bleibe hier. Damit uns auch niemand folgt, natürlich.', 39653),
(208808, 'deDE', '', 'Ich orte in der Nähe Bedienstete wie die in Oribos. Vielleicht sind sie die Hüter von Korthias Schätzen.', 39653),
(208807, 'deDE', '', 'Hmm... Na, das ist ja interessant.', 39653),
(208806, 'deDE', '', 'Er wird mit all seinem Unrat entfernt.', 39653),
(208805, 'deDE', '', 'Auch der Verräter wird seinen Lohn bekommen.', 39653),
(208803, 'deDE', 'Kel\'Thuzad wird zurückkehren...', '', 39653),
(208801, 'deDE', '', 'Ich war es, die sie gerufen hat, Fal\'zinge. Und jetzt sterbt.', 39653),
(208792, 'deDE', 'Was... Markgräfin! Beendet diesen Verrat!', '', 39653),
(208786, 'deDE', 'Ich sehe Euch, Schlundgänger!', '', 39653),
(208784, 'deDE', '', 'Prinz Renathal ist auf dem Weg zur Mutter des Steins. Eine ernst zu nehmende Ehrenwache mitzubringen, ist absolut angebracht. Man nennt sie schließlich nicht die Ernterin des Zorns, weil sie eine so freundliche Art hat.', 39653),
(208780, 'deDE', '|TInterface\\ICONS\\INV_Pet_ReliquarySuffering.blp:20|t Dormazain markiert Euch mit einem |cFFFF0000|Hspell:350647|h[Brandmal der Qual]|h|r!', '|TInterface\\ICONS\\INV_Pet_ReliquarySuffering.blp:20|t Dormazain markiert Euch mit einem |cFFFF0000|Hspell:350647|h[Brandmal der Qual]|h|r!', 39653),
(208777, 'deDE', 'Danke, meine Archon. Wir gehen und dienen.', '', 39653),
(208776, 'deDE', '', 'Eure Hingabe an unseren heiligen Auftrag hat nie nachgelassen.', 39653),
(208775, 'deDE', '', 'Ich? Verzeiht, meine Archon aber ich...', 39653),
(208773, 'deDE', '', 'Adrestes, ich weihe Euch zum Paragon der Hingabe.', 39653),
(208772, 'deDE', '', 'Lernen wir von Uthers Beispiel.', 39653),
(208769, 'deDE', '', 'Als Devos sich auflehnte, bin ich ihr mit dem Speer entgegengetreten.', 39653),
(208767, 'deDE', '', 'Und zu den Seelen, die wir in die Schattenlande geleiten.', 39653),
(208766, 'deDE', 'Vielleicht brauchen wir nicht Loyalität, sondern... Hingabe. Zu unserem Pfad. Zueinander.', '', 39653),
(208765, 'deDE', 'Meine Archon... Loyalität ohne Mitgefühl hat das Herz der Kyrianer zerrissen.', '', 39653),
(208764, 'deDE', '', 'Am heutigen Tag benennen wir das neue Paragon der Loyalität.', 39653),
(208763, 'deDE', '', 'Alle fünf Paragons müssen dabei sein, um ein neues Paktsiegel zu schmieden.', 39653),
(208762, 'deDE', 'Adrestes. Wir müssen reden.', '', 39653),
(208761, 'deDE', 'Hättet Ihr die Wahl...', '', 39653),
(208760, 'deDE', 'Nein. Sie sind eine Erinnerung an gelernte Lektionen. Hätte ich die Wahl, würde ich sie nie loslassen.', '', 39653),
(208759, 'deDE', 'Uther, wenn Euch diese Erinnerungen so peinigen, könnt Ihr sie mit der Zeit loswerden.', '', 39653),
(208758, 'deDE', 'Das werde ich. Arthas... Hätte ich nur versucht, Euch zu retten...', '', 39653),
(208756, 'deDE', 'Vielleicht. Aber diese Erinnerung zu konfrontieren hat Euch das Mitgefühl näher gebracht als jede heilige Schrift.', '', 39653),
(208752, 'deDE', 'Mein Herz war nie so kalt. Ich habe ihn nicht als Lehrer betrachtet, oder als Freund, sondern als Erzfeind.', '', 39653),
(208750, 'deDE', 'In diesem Moment... habe ich ihn im Stich gelassen. Die Lehren nicht befolgt. Mitgefühl am wenigsten.', '', 39653),
(208749, 'deDE', 'Wieso diese Erinnerung, Uther? Was hält Euch hier?', '', 39653),
(208748, 'deDE', 'Da könnt Ihr lange hoffen, Uther. Ich beabsichtige, ewig zu leben.', '', 39653),
(208747, 'deDE', 'Nein! Ich war wütend...', '', 39653),
(208745, 'deDE', 'Er wollte die Urne... die mit der Asche des Vaters, den er ermordet hat.', '', 39653),
(208744, 'deDE', '', 'Das ist der Moment Eures Todes, nicht wahr?', 39653),
(208743, 'deDE', 'Wo sind wir hier?', '', 39653),
(208738, 'deDE', '', 'Geschafft! Stellt Euch die Wunder vor, die hier schlummern, Schlundgänger! Oh, und Euer Portalstein auch.', 39653),
(208737, 'deDE', '', 'Korthia ist wohl gegen das Auge des Kerkermeisters abgeschirmt, aber seine Truppen brechen durch die Verteidigung.', 39653),
(208736, 'deDE', '', 'Wir müssen unser Ziel erreichen, bevor mein Schleier verfliegt. Oh, und passt auf, wo Ihr hintretet.', 39653),
(208735, 'deDE', '', 'Bewegung!', 39653),
(208734, 'deDE', '', 'Nicht. Ein. Wort.', 39653),
(208733, 'deDE', '', 'Stopp!', 39653),
(208730, 'deDE', 'Genug von diesem Lärm!', '', 39653),
(208729, 'deDE', '', 'Lernt zu spielen, Gesindel!', 39653),
(208728, 'deDE', 'Das nennt Ihr Musik?!', '', 39653),
(208726, 'deDE', '', 'Runter von der Bühne!', 39653),
(208725, 'deDE', '', 'Korthia liegt vor uns... und das Auge des Kerkermeisters ist uns direkt im Weg.', 39653),
(208714, 'deDE', '', 'In Korthia muss sich starke Magie befinden, wenn sich das Auge abwenden muss. Vielleicht sind die Legenden wahr...', 39653),
(208713, 'deDE', '', 'Unwichtig. Der Verbannte soll seine Beute haben.', 39653),
(208712, 'deDE', 'Wie es scheint, kann das Auge Korthia nicht sehen. Unsere Suche muss ohne es weitergehen.', '', 39653),
(208711, 'deDE', '', 'Wir werden unangenehm nah an die Truppen des Kerkermeisters kommen. Bleibt bei mir.', 39653),
(208710, 'deDE', '', 'Bleibt bei mir, Schlundgänger.', 39653),
(208599, 'deDE', '', 'Bleibt in meiner Nähe und tut alles, was ich sage, sonst macht Euch das Auge des Kerkermeisters zu Stygia.', 39653),
(208595, 'deDE', 'Die Archivarin muss gerettet werden. Unser aller Schicksal hängt davon ab.', '', 39653),
(208590, 'deDE', '', 'Ich kann uns im Verborgenen halten wie schon zuvor.', 39653),
(208589, 'deDE', '', 'Seid vorsichtig. Das Auge des Kerkermeisters blickt zweifellos hierher.', 39653),
(208588, 'deDE', '', 'Meine Mittlerfreunde erzählen Legenden darüber. Eine prächtige Stadt voller Schätze, ihr Standort ein wohlgehütetes Geheimnis.', 39653),
(208587, 'deDE', '', 'Laut abgefangenen Berichten der Schlundgebundenen hat der Kerkermeister ein Reich namens \"Korthia\" gesucht.', 39653),
(208569, 'deDE', 'Möge mir das Licht vergeben.', '', 39653),
(208568, 'deDE', '', 'Ihr habt ihn auf den Weg der Gerechtigkeit gebracht. Er selbst ist davon abgekommen.', 39653),
(208566, 'deDE', 'Sagt das all den ermordeten Unschuldigen. Ich habe ihn auf diesen Weg gebracht!', '', 39653),
(208565, 'deDE', 'Ihr wolltet einen grübelnden Schüler trösten. Das kann Euch niemand verdenken.', '', 39653),
(208558, 'deDE', 'Die Arbeit eines maldraxxischen Soldaten endet nie!', '', 39653),
(208549, 'deDE', 'Schlagt zu, Wolfsmutter! Zeigt ihnen das Herz eines Nekrolords!', '', 39653),
(208544, 'deDE', 'Nein... Ich hätte zuhören sollen. Wieso habe ich nicht zugehört?', '', 39653),
(208542, 'deDE', '', 'Nehmt mein Geschenk, Vyraz. Ihr seid schließlich in der Unterzahl!', 39653),
(208541, 'deDE', 'Hah. Das tut er immer.', '', 39653),
(208540, 'deDE', 'Wie wäre es mit einem kleinen Übungskampf? Der sollte Euch lockern.', '', 39653),
(208537, 'deDE', '', 'Vyraz! Ihr werdet für das büßen, was Ihr Krexus angetan habt!', 39653),
(208536, 'deDE', 'Man setzt große Erwartungen in Euch, Junge. Ich bin sicher, ihr werdet alle übertreffen.', '', 39653),
(208535, 'deDE', 'Ihr habt mich so viel gelehrt, Uther... aber manchmal frage ich mich, ob dies wirklich mein Weg ist.', '', 39653),
(208534, 'deDE', '', 'So ängstlich, Maldraxxi? Der Kerkermeister duldet keine Schwäche in den Reihen!', 39653),
(208532, 'deDE', 'Unsere Feinde kommen näher, Helya. wir brauchen Verstärkung!', '', 39653),
(208528, 'deDE', 'Ehrlich? Ja. Ich sehe Eure Hingabe zum Licht, und Zweifel trüben mein Herz.', '', 39653),
(208527, 'deDE', 'Das ist der Tag, an dem Arthas Paladin wurde. Ich erinnere mich sehr gut...', '', 39653),
(208526, 'deDE', 'Nervös, Arthas?', '', 39653),
(208525, 'deDE', 'Ich mache mich in die Nekropole auf. Bitte, rettet meine Brüder!', '', 39653),
(208524, 'deDE', 'Maldraxxi? Hier?', '', 39653),
(208521, 'deDE', '', '\"Draenors Ehre\". Ein passender Name für eine würdige Waffe.', 39653),
(208519, 'deDE', 'Dra\'gora. Gut, sie wieder in der Hand zu haben.', '', 39653),
(208518, 'deDE', '', 'Ich besitze ein Gerät, das uns zu einem sicheren Außenposten in der Nähe der Landmasse bringt. Bleibt unbedingt bei mir, wenn wir da sind.', 39653),
(208517, 'deDE', '', 'Ich schlage vor, wir reisen gemeinsam hin. Ihr sucht Euren Portalstein und ich finde heraus, welche Profite winken könnten. Für uns beide natürlich.', 39653),
(208516, 'deDE', '', 'Der Kerkermeister hat ein gebrochenes Reich mit riesigen Ketten in den Schlund gezogen. Ich konnte nur einen Blick erhaschen, habe aber einen Verdacht, worum es sich handelt.', 39653),
(208513, 'deDE', '', 'Ihr seht irgendwie eigenartig aus, $uSchlundgänger:Schlundgängerin;.\n\nAls ob Ihr mich gleich um einen eher großen Gefallen bitten möchtet...', 39653),
(208512, 'deDE', '', 'Ah, Schlundgänger. Ich hatte mich schon gefragt, wann Ihr auftauchen würdet.', 39653),
(208510, 'deDE', 'Wir verteidigen Oribos gegen den Kerkermeister. Eilt Euch, Schlundgänger. Die Macht des Feindes wächst.', '', 39653),
(208508, 'deDE', 'Tal-Inara sagt, dass eine Verbindung direkt vom Schlund zum Tor hergestellt werden muss, bevor es geöffnet werden kann.', '', 39653),
(208503, 'deDE', '', 'Ich hätte nie gedacht, dass ich je solch schwere Zeiten erleben würde.\n\nLasst mich Eure Anima untersuchen. Vielleicht ist sie stark genug, dem drastischen Willen der Vorsehung zu trotzen.', 39653),
(208498, 'deDE', '', 'Über diesen Weg könntet Ihr alle nie wieder zurückkehren. Aber vielleicht gibt es einen anderen.', 39653),
(208490, 'deDE', 'Wir müssen einen Gegenangriff starten, bevor die Schlundgebundenen wiederkommen.', '', 39653),
(208475, 'deDE', '', 'Wer hat Euch Kämpfen beigebracht, Thrall?', 39653),
(208474, 'deDE', '', 'Ich wurde im Kampf geschmiedet. Wie auch Ihr, wie ich höre.', 39653),
(208473, 'deDE', 'Ihr seid eine sehr fähige Kriegerin, Draka.', '', 39653),
(208471, 'deDE', '', 'Ja. Sein Erbe wird immer ein Teil von mir sein.', 39653),
(208470, 'deDE', 'Im Leben gehörtet Ihr zum Frostwolfklan, nicht wahr?', '', 39653),
(208466, 'deDE', 'Er hat sie mir zum Geschenk gemacht. Eins von vielen.', '', 39653),
(208465, 'deDE', '', 'Wie ich sehe, tragt Ihr die Rüstung von Orgrim Schicksalshammer.', 39653),
(208458, 'deDE', '', 'Die Schlundgebundenen erzittern vor uns! Blut und Donner!', 39653),
(208457, 'deDE', '', 'Trefft mich in der Verdammnisfestung, wenn Ihr fertig seid.', 39653),
(208456, 'deDE', 'Keine Einigung zu erreichen. Tötung autorisiert!', '', 39653),
(208455, 'deDE', 'Wir können doch sicher eine andere Lösung finden?', '', 39653),
(208454, 'deDE', 'Halt. Der Eintritt ist beschränkt. Gebt Eure Waffen ab und folgt mir.', '', 39653),
(208451, 'deDE', 'Lasst Euch nicht durch Tazaveshs Schönheit von unserem gemeinsamen Ziel ablenken.', '', 39653),
(208439, 'deDE', 'Baut auf die Vorsehung.', '', 39653),
(208438, 'deDE', 'Mögt Ihr mit Wissen zurückkehren.', '', 39653),
(208436, 'deDE', 'Erhebt Euch, Uther, als Paladin von Lordaeron. Erster des Ordens der Silbernen Hand.', '', 39653),
(208433, 'deDE', 'Ich... Ich schwöre.', '', 39653),
(208432, 'deDE', 'Schwört Ihr, das Böse zu vernichten und die Schwachen und Unschuldigen zu schützen?', '', 39653),
(208431, 'deDE', 'Eure Trauer und Reue verfolgen Euch noch. Wie auch Arthas.', '', 39653),
(208429, 'deDE', 'Schwört Ihr, im Licht zu wandeln und seine Weisheit zu verbreiten?', '', 39653),
(208428, 'deDE', 'Diese Erinnerungen... Sie sind nicht ein und dieselben.', '', 39653),
(208416, 'deDE', '', 'Schwierigkeiten werden der Vorsehung nicht im Wege stehen.', 39653),
(208414, 'deDE', '', 'Schmerz vergeht. Erfahrung bleibt ewig.', 39653),
(208407, 'deDE', '', 'Grämt Euch nicht um Verluste. Konzentriert Euch darauf, was bleibt.', 39653),
(208406, 'deDE', '', 'Macht muss stets von Weisheit gemäßigt werden.', 39653),
(208403, 'deDE', 'Unterwerft... Euch...', '', 39653),
(208401, 'deDE', 'Erinnerungen sind vergänglich. Das Archiv ist ewig.', '', 39653),
(208400, 'deDE', 'Sucht Wissen, wohin Ihr auch geht.', '', 39653),
(208394, 'deDE', 'Stellt das Archiv wieder her. Erfüllt die Vorsehung.', '', 39653),
(208393, 'deDE', 'Folgt jederzeit der Vorsehung.', '', 39653),
(208389, 'deDE', 'Weisheit und Wissen müssen bewahrt werden.', '', 39653),
(208388, 'deDE', 'Willkommen im Archiv... oder dem, was davon übrig ist.', '', 39653),
(208387, 'deDE', 'FÜR DIE HORDE!!!', '', 39653),
(208386, 'deDE', 'Ich unterwerfe mich niemandem! Nicht Euch, nicht dem Kerkermeister, nicht diesem Feigling Thrall!', '', 39653),
(208385, 'deDE', 'Ein wahrer Gelehrter studiert alles.', '', 39653),
(208383, 'deDE', 'Ich... wir... haben eine hehre Pflicht.', '', 39653),
(208382, 'deDE', 'Aber ich würde jede meiner Entscheidungen wieder treffen. Mit Stolz.', '', 39653),
(208381, 'deDE', 'Es hieß, ich sollte für meine Verbrechen büßen... meine \"Sünden\" bereuen...', '', 39653),
(208378, 'deDE', '', 'Ihr seid der, der Thrall genannt wird, ja? Ich habe von Euch gehört. Kommt.', 39653),
(208375, 'deDE', 'Draka. Champion. Ich möchte Euch auf Eurer Mission begleiten.', '', 39653),
(208373, 'deDE', '', 'Vyraz versteckt sich in Desmotaeron. Wir sichern den Bereich und rufen die Zerekriss.', 39653),
(208368, 'deDE', 'Hochverrat? Seid Ihr nicht bei Sinnen, Arthas?', '', 39653),
(208367, 'deDE', 'Dann muss ich das als Hochverrat ansehen!', '', 39653),
(208366, 'deDE', 'Ihr seid noch nicht mein König, mein Junge! Und selbst wenn, würde ich den Befehl nicht ausführen!', '', 39653),
(208365, 'deDE', 'Verdammt, Uther! Als künftiger König befehle ich Euch, die Stadt zu säubern!', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(208355, 'deDE', '', 'Bergt den Leitstab. Wir warten in Sicherheit auf Euch.', 39653),
(208351, 'deDE', 'Der Vorsehung sei Dank, Ihr seid wohlauf! Hat der Verhörer...', '', 39653),
(208350, 'deDE', '', 'Benutzt das, um die Tarnungen der Nathrezim zu durchschauen.', 39653),
(208349, 'deDE', '', 'Wir sollten der Königin Bericht erstatten. Ich hoffe, sie konnte die Wildsamen retten!', 39653),
(208348, 'deDE', '', 'Seine Erinnerungen verwachsen miteinander. Wir müssen helfen!', 39653),
(208347, 'deDE', 'Wie... Wie könnt Ihr so etwas nur denken?', '', 39653),
(208346, 'deDE', '', 'Ruht, meine Liebe. Fallt sanft in traumlosen Schlummer.', 39653),
(208345, 'deDE', 'Diese ganze Stadt muss gesäubert werden.', '', 39653),
(208342, 'deDE', 'Mächtige Kreaturen aus Torghast wurden im Gebiet gesichtet.', '', 39653),
(208341, 'deDE', '', 'Der Schlund erzittert vor uns! Lok-tar, Brüder und Schwestern!', 39653),
(208329, 'deDE', 'Moment... Was ist das? In der Ecke?', '', 39653),
(208328, 'deDE', 'Mitgefühl. Über unsere Verschiedenheiten hinwegzusehen und Gemeinsamkeiten zu verstehen. Das Leid anderer erfahren, selbst wenn...', '', 39653),
(208327, 'deDE', '', 'Und?', 39653),
(208326, 'deDE', 'Die drei Tugenden. Respekt, Beharrlichkeit... und auch...', '', 39653),
(208325, 'deDE', 'Wie lauten die Lehren?', '', 39653),
(208324, 'deDE', 'Ich schwöre.', '', 39653),
(208323, 'deDE', 'Uther, schwört Ihr, die Lehren des Heiligen Lichtes zu ehren?', '', 39653),
(208322, 'deDE', 'Wir sind im Licht versammelt. Durch seine Gnade wird unser Bruder neu geboren.', '', 39653),
(208321, 'deDE', '', 'Wahrt Tapferkeit in Eurem Herzen. Es wird nicht wanken, ganz gleich, welcher Finsternis Ihr die Stirn bietet.', 39653),
(208320, 'deDE', '', 'Ihr seid bereit, Eure Diener zu opfern... aber was wird aus den Geistern unter Eurem Schutz?', 39653),
(208311, 'deDE', 'Kommt, Uther. Nehmt Euren Platz ein, damit wir beginnen können.', '', 39653),
(208310, 'deDE', 'Das ist... die Alonsuskapelle in Stratholme. Der Tag, an dem ich zum ersten Paladin wurde.', '', 39653),
(208301, 'deDE', '', 'Ich bin eine Überlebende des Angriffs auf das Quorum des Suchers. Ich bin auf der Suche nach dem Schicksalsschreiber.', 39653),
(208291, 'deDE', '', 'Zu Befehl.', 39653),
(208287, 'deDE', '', 'Ich weiß, sie ist schwer zu töten. Konzentriert Euch auf Eure Aufgabe, Khaliiq.', 39653),
(208275, 'deDE', '', 'Baronin, kanntet Ihr diese \"Tyrande Wisperwind\" im Leben?', 39653),
(208266, 'deDE', 'Oh je, der Schleim ist alle. Beim nächsten Mal muss ich mehr mitbringen!', '', 39653),
(208265, 'deDE', 'Oh, hallo! Ich habe viele Schleime für unsere Freunde da oben!', '', 39653),
(208264, 'deDE', '', 'Wenn Ihr gestattet, Baronin.', 39653),
(208262, 'deDE', '', 'Khaliiq. Entfernt Kel\'Thuzads Getreue aus dem Haus der Rituale. Danach dürft Ihr der Nachtkriegerin helfen.', 39653),
(208260, 'deDE', '', '$gSchlundgänger:Schlundgängerin;. Ihr habt Euch also zu einer Rückkehr herabgelassen?', 39653),
(208259, 'deDE', '', 'Willkommen zurück, $gSchlundgänger:Schlundgängerin;. Eure Loyalität steht Euch gut zu Gesicht.', 39653),
(208256, 'deDE', 'Ihr nach!', '', 39653),
(208250, 'deDE', 'Verteidigt Korthia um jeden Preis.', 'Verteidigt Korthia um jeden Preis.', 39653),
(208249, 'deDE', 'Nichts hat mehr Macht als ein Geheimnis.', 'Nichts hat mehr Macht als ein Geheimnis.', 39653),
(208248, 'deDE', 'Ich muss mich um die Folianten kümmern.', 'Ich muss mich um die Folianten kümmern.', 39653),
(208247, 'deDE', 'Alles dient der Vorsehung.', 'Alles dient der Vorsehung.', 39653),
(208246, 'deDE', 'Ich hoffe, Ihr wisst das zu nutzen.', 'Ich hoffe, Ihr wisst das zu nutzen.', 39653),
(208245, 'deDE', 'Was benötigt Ihr?', 'Was benötigt Ihr?', 39653),
(208244, 'deDE', 'Korthia hat viel zu bieten.', 'Korthia hat viel zu bieten.', 39653),
(208243, 'deDE', 'Wie kann ich Euch helfen?', 'Wie kann ich Euch helfen?', 39653),
(208242, 'deDE', 'Die Wahrheit... ist irgendwo da draußen.', 'Die Wahrheit... ist irgendwo da draußen.', 39653),
(208241, 'deDE', 'Wir haben nur eine Wahl: durchzuhalten.', 'Wir haben nur eine Wahl: durchzuhalten.', 39653),
(208240, 'deDE', 'So viele von uns verloren...', 'So viele von uns verloren...', 39653),
(208239, 'deDE', 'Diese Prüfung habe ich nie vorhergesehen.', 'Diese Prüfung habe ich nie vorhergesehen.', 39653),
(208238, 'deDE', 'Die Schlundgebundenen dürfen Korthia nicht einnehmen.', 'Die Schlundgebundenen dürfen Korthia nicht einnehmen.', 39653),
(208237, 'deDE', 'Wie hat der Kerkermeister uns gefunden?', 'Wie hat der Kerkermeister uns gefunden?', 39653),
(208236, 'deDE', 'Die Vorsehung hat uns hergebracht.', 'Die Vorsehung hat uns hergebracht.', 39653),
(208235, 'deDE', 'Sucht Ihr Weisheit? Oder Macht?', 'Sucht Ihr Weisheit? Oder Macht?', 39653),
(208234, 'deDE', 'Wissen ist eine Last und ein Fluch.', 'Wissen ist eine Last und ein Fluch.', 39653),
(208233, 'deDE', 'Das Schicksal eint uns.', 'Das Schicksal eint uns.', 39653),
(208232, 'deDE', 'Wir tun, was die Richterin befiehlt.', 'Wir tun, was die Richterin befiehlt.', 39653),
(208231, 'deDE', 'Nicht jedes Geheimnis muss gelüftet werden.', 'Nicht jedes Geheimnis muss gelüftet werden.', 39653),
(208230, 'deDE', 'Versteckt Euch vorm Gegner, doch nie vor der Wahrheit.', 'Versteckt Euch vorm Gegner, doch nie vor der Wahrheit.', 39653),
(208229, 'deDE', 'Manche Geheimnisse bleiben besser unausgesprochen.', 'Manche Geheimnisse bleiben besser unausgesprochen.', 39653),
(208228, 'deDE', 'Willkommen in der Stadt der Geheimnisse.', 'Willkommen in der Stadt der Geheimnisse.', 39653),
(208227, 'deDE', 'Wir waren völlig unvorbereitet. Die Invasion der Schlundgebundenen hat Jahrhunderte der Produktivität und des Friedens zunichtegemacht.', '', 39653),
(208210, 'deDE', 'Auf ein Wiedersehen.', 'Auf ein Wiedersehen.', 39653),
(208208, 'deDE', 'Der Kerkermeister wird für seine Verbrechen büßen.', 'Der Kerkermeister wird für seine Verbrechen büßen.', 39653),
(208206, 'deDE', 'Dient der Vorsehung gut.', 'Dient der Vorsehung gut.', 39653),
(208204, 'deDE', 'Die Weisheit ist Schwert und Schild.', 'Die Weisheit ist Schwert und Schild.', 39653),
(208203, 'deDE', 'Wir stehen in Eurer Schuld.', 'Wir stehen in Eurer Schuld.', 39653),
(208202, 'deDE', 'Vielleicht kann ich helfen.', 'Vielleicht kann ich helfen.', 39653),
(208201, 'deDE', 'Ich gebe Euch, was ich kann.', 'Ich gebe Euch, was ich kann.', 39653),
(208200, 'deDE', 'Benötigt Ihr Vorräte?', 'Benötigt Ihr Vorräte?', 39653),
(208199, 'deDE', 'Eure Füße betreten geheiligten Boden.', 'Eure Füße betreten geheiligten Boden.', 39653),
(208198, 'deDE', 'Weicht nicht vom Pfad ab.', 'Weicht nicht vom Pfad ab.', 39653),
(208197, 'deDE', 'Schützt, was noch bleibt.', 'Schützt, was noch bleibt.', 39653),
(208196, 'deDE', 'Bewahrt Eure Geheimnisse. Sichert sie.', 'Bewahrt Eure Geheimnisse. Sichert sie.', 39653),
(208195, 'deDE', 'Die Schlundgebundenen werden nicht siegen.', 'Die Schlundgebundenen werden nicht siegen.', 39653),
(208194, 'deDE', 'Folgt der Vorsehung.', 'Folgt der Vorsehung.', 39653),
(208192, 'deDE', '', 'In die Lüfte! Alle Truppen aufs Herz!', 39653),
(208191, 'deDE', '', 'Ich stehe in Eurer Schuld, Sterblicher.', 39653),
(208190, 'deDE', '', 'Wenn Ihr Freund seid und nicht Feind: den Schlüssel zur Zelle hat Verhörer Tzench.', 39653),
(208179, 'deDE', '', 'Ihr seid es, der nichts weiß, Fae. Was kommt, könnt Ihr nicht aufhalten.', 39653),
(208178, 'deDE', 'Ihr wisst nichts von Loyalität, Banshee.', '', 39653),
(208177, 'deDE', '', 'Eine Illusion. Die Winterkönigin schickt also ihre Untertanen vor, um für sie zu sterben.', 39653),
(208176, 'deDE', 'Hier ist nichts für die Augen Sterblicher bestimmt.', 'Hier ist nichts für die Augen Sterblicher bestimmt.', 39653),
(208175, 'deDE', 'Vergesst, was Ihr hier gesehen habt.', 'Vergesst, was Ihr hier gesehen habt.', 39653),
(208174, 'deDE', 'Unsere Pflicht ist heilig, unsere Entschlossenheit ewig.', 'Unsere Pflicht ist heilig, unsere Entschlossenheit ewig.', 39653),
(208173, 'deDE', 'Eindringlinge fallen über uns her.', 'Eindringlinge fallen über uns her.', 39653),
(208172, 'deDE', 'Korthia ist nicht mehr sicher.', 'Korthia ist nicht mehr sicher.', 39653),
(208171, 'deDE', 'Hütet Euch, Feinde der Richterin!', 'Hütet Euch, Feinde der Richterin!', 39653),
(208170, 'deDE', 'Die Vorsehung leitet uns immer.', 'Die Vorsehung leitet uns immer.', 39653),
(208169, 'deDE', 'Wir sind Verteidiger des Wissens.', 'Wir sind Verteidiger des Wissens.', 39653),
(208168, 'deDE', 'Das Archiv darf nicht geöffnet werden.', 'Das Archiv darf nicht geöffnet werden.', 39653),
(208167, 'deDE', 'Sylvanas wurde bei den Fällen gesichtet! Das ist unsere Chance, sie zu besiegen!', '', 39653),
(208163, 'deDE', '', 'Diese Abscheulichkeiten dienen dem Kerkermeister. Wir werden sie zu Staub mahlen.', 39653),
(208123, 'deDE', '', 'Wir treffen uns am Sitz des Primus, $p.', 39653),
(208121, 'deDE', 'Die Tore Torghasts öffnen sich und Kel\'Thuzad entsendet Peiniger in Richtung Tremaculum!', '', 39653),
(208119, 'deDE', '', 'In die Schlacht, Armeen von Maldraxxus! Erkämpft unseren Sieg!', 39653),
(208118, 'deDE', '', 'Wir müssen vorwärts drängen! Schlundgänger, gebt das Signal!', 39653),
(208116, 'deDE', 'Ich muss nach Revendreth. Gute Jagd, Schlundgänger. Lady Khaliiq.', '', 39653),
(208115, 'deDE', '', 'Da wir Verbündete sind, helfe ich. Aber nicht, bevor meine jetzige Mission beendet ist.', 39653),
(208112, 'deDE', '', 'Um ihr einen grausigen Tod zu ersparen, meint Ihr.', 39653),
(208111, 'deDE', 'Wir benötigen andere Nachtkrieger, um ihr mit einem gemeinsamen Ritual zu helfen.', '', 39653),
(208109, 'deDE', 'Der Schlundgänger hat mir aufgetragen, frühere Nachtkrieger zu finden, um ihr zu helfen.', '', 39653),
(208108, 'deDE', 'Tyrande Wisperwind, eine Nachtkriegerin aus meiner Welt, ist in großer Not.', '', 39653),
(208102, 'deDE', 'Dann kommt. Ihr werdet sehen, dass wir einander ebenbürtig sind.', '', 39653),
(208101, 'deDE', 'Ihr stinkt nach Tod, Mensch. Ihr werdet bereuen, Euch gegen mich gewandt zu haben.', '', 39653),
(208100, 'deDE', 'Seid Ihr Euch dessen gewiss, Dämonenjäger? Denkt Ihr, Euer Wille sei wirklich der Eure?', '', 39653),
(208099, 'deDE', 'Ich bin nach zehntausend Jahren endlich frei, aber noch immer denkt mein eigener Bruder, ich wäre ein Schurke! Ich werde ihm meine wahre Macht zeigen! Ich werde ihm beweisen, dass die Dämonen keine Macht über mich haben!', '', 39653),
(208098, 'deDE', '<Uthers Atem geht schwer, während er gegen den Schmerz ankämpft.>', '', 39653),
(208097, 'deDE', 'Dieser Schmerz tief meiner Seele... Ich bin für das Ende bereit.', '', 39653),
(208096, 'deDE', 'Wenn meine Seele geheilt werden kann, dann auch das Zerwürfnis mit den Verschmähten...', '', 39653),
(208082, 'deDE', '', 'Alle Mann vorwärts! Findet die Winterkönigin und mit ihr das Siegel!', 39653),
(208081, 'deDE', 'Wilde Jagd, wir reiten!', '', 39653),
(208080, 'deDE', '', 'Die wahre Winterkönigin schützt das Herz des Waldes. Es liegt jetzt an uns, die Eindringlinge aufzuhalten!', 39653),
(208079, 'deDE', 'Die List wird sie nur kurz täuschen. Wir müssen die Schlacht schnell beenden.', '', 39653),
(208077, 'deDE', '', 'Nur noch eine! Oh, der Zauber muss einfach wirken!', 39653),
(208072, 'deDE', '', 'In der Tat. Und Ihr sagt mir jetzt, wieso.', 39653),
(208071, 'deDE', 'Wir jagen offensichtlich einen Spion aus dem Haus der Augen.', '', 39653),
(208069, 'deDE', 'Ah! $n. Ich habe Euch schon erwartet.', '', 39653),
(208066, 'deDE', 'So nahe... der Heimat...', 'So nahe... der Heimat...', 39653),
(208065, 'deDE', 'Wie... vom Meister... geplant...', 'Wie... vom Meister... geplant...', 39653),
(208064, 'deDE', 'Erbärmliches... sterbliches... Draufgängertum...', 'Erbärmliches... sterbliches... Draufgängertum...', 39653),
(208063, 'deDE', 'Dunkelheit... umfange mich...', 'Dunkelheit... umfange mich...', 39653),
(208062, 'deDE', 'Ihr... erreicht... nichts...', 'Ihr... erreicht... nichts...', 39653),
(208061, 'deDE', 'Alles... nach... Plan...', 'Alles... nach... Plan...', 39653),
(208060, 'deDE', 'Wir... haben bereits... gesiegt...', 'Wir... haben bereits... gesiegt...', 39653),
(208059, 'deDE', 'Der Sieg ist Euch verwehrt.', 'Der Sieg ist Euch verwehrt.', 39653),
(208058, 'deDE', 'Ihr seid unterlegen, Sterblicher.', 'Ihr seid unterlegen, Sterblicher.', 39653),
(207998, 'deDE', '', 'Ah, Kael\'thas. Wie ich sehe, hat Euch die Anklägerin aus Eurem Käfig gelassen.', 39653),
(207997, 'deDE', '', 'Und nicht an Siegen. Könnt Ihr dasselbe behaupten?', 39653),
(207992, 'deDE', 'Ah, ich hatte mich schon gewundert, wo Ihr hin seid!\n\nKein Grund, peinlich berührt zu sein. Ich weiß, dass Ihr Eure Studien vernachlässigt habt. Aber jetzt seid Ihr ja hier! Dann können wir uns ja gleich an die Arbeit machen!', '', 39653),
(207991, 'deDE', '', 'Wir wollen hier Schreckenslords jagen und töten. Versucht, Euch ihnen diesmal nicht anzuschließen.', 39653),
(207989, 'deDE', '', 'Ich war noch nicht mal fünf Minuten in Revendreth und die Anklägerin hat schon dreimal versucht, mich zum \"Büßen\" zu bewegen.\n\nWenn der Primus mich nicht gewarnt hätte, wie gefährlich sie an diesem Ort ist, fände ich es ja glatt amüsant. Ich habe fast Mitleid mit Kael\'thas.', 39653),
(207982, 'deDE', '', 'Ihr wart einst loyal. Ihr solltet es besser wissen, als Euch einzumischen.', 39653),
(207981, 'deDE', '', 'Azeroths kleiner Held will also spielen. Ihr werdet wieder versagen.', 39653),
(207974, 'deDE', '', 'Also hat er endlich den Mut gefunden, sie zu treffen. Ich muss eine würdige Eskorte sammeln.', 39653),
(207972, 'deDE', '', 'Unsere Verbündeten werden immer stärker. Ebenso wie unsere Streitkräfte hier.\n\nDas ist alles Euren Taten zu verdanken, $gSchlundgänger:Schlundgängerin;.', 39653),
(207956, 'deDE', '', 'Haltet die Stellung, bis unsere Truppen zum Angriff bereit sind!', 39653),
(207925, 'deDE', 'Das... ändert... gar nichts...', '', 39653),
(207849, 'deDE', 'Euer sterblicher Körper braucht Ruhe, nicht wahr?', 'Euer sterblicher Körper braucht Ruhe, nicht wahr?', 39653),
(207848, 'deDE', 'Seid gegrüßt. Ich bin der Wächter des Portalsteins. Schon vor der Katastrophe war es meine heilige Pflicht, zu warten und zu wachen, bis diejenigen kommen, die den Stein benutzen könnten.', 'Seid gegrüßt. Ich bin die Wächterin des Portalsteins. Schon vor der Katastrophe war es meine heilige Pflicht, zu warten und zu wachen, bis diejenigen kommen, die den Stein benutzen könnten.', 39653),
(207847, 'deDE', 'Ich diene der Vorsehung, indem ich repariere und in Ordnung bringe, was zerbrochen ist. Erlaubt mir, Euch zu unterstützen.', 'Ich diene der Vorsehung, indem ich repariere und in Ordnung bringe, was zerbrochen ist. Erlaubt mir, Euch zu unterstützen.', 39653),
(207846, 'deDE', 'Diese Mächte sollen mir gehören!', '', 39653),
(207844, 'deDE', 'Ein leerer Sieg. Ihr werdet dem Unausweichlichen erliegen.', '', 39653),
(207843, 'deDE', 'Dieser Turm wird Eure ewige Qual sein.', '', 39653),
(207837, 'deDE', 'Schlundgänger, Polemarch Adrestes bringt finstere Kunde aus der Bastion. Man braucht Euch sofort in Oribos.', '', 39653),
(207836, 'deDE', 'Sie haben uns kalt erwischt. Der Kerkermeister ist inzwischen mächtiger, als wir es uns je hätten vorstellen können.', '', 39653),
(207820, 'deDE', '', 'Die Nekrolords ziehen gegen den Altar der Herrschaft. Stoßt zu uns und führt uns an!', 39653),
(207485, 'deDE', '', 'Meine Eltern ließen mich hier, um von den Mönchen zu lernen. Doch ich will einfach nur mit meinen Haustieren Kämpfe veranstalten! Habt Ihr Haustiere?', 39653),
(207484, 'deDE', '', 'Endlich geht es mal rund!', 39653),
(207483, 'deDE', '', 'Gewonnen! Ich wusste, ich kann es schaffen!', 39653),
(207482, 'deDE', '', 'Ihr habt gewonnen, aber ich bin trotzdem die Beste.', 39653),
(207481, 'deDE', '', 'Auf sie!', 39653),
(207480, 'deDE', '', 'Och, wie unfair!', 39653),
(207479, 'deDE', '', 'Ja! Hurra!', 39653),
(207478, 'deDE', '', 'Grüße und herzlich willkommen zum Mythic Dungeon Invitational!\n\nIch kann Euch direkt zu sämtlichen Shadowlands-Dungeons teleportieren.\n\nVergewissert Euch, dass Ihr den mythischen Schwierigkeitsgrad aktiviert habt, bevor Ihr teleportiert.', 39653),
(207477, 'deDE', 'Ich möchte zu den Blutigen Tiefen (Dungeon) teleportieren.', 'Ich möchte zu den Blutigen Tiefen (Dungeon) teleportieren.', 39653),
(207476, 'deDE', 'Ich möchte zur Andren Seite (Dungeon) teleportieren.', 'Ich möchte zur Andren Seite (Dungeon) teleportieren.', 39653),
(207475, 'deDE', 'Ich möchte zum Theater der Schmerzen (Dungeon) teleportieren.', 'Ich möchte zum Theater der Schmerzen (Dungeon) teleportieren.', 39653),
(207474, 'deDE', 'Ich möchte zu den Spitzen des Aufstiegs (Dungeon) teleportieren.', 'Ich möchte zu den Spitzen des Aufstiegs (Dungeon) teleportieren.', 39653),
(207470, 'deDE', 'Ich möchte zur Nekrotischen Schneise (Dungeon) teleportieren.', 'Ich möchte zur Nekrotischen Schneise (Dungeon) teleportieren.', 39653),
(207462, 'deDE', 'Wie es scheint, könnt Ihr dies nutzen, um Euch selbst die Animaboni zu entziehen.', 'Wie es scheint, könnt Ihr dies nutzen, um Euch selbst die Animaboni zu entziehen.', 39653),
(207449, 'deDE', '|TInterface\\ICONS\\ABILITY_ROGUE_BLOODYEYE.BLP:20|t Zo\'phex markiert Euch für die |cFFFF0000|Hspell:347949|h[Eindämmungszelle]|h|r!', '|TInterface\\ICONS\\ABILITY_ROGUE_BLOODYEYE.BLP:20|t Zo\'phex markiert Euch für die |cFFFF0000|Hspell:347949|h[Eindämmungszelle]|h|r!', 39653),
(207432, 'deDE', '$n bereitet ein besonders opulentes Dunkelmond-Festmahl zu!', '$n bereitet ein besonders opulentes Dunkelmond-Festmahl zu!', 39653),
(207395, 'deDE', 'Wir tun, was die Lebenden nicht vermögen.', '', 39653),
(207394, 'deDE', 'Der Tod allein kann uns nicht aufhalten.', '', 39653),
(207393, 'deDE', 'Wir sind gestorben, damit andere leben können.', '', 39653),
(207392, 'deDE', 'Was ist Euer Begehr?', '', 39653),
(207387, 'deDE', 'Versprühen', 'Versprühen', 39653),
