(206972, 'deDE', 'Seid Ihr sicher, dass Ihr die Hallen der Sühne verlassen möchtet?', 'Seid Ihr sicher, dass Ihr die Hallen der Sühne verlassen möchtet?', 39653),
(206946, 'deDE', 'Glaubt Ihr, Ihr seid ein Trendsetter? Besucht Warpweber Ta\'oren oder andere Transmogrifizierer, um am großen Stylecheck teilzunehmen!', 'Glaubt Ihr, Ihr seid ein Trendsetter? Besucht Warpweber Ta\'oren oder andere Transmogrifizierer, um am großen Stylecheck teilzunehmen!', 39653),
(206907, 'deDE', 'Meister des Konflikts', 'Meister des Konflikts', 39653),
(206906, 'deDE', 'Wenn Ihr Zeit für Gespräche habt, dann habt Ihr auch Zeit für das Training! Müßiggang ist keine Option!', '', 39653),
(206905, 'deDE', 'Es ist Eure Pflicht als Vorbild für die Soldaten, die anderen in die Schlacht zu führen. Zeigt ihnen die wahre Bedeutung von Stärke!', '', 39653),
(206904, 'deDE', 'Es wäre dem Primus eine Ehre, an Eurer Seite zu kämpfen, $p.', '', 39653),
(206903, 'deDE', 'Die Feinde werden Euren Namen kennen, $n! Und dieser Name wird ihre Herzen mit Furcht erfüllen!', '', 39653),
(206902, 'deDE', '$p, solltet Ihr im Kampf fallen, dann lasst Euer Opfer den Sieg sichern!', '', 39653),
(206900, 'deDE', '|cfff2e699$1i Seelen befreit|r', '|cfff2e699$1i Seelen befreit|r', 39653),
(206888, 'deDE', '', 'Aus dem Schlund entkommt Ihr nie!', 39653),
(206671, 'deDE', 'Könnt Ihr meine Ausrüstung reparieren?', 'Könnt Ihr meine Ausrüstung reparieren?', 39653),
(206637, 'deDE', 'Diesen Durchgang abbrechen und nach Torghast zurückkehren?', 'Diesen Durchgang abbrechen und nach Torghast zurückkehren?', 39653),
(206633, 'deDE', 'Torghast verlassen und zum Schlund zurückkehren?', 'Torghast verlassen und zum Schlund zurückkehren?', 39653),
(206602, 'deDE', 'Kehrt zu den Ogerruinen zurück!', 'Kehrt zu den Ogerruinen zurück!', 39653),
(206592, 'deDE', 'Die Zeit für Grafen ist vorbei. Revendreth dient jetzt einem Hof.', '', 39653),
(206573, 'deDE', '|cffb27fe5-$1i Stygia|r', '|cffb27fe5-$1i Stygia|r', 39653),
(206533, 'deDE', '', 'Ihr dürft wegtreten.', 39653),
(206531, 'deDE', '', 'Ihr sprecht mit einer Prinzessin!', 39653),
