(206342, 'deDE', 'Zwiesprache halten', 'Zwiesprache halten', 39653),
(206123, 'deDE', '', 'Der Primus bewahrt in Maldraxxus die Ordnung, und in diesem Graben hat er jene vernichtet, die ihn stürzen wollten. Ehrt seine Macht im Kampf.', 39653),
(206121, 'deDE', '', 'Ehrgeiz wird in Maldraxxus sehr geschätzt. Doch es gibt Zeiten, in denen dieser Ehrgeiz zu Konflikten führt.', 39653),
(206015, 'deDE', 'Ihr geht schon?', '', 39653),
(206009, 'deDE', 'Blut und Ruhm! Seid Ihr bereit, in der Arena zu kämpfen?', '', 39653),
(205922, 'deDE', '|TInterface\\ICONS\\Creatureportrait_portal_eyeofthestormhorde.blp:20|t Ihr wurdet als Ziel von|cFFFF0000|Hspell:328437|h [Dimensionenriss]|h|r ausgewählt!', '|TInterface\\ICONS\\Creatureportrait_portal_eyeofthestormhorde.blp:20|t Ihr wurdet als Ziel von|cFFFF0000|Hspell:328437|h [Dimensionenriss]|h|r ausgewählt!', 39653),
