(205333, 'deDE', 'Hassh tak heeeek ta!', '', 39653),
(205332, 'deDE', 'Ich sollte dankbar sein... doch das kann ich schon lange nicht mehr...', '', 39653),
(205331, 'deDE', 'Ich dich quetschen und fressen!', '', 39653),
(205329, 'deDE', 'Braaaagh!', '', 39653),
