(205263, 'deDE', '|TInterface\\ICONS\\Spell_Fire_Immolation.blp:20|tSorgt dafür, dass Ihr nicht zu viele Stapel von |cFFFF0000|Hspell:326456|h[Brennende Überreste]|h|r ansammelt!', '|TInterface\\ICONS\\Spell_Fire_Immolation.blp:20|tSorgt dafür, dass Ihr nicht zu viele Stapel von |cFFFF0000|Hspell:326456|h[Brennende Überreste]|h|r ansammelt!', 39653),
(205262, 'deDE', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Beam.BLP:20|tKael\'thas kann nicht geheilt werden, während der Schemen von Kael\'thas anwesend ist!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Beam.BLP:20|tKael\'thas kann nicht geheilt werden, während der Schemen von Kael\'thas anwesend ist!', 39653),
(205261, 'deDE', '|TInterface\\ICONS\\Ability_Gouge.blp:20|tSorgt dafür, dass Ihr nicht zu viele Stapel von |cFFFF0000|Hspell:325442|h[Bezwungen]|h|r ansammelt!', '|TInterface\\ICONS\\Ability_Gouge.blp:20|tSorgt dafür, dass Ihr nicht zu viele Stapel von |cFFFF0000|Hspell:325442|h[Bezwungen]|h|r ansammelt!', 39653),
(205260, 'deDE', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Nova.BLP:20|tUnterbrecht das |cFFFF0000|Hspell:333002|h[Vulgäre Brandmal]|h|r der üblen Okkultisten!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Nova.BLP:20|tUnterbrecht das |cFFFF0000|Hspell:333002|h[Vulgäre Brandmal]|h|r der üblen Okkultisten!', 39653),
(205259, 'deDE', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Wave.BLP:20|tIhr seid Ziel von |cFFFF0000|Hspell:328885|h[Große Züchtigung]|h|r!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Wave.BLP:20|tWenn Ihr Ziel von |cFFFF0000|Hspell:328885|h[Große Züchtigung]|h|r seid, dann entfernt Euch von Euren Verbündeten!', 39653),
(205258, 'deDE', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Buff.BLP:20|tSammelt Infusionskugeln ein, um |cFFFF0000|Hspell:326078|h[Gabe der Infusorin]|h|r zu erhalten!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Buff.BLP:20|tSammelt Infusionskugeln ein, um |cFFFF0000|Hspell:326078|h[Gabe der Infusorin]|h|r zu erhalten!', 39653),
(205257, 'deDE', '|TInterface\\ICONS\\ability_warlock_SoulLink.blp:20|tSeeleninfusorinnen fügen Kael\'thas Schaden zu!', '|TInterface\\ICONS\\ability_warlock_SoulLink.blp:20|tSeeleninfusorinnen fügen Kael\'thas Schaden zu!', 39653),
(205256, 'deDE', '|TInterface\\ICONS\\Spell_Fire_SelfDestruct.blp:20|tWenn Ihr Ziel von |cFFFF0000|Hspell:325873|h[Glutexplosion]|h|r seid, dann nähert Euch Verbündeten, um den Schaden aufzuteilen!', '|TInterface\\ICONS\\Spell_Fire_SelfDestruct.blp:20|tWenn Ihr Ziel von |cFFFF0000|Hspell:325873|h[Glutexplosion]|h|r seid, dann nähert Euch Verbündeten, um den Schaden aufzuteilen!', 39653),
(205255, 'deDE', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|tIhr seid Ziel von |cFFFF0000|Hspell:341473|h[Blutroter Schlaghagel]|h|r!', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|tWenn Ihr Ziel von |cFFFF0000|Hspell:326583|h[Blutroter Schlaghagel]|h|r seid, dann entfernt Euch von Euren Verbündeten!', 39653),
(205254, 'deDE', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|tIhr seid Ziel von |cFFFF0000|Hspell:326583|h[Blutroter Schlaghagel]|h|r!', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|tWenn Ihr Ziel von |cFFFF0000|Hspell:326583|h[Blutroter Schlaghagel]|h|r seid, dann entfernt Euch von Euren Verbündeten!', 39653),
(205224, 'deDE', 'Übergang in die Schattenlande', 'Übergang in die Schattenlande', 39653),
(205223, 'deDE', 'Rückkehr zum Leben', 'Rückkehr zum Leben', 39653),
(205211, 'deDE', 'Ich habe genau das, was helfen könnte. Seht in meinem Inventar nach.', '', 39653),
(205208, 'deDE', '', 'Ihr habt es gefunden?\nNun, wie schön für Euch.\n\nWisst Ihr was? Ihr habt Euch etwas verdient...\n\n<Tabithia klatscht auf extrem langsame Art genau ein Mal in die Hände.>\n\nSo, nun fort mit Euch! Ich bin hier ziemlich beschäftigt, wisst Ihr... in den Trümmern meines Heims.', 39653),
(205207, 'deDE', '', 'Ja, ein riesiger! Ist direkt unter meinen Möbeln aus dem Boden gekrochen. Das Ei muss wohl irgendeine Art Geruch verströmt haben, denn der Gorm hat alles andere ignoriert. Er hat sich einfach das Ei geschnappt und es verschluckt.\n\nSolange Ihr keinen außergewöhnlichen Geruchssinn habt, werdet Ihr das Ding nie finden. Sagt dem Mittler am besten, dass sein Kleinod fort ist.\n\nUnd wenn Ihr mich jetzt bitte entschuldigen würdet... ich muss mich hier noch etwas in Selbstmitleid suhlen.', 39653),
(205206, 'deDE', '', 'Ihr seid wohl im Auftrag dieses Mittlers hier, was?\n\nIhr seid zu spät... ein verdammter Gorm hat es gefressen.', 39653),
(205118, 'deDE', '<Bleibt ein Weilchen und hört zu.>', '<Bleibt ein Weilchen und hört zu.>', 39653),
(204881, 'deDE', 'Frakturkammern', 'Frakturkammern', 39653),
(204758, 'deDE', 'Das sind die Waffen der Nekrolords.', '', 39653),
(204757, 'deDE', 'Verteidigt die Reiche des Todes.', '', 39653),
(204756, 'deDE', 'Standhaftigkeit.', '', 39653),
(204755, 'deDE', 'Kämpft immer zum Wohle des Reichs.', '', 39653),
(204754, 'deDE', 'Dominanz.', '', 39653),
(204753, 'deDE', 'Konzentration.', '', 39653),
(204715, 'deDE', 'Bringt mich zu Kel\'Thuzad.', 'Bringt mich zu Kel\'Thuzad.', 39653),
(204605, 'deDE', '', 'Hebt Euer Schwert, Champion! Für Maldraxxus!', 39653),
(204583, 'deDE', '%s hat wie ein guter Junge sein Geschäft in der Ecke verrichtet.', '%s hat wie ein guter Junge sein Geschäft in der Ecke verrichtet.', 39653),
(204581, 'deDE', '%s schnüffelt herum.', '%s schnüffelt herum.', 39653),
(204525, 'deDE', 'Kooomm, Miez, Miez.', '', 39653),
(204524, 'deDE', 'Alles läuft nach Plan.', '', 39653),
(204523, 'deDE', 'Der Sieg des Todes ist nahe.', '', 39653),
(204522, 'deDE', 'Gehorcht dem Willen von Kel\'Thuzad!', '', 39653),
(204521, 'deDE', 'Verschwendet besser nicht meine Zeit!', '', 39653),
(204520, 'deDE', 'Nun? Was gibt es?', '', 39653),
(204519, 'deDE', 'Ihr dürft nun zu Eurem Meister sprechen.', '', 39653),
(204493, 'deDE', 'Erzählt mir Eure Geschichte.', 'Erzählt mir Eure Geschichte.', 39653),
(204403, 'deDE', '', 'Kommt, Lich. Der Verbannte ruft Euch zu sich.', 39653),
(204402, 'deDE', 'Sein Schicksal liegt nicht in Eurer Hand.', '', 39653),
(204401, 'deDE', 'Was?! Wir können nicht gehen! Nicht, solange Kel\'Thuzad noch lebt. Ich will Rache für Silbermond!', '', 39653),
(204400, 'deDE', 'Das Medaillon ist unser. Kehren wir nach Revendreth zurück.', '', 39653),
(204399, 'deDE', 'Törichte Markgräfin. Euer Sieg zählt rein gar nichts.', '', 39653),
(204398, 'deDE', '', 'Ihr büßt für Eure Verbrechen gegen Maldraxxus... und gegen mich.', 39653),
(204397, 'deDE', '', 'Es ist vorbei, Thronräuber!', 39653),
(204396, 'deDE', 'Wir sind nicht die, die Ihr fürchten müsst, Kel\'Thuzad!', '', 39653),
(204395, 'deDE', 'Eindringlinge! Ihr entkommt Eurer Strafe nicht!', '', 39653),
(204394, 'deDE', 'Grüße, Baronin. Revendreth steht Euch bei!', '', 39653),
(204391, 'deDE', '', 'Nekrolords, haltet die Stellung! Maldraxxus wird nicht fallen!', 39653),
(204389, 'deDE', 'Die Bestie verbrennt unsere Truppen! Wir werden überrant!', '', 39653),
(204386, 'deDE', 'Ihr seid zu spät! Der Pfad ist offen!', '', 39653),
(204353, 'deDE', '', 'Für Maldraxxus.', 39653),
(204352, 'deDE', '', 'Erringt den Sieg um jeden Preis.', 39653),
(204351, 'deDE', '', 'Was möchtet Ihr wissen?', 39653),
(204350, 'deDE', '', 'Ihr dürft sprechen, Sterblicher.', 39653),
(204346, 'deDE', '$gSchlundgänger:Schlundgängerin;! Spielchen Fangt-den-Gräber gefällig?\n\nHab mich richtig gut eingeschmiert, aber keiner will mich jagen!\n\nOder vielleicht ein Hechtsprung in die gute alte Schlammlache, um Eure sterblichen Knochen zu entspannen?', '', 39653),
(204170, 'deDE', '<Gebt 4 Steinziegel.>', '<Gebt 4 Steinziegel.>', 39653),
(203954, 'deDE', '', 'Wir sind hier fertig.', 39653),
(203953, 'deDE', '', 'Niederlagen sind inakzeptabel.', 39653),
(203952, 'deDE', '', 'Wir werden Maldraxxus um jeden Preis beherrschen.', 39653),
(203951, 'deDE', '', 'Stellt meine Geduld nicht auf die Probe.', 39653),
(203950, 'deDE', '', 'Für Narren habe ich keine Zeit.', 39653),
(203949, 'deDE', '', 'Was gibt es?', 39653),
(203915, 'deDE', 'Gut. Wir haben unsere Waffe. Jetzt schärfen wir sie.', '', 39653),
(203913, 'deDE', '', 'Gebt ihn mir. Ihr habt gesehen, wozu er fähig ist, wenn er an etwas glaubt. Mit etwas Geduld erzielen wir... bessere Ergebnisse.', 39653),
(203912, 'deDE', '...Wichtig ist nur, dass wir jetzt das nötige Instrument haben. Beginnen wir mit der Vorbereitung.', '', 39653),
(203907, 'deDE', 'Los!', 'Los!', 39653),
(203906, 'deDE', '1...', '1...', 39653),
(203905, 'deDE', '2...', '2...', 39653),
(203904, 'deDE', '3...', '3...', 39653),
(203890, 'deDE', 'Mephiles! Ihr inkompetenter Narr!', '', 39653),
(203824, 'deDE', '', 'Zenturionen! Vorwärts! Tod den Eindringlingen!', 39653),
(203811, 'deDE', 'Vertraut auf die Vorsehung.', '', 39653),
(203810, 'deDE', 'Gesegnet sei ihre Stimme.', '', 39653),
(203809, 'deDE', 'Das Schicksal führt uns alle.', '', 39653),
(203808, 'deDE', 'Bitte haltet unsere Korridore sauber.', '', 39653),
(203807, 'deDE', 'Die Ewige Stadt muss beschützt werden.', '', 39653),
(203806, 'deDE', 'Der Vorsehung muss gefolgt werden.', '', 39653),
(203804, 'deDE', 'Wonach sucht Ihr?', '', 39653),
(203803, 'deDE', 'Die Richterin wacht über alle.', '', 39653),
(203802, 'deDE', 'Ich wurde angewiesen, Euch zu helfen.', '', 39653),
(203801, 'deDE', 'Ihr seid in Oribos willkommen.', '', 39653),
(203800, 'deDE', 'Bitte lasst mich allein... ganz allein in der Nacht.', '', 39653),
(203779, 'deDE', 'Ja... Ihr habt recht. Ich kann solche Macht nicht beherrschen. Aber wir können das.', '', 39653),
(203778, 'deDE', '', 'Ja, Prinz Renathal. Ihr kennt ihn doch. Und das, was die Machtgier aus ihm gemacht hat.', 39653),
(203777, 'deDE', 'Ihr kennt meine Macht. Nehmt sie an. Seid wieder eins mit mir.', '', 39653),
(203776, 'deDE', 'Renathal...', '', 39653),
(203775, 'deDE', '', 'Wird das denn reichen? Noch haben wir nicht alle Medaillons.', 39653),
(203774, 'deDE', 'Noch nicht. Dann verlieren wir mehr als nur diese Zitadelle.', '', 39653),
(203773, 'deDE', '', 'Kel\'Thuzads Schergen brechen bald durch die Außenmauer. Wir sollten uns zurückziehen.', 39653),
(203766, 'deDE', '|TInterface\\ICONS\\Ability_Fixated_State_Green.blp:20|t Ein flüchtiger Geist fixiert sich auf Euch!', '|TInterface\\ICONS\\Ability_Fixated_State_Green.blp:20|t Ein flüchtiger Geist fixiert sich auf Euch!', 39653),
(203716, 'deDE', 'Lasst sie... nicht... aaarrggghh!', 'Lasst sie... nicht... aaarrggghh!', 39653),
(203714, 'deDE', '', 'Wir haben ihn! FEUER!', 39653),
(203713, 'deDE', 'Schützt den Markgrafen!', 'Schützt den Markgrafen!', 39653),
(203712, 'deDE', 'Nutzlose Narren! Schützt Euer Haus!', 'Nutzlose Narren! Schützt Euer Haus!', 39653),
(203711, 'deDE', 'GRAAAAHH!', 'GRAAAAHH!', 39653),
(203688, 'deDE', 'Was für eine Darbietung!', '', 39653),
(203629, 'deDE', '', 'Er paktiert mit fremden Mächten und trotzt dem Willen des Primus! Heute wird er für seine Taten büßen!', 39653),
(203628, 'deDE', '', 'Verteidiger von Maldraxxus! Mit Lüge und Verrat hat Kel\'Thuzad unsere stolzen Häuser gegeneinander aufgewiegelt.', 39653),
(203508, 'deDE', 'Für Maldraxxus!', '', 39653),
(203507, 'deDE', 'Der Sieg wird nicht einem Haus allein gehören, sondern durch die Kraft unseres Paktes errungen.', '', 39653),
(203501, 'deDE', 'Pflicht ist der Mantel all derer, die dienen.', '', 39653),
(203498, 'deDE', 'Macht ohne Kontrolle ist verschwendet.', '', 39653),
(203497, 'deDE', 'Der Feind ist überall, auch unter uns.', '', 39653),
(203496, 'deDE', 'Konzentration. Strategie. Unerbittlichkeit.', '', 39653),
(203495, 'deDE', 'Die Instrumente... der Herrschaft.', '', 39653),
(203494, 'deDE', '...eine Krone für den König der Verdammten.', '', 39653),
(203493, 'deDE', 'Ja. Eure beste Gramklinge...', '', 39653),
(203492, 'deDE', 'Das Geheimnis, das die Ersten zu verbergen suchten.', '', 39653),
(203491, 'deDE', 'Den besten Entwurf... ich will den letzten Schatz.', '', 39653),
(203490, 'deDE', '<schreit vor Schmerz>', '', 39653),
(203489, 'deDE', 'Dennoch brauche ich... mehr.', '', 39653),
(203488, 'deDE', 'Unzählige Euch entrissene Geheimnisse. Perfide Waffen für meine Armeen.', '', 39653),
(203487, 'deDE', 'Aber selbst gebrochen könnt Ihr mir noch dienen.', '', 39653),
(203486, 'deDE', 'Narr. Euer Geist ist schon gebrochen.', '', 39653),
(203485, 'deDE', 'Ich breche nicht... Ich breche nicht... Ich breche...', '', 39653),
(203484, 'deDE', 'Seht Euch an. Erbärmlich. Eine Puppe an Fäden.', '', 39653),
(203483, 'deDE', '<Stöhnt>', '', 39653),
(203458, 'deDE', '', 'Nun... Es ist Zeit, dass wir alle mit Euch singen.', 39653),
(203457, 'deDE', '', 'Einst sagte ich, dass Eure Stimme wie ein Vogel in der Nacht klingt.', 39653),
(203405, 'deDE', 'Stechen', 'Stechen', 39653),
(203399, 'deDE', 'Genießt den Hof, wenn Ihr möchtet.', 'Genießt den Hof, wenn Ihr möchtet.', 39653),
(203393, 'deDE', 'Baine! Nein!', '', 39653),
(203356, 'deDE', 'Unwürdig.', '', 39653),
(203355, 'deDE', 'Armseliger Sterblicher. Euer Geist ist so...', '', 39653),
(203324, 'deDE', 'Wir alle müssen unsere Pflicht tun.', '', 39653),
(203309, 'deDE', 'Es gibt viel zu tun.', '', 39653),
(203307, 'deDE', 'Gemeinsam trotzen wir der Finsternis.', '', 39653),
(203306, 'deDE', 'Ich werde Euch helfen, so gut ich kann.', '', 39653),
(203305, 'deDE', 'Gibt es Neuigkeiten?', '', 39653),
(203304, 'deDE', 'Was auch kommt, wir sind stark.', '', 39653),
(203303, 'deDE', 'Wir tragen noch die Ketten der Vergangenheit.', '', 39653),
(203302, 'deDE', 'Ich fürchte, dunklere Tage stehen noch bevor.', '', 39653),
(203301, 'deDE', 'Wir alle haben unsere Last zu tragen.', '', 39653),
(203300, 'deDE', 'Viel wurde uns abverlangt. Noch mehr ist nötig.', '', 39653),
(203299, 'deDE', 'Kämpft für Azeroth.', '', 39653),
(203297, 'deDE', '', 'Mama Tomalin heißt Euch willkommen!', 39653),
(203296, 'deDE', '', 'Mein Essen ist das Beste in Maldraxxus. Probiert mal!', 39653),
(203295, 'deDE', '', 'Entspannt Euch, trinkt, esst. Hier sind alle Freunde.', 39653),
(203294, 'deDE', '', 'Mama Tomalin ist immer für Euch da!', 39653),
(203261, 'deDE', 'Das Gleichgewicht muss wiederhergestellt werden.', '', 39653),
(203171, 'deDE', 'Denkt an diese Lektion.', '', 39653),
(203169, 'deDE', 'ICH... BIN... REVENDRETH!', '', 39653),
(203168, 'deDE', 'Ich bin Euer MEISTER!', '', 39653),
(203167, 'deDE', 'Ich bin ewig!', '', 39653),
(203166, 'deDE', 'Ihr könnt mich hier nicht binden!', '', 39653),
(203164, 'deDE', '', 'Sollen wir anfangen?', 39653),
(203163, 'deDE', 'Die Zeit ist reif, Euch an Revendreths edlen Zweck zu erinnern.', '', 39653),
(203160, 'deDE', 'Ihr habt immer darauf bestanden, dass wir Venthyr nicht zerstören. Wir erziehen.', '', 39653),
(203157, 'deDE', 'Der Rest von Euch durchkämmt die Felder. Füllt die Leichendepots!', 'Der Rest von Euch durchkämmt die Felder. Füllt die Leichendepots!', 39653),
(203156, 'deDE', 'Ergreift diesen Narren!', 'Ergreift diesen Narren!', 39653),
(203154, 'deDE', 'Kommt her, Verräter! Das Haus der Konstrukte wird fallen!', '', 39653),
(203153, 'deDE', 'Geht vor. Ich sorge für Ablenkung.', '', 39653),
(203151, 'deDE', 'Stellt Euch tot. Leichen sammeln sie immer ein. Für neue Teile.', '', 39653),
(203140, 'deDE', 'Zeit für eine neue Strategie.', '', 39653),
(203139, 'deDE', 'Gewalt nutzt uns hier nichts. Es sind zu viele.', '', 39653),
(203135, 'deDE', 'Ergebt Euch dem Unvermeidlichen!', '', 39653),
(203116, 'deDE', 'Erzählt mir mehr darüber, wie man Neulingen unter die Arme greift.', 'Erzählt mir mehr darüber, wie man Neulingen unter die Arme greift.', 39653),
(203046, 'deDE', '', 'Fragt mich nicht andauernd. Ich bin doch kein... graues Orakel.', 39653),
(203044, 'deDE', '', 'Willkommen in Oribos.', 39653),
(203043, 'deDE', '', 'Jede Seele hat ihren Platz.', 39653),
(203042, 'deDE', '', 'Die Richterin sieht alles.', 39653),
(203041, 'deDE', '', 'Wie kann ich Euch helfen?', 39653),
(203040, 'deDE', '', 'Die Vorsehung hat Euch hergeführt.', 39653),
(203039, 'deDE', '', 'Die Ewige Stadt muss überdauern.', 39653),
(203034, 'deDE', '', 'Den Verräter Denathrius entlarvt und den Schrecken des Schlunds getrotzt.', 39653),
(203011, 'deDE', '', 'Wir alle spielen unsere Rolle.', 39653),
(203010, 'deDE', '', 'Das Schicksal leitet Eure Hand.', 39653),
(203004, 'deDE', '', 'Gesegnet sei ihre Stimme.', 39653),
(203003, 'deDE', '', 'Vertraut auf die Vorsehung.', 39653),
(202995, 'deDE', 'Der manische Mortimer hat sich für die Wissenschaft dreigeteilt. Solche Erinnerungen sind im Training Gold wert!', '', 39653),
(202860, 'deDE', '|cfff2e699+Bonuszufriedenheit (Theotar)|r', '|cfff2e699+Bonuszufriedenheit (Theotar)|r', 39653),
(202857, 'deDE', '', 'Wer hätte gedacht, dass ein Provost und sein Goliath DAS schaffen!', 39653),
(202850, 'deDE', '', 'Ich freue mich schon auf Brons Kampftechnik. Vielleicht könnte ich ja mal mit ihm üben?', 39653),
(202836, 'deDE', '', 'Passt auf, wo Ihr hintretet!', 39653),
(202828, 'deDE', '', 'Sieht aus, als hat Euer Goliath ein paar Schrauben locker.', 39653),
(202754, 'deDE', 'Nein... ich habe das, was ich brauche.', '', 39653),
(202753, 'deDE', 'Ihr... habt versagt.', '', 39653),
(202751, 'deDE', 'Interessant...\n', '', 39653),
(202750, 'deDE', 'Das Licht ist mit mir... sogar hier.', '', 39653),
(202749, 'deDE', 'Los, Champion! Los!', '', 39653),
(202747, 'deDE', 'Sie haben gestoppt...', '', 39653),
(202746, 'deDE', 'Gar nichts entkommt dem Schlund.', '', 39653),
(202739, 'deDE', 'Ich möchte zu Lady Inerva Dunkelader teleportiert werden.', 'Ich möchte zu Lady Inerva Dunkelader teleportiert werden.', 39653),
(202738, 'deDE', 'Ich möchte zu Schloss Nathria (Schlachtzug) teleportiert werden.', 'Ich möchte zu Schloss Nathria (Schlachtzug) teleportiert werden.', 39653),
(202730, 'deDE', 'Rupfen', '', 39653),
(202699, 'deDE', '|TINTERFACE\\ICONS\\INV_SpiderMount.blp:20|t Domina ruft tödliche |cFFFF0404|Hspell:332313|h[Brutassassinen]|h|r in die Schlacht!', '|TINTERFACE\\ICONS\\INV_SpiderMount.blp:20|t Domina ruft tödliche |cFFFF0404|Hspell:332313|h[Brutassassinen]|h|r in die Schlacht!', 39653),
(202676, 'deDE', 'Ich möchte zur Rettung des Sonnenkönigs teleportiert werden.', 'Ich möchte zur Rettung des Sonnenkönigs teleportiert werden.', 39653),
(202675, 'deDE', 'Ich möchte zum Rat des Blutes teleportiert werden.', 'Ich möchte zum Rat des Blutes teleportiert werden.', 39653),
(202674, 'deDE', 'Ich möchte zu den Generälen der Steinlegion teleportiert werden.', 'Ich möchte zu den Generälen der Steinlegion teleportiert werden.', 39653),
(202673, 'deDE', 'Ich möchte zu Konstrukteur Xy\'mox teleportiert werden.', 'Ich möchte zu Konstrukteur Xy\'mox teleportiert werden.', 39653),
(202672, 'deDE', 'Ich möchte zu Jäger Altimor teleportiert werden.', 'Ich möchte zu Jäger Altimor teleportiert werden.', 39653),
(202671, 'deDE', 'Ich möchte zum hungernden Zerstörer teleportiert werden.', 'Ich möchte zum hungernden Zerstörer teleportiert werden.', 39653),
(202670, 'deDE', 'Ich möchte zu Graf Denathrius teleportiert werden.', 'Ich möchte zu Graf Denathrius teleportiert werden.', 39653),
(202669, 'deDE', 'Ich möchte zu Schlickfaust teleportiert werden.', 'Ich möchte zu Schlickfaust teleportiert werden.', 39653),
(202668, 'deDE', 'Ich möchte zu Schrillschwinge teleportiert werden.', 'Ich möchte zu Schrillschwinge teleportiert werden.', 39653),
(202544, 'deDE', '', 'Die Masken... was sind sie?', 39653),
(202543, 'deDE', '', 'Das kann nicht wahr sein...', 39653),
(202542, 'deDE', '', 'So viele fort...', 39653),
(202541, 'deDE', '', 'Mein Hain... meine Freunde...', 39653),
(202540, 'deDE', '', 'Wir haben keine Zeit zu verlieren.', 39653),
(202539, 'deDE', '', 'Der Königin sei Dank, Ihr seid da.', 39653),
(202538, 'deDE', '', 'Wir müssen retten, wen wir können!', 39653),
(202537, 'deDE', '', 'Warum greifen sie uns an?', 39653),
(202440, 'deDE', 'Lasst uns von hier verschwinden.', 'Lasst uns von hier verschwinden.', 39653),
(202402, 'deDE', 'Markieren', 'Markieren', 39653),
(202374, 'deDE', 'Seid Ihr sicher, dass Ihr die Blutigen Tiefen verlassen möchtet?', 'Seid Ihr sicher, dass Ihr die Blutigen Tiefen verlassen möchtet?', 39653),
(202336, 'deDE', 'Ich muss schon sagen, äußerst enttäuschend.', '', 39653),
(202335, 'deDE', 'Wie schrecklich vorhersehbar.', '', 39653),
(202332, 'deDE', '<Unheimliches Lachen - kurz>', '', 39653),
(202304, 'deDE', '|cfff2e699+Bonuszufriedenheit|r', '|cfff2e699+Bonuszufriedenheit|r', 39653),
(202303, 'deDE', '|cff34cceb+Bonuszeit|r', '|cff34cceb+Bonuszeit|r', 39653),
(202301, 'deDE', '%s wird resistent gegen Kontrollverlusteffekte!', '%s wird resistent gegen Kontrollverlusteffekte!', 39653),
(202112, 'deDE', '|TInterface\\Icons\\ABILITY_HUNTER_ASSASSINATE2.BLP:20|t Ihr wurdet als Ziel von |cFFFF0000|Hspell:335114|h[Sündensucher]|h|r markiert!', '|TInterface\\Icons\\ABILITY_HUNTER_ASSASSINATE2.BLP:20|t Ihr wurdet als Ziel von |cFFFF0000|Hspell:335114|h[Sündensucher]|h|r markiert!', 39653),
(202051, 'deDE', '', 'Der Sitz des Primus gehört uns!', 39653),
(202050, 'deDE', 'Zurück!', '', 39653),
(202048, 'deDE', 'Die Feinde der Würdigen werden sterben.', '', 39653),
(202045, 'deDE', 'Tötet den Sterblichen und bringt mir die Runenklinge!', '', 39653),
(202026, 'deDE', '<Bleibt ein Weilchen und hört zu.>', '<Bleibt ein Weilchen und hört zu.>', 39653),
(202015, 'deDE', '', 'Es tut uns leid, Ara\'lon. Die Nacht umarme Euch.', 39653),
(202014, 'deDE', 'Wilde Jagd! Wir reiten zum Hain des Erwachens!', '', 39653),
(202013, 'deDE', 'Für Königin... und Hain...', '', 39653),
(202012, 'deDE', 'Wir halten sie auf, Ara\'lon. Ich schwöre es. Für Königin und Hain.', '', 39653),
(202011, 'deDE', 'Erwachen... sie strebt nach... Erwachen...', '', 39653),
(202010, 'deDE', 'Wisst Ihr, wo ihr Anführer jetzt ist?', '', 39653),
(202009, 'deDE', 'Eine Finte, um von ihrem wahren Ziel abzulenken!', '', 39653),
(202008, 'deDE', '', 'Ara\'lon!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(202007, 'deDE', '', 'Wartet! Ich spüre etwas... Verborgenes.', 39653),
(202006, 'deDE', 'Euer Befall endet hier, Monster!', '', 39653),
(202005, 'deDE', '', 'Nun kommt schon! Die Arbeit wartet!', 39653),
(202004, 'deDE', '', 'Hmpf! Euch kann man auch nicht allein lassen, nicht wahr?', 39653),
(202003, 'deDE', 'Schützt das Herz um jeden Preis!', '', 39653),
(202002, 'deDE', '', 'Es sind einfach zu viele!', 39653),
(202001, 'deDE', '', 'Wenn wir sie nicht bald retten, ist sie für immer verloren!', 39653),
(202000, 'deDE', 'Der Wildsamen... Ich spüre keine Träume mehr.', '', 39653),
(201998, 'deDE', 'Aliothe, seht!', '', 39653),
(201997, 'deDE', 'Oh nein...', '', 39653),
(201990, 'deDE', 'Entfesselt die Knochenspeere!', '', 39653),
(201989, 'deDE', '|TInterface\\Icons\\Ability_Druid_MarkofUrsol.blp:20|t Bargast beginnt, |cFFFF0000|Hspell:334797|h[Seele ausreißen]|h|r zu wirken!', '|TInterface\\Icons\\Ability_Druid_MarkofUrsol.blp:20|t Bargast beginnt, |cFFFF0000|Hspell:334797|h[Seele ausreißen]|h|r zu wirken!', 39653),
(201988, 'deDE', 'Da formt sich etwas im Schleim...', '', 39653),
(201918, 'deDE', '', 'Ihr seid ein echter Held.', 39653),
(201917, 'deDE', '', 'Der Königin sei Dank, dass Ihr hier seid!', 39653),
(201916, 'deDE', '', 'Bitte gewährt mir Eure Hilfe.', 39653),
(201915, 'deDE', '', 'Seid Ihr hier, um zu helfen?', 39653),
(201899, 'deDE', 'Es ist wohl wahr, dass duftender Matsch nicht die Dekoration ist, die ich gewählt hätte...', '', 39653),
(201898, 'deDE', 'Was haben sie getan?! Ist das eine Sauerei hier!', '', 39653),
(201897, 'deDE', 'Genug Dreck! Jeder Gräber für sich selbst!', '', 39653),
(201896, 'deDE', '$gSchlundgänger:Schlundgängerin;, schafft die hier raus. Und besorge mir jemand einen Wischmopp!', '', 39653),
(201895, 'deDE', 'Diese Gräber sind über und über mit Dreck bedeckt! Sie verschandeln noch die Dekorationen!', '', 39653),
(201739, 'deDE', '', 'Lasst ihre Hüllen verrotten!', 39653),
(201738, 'deDE', '', 'Ihre Anima wird unseren Sieg nähren.', 39653),
(201699, 'deDE', 'Torghast freigeschaltet', 'Torghast freigeschaltet', 39653),
(201698, 'deDE', 'Auge des Kerkermeisters freigeschaltet', 'Auge des Kerkermeisters freigeschaltet', 39653),
(201532, 'deDE', 'Ich werde mein Bestes geben. Was habt Ihr verloren?', 'Ich werde mein Bestes geben. Was habt Ihr verloren?', 39653),
(201517, 'deDE', '', 'Es ist die Pflicht meines Volks, sterbliche Seelen in die Schattenlande zu geleiten. Es wäre ein Leichtes, sie wieder hinauszugeleiten... dauerhaft.', 39653),
(201516, 'deDE', '', 'Vorsicht. Es gibt viele hohe Punkte in der Bastion, von denen lästige Sterbliche sehr leicht stürzen könnten.', 39653),
(201515, 'deDE', '', 'Ihr seid sehr tapfer oder sehr dumm, mich zu belästigen. Ich vermute, das Letztere trifft zu.', 39653),
(201514, 'deDE', 'Könnt Ihr mir nochmals Mondsicht gewähren?', 'Könnt Ihr mir nochmals Mondsicht gewähren?', 39653),
(201501, 'deDE', '', 'Hilfe! Der Herzholzhain wird angegriffen!', 39653),
(201466, 'deDE', 'Magisches Siegel brechen', 'Magisches Siegel brechen', 39653),
(201465, 'deDE', 'Ich kann die Werkzeuge für Euch suchen.', 'Ich kann die Werkzeuge für Euch suchen.', 39653),
(201463, 'deDE', 'Seid Ihr verletzt?', 'Seid Ihr verletzt?', 39653),
(201413, 'deDE', 'Ich stehe an der Seite des Argentumkreuzzugs.', 'Ich stehe an der Seite des Argentumkreuzzugs.', 39653),
(201386, 'deDE', '', 'Ehrt unsere Wege.', 39653),
(201385, 'deDE', '', 'Vertraut dem Weg.', 39653),
(201384, 'deDE', '', 'Geht und dient.', 39653),
(201379, 'deDE', '', 'Vergangenheit ist nur Prolog.', 39653),
(201378, 'deDE', '', 'Haltet aus. Haltet stand.', 39653),
(201370, 'deDE', '', 'Folgt dem Weg.', 39653),
(201369, 'deDE', '', 'Wir werden das durchstehen.', 39653),
(201368, 'deDE', '', 'Wir erwarten viel von Euch.', 39653),
(201367, 'deDE', '', 'Ihr wandelt unter Aufgestiegenen.', 39653),
(201365, 'deDE', '', 'Pflicht und Dienst.', 39653),
(201364, 'deDE', '', 'Kommt ruhig näher.', 39653),
(201363, 'deDE', '', 'Sprecht, sterbliches Wesen.', 39653),
(201362, 'deDE', '', 'Euer Weg hat Euch zu uns geführt.', 39653),
(201361, 'deDE', '', 'Ich werde Euch anhören.', 39653),
(201357, 'deDE', 'Was meint Ihr?', 'Was meint Ihr?', 39653),
(201229, 'deDE', '', 'Für Akarek!', 39653),
(201228, 'deDE', 'Spionin! Verflucht seid Ihr und Euer Haus!', '', 39653),
(201227, 'deDE', '', 'Und Euren Tod verantwortet Ihr selbst.', 39653),
(201226, 'deDE', '', 'Ihr seid mir ein wahrer Narr, Mor\'Bitan.', 39653),
(201225, 'deDE', 'Was?! Ihr habt... das Ritual verhunzt!', '', 39653),
(201224, 'deDE', 'Endlich! Die Macht, die uns der neue Baron versprach wird...', '', 39653),
(201223, 'deDE', 'Die Vorbereitungen sind abgeschlossen. Wir erwarten Eure Ankunft.', '', 39653),
(201222, 'deDE', '', 'Die Falle ist gelegt. Mor\'Bitans Ende ist nah.', 39653),
(201198, 'deDE', '|TINTERFACE\\ICONS\\Spell_Necro_InevitableEnd.blp:20|t Knochenzahn atmet für seinen |cFFFF0404|Hspell:333493|h[Nekrotischen Hauch]|h|r tief ein!', '|TINTERFACE\\ICONS\\Spell_Necro_InevitableEnd.blp:20|t Knochenzahn atmet für seinen |cFFFF0404|Hspell:333493|h[Nekrotischen Hauch]|h|r tief ein!', 39653),
(201185, 'deDE', 'Fungianer können nur im Verfall überleben! Kehrt um!', 'Fungianer können nur im Verfall überleben! Kehrt um!', 39653),
(201089, 'deDE', 'Die Nacht umarme Euch.', '', 39653),
(201088, 'deDE', 'Eure Hilfe ist mehr als willkommen!', '', 39653),
(201087, 'deDE', 'Entschuldigung, seid Ihr... sterblich?', '', 39653),
(201086, 'deDE', 'Ein Freund von Federleicht ist auch mein Freund.', '', 39653),
(200990, 'deDE', 'Es kann weise sein, fortzugehen. Weit fort... Weiter...', '', 39653),
(200989, 'deDE', 'Pflicht birgt ihre eigene Weisheit.', '', 39653),
(200988, 'deDE', 'Je mehr wir uns an Dinge klammern, desto mehr leiden wir.', '', 39653),
(200986, 'deDE', 'Setzt Eure Reise fort.', '', 39653),
(200985, 'deDE', 'Sucht Ihr Weisheit?', '', 39653),
(200984, 'deDE', 'Ich will Euch helfen.', '', 39653),
(200983, 'deDE', 'Welchen Rat wünscht Ihr?', '', 39653),
(200982, 'deDE', 'Kommt und sprecht zu uns.', '', 39653),
(200981, 'deDE', '', 'Mein alter Feind. Du kannst dich nicht vor mir verstecken, egal, welche Form du annimmst. Ach, Ihr seid es bloß. Vergesst das.', 39653),
(200980, 'deDE', '', 'Dies ist der Weg.', 39653),
(200979, 'deDE', '', 'Für die Archon und die Bastion.', 39653),
(200978, 'deDE', '', 'Geht immer vorwärts.', 39653),
(200976, 'deDE', '', 'Für die Archon.', 39653),
(200975, 'deDE', '', 'Ihr habt mein Gehör.', 39653),
(200974, 'deDE', '', 'Sprecht ohne Angst.', 39653),
(200973, 'deDE', '', 'Willkommen, tapfere Seele.', 39653),
(200972, 'deDE', '', 'Einige Bürden sind beharrlich.', 39653),
(200971, 'deDE', '', 'Lebtwohl.', 39653),
(200969, 'deDE', '', 'Geht und dient.', 39653),
(200968, 'deDE', '', 'Geht, streift Eure Sorgen ab.', 39653),
(200967, 'deDE', '', 'Legt ab Eure Bürden.', 39653),
(200966, 'deDE', '', 'Was beunruhigt Euch?', 39653),
(200965, 'deDE', '', 'Ich bin ganz Ohr.', 39653),
(200964, 'deDE', '', 'Teilt, und ich werde helfen.', 39653),
(200950, 'deDE', '|TInterface\\ICONS\\ABILITY_CREATURE_DISEASE_03.BLP:20|t Ihr seid |cFFF00000|Hspell:332748|h[Infiziert!]|h|r', '|TInterface\\ICONS\\ABILITY_CREATURE_DISEASE_03.BLP:20|t Ihr seid |cFFF00000|Hspell:332748|h[Infiziert!]|h|r', 39653),
(200901, 'deDE', '|TInterface\\ICONS\\Ability_DemonHunter_VengefulRetreat.blp:20|t Domina markiert Euch für den |cFFFF0000|Hspell:331818|h[Schattenhaften Hinterhalt]|h|r!', '|TInterface\\ICONS\\Ability_DemonHunter_VengefulRetreat.blp:20|t Domina markiert Euch für den |cFFFF0000|Hspell:331818|h[Schattenhaften Hinterhalt]|h|r!', 39653),
(200898, 'deDE', 'Aufreißen', 'Aufreißen', 39653),
(200866, 'deDE', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius bereitet sich darauf vor, Euch mit |cFFFF0000|Hspell:332797|h[Fatale Finesse]|h|r niederzustrecken!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius bereitet sich darauf vor, Euch mit |cFFFF0000|Hspell:332797|h[Fatale Finesse]|h|r niederzustrecken!', 39653),
(200730, 'deDE', '', 'Zusammen werden wir dem Reich Frieden und Ordnung bringen. Für die Bastion!', 39653),
(200729, 'deDE', '', 'Heute schließen wir miteinander unseren heiligen Pakt.', 39653),
(200727, 'deDE', '', 'In unseren Diensten haben sie unsere Tempel mutig verteidigt.', 39653),
(200725, 'deDE', '', 'Dieser Sterbliche geht noch nicht lang auf unserem Pfad, und hat sich dennoch schon einen Namen in unseren Hallen gemacht.', 39653),
(200630, 'deDE', '', 'Aber wenn sie sich seinem Einfluss entziehen konnten, können sie uns vielleicht helfen.', 39653),
(200612, 'deDE', 'Ausgraben', 'Ausgraben', 39653),
(200578, 'deDE', 'Präsentieren', 'Präsentieren', 39653),
(200504, 'deDE', '[DEPRECATED] Hibernal Hollow... my grove was sacrificed so groves like this could survive.', '', 39653),
(200503, 'deDE', 'Sie trägt die größte Last. Wir müssen tun, was wir können, um sie zu teilen.', '', 39653),
(200502, 'deDE', '', 'Wie auch die Winterkönigin...', 39653),
(200501, 'deDE', 'Es tut mir leid, Niya. Wäre die Wilde Jagd nur dort gewesen... aber unsere Reihen sind zu ausgedünnt.', '', 39653),
(200500, 'deDE', '', 'Mein Hain ist auch verloren... Aber nicht an die Dürre. Es waren maskierte Fae. Meine Freunde...', 39653),
(200499, 'deDE', 'Es war nicht immer so. Ich bin der Wilden Jagd erst beigetreten... nachdem ich meinen Hain opfern musste.', '', 39653),
(200498, 'deDE', '', '[DEPRECATED] I only hope... that the hollow survives where my own grove did not.', 39653),
(200497, 'deDE', '', '[DEPRECATED] Dreamweaver instructed us to bring it to Hibernal Hollow in the hopes that it may be saved.', 39653),
(200494, 'deDE', '', 'Danke für den Begleitschutz, Ara\'lon. Es beruhigt mich, von einem Jäger beschützt zu werden.', 39653),
(200493, 'deDE', '[DEPRECATED] Niya, was it? Tell me more about this wildseed.', '', 39653),
(200492, 'deDE', 'Kommt, reiten wir zum Winterschlafbecken.', '', 39653),
(200472, 'deDE', 'Die Wilde Jagd wird den Ardenwald von Euch säubern!', '', 39653),
(200471, 'deDE', 'Überrennt sie!', '', 39653),
(200470, 'deDE', 'Die Verseuchten stellen sich uns in den Weg!', '', 39653),
(200468, 'deDE', 'Kehrt zum Gluthof zurück.', 'Kehrt zum Gluthof zurück.', 39653),
(200414, 'deDE', '', 'Wie wäre es, wenn ich \"die Katze aus dem Sack lasse\"? Sie kommt aber nicht zum Kuscheln.', 39653),
(200411, 'deDE', '', 'Ich kämpfe für den Ardenwald.', 39653),
(200410, 'deDE', '', 'Ihr seid wohl wegen einer Lektion hier, was?', 39653),
(200409, 'deDE', '', 'Was kann diese alte Dornsprecherin für Euch tun, hmm?', 39653),
(200408, 'deDE', '', 'Hütet Euch vor den Wäldern.', 39653),
(200407, 'deDE', '', 'Erhaltet das Gleichgewicht.', 39653),
(200406, 'deDE', '', 'Richtet schnell und rechtschaffen.', 39653),
(200405, 'deDE', '', 'Die Kraft des Waldes sei mit Euch.', 39653),
(200402, 'deDE', '', 'Was ist los? Sagt schon!', 39653),
(200386, 'deDE', 'Viele dieser legendären Sühnen habe ich selbst miterlebt.\n\nEs lohnt sich, davon zu erzählen.', '', 39653),
(200352, 'deDE', 'Alle Waffenhändler brauchen Hilfe bei... Vorführungen. Hättet Ihr Interesse?', '', 39653),
(200351, 'deDE', 'Hört ja nicht auf, mir Arbeit zu verschaffen.', '', 39653),
(200350, 'deDE', 'Waffen werden immer gebraucht.', '', 39653),
(200349, 'deDE', 'Wer auch gewinnt, wir profitieren.', '', 39653),
(200348, 'deDE', 'Ah, meine treue Kundschaft.', '', 39653),
(200347, 'deDE', 'Sieg hat seinen Preis.', '', 39653),
(200346, 'deDE', 'Krieg ist ein Geschäft wie jedes andere.', '', 39653),
(200283, 'deDE', '', 'Ein echtes Symbol der Stärke der Allianz.', 39653),
(200263, 'deDE', 'Stallmeister', 'Stallmeister', 39653),
(200260, 'deDE', 'Briefkasten', 'Briefkasten', 39653),
(200258, 'deDE', 'Gasthaus', 'Gasthaus', 39653),
(200256, 'deDE', 'Flugmeister', 'Flugmeister', 39653),
(200254, 'deDE', 'Erscheinungswerber', 'Erscheinungswerber', 39653),
(200249, 'deDE', 'Bank', 'Bank', 39653),
(200247, 'deDE', 'Transmogrifikation', 'Transmogrifikation', 39653),
(200240, 'deDE', 'Die Enklave', 'Die Enklave', 39653),
(200229, 'deDE', 'Muss das immer sein? Ich kriege schon von Lady Mondbeere genug davon ab. Schönen Dank auch.', '', 39653),
(200218, 'deDE', '', 'Für die Bastion.', 39653),
(200217, 'deDE', '', 'Ihr sucht meine Hilfe?', 39653),
(200216, 'deDE', '', 'Ihr werdet gesehen.', 39653),
(200214, 'deDE', 'Also gut, Ihr habt meine Aufmerksamkeit.', '', 39653),
(200213, 'deDE', 'Immer so viel zu tun.', '', 39653),
(200212, 'deDE', 'Ich bin gerade sehr beschäftigt.', '', 39653),
(200211, 'deDE', 'Weiter so.', '', 39653),
(200210, 'deDE', 'Wäre das dann alles?', '', 39653),
(200209, 'deDE', 'Weitermachen.', '', 39653),
(200139, 'deDE', 'Ich folge dem Ruf.', '', 39653),
(200138, 'deDE', 'Dass wir niemals wanken.', '', 39653),
(200137, 'deDE', 'Erfüllt treu Eure Vorsehung.', '', 39653),
(200136, 'deDE', 'Fliegt mit Weisheit.', '', 39653),
(200135, 'deDE', 'Unser Ziel ist klar.', '', 39653),
(200134, 'deDE', 'Ihr werdet gesehen.', '', 39653),
(200020, 'deDE', 'Wisst Ihr was? Vielleicht solltet Ihr doch mit der Archon sprechen. Nur dieses eine Mal.', '', 39653),
(200019, 'deDE', 'Also diene ich ihr, um ihr Ablenkungen wie diese zu ersparen...', '', 39653),
(200018, 'deDE', 'Sie würde ihre heilige Pflicht nicht erfüllen können, wenn man sie unnötig stören würde.', '', 39653),
(200017, 'deDE', 'Die Archon ist viel zu beschäftigt, um alle Anfragen zu beantworten. Dafür bin ich hier.', '', 39653),
(200016, 'deDE', 'Bleibt bescheiden.', '', 39653),
(199965, 'deDE', 'Mit Mut voran.', '', 39653),
(199964, 'deDE', 'Weisheit leite Eure Schritte.', '', 39653),
(199959, 'deDE', 'Findet Eure Reinheit.', '', 39653),
(199956, 'deDE', 'Geht und dient.', '', 39653),
(199955, 'deDE', 'Bleibt unserer ewigen Aufgabe treu.', '', 39653),
(199954, 'deDE', 'Wir alle dienen einem höheren Zweck.', '', 39653),
(199953, 'deDE', 'Was beunruhigt Euch?', '', 39653),
(199952, 'deDE', 'Wünscht Ihr eine Aufgabe?', '', 39653),
(199918, 'deDE', 'Ich bin der Wille der Archon.', '', 39653),
(199917, 'deDE', 'Ihr habt Fragen?', '', 39653),
(199915, 'deDE', 'Ihr werdet gesehen.', '', 39653),
(199912, 'deDE', 'Ihr möchtet dienen?', '', 39653),
(199911, 'deDE', 'Bei der Gnade der Archon.', '', 39653),
(199837, 'deDE', '<Nehmt den Käfigschlüssel.>', '<Nehmt den Käfigschlüssel.>', 39653),
(199564, 'deDE', 'Lust auf einen Plausch?', '', 39653),
(199563, 'deDE', 'Was verschafft mir das Vergnügen?', '', 39653),
(199562, 'deDE', 'Hallo.', '', 39653),
(199561, 'deDE', 'Wir sehen uns.', '', 39653),
(199560, 'deDE', 'Immer ein Vergnügen.', '', 39653),
(199558, 'deDE', 'Bis zum nächsten Mal.', '', 39653),
(199556, 'deDE', 'Na dann los.', '', 39653),
(199551, 'deDE', '', 'Gemeinsam sind wir stark.', 39653),
(199550, 'deDE', '', 'Geht und dient.', 39653),
(199549, 'deDE', 'Für die Allianz!', '', 39653),
(199548, 'deDE', 'Ehre dem König.', '', 39653),
(199547, 'deDE', 'Schön, Euch wiederzusehen!', '', 39653),
(199546, 'deDE', 'Henry Garrick, melde mich zum Dienst!', '', 39653),
(199545, 'deDE', '', 'Möge die Archon über Euch wachen.', 39653),
(199542, 'deDE', '', 'Was beunruhigt Euch?', 39653),
(199540, 'deDE', '', 'Ihr sucht Führung?', 39653),
(199539, 'deDE', '', 'Schaut, am Horizont! Eins unserer Luftschiffe nähert sich!', 39653),
(199538, 'deDE', '', 'Zusammen erheben wir uns.', 39653),
(199534, 'deDE', '|TInterface\\Icons\\Spell_Shadow_SpectralSight:20|tSchlickfausts |cFFFF0000|Hspell:331209|h[Hasserfüllter Blick]|h|r fällt auf |cFFFF0000$n|r!', '|TInterface\\Icons\\Spell_Shadow_SpectralSight:20|tSchlickfausts |cFFFF0000|Hspell:331209|h[Hasserfüllter Blick]|h|r fällt auf |cFFFF0000$n|r!', 39653),
(199505, 'deDE', 'Für die Horde!', '', 39653),
(199504, 'deDE', 'Azeroth steht zahllosen Gefahren gegenüber. Es bedarf kühnen Helden, um sie zu verteidigen.', '', 39653),
(199503, 'deDE', 'Nachdem Ihr Euch auf der Insel des Verbannten bewiesen habt, warten Abenteuer und Ruhm auf Euch.', '', 39653),
(199502, 'deDE', 'Doch kein Feind besteht gegen die furchtlosen Soldaten der Horde!', '', 39653),
(199501, 'deDE', 'Ihr Rivale, die herrische Allianz, ist eine konstante Gefahr.', '', 39653),
(199500, 'deDE', 'Als Symbol für Stolz und Widerstandskraft, ist es Schauplatz regen Handels und Sammelpunkt mächtiger Truppen.', '', 39653),
(199499, 'deDE', 'Orgrimmar. Bollwerk der mächtigen Horde.', '', 39653),
(199491, 'deDE', '', 'Kommt, Rekruten. Zeit, nach Hause zurückzukehren.', 39653),
(199490, 'deDE', '', 'So sieht die geballte macht der Horde aus. Die Oger sollten besser die Flucht ergreifen.', 39653),
(199489, 'deDE', '', 'Schaut am Horizont, $p! Eins unserer Luftschiffe!', 39653),
(199488, 'deDE', '', 'Ich bin froh, dass Ihr sie nicht habt. Diese Insel muss sich erholen.', 39653),
(199487, 'deDE', 'Dass diese Rohlinge solche Magie beherrschen... Hätte ich nur mehr Zeit, sie zu studieren!', '', 39653),
(199327, 'deDE', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Remornia wird Euch gleich |cFFFF0000|Hspell:329974|h[Durchbohren]|h|r!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Remornia wird Euch gleich |cFFFF0000|Hspell:329974|h[Durchbohren]|h|r!', 39653),
(199311, 'deDE', 'Ich habe eine Seele für Euch.', 'Ich habe eine Seele für Euch.', 39653),
(199277, 'deDE', '', 'Mit verzauberten Waffen könnt Ihr Euch auf Euren primären Angriff konzentrieren.', 39653),
(199276, 'deDE', 'Mit verzauberten Waffen könnt Ihr Euch auf Euren primären Angriff konzentrieren.', '', 39653),
(199270, 'deDE', '', 'Eure Blitzzauber laden Stapel von \'Entladung\' auf und machen \'Erdschock\' so zu einem Eurer mächtigsten Zauber.', 39653),
(199269, 'deDE', 'Eure Blitzzauber laden Stapel von \'Entladung\' auf und machen \'Erdschock\' so zu einem Eurer mächtigsten Zauber.', '', 39653),
(199268, 'deDE', '', 'Achtet auf die Stapel von \'Entladung\', damit Ihr keine Gelegenheit für einen mächtigen \'Erdschock\' verpasst.', 39653),
(199267, 'deDE', 'Achtet auf die Stapel von \'Entladung\', damit Ihr keine Gelegenheit für einen mächtigen \'Erdschock\' verpasst.', '', 39653),
(199264, 'deDE', 'Wir Goblins kennen uns mit Sprengstoff richtig gut aus. Eine kleine Demonstration gefällig?', '', 39653),
(199263, 'deDE', 'Seht Ihr nicht, dass ich gerade dabei bin, Pläne zu schmieden?', '', 39653),
(199262, 'deDE', 'Hey! Lasst stecken, ja?', '', 39653),
(199256, 'deDE', 'Die Macht der Wissenschaft ist unschlagbar!', '', 39653),
(199255, 'deDE', 'Tut gut, wieder in Sturmwind zu sein!', '', 39653),
(199254, 'deDE', '', 'Es gibt kein Entkommen! Festhalten!', 39653),
(199252, 'deDE', '', 'So sehen wir uns also wieder.', 39653),
(199250, 'deDE', '', 'Throm-ka.', 39653),
(199236, 'deDE', 'Reparieren', '', 39653),
(199235, 'deDE', 'Als Mitglied des Hauses habt Ihr natürlich jederzeit Zugriff auf die Schatzkammer.', '', 39653),
(199234, 'deDE', 'Es ist mir eine Ehre, ein weiteres geschätztes Mitglied des Hauses Grinskinn zu begrüßen.', '', 39653),
(199232, 'deDE', 'Also, DAS ist eine Frage, die nur jemand stellen kann, der NICHT Mitglied des Hauses Grinskinn ist!\n\n<Das Steinscheusal grinst Euch an.>\n\nHehe, aber ist schon in Ordnung...\n\nIch habe klare Befehle: Für alle Ewigkeit auf dieser Schatztruhe sitzen, nur für jene öffnen, die einen Ring von Haus Grinskinn haben.\n\nÜber das Beantworten von Fragen von seltsam aussehenden Fremden haben sie nichts gesagt.\n\n<Das Steinscheusal zwinkert Euch langsam zu.>\n\nWenn Ihr hier den Ring von Haus Grinskinn findet, kommen wir beide hoffentlich bald in den Genuss von etwas Aufregung.', '', 39653),
(199230, 'deDE', 'Seid Ihr vom Haus Grinskinn?\n\nNur Mitglieder des Hauses Grinskinn haben Zugriff auf die Schatztruhe des Hauses.', '', 39653),
(199199, 'deDE', '', '\'Instabiles Gebrechen\' verursacht regelmäßigen Schaden und erhöht den Schaden aller anderen Zauber gegen den Gegner.', 39653),
(199196, 'deDE', 'In Deckung! |TInterface\\ICONS\\INV_Eng_BombPoison.blp:20|t |cFFF00000|Hspell:328038|h[Saronitbombardement]|h|r!', 'In Deckung! |TInterface\\ICONS\\INV_Eng_BombPoison.blp:20|t |cFFF00000|Hspell:328038|h[Saronitbombardement]|h|r!', 39653),
(199192, 'deDE', 'Jetzt braucht es mehr als Mut, um Euch zu retten.', '', 39653),
(199184, 'deDE', 'Durch Schlüsselloch blicken', 'Durch Schlüsselloch blicken', 39653),
(199166, 'deDE', '', 'Die Kyrianertempel und die Herrschaft der Archon werden fallen!', 39653),
(199165, 'deDE', '', 'Gut. Unsere Verbündeten wollen los.', 39653),
(199164, 'deDE', '', 'Der Schutz wurde wie vereinbart sabotiert.', 39653),
(199078, 'deDE', 'Wir sollten lieber springen...', 'Wir sollten lieber springen...', 39653),
(199077, 'deDE', 'Er greift uns an!', 'Er greift uns an!', 39653),
(199070, 'deDE', '', 'Pflanzen spüren die Stimmung ihrer Pfleger. Vielleicht solltet Ihr Euch eine Weile selbst pflegen.', 39653),
(199069, 'deDE', '', 'Kultiviert Euren Geist.', 39653),
(199068, 'deDE', '', 'Gebt Euch dem Zyklus hin.', 39653),
(199067, 'deDE', '', 'Zarte Zweige wiegen sich im Wind.', 39653),
(199066, 'deDE', '', 'Aus einem Setzling erwächst ein Wald.', 39653),
(199060, 'deDE', '', 'Das Herz schlägt, die Hoffnung gedeiht.', 39653),
(199059, 'deDE', '', 'Pflegt den Baum. Gestaltet sein Wachstum.', 39653),
(199047, 'deDE', 'Nehmt den Kasten.', 'Nehmt den Kasten.', 39653),
(198980, 'deDE', '', 'Der Ardenwald wird die Dürre überleben. Das schwöre ich.', 39653),
(198979, 'deDE', '', 'Zeit verstreicht, doch der Traum währt ewig.', 39653),
(198977, 'deDE', '', 'Möge die Nacht Euch umarmen.', 39653),
(198976, 'deDE', '', 'Der Zyklus muss gewahrt bleiben.', 39653),
(198975, 'deDE', '', 'Nur Mut. Hoffnung gibt es immer.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(198974, 'deDE', '', 'Jeder Traum birgt einen Alptraum und jeder Alptraum endet einmal.', 39653),
(198973, 'deDE', '', 'Zusammen werden wir siegen.', 39653),
(198972, 'deDE', '', 'Ich träume und die Welt erbebt.', 39653),
(198971, 'deDE', '', 'Sagt mir, was seht Ihr?', 39653),
(198970, 'deDE', '', 'Ich habe in Eure Träume geblickt.', 39653),
(198969, 'deDE', '', 'Mein langer Schlaf ist vorbei.', 39653),
(198968, 'deDE', '', 'Ich bin dem Traum und der mondlosen Nacht verbunden.', 39653),
(198967, 'deDE', 'Legt Euch mit Lord Herne an und Ihr lernt Lord Horn kennen.', '', 39653),
(198966, 'deDE', 'Unsere Beute soll sich vorsehen.', '', 39653),
(198965, 'deDE', 'Gute Jagd.', '', 39653),
(198964, 'deDE', 'Die Nacht umarme Euch.', '', 39653),
(198963, 'deDE', 'Für Königin und Hain.', '', 39653),
(198962, 'deDE', 'Seid gegrüßt.', '', 39653),
(198961, 'deDE', 'Wir schleichen durch die mondlose Nacht.', '', 39653),
(198960, 'deDE', 'Mein Schwur gilt dem gesamten Wald.', '', 39653),
(198959, 'deDE', 'Die Wilde Jagd heißt Euch willkommen.', '', 39653),
(198955, 'deDE', 'Niya ist immer noch dort!', 'Niya ist immer noch dort hinten!', 39653),
(198954, 'deDE', '', 'Rennt weiter!', 39653),
(198953, 'deDE', 'Bitte helft Niya!', 'Bitte helft Niya!', 39653),
(198929, 'deDE', '', 'Verliert nicht die Hoffnung.', 39653),
(198928, 'deDE', '', 'Wir dürfen hier nicht bleiben.', 39653),
(198927, 'deDE', '', 'Wie kann hier jemand überleben?', 39653),
(198926, 'deDE', '', 'So viel Dunkelheit und Verzweiflung...', 39653),
(198925, 'deDE', '', 'Die mondlose Nacht... beunruhigt mich.', 39653),
(198924, 'deDE', '', 'Tyrande braucht mich mehr denn je.', 39653),
(198923, 'deDE', '', 'Ich werde nicht zulassen, dass noch ein Wald stirbt.', 39653),
(198921, 'deDE', '', 'Der Ardenwald ist viel schöner, als ich gedacht hatte.', 39653),
(198913, 'deDE', 'Was ist Eure Vorsehung?', '', 39653),
(198906, 'deDE', 'Auf ewig im Dienst.', '', 39653),
(198884, 'deDE', 'Wollt Ihr die Demutssequenz noch einmal erleben?', '', 39653),
(198883, 'deDE', 'Geht hin und dient.', '', 39653),
(198882, 'deDE', 'Bis ich wieder benötigt werde.', '', 39653),
(198879, 'deDE', 'Macht weiter so.', '', 39653),
(198878, 'deDE', 'Was sucht Ihr?', '', 39653),
(198877, 'deDE', 'Ich diene den Kyrianern.', '', 39653),
(198873, 'deDE', 'Ich biete Euch meine Hilfe an.', '', 39653),
(198796, 'deDE', 'Für die Allianz!', '', 39653),
(198795, 'deDE', 'Azeroth steht zahllosen Gefahren gegenüber. Es bedarf kühner Helden, um sie zu verteidigen.', '', 39653),
(198794, 'deDE', 'Nach Eurer Rückkehr von der Insel des Verbannten erwarten Euch neue Abenteuer.', '', 39653),
(198793, 'deDE', 'Doch die Soldaten von Sturmwind stellen sich jeder Herausforderung.', '', 39653),
(198792, 'deDE', 'Ihr alter Feind, die wilde Horde, ist eine fortwährende Bedrohung.', '', 39653),
(198791, 'deDE', 'Obwohl die Völker der Allianz aus verschiedensten Ländern stammen, treffen sich alle in Sturmwind für Handel und Diplomatie.', '', 39653),
(198790, 'deDE', 'Sturmwind. Die Hauptstadt der edlen Allianz.', '', 39653),
(198785, 'deDE', '', 'Ich bin bereit, meine Königin.', 39653),
(198784, 'deDE', '', 'Meine letzte Nacht war wunderschön. Ich bin so froh, dass Ihr sie mit mir geteilt habt.', 39653),
(198765, 'deDE', 'Ist dem Haus der Auserwählten der Appetit vergangen?', 'Ist dem Haus der Auserwählten der Appetit vergangen?', 39653),
(198764, 'deDE', '', 'Unter uns ist ein lebendiger Sterblicher. Faszinierend...', 39653),
(198763, 'deDE', 'Welches Haus hat den Sieg errungen?', 'Welches Haus hat den Sieg errungen?', 39653),
(198732, 'deDE', 'Ruft Eure Armeen zurück... oder stellt Euch meiner Klinge!', '', 39653),
(198731, 'deDE', 'Wo bleibt Euer Hunger nach Ruhm?', 'Wo bleibt Euer Hunger nach Ruhm?', 39653),
(198730, 'deDE', 'Aber wo sind die Banner?', 'Aber wo sind die Banner?', 39653),
(198729, 'deDE', 'Schnappt Euch Theotars Teetablett und versucht es erneut!', 'Schnappt Euch Theotars Teetablett und versucht es erneut!', 39653),
(198725, 'deDE', 'Bringt das vollständige Teeservice zu Theotar!', 'Bringt das vollständige Teeservice zu Theotar!', 39653),
(198638, 'deDE', '<Jaithys macht ein Geräusch, als würde sie schmatzen.>', '', 39653),
(198636, 'deDE', 'Ich stehl... Euren Stahl...', '', 39653),
(198635, 'deDE', 'Hunger... HUNGER... Metall...', '', 39653),
(198634, 'deDE', 'Ich ernte den Kummer...', '', 39653),
(198633, 'deDE', 'Das wird extrem schmerzhaft! Für Euch...', '', 39653),
(198632, 'deDE', 'Bald... bald... bald gibt es Euch nicht mehr...', '', 39653),
(198631, 'deDE', 'Hier kommt Armageddon.', '', 39653),
(198630, 'deDE', 'Seht mich an und seht Euren Tod!', '', 39653),
(198629, 'deDE', 'Das wird Eure letzte Reise.', '', 39653),
(198628, 'deDE', 'Ein weiteres gebrochenes Versprechen.', '', 39653),
(198627, 'deDE', 'Sie haben gesagt, ich bin stumpf. Wer hat jetzt den letzten Lacher?', '', 39653),
(198626, 'deDE', 'Direkt zum Entsandten der Sterblichkeit.', '', 39653),
(198625, 'deDE', 'Beschäftigt den Gruftmacher.', '', 39653),
(198624, 'deDE', 'Ihr fallt Eurer Verdammnis zum Opfer.', '', 39653),
(198623, 'deDE', 'Spürt Ihr den Unheilsgriff?', '', 39653),
(198622, 'deDE', 'Heh, heh... Mord...', '', 39653),
(198588, 'deDE', 'Anima entreißen', 'Anima entreißen', 39653),
(198585, 'deDE', '', 'Andere sind so tief gefallen, dass ihnen die Macht des Schlunds gehorcht.', 39653),
(198584, 'deDE', '', 'Euch scheint bei all dem eine Rolle zuzukommen. Sehen wir, wie sich alles entwickelt. Geht und dient.', 39653),
(198583, 'deDE', '', 'Paragons, zurück zu Euren Tempeln. Adrestes, überwacht die Schutze.', 39653),
(198582, 'deDE', '', 'Was Ihr da sagt ist undenkbar, aber wir müssen dennoch wachsam bleiben.', 39653),
(198581, 'deDE', '', 'Wir wissen, die Verschmähten werden zuschlagen, aber nicht wann oder wo.', 39653),
(198580, 'deDE', '', 'Es ist wahr. Dieser Sterbliche hat gegen Aufgestiegene gekämpft, die dem Kerkermeister dienen. Lysonia ist nicht allein.', 39653),
(198579, 'deDE', '', 'Viele haben nur den Glauben verloren und sind noch zu retten.', 39653),
(198578, 'deDE', '', 'Wer sind diese Verschmähten?', 39653),
(198577, 'deDE', '', 'Die Umstände haben sich geändert.', 39653),
(198576, 'deDE', '', 'Das sind schlimme Neuigkeiten, Vesiphone. Aber die Archon hat schon früher solche Kunde ignoriert.', 39653),
(198571, 'deDE', '', 'Hört auf. Es sei denn, Ihr wollt auch tot sein.', 39653),
(198544, 'deDE', 'Zenturionen! Vorwärts! Tod den Eindringlingen!', '', 39653),
(198541, 'deDE', '', '[DNT] We need to do something!', 39653),
(198458, 'deDE', 'Vorrücken! Domina holt sich unsere Schädel, wenn sie Stradamas Seuche nicht bekommt!', '', 39653),
(198446, 'deDE', '|cfff2e699+Bonuszufriedenheit (Steinkopf)|r', '|cfff2e699+Bonuszufriedenheit (Steinkopf)|r', 39653),
(198445, 'deDE', '|cfff2e699+Bonuszufriedenheit (Sika)|r', '|cfff2e699+Bonuszufriedenheit (Sika)|r', 39653),
