(198443, 'deDE', '|cfff2e699+Bonuszufriedenheit (Kleia und Pelagos)|r', '|cfff2e699+Bonuszufriedenheit (Kleia und Pelagos)|r', 39653),
(198442, 'deDE', '|cfff2e699+Bonuszufriedenheit (Großmeister Vole)|r', '|cfff2e699+Bonuszufriedenheit (Großmeister Vole)|r', 39653),
(198441, 'deDE', '|cfff2e699+Bonuszufriedenheit (Dromanin Aliothe)|r', '|cfff2e699+Bonuszufriedenheit (Dromanin Aliothe)|r', 39653),
(198440, 'deDE', '|cfff2e699+Bonuszufriedenheit (Grufthüter Kassir)|r', '|cfff2e699+Bonuszufriedenheit (Grufthüter Kassir)|r', 39653),
(198439, 'deDE', '|cfff2e699+Bonuszufriedenheit (Rendel und Knüppelfratze)|r', '|cfff2e699+Bonuszufriedenheit (Rendel und Knüppelfratze)|r', 39653),
(198438, 'deDE', '|cfff2e699+Bonuszufriedenheit (Polemarch Adrestes)|r', '|cfff2e699+Bonuszufriedenheit (Polemarch Adrestes)|r', 39653),
(198437, 'deDE', '|cfff2e699+Bonuszufriedenheit (Korayn)|r', '|cfff2e699+Bonuszufriedenheit (Korayn)|r', 39653),
(198436, 'deDE', '|cfff2e699+Bonuszufriedenheit (Alexandros Mograine)|r', '|cfff2e699+Bonuszufriedenheit (Alexandros Mograine)|r', 39653),
(198435, 'deDE', '|cfff2e699+Bonuszufriedenheit (Die Gräfin)|r', '|cfff2e699+Bonuszufriedenheit (Die Gräfin)|r', 39653),
(198434, 'deDE', '|cfff2e699+Bonuszufriedenheit (Mikanikos)|r', '|cfff2e699+Bonuszufriedenheit (Mikanikos)|r', 39653),
(198433, 'deDE', '|cfff2e699+Bonuszufriedenheit (Lady Mondbeere)|r', '|cfff2e699+Bonuszufriedenheit (Lady Mondbeere)|r', 39653),
(198432, 'deDE', '|cfff2e699+Bonuszufriedenheit (Baronin Vashj)|r', '|cfff2e699+Bonuszufriedenheit (Baronin Vashj)|r', 39653),
(198430, 'deDE', '|cfff2e699+Bonuszufriedenheit (Choofa)|r', '|cfff2e699+Bonuszufriedenheit (Choofa)|r', 39653),
(198391, 'deDE', 'Wie gebe ich Euch das Zeichen?', 'Wie gebe ich Euch das Zeichen?', 39653),
(198377, 'deDE', '', 'Kommt, Rekruten. Gehen wir nach Hause.', 39653),
(198376, 'deDE', '', 'Ein echtes Symbol der Stärke der Allianz. Vielleicht stehst du eines Tages am Steuer.', 39653),
(198375, 'deDE', 'Schaut, am Horizont! Ein Luftschiff! Ich habe noch nie eins fliegen sehen...', '', 39653),
(198374, 'deDE', '', 'Mit der Zeit wird sich die Insel von den dunklen Ritualen erholen.', 39653),
(198373, 'deDE', '', 'Hah! Der Rest der Oger macht sich aus dem Staub! Sie hatten nie eine echte Chance!', 39653),
(198270, 'deDE', 'Ahhhhhhh!!!!!!!', 'Ahhhhhhh!!!!!!!', 39653),
(198266, 'deDE', 'Schwert loslassen', 'Schwert loslassen', 39653),
(198171, 'deDE', 'Vergesst nicht, das hier ist nur ein Zweckbündnis.', '', 39653),
(198132, 'deDE', 'Talent. Irgendwas fehlt immer.', '', 39653),
(198131, 'deDE', 'Macht es gut.', '', 39653),
(198130, 'deDE', 'Hals und Beinbruch.', '', 39653),
(198128, 'deDE', 'Die Show muss weitergehen.', '', 39653),
(198126, 'deDE', 'Wie sieht das Publikum aus?', '', 39653),
(198122, 'deDE', 'Könnt Ihr Euren Text auswendig?', '', 39653),
(198120, 'deDE', 'Und was wünscht Ihr?', '', 39653),
(197765, 'deDE', 'Was ist passiert?', 'Was ist passiert?', 39653),
(197715, 'deDE', 'Ein schrecklicher Missbrauch von Anima durch Denathrius\' Diener. Danke, dass Ihr uns davor beschützt habt.', '', 39653),
(197714, 'deDE', 'Sie haben aus diesen Gräbern eine Manifestation des Krieges erschaffen... keinen Steinwurf von Sündensturz. Bringt sie zu Fall.', '', 39653),
(197676, 'deDE', 'Keine Sorge. Riecht gut!', '', 39653),
(197675, 'deDE', 'Aufpassen, Klumplump! Ihr lasst überall Müll fallen!', '', 39653),
(197674, 'deDE', 'Ja, es ist gerade sehr schlecht! Seht Ihr nicht, dass wir Gäste haben?', '', 39653),
(197673, 'deDE', 'Ist grad schlecht?', '', 39653),
(197587, 'deDE', 'Überprüfen', 'Überprüfen', 39653),
(197568, 'deDE', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius betrachtet Euch mit |cFFFF0000|Hspell:327823|h[Unstillbarem Hunger]|h|r!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius betrachtet Euch mit |cFFFF0000|Hspell:327823|h[Unstillbarem Hunger]|h|r!', 39653),
(197558, 'deDE', '', 'Warum?', 39653),
(197557, 'deDE', 'Beeindruckend, dass Ihr unser kleines Geheimnis entdeckt habt...', '', 39653),
(197556, 'deDE', 'Jüngste Ereignisse verlangen, dass wir unsere Anstrengungen forcieren.', '', 39653),
(197504, 'deDE', '$n bereitet ein Festmahl des unersättlichen Hedonismus zu!', '$n bereitet ein Festmahl des unersättlichen Hedonismus zu!', 39653),
(197503, 'deDE', '$n bereitet ein überraschend genießbares Festmahl zu!', '$n bereitet ein überraschend genießbares Festmahl zu!', 39653),
(197497, 'deDE', '', 'Die Worte der Archon! Verteidigt die Festung!', 39653),
(197495, 'deDE', '', 'Devos muss gestoppt werden!', 39653),
(197494, 'deDE', '', 'Aufgestiegene, schlagt sie zurück! Paragons, zu mir!', 39653),
(197492, 'deDE', '', 'Die Spitzen des Aufstiegs werden den Verschmähten gehören!', 39653),
(197490, 'deDE', '', 'Die blinden Erlasse der Archon bringen uns in Gefahr! Wir gehen einen neuen Weg!', 39653),
(197488, 'deDE', '', 'Devos? Ihr führt diese Rebellion?!', 39653),
(197486, 'deDE', '', 'Erhebt Euch, Verschmähte!', 39653),
(197484, 'deDE', '', 'Schluss mit Euren Ritualen, Archon. Die Wahrheit!', 39653),
(197481, 'deDE', '', 'Heute werdet Ihr zur Aufgestiegenen.', 39653),
(197480, 'deDE', '', 'Ihr seid eine Mentorin für alle und auch eine tapfere Verteidigerin der Bastion.', 39653),
(197478, 'deDE', '', 'Aspirantin Kleia, tretet vor.', 39653),
(197444, 'deDE', '', 'Habt Ihr eine Vorsehung? Ich stelle Euch gern eine zur Verfügung... Wenn Ihr FORTGEHT.', 39653),
(197442, 'deDE', '', 'Sagt mir... plant Ihr, bald in den Schlund zurückzukehren?', 39653),
(197435, 'deDE', '', 'Geht in Frieden. GEHT... in Frieden.', 39653),
(197433, 'deDE', '', 'Ich habe festgestellt, dass Ihr Sterbliche höchst... beharrlich seid.', 39653),
(197431, 'deDE', '', 'Bis zu unserem nächsten Gespräch.', 39653),
(197427, 'deDE', '', 'Ich werde Eure Worte abwägen.', 39653),
(197413, 'deDE', '', 'Eines Tages wird sie erwachen.', 39653),
(197407, 'deDE', '', 'Alle werden gerecht beurteilt.', 39653),
(197395, 'deDE', '', 'Gesegnet sei ihre Stimme.', 39653),
(197386, 'deDE', '', 'Euer Weg wurde gewählt.', 39653),
(197383, 'deDE', '', 'Mit ihrer Stimme habe ich gesprochen.', 39653),
(197382, 'deDE', '', 'Ich spreche für die, die schweigt.', 39653),
(197381, 'deDE', '', 'Hört die Worte der Richterin.', 39653),
(197380, 'deDE', '', 'Tretet vor und lasst über Euch urteilen.', 39653),
(197372, 'deDE', '', 'Was bringt Ihr für Neuigkeiten?', 39653),
(197367, 'deDE', '', 'Was mag Eure Vorsehung sein?', 39653),
(197361, 'deDE', '', 'Sprecht, sterbliches Wesen.', 39653),
(197360, 'deDE', '', 'Vertraut auf die Vorsehung.', 39653),
(197329, 'deDE', 'Alle aufsteigen!', '', 39653),
(197328, 'deDE', 'Keine Sorge! Ich weiß, was zu tun ist.', '', 39653),
(197327, 'deDE', '', 'Sie werden uns überwältigen!', 39653),
(197325, 'deDE', '', 'Was war das?', 39653),
(197324, 'deDE', 'Herrlich. Brons Stärke ist meine Stärke. Unsere Stärke!', '', 39653),
(197236, 'deDE', '', 'Denathrius wird wahre Buße erfahren.', 39653),
(197235, 'deDE', '', 'Bringt Licht in die Dunkelheit.', 39653),
(197234, 'deDE', '', 'Sprecht, Kind. Die Schatten müssen noch warten.', 39653),
(197233, 'deDE', '', 'Ein schwaches Licht scheint dennoch.', 39653),
(197225, 'deDE', 'Willkommen, ebenfalls verdammter Freund.', '', 39653),
(197224, 'deDE', 'Ich vermisse die gute alte Zeit, in der wir uns alle gegenseitig für Macht auslöschen wollten.', '', 39653),
(197222, 'deDE', 'Was kann dieser bescheidene gefallene Prinz heute für Euch tun?', '', 39653),
(197221, 'deDE', 'Finsterste Grüße, Schlundgänger.', '', 39653),
(197220, 'deDE', 'Ah! Der mögliche Retter der Schattenlande ist da.', '', 39653),
(197219, 'deDE', 'Kommt näher, mein neuer Freund.', '', 39653),
(197218, 'deDE', 'Die Dürre, der Mangel an Seelen, der Kerkermeister, alles hängt zusammen.', '', 39653),
(197217, 'deDE', 'Uns droht ein düsteres Schicksal. Aber keins, dem wir uns kampflos ergeben.', '', 39653),
(197216, 'deDE', 'Ihr und ich gegen das Ende der Realität... Möglicherweise brauchen wir Hilfe.', '', 39653),
(197215, 'deDE', 'Ich sehe Euch und wage etwas... Hoffnung.', '', 39653),
(197214, 'deDE', 'Die Verräter werden ihrer gerechten Strafe zugeführt.', '', 39653),
(197213, 'deDE', 'Der Meister sieht alles.', '', 39653),
(197212, 'deDE', 'Steingeborene sind nichts ohne Befehle.', '', 39653),
(197211, 'deDE', 'Ich diene, denn die anderen haben es verlernt.', '', 39653),
(197210, 'deDE', '', 'Wir haben vergessen, was es heißt, Venthyr zu sein. Wir müssen uns erinnern.', 39653),
(197208, 'deDE', '', 'Revendreth dient zwei Herren.', 39653),
(197206, 'deDE', '', 'Nehmt mich mit.', 39653),
(197205, 'deDE', '', 'Ich habe mal mit einem intelligenten Schlamm gekämpft.', 39653),
(197204, 'deDE', '', 'Ich habe mal mit einem Ritter der Leere gekämpft, dessen Klingen aus Schatten und Schreien bestanden.', 39653),
(197203, 'deDE', '', 'Ich habe mal mit einer dreiarmigen Entartung mit Krummsäbeln statt Händen gekämpft.', 39653),
(197202, 'deDE', '', 'Eine Klinge ist nur ein Werkzeug. Die Fertigkeit liegt in der Hand, die sie führt.', 39653),
(197201, 'deDE', '', 'Deckung, drehen, parieren, ausweichen, Pirouette, zustoßen...', 39653),
(197200, 'deDE', '', 'Revendreth, wo niemand Euren Namen kennen sollte.', 39653),
(197199, 'deDE', '', 'Haltung beachten, Flanke schützen, und lasst sie nie Angst wittern.', 39653),
(197198, 'deDE', '', 'Lasst mich wissen, wenn Ihr etwas... Herausforderndes findet.', 39653),
(197197, 'deDE', '', 'Denkt an mich, wenn der nächste Kampf ansteht.', 39653),
(197196, 'deDE', '', 'Ich bin eine Klinge, die gezogen werden will.', 39653),
(197195, 'deDE', '', 'Für welches Abenteuer braucht Ihr mich heute?', 39653),
(197194, 'deDE', '', 'Es tut ganz gut, Euch zu sehen.', 39653),
(197193, 'deDE', '', 'Im Leben war ich unbesiegbar. Im Tod bin ich unaufhaltsam.', 39653),
(197192, 'deDE', '', 'Ihr sucht eindeutig die Beste.', 39653),
(197189, 'deDE', '', 'Meine Klinge könnte die Eure sein.', 39653),
(197183, 'deDE', '', 'Ihr seid so erfrischend... frisch.', 39653),
(197166, 'deDE', '', 'Niemand steht je wieder zwischen mir und meinem Prinzen. Niemand.', 39653),
(197157, 'deDE', 'Auserwählte! Zu den Waffen!', '', 39653),
(197156, 'deDE', '', 'Tötet sie alle.', 39653),
(197155, 'deDE', '', 'Wohl kaum, Krexus. Euer Schwert... wird brechen.', 39653),
(197154, 'deDE', 'Wir sollen die Schattenlande schützen, nicht erobern!', '', 39653),
(197153, 'deDE', 'Der Primus ist Geschichte, Krexus!', 'Der Primus ist Geschichte, Krexus!', 39653),
(197152, 'deDE', 'Eure Häuser haben die Bastion angegriffen... Hochverrat an Allem, wofür der Primus stand!', '', 39653),
(197151, 'deDE', 'Dieser Sterbliche hat Euren Verrat gesehen!', '', 39653),
(197150, 'deDE', '', 'Ganz genau.', 39653),
(197149, 'deDE', 'Sin\'dane, ist das der Störenfried, der unseren Angriff vereitelt hat?', 'Sin\'dane, ist das der Störenfried, der unseren Angriff vereitelt hat?', 39653),
(197148, 'deDE', '', 'Seht genauer hin, Gharmal.', 39653),
(197147, 'deDE', 'Ein Sieger tritt hervor!', 'Ein Sieger tritt hervor!', 39653),
(197120, 'deDE', 'Macht die Arena frei! Der finale Kampf beginnt!', '', 39653),
(197088, 'deDE', 'Ich kenne jemanden, der Euch helfen kann. Die Anklägerin ist ganz in der Nähe.', 'Ich kenne jemanden, der Euch helfen kann. Die Anklägerin ist ganz in der Nähe.', 39653),
(197078, 'deDE', '', 'Ich bin ganz bei Euch.', 39653),
(197077, 'deDE', '', 'Wir werden siegen.', 39653),
(197076, 'deDE', '', 'Unsere Wege werden sich wieder kreuzen.', 39653),
(197075, 'deDE', '', 'Bleibt standhaft.', 39653),
(197074, 'deDE', '', 'Ich diene.', 39653),
(197069, 'deDE', '', 'Der Kreuzzug ist bereit.', 39653),
(197041, 'deDE', '', 'Ich hoffe, Ihr könnt mir zur Hand gehen...', 39653),
(197027, 'deDE', 'Shorel\'aran.', '', 39653),
(197026, 'deDE', 'Passt gut auf Euch auf.', '', 39653),
(197025, 'deDE', 'Vergesst nicht den Tag, an dem Ihr mir begegnet seid.', '', 39653),
(197024, 'deDE', 'Die ewige Sonne leitet uns.', '', 39653),
(197023, 'deDE', 'Natürlich wendet Ihr Euch an mich.', '', 39653),
(197022, 'deDE', 'Mithdran Dämmersucher, zu Euren Diensten.', '', 39653),
(197021, 'deDE', 'Vielleicht sollte ich Euch auch mal anstupsen. Mit einem Speer.', '', 39653),
(197020, 'deDE', 'Habt Ihr nicht noch was zu tun?', '', 39653),
(197019, 'deDE', 'Ihr geht mir langsam auf die Nerven.', '', 39653),
(197018, 'deDE', 'Bleibt stark, bleibt stolz.', '', 39653),
(197017, 'deDE', 'Geht mit Ehre.', '', 39653),
(197016, 'deDE', 'Für die Horde!', '', 39653),
(197015, 'deDE', 'Die Horde lässt niemanden zurück!', '', 39653),
(197014, 'deDE', 'Wir retten die Expedition.', '', 39653),
(197013, 'deDE', 'Ich bin hier, um zu helfen.', '', 39653),
(197012, 'deDE', 'Sehen uns später!', '', 39653),
(197011, 'deDE', 'Wirklich schön, Geschäfte mit Euch zu machen.', '', 39653),
(197010, 'deDE', 'Haut rein!', '', 39653),
(197009, 'deDE', 'Zeit ist Geld.', '', 39653),
(197008, 'deDE', 'Ihr braucht\'s, ich hab\'s!', '', 39653),
(197007, 'deDE', 'Bereit, etwas Gold zu verdienen?', '', 39653),
(197006, 'deDE', '', 'Mögen die Geister mit Euch sein.', 39653),
(197005, 'deDE', '', 'Schön vorsichtig da drauß\'n.', 39653),
(197004, 'deDE', '', 'Die Überlebenden zähl\'n auf uns.', 39653),
(197003, 'deDE', '', 'Was habt Ihr denn?', 39653),
(197002, 'deDE', '', 'Is\' übles Mojo auf dieser Insel.', 39653),
(197001, 'deDE', '', 'Wir müss\'n die andren zurückhol\'n.', 39653),
(196995, 'deDE', 'Passt auf Euch auf.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(196994, 'deDE', 'Bleibt bereit.', '', 39653),
(196993, 'deDE', 'Lasst Euch nicht aus der Ruhe bringen.', '', 39653),
(196992, 'deDE', 'Ein wachsamer Geist ist ein starker Geist.', '', 39653),
(196970, 'deDE', 'Stärke erwächst aus Konzentration.', '', 39653),
(196969, 'deDE', 'Beharrlichkeit kann jeden Kampf gewinnen.', '', 39653),
(196967, 'deDE', '', 'Viel Spaß mit dem sicheren Tod.', 39653),
(196965, 'deDE', '', 'Viel Glück.', 39653),
(196964, 'deDE', '', 'Bleibt am Leben. Warum auch immer.', 39653),
(196963, 'deDE', '', 'Willkommen bei der Party.', 39653),
(196962, 'deDE', '', 'Mit der Horde wird es nie langweilig.', 39653),
(196961, 'deDE', '', 'Ich frage mich, ob diese Insel mich das Leben kosten wird. Schon wieder.', 39653),
(196960, 'deDE', 'Immer erfinderisch bleiben!', '', 39653),
(196959, 'deDE', 'Wir sehen uns!', '', 39653),
(196958, 'deDE', 'Bleibt weitestgehend an einem Stück!', '', 39653),
(196956, 'deDE', 'Nekromantie! Einfach widerlich... oder?', '', 39653),
(196955, 'deDE', 'Lust auf verbotene Magie?', '', 39653),
(196954, 'deDE', 'Interesse an ein paar kleinen Experimenten?', '', 39653),
(196952, 'deDE', '', 'Auf dass wir Frieden finden.', 39653),
(196951, 'deDE', '', 'Möge An\'she Euch den Weg weisen.', 39653),
(196950, 'deDE', '', 'Geht mit der Erdenmutter.', 39653),
(196949, 'deDE', '', 'Seid gegrüßt.', 39653),
(196948, 'deDE', '', 'Wir müssen die Krankheit hier heilen.', 39653),
(196947, 'deDE', '', 'Die Insel schreit vor Schmerzen.', 39653),
(196946, 'deDE', '', 'Kraft und Ehre.', 39653),
(196945, 'deDE', '', 'Bleibt wachsam.', 39653),
(196944, 'deDE', '', 'Mögen die Elemente Euch leiten.', 39653),
(196943, 'deDE', '', 'Wisst Ihr, was mit einem Rekruten passiert, der vom Blitz getroffen wird? Wollt Ihr es herausfinden?', 39653),
(196942, 'deDE', '', 'Für sowas hab ich mich nicht gemeldet.', 39653),
(196941, 'deDE', '', 'Man hat mich schon vor Rekruten wie Euch gewarnt.', 39653),
(196940, 'deDE', '', 'Die Horde wird siegen.', 39653),
(196939, 'deDE', '', 'Ich werde tun, was nötig ist.', 39653),
(196938, 'deDE', '', 'Wir müssen die anderen retten.', 39653),
(196937, 'deDE', '', 'Bleibt stark!', 39653),
(196936, 'deDE', '', 'Vernachlässigt nie Euer Training.', 39653),
(196935, 'deDE', '', 'Schön, Euch wiederzusehen.', 39653),
(196934, 'deDE', '', 'Lok-tar!', 39653),
(196933, 'deDE', '', 'Diese Oger werden vor der Horde erzittern!', 39653),
(196932, 'deDE', '', 'Zusammen machen wir diesen Ritualen ein Ende.', 39653),
(196931, 'deDE', '', 'Die Horde hat schon Schlimmeres überstanden.', 39653),
(196930, 'deDE', '', 'Für die Horde!', 39653),
(196929, 'deDE', '', 'Lasst Euch nie kalt erwischen.', 39653),
(196928, 'deDE', '', 'Bleibt wachsam. Überall lauert Gefahr.', 39653),
(196927, 'deDE', '', 'Ich war mal genau wie Ihr. Bevor mir etwas Vernunft eingeprügelt wurde.', 39653),
(196926, 'deDE', '', 'Ihr hängt nicht besonders an Eurem Finger, oder?', 39653),
(196925, 'deDE', '', 'Schluss jetzt. Oder ich zeige Euch, warum man mich Grimmaxt nennt.', 39653),
(196924, 'deDE', '', 'Konzentriert Euch auf unsere Mission.', 39653),
(196923, 'deDE', '', 'Die Horde lässt niemanden zurück.', 39653),
(196922, 'deDE', '', 'Wir werden nicht ruhen, bis wir die Expedition gefunden haben.', 39653),
(196912, 'deDE', 'Haltet Euch an mich. Ihr könnt Held, aber ich kann Revendreth.', '', 39653),
(196911, 'deDE', 'Ich sag den Jungs, Ihr seid in Ordnung.', '', 39653),
(196910, 'deDE', 'Vorsicht. Die Dürre macht dieses Reich besonders gefährlich.', '', 39653),
(196909, 'deDE', 'Seid so gut, sagt den fiesen Bossen nicht, dass ich nichts zu tun hab.', '', 39653),
(196908, 'deDE', 'Traut keinen Schwingen oder Fangzähnen.', '', 39653),
(196907, 'deDE', 'Folgt Euch jemand?', '', 39653),
(196906, 'deDE', 'Welche Bosse haben Euch geschickt?', '', 39653),
(196905, 'deDE', 'Würde was geben, um die Reiche zu sehen, die Ihr gesehen habt.', '', 39653),
(196904, 'deDE', 'Schlund wird größer. Wart Ihr das?', '', 39653),
(196903, 'deDE', 'Wenn Ihr gefressen werdet, gehören die schicken Schuhe da mir.', '', 39653),
(196898, 'deDE', 'Erschaffer oder Zerstörer?', '', 39653),
(196897, 'deDE', 'Dieses Loch hält mich nicht lange. Wartet\'s nur ab. Eines Tages bin ich Dieb aller Reiche!', '', 39653),
(196896, 'deDE', 'Ein wahrhaft unglaublicher Schurke. Ein Missetäter mit Kniff, Kneten und einem ganzen Kader an Kohorten!', '', 39653),
(196895, 'deDE', 'Vorsicht, wen Ihr angrabbelt. Großes erwartet mich.', '', 39653),
(196894, 'deDE', 'Helden. Pah. Was wissen die von echter Arbeit?', '', 39653),
(196893, 'deDE', 'Ey!', '', 39653),
(196892, 'deDE', 'Die Dürre wird noch unser aller Ende sein.', '', 39653),
(196888, 'deDE', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius markiert Euch für |cFFFF0000|Hspell:327039|h[Fütterungszeit]|h|r!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t Denathrius markiert Euch für |cFFFF0000|Hspell:327039|h[Fütterungszeit]|h|r!', 39653),
(196833, 'deDE', 'Hier für Arbeit? ...Oder Fäuste?', '', 39653),
(196832, 'deDE', 'Arbeit für mich?', '', 39653),
(196809, 'deDE', 'Solltet Ihr in Revendreth sein?', '', 39653),
(196765, 'deDE', 'Was macht jemand wie Ihr denn hier?', '', 39653),
(196763, 'deDE', 'Achtet auf den Himmel. Er beobachtet Euch.', '', 39653),
(196762, 'deDE', '', 'Setzt \'Sturmschlag\' so oft wie möglich ein.', 39653),
(196760, 'deDE', 'Traut den Zähnen nicht. Keiner von denen wurde umsonst hergeschickt.', '', 39653),
(196759, 'deDE', 'Setzt \'Sturmschlag\' so oft wie möglich ein.', '', 39653),
(196757, 'deDE', 'Ey!', '', 39653),
(196756, 'deDE', 'Ganz schön lebendig.', '', 39653),
(196739, 'deDE', 'Ich habe Euch perfektioniert. Jetzt dient mir mit dem Tod unserer Feinde!', '', 39653),
(196738, 'deDE', 'J-ja... Meister...', '', 39653),
(196732, 'deDE', 'Nein! Nein! NEIN!', '', 39653),
(196731, 'deDE', 'Was... macht Ihr... mit mir?!', '', 39653),
(196729, 'deDE', '', 'Thanikos!', 39653),
(196727, 'deDE', 'Ah, genau das richtige Gefäß.', '', 39653),
(196726, 'deDE', 'Für die Archon! Für die Bastion!', '', 39653),
(196725, 'deDE', 'Mein Paragon, Ihr seid nicht allein!', '', 39653),
(196724, 'deDE', '', 'Ihr könnt nicht gewinnen, Totenbeschwörer! Unser Mut wankt nie!', 39653),
(196723, 'deDE', '', '\'Sturmschlag\' ist ein starker Angriff mit beiden Waffen und entfesselt gewaltige, mit der Zeit aufgebaute elektrische Energien. Eure Fähigkeiten können zusätzlich \'Sturmbringer\' auslösen und Euch sofort eine verstärkte Aufladung von \'Sturmschlag\' gewähren.', 39653),
(196722, 'deDE', '', 'Eure mächtigste Waffenfähigkeit ist \'Sturmschlag\'.', 39653),
(196715, 'deDE', '\'Sturmschlag\' ist ein starker Angriff mit beiden Waffen und entfesselt gewaltige, mit der Zeit aufgebaute elektrische Energien. Eure Fähigkeiten können zusätzlich \'Sturmbringer\' auslösen und Euch sofort eine verstärkte Aufladung von \'Sturmschlag\' gewähren.', '', 39653),
(196669, 'deDE', 'Eure mächtigste Waffenfähigkeit ist \'Sturmschlag\'.', '', 39653),
(196648, 'deDE', '', '\'Lavapeitsche\' verwendet Eure Schildhandwaffe, also verstärkt ihre sengende Kraft, indem Ihr die Waffe mit \'Flammenzunge\' verzaubert.', 39653),
(196646, 'deDE', '', 'Setzt dann \'Lavapeitsche\' ein, um Euer Ziel mit der Urgewalt geschmolzener Lava zu treffen.', 39653),
(196645, 'deDE', 'Setzt dann \'Lavapeitsche\' ein, um Euer Ziel mit der Urgewalt geschmolzener Lava zu treffen.', '', 39653),
(196588, 'deDE', '', 'Verleiht zuerst Euren Waffen die Macht von Wind und Feuer.', 39653),
(196587, 'deDE', 'Verleiht zuerst Euren Waffen die Macht von Wind und Feuer.', '', 39653),
(196578, 'deDE', '', 'Wirkt \'Flammenzunge\' und \'Windzorn\' auf Eure Waffen.', 39653),
(196577, 'deDE', 'Wirkt \'Flammenzunge\' und \'Windzorn\' auf Eure Waffen.', '', 39653),
(196560, 'deDE', 'Ihr. Seid. Entbehrlich.', '', 39653),
(196559, 'deDE', 'Geduld ist eine Tugend... Eine Tugend, über die ich nicht mehr länger verfüge.', '', 39653),
(196557, 'deDE', 'Wir Mograines sind nicht für unsere Zurückhaltung bekannt.', '', 39653),
(196556, 'deDE', 'Ein weiteres Ärgernis, dem ich mit widmen muss.', '', 39653),
(196555, 'deDE', 'Weggetreten.', '', 39653),
(196554, 'deDE', 'Wir wissen, was es heißt... Opfer zu bringen.', '', 39653),
(196553, 'deDE', 'Sammelt Euren Hass. Macht ihn Euch zunutze.', '', 39653),
(196552, 'deDE', 'Noch ist nicht alles verloren. Noch nicht.', '', 39653),
(196551, 'deDE', 'Für uns gibt es keinen Frieden. Keine Rast.', '', 39653),
(196550, 'deDE', 'Wir folgen einer einzigen Bestimmung: Vergeltung.', '', 39653),
(196549, 'deDE', 'Wir sind ewig. Wir sind unnachgiebig.', '', 39653),
(196548, 'deDE', 'Es bleibt ein Funken Hoffnung.', '', 39653),
(196546, 'deDE', 'Wir müssen unser eigenes Schicksal schmieden.', '', 39653),
(196544, 'deDE', 'Wir werden dies durchstehen... bis zum bitteren Ende.', '', 39653),
(196542, 'deDE', 'Die Ritter der Schwarzen Klinge werden nicht wanken.', '', 39653),
(196488, 'deDE', 'Wütende Winde wehen wild durch die Winterluft.', 'Wütende Winde wehen wild durch die Winterluft.', 39653),
(196485, 'deDE', '|TInterface\\ICONS\\SPELL_FROST_RING OF FROST.BLP:20|t |cFFF00000|Hspell:326787|h[Unterkühlende Winde]|h|r erfüllen die Luft! Sucht an einem |TInterface\\ICONS\\SPELL_FIRE_FIRE.BLP:20|t |cFFF00000|Hspell:326774|h[Feuer]|h|r Wärme.', '|TInterface\\ICONS\\SPELL_FROST_RING OF FROST.BLP:20|t |cFFF00000|Hspell:326787|h[Unterkühlende Winde]|h|r erfüllen die Luft! Sucht an einem |TInterface\\ICONS\\SPELL_FIRE_FIRE.BLP:20|t |cFFF00000|Hspell:326774|h[Feuer]|h|r Wärme.', 39653),
(196471, 'deDE', '', 'Ihr habt die Überlebenden gerettet un\' alle Spinn\' plattgemacht.', 39653),
(196470, 'deDE', '', 'Oh gut, Ihr habt es geschafft.', 39653),
(196469, 'deDE', '', 'Dunkle Magie hat diesen Ort verheert.', 39653),
(196468, 'deDE', '', 'An\'she, bewache und beschütze uns!', 39653),
(196431, 'deDE', '|TINTERFACE\\ICONS\\inv_misc_hook_01.blp:20|t Fleischnahts Schöpfung zielt mit dem |cFFFF0404|Hspell:322681|h[Fleischerhaken]|h|r auf Euch!', '|TINTERFACE\\ICONS\\spell_warlock_soulburn.blp:20|t Fleischnahts Schöpfung zielt mit |cFFFF0404|Hspell:308044|h[Stygische Vernichtung]|h|r auf Euch!', 39653),
(196395, 'deDE', '', 'Wir beenden diese Rituale, bevor die Oger sie abschließen können. Lok-tar ogar!', 39653),
(196394, 'deDE', '', 'Dann müssen wir handeln. Denk daran: Mit vereinten Kräften bezwingt die Horde jede Herausforderung.', 39653),
(196393, 'deDE', '', 'Es hat schon begonnen... Sie wollen den Drachen mit der gesammelten Lebenskraft reanimieren!', 39653),
(196392, 'deDE', '', 'Für ihre Magie brauchen sie Opfer wie uns. Sie sind dabei, ein Ritual zu beginnen, das...', 39653),
(196391, 'deDE', '', 'Zu Befehl. Die Oger wollen durch Nekromantie einen toten Drachen erwecken.', 39653),
(196381, 'deDE', 'Ja... Ja! Die Fesseln werden schwächer...', '', 39653),
(196367, 'deDE', 'Jeder hat seinen Preis.', '', 39653),
(196366, 'deDE', 'Unterschätzt nie die Macht, die ein bisschen sozialer Einfluss mit sich bringt.', '', 39653),
(196365, 'deDE', 'Erinnert Euch, wer die Steine klopft, auf denen Ihr geht.', '', 39653),
(196364, 'deDE', 'Was ist Euer Begehr, Pöbel?', '', 39653),
(196363, 'deDE', 'Was für ein sonderbares Instrument... Wie viel?', '', 39653),
(196362, 'deDE', 'Seid Ihr hier, um Euren Zehnt zu bezahlen?', '', 39653),
(196360, 'deDE', '', 'Ihr seid die Jagd nicht wert.', 39653),
(196359, 'deDE', '', 'In mir regt sich der Verdacht, dass Ihr mich verfolgt.', 39653),
(196358, 'deDE', '', 'Ihr könnt Euch nicht vor mir verstecken.', 39653),
(196357, 'deDE', '', 'Bleibt wachsam, oder jemand anderes ist es.', 39653),
(196356, 'deDE', '', 'Ich würde auch flüchten, wenn ich Ihr wäre.', 39653),
(196355, 'deDE', '', 'Nächstes Mal finde ich Euch.', 39653),
(196354, 'deDE', '', 'Ihr stinkt nach Sünde... Ihr wärt leicht zu finden.', 39653),
(196353, 'deDE', '', 'Ich gebe Euch einen Vorsprung.', 39653),
(196352, 'deDE', '', 'Flieht, solange Ihr noch könnt.', 39653),
(196351, 'deDE', '', 'Alles ist Beute für das Raubtier an der Spitze.', 39653),
(196350, 'deDE', '', 'Ihr müsst mich nicht kennen, um mich zu fürchten.', 39653),
(196349, 'deDE', '', 'Ihr braucht nur eine Schwäche, um verwundbar zu sein.', 39653),
(196346, 'deDE', '', 'Die Furcht selbst... genügt.', 39653),
(196345, 'deDE', '', 'Ihr habt vieles zu fürchten.', 39653),
(196344, 'deDE', '', 'Eure Angst verrät Euch.', 39653),
(196343, 'deDE', '', 'Wurdet Ihr jemals wirklich gedemütigt?', 39653),
(196313, 'deDE', 'Mit Euch bin ich fertig. Für den Moment.', '', 39653),
(196310, 'deDE', 'Gold? Wofür brauche ich Gold?', '', 39653),
(196309, 'deDE', 'Belästigt mich nicht länger!', '', 39653),
(196308, 'deDE', 'Ich diene... dem Lichkönig? Nein... Das kann nicht sein...', '', 39653),
(196307, 'deDE', 'Was ist das für eine Folter?', '', 39653),
(196299, 'deDE', '', 'Feiglinge! Bald spürt Ihr die volle Macht der Horde!', 39653),
(196291, 'deDE', 'Wahre Arroganz ist, Zeit damit zu verschwenden, eine gebundene Seele zu quälen, wenn die Schattenlande in Gefahr sind!', '', 39653),
(196289, 'deDE', 'Wie Ihr seht, war die Terrasse der Magister nur ein Rückschlag.', '', 39653),
(196288, 'deDE', 'Ich dachte, mein Pakt mit Kil\'jaeden würde die Sin\'dorei retten. Aber... er hat alles nur schlimmer gemacht.', '', 39653),
(196284, 'deDE', 'Die Venthyr können mich auch ohne Eure Hilfe gut quälen.', '', 39653),
(196283, 'deDE', 'Ich habe alles nur für die Sin\'dorei getan.', '', 39653),
(196282, 'deDE', 'Bis Ihr mich ein weiteres Mal braucht.', '', 39653),
(196281, 'deDE', 'Ich werde über meine... Vergehen nachdenken.', '', 39653),
(196276, 'deDE', 'Maßt Euch nicht an, über mich zu richten.', '', 39653),
(196274, 'deDE', 'Ich denke, ich habe Zeit, zuzuhören.', '', 39653),
(196273, 'deDE', 'Und was möchtet Ihr von mir?', '', 39653),
(196269, 'deDE', 'Ich kann lernen, bescheiden zu sein. Aber niemals unterwürfig.', '', 39653),
(196256, 'deDE', 'Für den Sonnenbrunnen.', '', 39653),
(196255, 'deDE', 'War das alles?', '', 39653),
(196254, 'deDE', 'Also schön.', '', 39653),
(196251, 'deDE', 'Wenn Ihr etwas zu sagen habt, dann sprecht!', '', 39653),
(196248, 'deDE', 'Nur ich gebiete über meine Macht.', '', 39653),
(196245, 'deDE', 'Ist es eine Sünde, ums Überleben zu kämpfen?', '', 39653),
(196244, 'deDE', 'Ihr sprecht mit dem Sonnenkönig.', '', 39653),
(196228, 'deDE', 'Och, Ihr habt \'n bisschen Zeit für mich!', '', 39653),
(196227, 'deDE', 'Neuer Tag, neue Abmachung.', '', 39653),
(196226, 'deDE', 'Oh. Ihr seid wohl nich\' tot... noch nich\'.', '', 39653),
(196222, 'deDE', 'Ah... Ihr habt mich vermisst!', '', 39653),
(196221, 'deDE', 'Auf bald! Ganz bald.', '', 39653),
(196219, 'deDE', 'Vergesst nich\', die Loa wach\'n über Euch.', '', 39653),
(196217, 'deDE', 'Ich werd lange hier sein.', '', 39653),
(196216, 'deDE', 'Sorgt Euch nich\'. Ich bin nie weit.', '', 39653),
(196067, 'deDE', 'Keine... Sorge. Gut, dass Ihr alle in Sicherheit seid.', '', 39653),
(196066, 'deDE', '', 'Anduin! Wie schlimm seid Ihr verletzt?', 39653),
(196062, 'deDE', 'Diese Fesseln können wir nicht brechen. Wir müssen ihn anders befreien.', '', 39653),
(196057, 'deDE', '', 'Unwichtig. Wir finden, was wir suchen... in jemand anderem.', 39653),
(196056, 'deDE', '', 'Oh, wie engstirnig. Da enttäuscht Ihr mich.', 39653),
(196055, 'deDE', 'Ihr brecht... mich nicht...', '', 39653),
(196045, 'deDE', 'Schluss jetzt, sonst heißt\'s grau statt orange!', '', 39653),
(196044, 'deDE', 'Genug Eurer Belästigungen! Da ist mir ja Einzelhaft lieber!', '', 39653),
(196043, 'deDE', 'Das ist ein Ort zahlloser Legenden.', '', 39653),
(196042, 'deDE', 'Wir müssen ihn aufhalten.', '', 39653),
(196041, 'deDE', 'Das Schicksal hat uns zusammengeführt.', '', 39653),
(196040, 'deDE', 'Ich erinnere mich... an so wenig.', '', 39653),
(196039, 'deDE', 'Ich... erinnere mich an Euch.', '', 39653),
(196038, 'deDE', 'Was habt Ihr entdeckt?', '', 39653),
(196037, 'deDE', 'Ich werde Euch bestmöglich helfen.', '', 39653),
(196036, 'deDE', 'Geht vorsichtig in die Finsternis.', '', 39653),
(196035, 'deDE', 'Schützt Eure Seele, Sterblicher.', '', 39653),
(196034, 'deDE', 'Diese Hallen bergen Schrecken jenseits aller Vorstellungskraft.', '', 39653),
(196033, 'deDE', 'Vorsichtig entfernen', '', 39653),
(195976, 'deDE', '$n stellt einen zusammengenähten Überraschungskuchen hin, an dem alle Hungrigen sich erfreuen können.', '$n stellt einen zusammengenähten Überraschungskuchen hin, an dem alle Hungrigen sich erfreuen können.', 39653),
(195973, 'deDE', 'Ich muss meine Ausrüstung reparieren.', 'Ich muss meine Ausrüstung reparieren.', 39653),
(195923, 'deDE', 'Hütet Euch vor dem Auge des Kerkermeisters.', '', 39653),
(195922, 'deDE', 'Wir wandern durch die Bruchstücke der Erinnerung.', '', 39653),
(195921, 'deDE', 'Verliert Euch nicht in Verzweiflung.', '', 39653),
(195911, 'deDE', 'Die Vergangenheit ist ein zerbrochener Spiegel.', '', 39653),
(195890, 'deDE', 'Das kann ich für Euch bauen.', 'Das kann ich für Euch bauen.', 39653),
(195850, 'deDE', '', 'Ihr unterstreicht nur, was ich bisher von Sterblichen gehalten habe.', 39653),
(195849, 'deDE', '', 'Müsst Ihr Euch denn so benehmen?', 39653),
(195848, 'deDE', '', 'Euer Verhalten ist schockierend.', 39653),
(195847, 'deDE', '', 'Ihr solltet Euch schämen.', 39653),
(195846, 'deDE', '', 'Wo sind Eure Manieren?', 39653),
(195845, 'deDE', '', 'Das wäre alles.', 39653),
(195843, 'deDE', '', 'Kommt bald wieder.', 39653),
(195842, 'deDE', '', 'Bis wir uns wiedersehen.', 39653),
(195841, 'deDE', '', 'Gehabt Euch wohl.', 39653),
(195840, 'deDE', '', 'Ich bin ganz Ohr.', 39653),
(195839, 'deDE', '', 'Welche Geheimnisse könnt Ihr berichten?', 39653),
(195838, 'deDE', '', 'Euer Aufzug ist... amüsant.', 39653),
(195837, 'deDE', '', 'Lasst uns reden.', 39653),
(195828, 'deDE', '', 'Betroffene Ziele erleiden außerdem mehr Schaden durch jeden Eurer Zauber. Im Gegensatz zu \'Agonie\' und \'Verderbnis\' wirkt \'Instabiles Gebrechen\' aber immer nur auf einen Gegner.', 39653),
(195826, 'deDE', '\'Instabiles Gebrechen\' verursacht regelmäßigen Schaden und erhöht den Schaden aller anderen Zauber gegen den Gegner.', '', 39653),
(195807, 'deDE', 'Jetzt macht Ihr mich RICHTIG wütend!!', '', 39653),
(195806, 'deDE', 'Jetzt macht Ihr mich wütend!', '', 39653),
(195805, 'deDE', 'Was kommt da von oben? Ha ha ha.', '', 39653),
(195804, 'deDE', 'Druuuu...', '', 39653),
(195803, 'deDE', 'Aufi-wachi... Knochen-krachi!', '', 39653),
(195802, 'deDE', 'Ich müde. Brauche kleines Nickerchen...', '', 39653),
(195798, 'deDE', 'Steine fallen, Ihr sterbt!', '', 39653),
(195796, 'deDE', 'Grah!!', '', 39653),
(195794, 'deDE', 'Grah! Genug Magie! Zeit zum ZERSCHMETTERN!', '', 39653),
(195781, 'deDE', '', 'Ihr genießt meine Gastfreundschaft, solange Ihr Euch anhört, was ich Euch zu sagen habe.', 39653),
(195685, 'deDE', '...und manche trotzdem unbeugsam.', '', 39653),
(195684, 'deDE', '...hungernd...', '', 39653),
(195683, 'deDE', 'Doch Ihr kommt inmitten eines gewalttätigen Aufstands. Unsere Ressourcen sind knapp bemessen.', '', 39653),
(195682, 'deDE', 'Schlundgänger, ich weiß um Eure dringende Bitte um Anima. Normalerweise würde ich ihr zu gern nachkommen.', '', 39653),
(195681, 'deDE', 'Ich präsentiere Euch... den Schlundgänger.', '', 39653),
(195680, 'deDE', 'Aber ich fürchte, Ihr werdet diesen Triumph nicht miterleben.', '', 39653),
(195679, 'deDE', '...wenn auch etwas lästig.', '', 39653),
(195678, 'deDE', 'Ihr müsst wirklich besser auf ungebetene Gäste achten, meine Dame.', '', 39653),
(195677, 'deDE', 'Ans Werk, Inerva.', '', 39653),
(195676, 'deDE', '', 'Anima ernten erfordert Finesse.', 39653),
(195523, 'deDE', 'Was im Namen des Meisters...?', '', 39653),
(195379, 'deDE', 'Ich bin immer noch zu alt für diesen Unsinn.', '', 39653),
(195378, 'deDE', 'Mein Schicksal steht noch nicht geschrieben.', '', 39653),
(195377, 'deDE', 'Die Verschmähten müssen aufgehalten werden.', '', 39653),
(195376, 'deDE', 'Gerechtigkeit, Rache... Ein schmaler Grat...', '', 39653),
(195375, 'deDE', 'Danke für Eure Gnade.', '', 39653),
(195374, 'deDE', 'War alles umsonst?', '', 39653),
(195373, 'deDE', 'Ich habe Antworten gesucht... und nur Wut gefunden.', '', 39653),
(195372, 'deDE', 'Ich habe vieles zu bedenken.', '', 39653),
(195371, 'deDE', 'Meine Erinnerungen suchen mich noch immer heim.', '', 39653),
(195356, 'deDE', '', 'Euch blüht ein Sommernachtsalptraum.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(195355, 'deDE', '', 'Vergesst Tirna Noch. Wenn Ihr so weitermacht, lernt Ihr Tirna Loch im Kopf kennen.', 39653),
(195354, 'deDE', '', 'Ihr glaubt, die Spriggans sind schlimm? Kommt. Stupst mich nochmal.', 39653),
(195353, 'deDE', '', 'Ihr werdet richtig Spaß haben!', 39653),
(195352, 'deDE', '', 'Ich kann Euren nächsten Schritt kaum erwarten.', 39653),
(195350, 'deDE', '', 'Mit Euch ist es nie langweilig.', 39653),
(195349, 'deDE', '', 'Welch geistreiche Schlagfertigkeit.', 39653),
(195348, 'deDE', '', 'War das alles?', 39653),
(195347, 'deDE', '', 'Immer ein Vergnügen.', 39653),
(195346, 'deDE', '', 'Wir werden uns wiedersehen.', 39653),
(195345, 'deDE', '', 'Ihr seid besonders, nicht wahr?', 39653),
(195344, 'deDE', '', 'So schön, Euch zu sehen.', 39653),
(195343, 'deDE', '', 'Was kann ich für Euch tun?', 39653),
(195342, 'deDE', '', 'Sieht aus, als könntet Ihr Hilfe brauchen, hm?', 39653),
(195341, 'deDE', '', 'Verzeihung, brauchtet Ihr etwas?', 39653),
(195339, 'deDE', '', 'Sieh einer an, was haben wir denn hier?', 39653),
(195338, 'deDE', '', 'Oh, das dürfte interessant werden.', 39653),
(195330, 'deDE', '', 'Statt eines Kerkermeisters gäbe es eine Königin, kalt und schön wie der Winter. Alle würden mich lieben und verzweifeln!', 39653),
(195323, 'deDE', '', 'Habt Ihr eine Schwester, sterbliches Wesen? Ihr seid mindestens genauso anstrengend wie meine.', 39653),
(195322, 'deDE', '', 'Ich bin ewig. Meine Geduld ist es nicht.', 39653),
(195321, 'deDE', '', 'Es gibt eine Zeit für Mitgefühl... und eine Zeit für Entschlossenheit.', 39653),
(195320, 'deDE', '', 'Egal was kommt, wir müssen unsere Pflicht erfüllen.', 39653),
(195319, 'deDE', '', 'Der Wald wird Euch beobachten.', 39653),
(195318, 'deDE', '', 'Gute Jagd, Schlundgänger.', 39653),
(195317, 'deDE', '', 'Der Hof der Nacht steht Euch bei.', 39653),
(195316, 'deDE', '', 'Mögen Eure Mühen Früchte tragen.', 39653),
(195315, 'deDE', '', 'Geht mit dem Segen der Wildnis.', 39653),
(195314, 'deDE', '', 'Schwierige Entscheidungen sind uns nicht fremd.', 39653),
(195313, 'deDE', '', 'Die Dürre bedroht uns alle.', 39653),
(195311, 'deDE', '', 'Der Ardenwald möchte Euer Gesuch anhören.', 39653),
(195310, 'deDE', '', 'Ich gewähre Euch eine Audienz, Sterblicher.', 39653),
(195308, 'deDE', '', 'Unsere heilige Aufgabe bleibt unverändert.', 39653),
(195307, 'deDE', '', 'Die Sterne drehen sich. Der Zyklus geht weiter.', 39653),
(195306, 'deDE', '', 'Sprecht und der Wald wird zuhören.', 39653),
(195305, 'deDE', 'Ich schreie nicht! Ihr schreit! Wartet, ICH schreie. DAS MACHE ICH NUN MAL!', '', 39653),
(195304, 'deDE', 'Glaubt Ihr, das hier ist ein Spiel? Das. IST. MALDRAXXUS!', '', 39653),
(195302, 'deDE', 'Beweist Euren Wert.', '', 39653),
(195300, 'deDE', 'Champions werden nicht geboren. Sie werden geschmiedet.', '', 39653),
(195298, 'deDE', 'Gebt nie auf.', '', 39653),
(195291, 'deDE', 'Kämpft gut, Gladiator.', '', 39653),
(195290, 'deDE', 'Es gibt nichts Schöneres als Kampfeslärm.', '', 39653),
(195288, 'deDE', 'Heute haben wir Frischfleisch.', '', 39653),
(195286, 'deDE', 'Nehmt Euch eine Waffe und reiht Euch ein.', '', 39653),
(195268, 'deDE', 'Wollt Ihr Euch messen?', '', 39653),
(195248, 'deDE', '', 'Auf Wiedersehen.', 39653),
(195247, 'deDE', '', 'Lasst den Wind nicht alles hören.', 39653),
(195246, 'deDE', '', 'Im Wald seid Ihr nie allein.', 39653),
(195245, 'deDE', '', 'He. Wollt Ihr ein Geheimnis hören?', 39653),
(195244, 'deDE', '', 'Sagt mir, wie ich Euch helfen kann.', 39653),
(195243, 'deDE', '', 'Ich wusste doch, dass Ihr mich besuchen kommt.', 39653),
(195242, 'deDE', 'Elunes Zorn sollte man nicht unterschätzen.', '', 39653),
(195241, 'deDE', 'Nichts ist wichtiger als die, die wir lieben.', '', 39653),
(195240, 'deDE', 'Wir alle tun, was wir tun müssen.', '', 39653),
(195239, 'deDE', 'Möchtet Ihr mich etwas fragen?', '', 39653),
(195238, 'deDE', 'Der Wald singt Loblieder auf Euch.', '', 39653),
(195237, 'deDE', 'Grüße.', '', 39653),
(195236, 'deDE', 'Ich wünsche Euch nur das Beste.', '', 39653),
(195235, 'deDE', 'Beschützt das, was Euch am Herzen liegt.', '', 39653),
(195234, 'deDE', 'Bereut nichts, was Ihr aus Liebe tut.', '', 39653),
(195233, 'deDE', 'Der Wald steht tief in Eurer Schuld.', '', 39653),
(195232, 'deDE', 'Seid gegrüßt, Held von Azeroth.', '', 39653),
(195231, 'deDE', 'Sucht Ihr die Weisheit des Nachtkriegers?', '', 39653),
(195192, 'deDE', '', 'Kommt jetzt. Der Moment der Entscheidung ist gekommen.', 39653),
(195191, 'deDE', 'Hey, Mann, denk\'n wir an meine Zeit als Kriegshäuptling zurück. <Schweigt drei Sekunden.> Fertig? <Seufzt.> Ja, Mann, ich auch.', '', 39653),
(195190, 'deDE', '', 'So soll es sein, Ewige. Mit ihrer Stimme habe ich gesprochen.', 39653),
(195189, 'deDE', '', 'Und wenn unsre Welten wieder erstarkt sind, werden wir uns gemeinsam gegen die Dunkelheit stellen.', 39653),
(195188, 'deDE', 'Is\' ganz schön schwer, Schattenjäger zu sein, wenn der eig\'ne Geist keinen Schatten wirft!', '', 39653),
(195187, 'deDE', '', 'Ja. Zum Wohl der Schattenlande sollte jeder Sterbliche einen Pakt eingehen.', 39653),
(195186, 'deDE', '', 'Auch meinem Wald wurde geholfen. Die Sterblichen haben großes Potenzial bewiesen, das das Blatt zu unseren Gunsten wenden könnte.', 39653),
(195185, 'deDE', 'Vorsicht. Wär nich\' das erste Mal, dass ich wen verhexe, der nich\' mit dem Stupsen aufhört!', '', 39653),
(195184, 'deDE', 'Noch ist Hoffnung. Der Sterbliche hier hat mich gerettet und den Verrat des Grafen aufgedeckt.', '', 39653),
(195183, 'deDE', '', 'Der Primus ist fort, Denathrius ein Verräter, unser Pantheon in Trümmern... die Schattenlande stehen vor dem Untergang.', 39653),
(195182, 'deDE', '', 'Vor langer Zeit kämpften wir alle gegen dieses... Monster.', 39653),
(195181, 'deDE', 'Als sein Verrat aufgedeckt wurde, hat er seine gesammelte Anima in den Schlund gelenkt um die Macht... seinem wahren Meister zu schenken.', '', 39653),
(195180, 'deDE', 'Die Dürre war sein Werk. Er hat das Lebensblut von uns gestohlen und sein Volk ausgehungert... sowie Eures.', '', 39653),
(195179, 'deDE', 'Mein Graf... hat uns alle verraten.', '', 39653),
(195178, 'deDE', '', 'Ihr sprecht für Revendreth? Wo ist Euer Graf? Wo ist unser Bruder Denathrius?', 39653),
(195177, 'deDE', '', 'Der Primus hat die Wahrheit durchschaut, aber seine Warnung kam zu spät. Für sein Wissen hat er einen hohen Preis bezahlt.', 39653),
(195176, 'deDE', '', 'Das Böse, das wir verbannt wähnten, versucht uns abzulenken und zu spalten.', 39653),
(195175, 'deDE', '', 'Der Schlund wächst und brodelt vor Macht! Wie konnte das passieren?!', 39653),
(195174, 'deDE', '', 'Als Stimme der Richterin, höre ich den Ruf der Ewigen. Wie kann ich helfen?', 39653),
(195138, 'deDE', '', 'Die Berührung des Schlunds lastet auch auf ihnen.', 39653),
(195137, 'deDE', 'Haltet ein. Ich bin Bolvar Fordragon. Diese Ritter und ich möchten helfen.', '', 39653),
(195136, 'deDE', 'Mehr Fremde! Was habt Ihr nur getan, Sterblicher?', '', 39653),
(195119, 'deDE', '', 'Kah-Delen! Kah-Sher! Gelobt sei die Vorsehung! Endlich regt sich die Richterin!', 39653),
(195118, 'deDE', '', 'Diese Flucht bedeutet vielleicht, dass das Gefängnis... schwächer wird. Dann könnte der Verbannte...', 39653),
(195117, 'deDE', 'Jeder Diener in Oribos lernt, dass der Schlund undurchdringlich ist und dass seine bösartigen Seelen für immer eingeschlossen sind.', '', 39653),
(195092, 'deDE', 'Ich höre.', '', 39653),
(195091, 'deDE', 'Seid Ihr bereit?', '', 39653),
(195090, 'deDE', 'Die Geister sin\' ruheloser denn je.', '', 39653),
(195089, 'deDE', 'Braucht Ihr was, Mann?', '', 39653),
(195088, 'deDE', 'Finstere Zeiten.', '', 39653),
(195087, 'deDE', 'Passt auf die Schatt\'n auf.', '', 39653),
(195086, 'deDE', 'Der alte Vol\'jin wird wart\'n.', '', 39653),
(195085, 'deDE', 'Haltet die Augen off\'n.', '', 39653),
(195084, 'deDE', 'Alles is\' \'ne Prüfung. Durchhalt\'n, Mann.', '', 39653),
(195083, 'deDE', 'Für die Dunkelspeere... un\' alle Stämme.', '', 39653),
(195082, 'deDE', 'Die Geister beobacht\'n uns... Die gut\'n und die bös\'n.', '', 39653),
(195081, 'deDE', 'Bis dann.', '', 39653),
(195080, 'deDE', '', 'Ich bin die Ernterin des Zorns. Würdet Ihr gern erfahren, warum?', 39653),
(195079, 'deDE', '', 'Im Leben habe ich wesentlich gefährlichere Helden als Euch in die Schattenlande geschickt.', 39653),
(195078, 'deDE', '', 'Seid vorsichtig, oder Revendreth wird Euer wahres Schicksal.', 39653),
(195077, 'deDE', '', 'Krieg ist Sturm im Wetter der Konflikte.', 39653),
(195076, 'deDE', '', 'Ich habe genug Krieger geerntet, um die Sinnlosigkeit des Krieges zu kennen.', 39653),
(195075, 'deDE', '', 'Ich ernte so viele Helden wie Schurken. Wir sehen uns noch.', 39653),
(195074, 'deDE', '', 'Die Steingeborenen sind meine Kinder. Handelt überlegt.', 39653),
(195073, 'deDE', '', 'Ich dulde keinen Krieg zwischen meinen Steinkindern.', 39653),
(195072, 'deDE', '', 'Achtet auf die Etikette in diesem Reich. Niemand ist zufällig hier.', 39653),
(195071, 'deDE', '', 'Am Ende holt uns der Schlund alle.', 39653),
(195070, 'deDE', '', 'Man sträubt sich nicht gegen den Willen des Meisters.', 39653),
(195069, 'deDE', '', 'Wählt Eure nächsten Worte mit Bedacht.', 39653),
(195068, 'deDE', '', 'Ich habe Euren Namen auf vielen frischen Sündensteinen gesehen.', 39653),
(195067, 'deDE', '', 'Verschwindet hier, bevor es zu spät ist.', 39653),
(195066, 'deDE', '', 'Die Lebenden sollten nicht hier sein.', 39653),
(195065, 'deDE', '', 'Ich hab nicht sonderlich viel übrig für... Helden.', 39653),
(195064, 'deDE', 'Muss ich Euch an Euren Stand hier erinnern, Sterblicher. Ihr habt kaum Verbündete in diesem Reich.', '', 39653),
(195063, 'deDE', 'Graf Denathrius wird von dieser Respektlosigkeit erfahren.', '', 39653),
(195062, 'deDE', 'Werdet Ihr etwa hochnäsig mit mir?', '', 39653),
(195061, 'deDE', 'Revendreth ist entschlossen!', '', 39653),
(195060, 'deDE', 'Schenkt den Gerüchten über Rebellion keinen Glauben.', '', 39653),
(195059, 'deDE', 'Vertraut dem Plan des Meisters.', '', 39653),
(195058, 'deDE', 'Die Gerüchte um die Dürre sind sehr überzogen.', '', 39653),
(195055, 'deDE', 'Graf Denathrius freut sich schon darauf, dass ich Euch ihm vorstelle.', '', 39653),
(195054, 'deDE', 'Kann ich Euch helfen?', '', 39653),
(195053, 'deDE', 'Willkommen in Revendreth.', '', 39653),
(195052, 'deDE', 'Ich diene dem Meister.', '', 39653),
(195051, 'deDE', '', 'Die Rebellion ist längst tot. Manche haben das nur noch nicht begriffen.', 39653),
(195050, 'deDE', '', 'Loyalität statt Ehrlosigkeit.', 39653),
(195049, 'deDE', '', 'Für Prinz Renathal!', 39653),
(195045, 'deDE', '', 'Oh gut! Ich brauche Eure Hände.', 39653),
(195044, 'deDE', '', 'Haltet Eure Klinge messerscharf.', 39653),
(195043, 'deDE', '', 'Meine Kurven sind tödlich!', 39653),
(195042, 'deDE', '', 'Bin ich nur ein Objekt für Euch?', 39653),
(195041, 'deDE', '', 'Ein Körper. Gut. Könnte nützlich sein.', 39653),
(194976, 'deDE', '', 'Erhebt Euch, $p von Azeroth, als Jägerin der Wilden Jagd, Champion des Hofs der Nacht und Beschützerin des Ardenwalds.', 39653),
(194928, 'deDE', '', 'Gehabt Euch wohl.', 39653),
(194927, 'deDE', '', 'Geb immer Euer Bestes.', 39653),
(194926, 'deDE', '', 'Bis wir uns wiedersehen.', 39653),
(194925, 'deDE', '', 'Ja?', 39653),
(194924, 'deDE', '', 'Wie kann ich Euch helfen?', 39653),
(194923, 'deDE', '', 'Für den Kreuzzug.', 39653),
(194849, 'deDE', 'Leiten wir diese Anima um.', 'Leiten wir diese Anima um.', 39653),
(194723, 'deDE', 'Bringt die Expeditionsmitglieder sicher nach Hause. Für die Horde!', '', 39653),
(194722, 'deDE', 'Ihr und andere Goblins habt Euch als Mitglieder des Bilgewasserkartells der Horde angeschlossen in Aussicht auf Abenteuer... und Profit!', '', 39653),
(194721, 'deDE', 'Obwohl die Heimat der Blutelfen fast an Tragödie und Verrat verloren ging, haben sich Eure Leute ihr Geburtsrecht zurückgeholt und streben nach neuem Ruhm.', '', 39653),
(194720, 'deDE', 'Die Dunkelspeertrolle haben die Barbarei der anderen Trollstämme abgelegt und beschützen ihre Verbündeten mit wilder Zähigkeit.', '', 39653),
(194718, 'deDE', 'Als einer der weisen und edlen Tauren ehrt Ihr mit Eurer Stärke und spirituellen Entschlossenheit das Andenken Eurer Vorfahren.', '', 39653),
(194717, 'deDE', 'Die untoten Verlassenen mögen von den Lebenden verstoßen sein, doch streben sie danach, aus den Trümmern eine neue Zukunft zu schmieden.', '', 39653),
(194716, 'deDE', 'Obwohl die Orcs diese Welt als Eroberer betreten haben, zählt Euer Volk heute zu ihren größten Champions.', '', 39653),
(194714, 'deDE', 'Als neuer Rekrut seid Ihr Teil einer Rettungsmission, die von Orgrimmar aufbricht.', '', 39653),
(194713, 'deDE', 'Kürzlich ist eine Hordeexpedition zu einer unerforschten Insel verschollen.', '', 39653),
(194712, 'deDE', 'Ihr seid Teil der mächtigen Horde. Dieser Bund aus verschiedensten Völkern kämpft vereint für Freiheit, Ehre und Ruhm.', '', 39653),
(194699, 'deDE', '', 'Widerstand ist nicht ratsam.', 39653),
(194656, 'deDE', '', 'Ich bin vielseitig. Lernt diese Seite kennen!', 39653),
(194420, 'deDE', 'Die Geister sei\'n mit Euch.', '', 39653),
(194418, 'deDE', 'Wie kann der alte Vol\'jin helf\'n?', '', 39653),
(194370, 'deDE', '', 'Stärke erwächst aus Loyalität, Ehre und... Hört auf, das kitzelt!', 39653),
(194369, 'deDE', '', 'Ich bin die Klinge im Dunklen... und die Klinge in Eurem Gesicht.', 39653),
(194368, 'deDE', '', 'Im Haus der Augen habe ich DIE GEHEIMNISSE DER RAFINESSE GELERNT!', 39653),
(194367, 'deDE', '', 'Lok-tar ogar! Das bedeutet Sieg oder Tod. In Maldraxxus heißt es Sieg UND Tod.', 39653),
(194366, 'deDE', '', 'Kraft und Ehre.', 39653),
(194365, 'deDE', '', 'Im Namen des Primus!', 39653),
(194364, 'deDE', '', 'Für Krexus. Für Akarek!', 39653),
(194362, 'deDE', '', 'Nur die Starken überleben.', 39653),
(194361, 'deDE', '', 'Selbst hier schütze ich die Schwachen.', 39653),
(194360, 'deDE', '', 'Jede Niederlage ist eine Lektion.', 39653),
(194359, 'deDE', '', 'Stärke entspringt dem Herzen.', 39653),
(194357, 'deDE', '', 'Blut und Donner!', 39653),
(194356, 'deDE', '', 'Immer bereit für den Kampf.', 39653),
(194355, 'deDE', '', 'Für die Ehre des Klingenschwurs.', 39653),
(194353, 'deDE', '', 'Wie läuft der Kampf?', 39653),
(194352, 'deDE', '', 'Throm-ka!', 39653),
(194351, 'deDE', '', 'Lok-tar!', 39653),
(194310, 'deDE', 'Aber natürlich werdet Ihr das.', '', 39653),
(194309, 'deDE', '', 'Ich kümmere mich um sie, Graf... ohne Gnade.', 39653),
(194308, 'deDE', 'Seid versichert, diese Anima dient einem höheren Zweck.', '', 39653),
(194307, 'deDE', 'Die anderen Reiche würden dieses kostbarste Gut vergeuden. Das lasse ich nicht zu.', '', 39653),
(194306, 'deDE', '', 'Ihr entzieht Eurem eigenen Volk Anima und verursacht eine Dürre in den Schattenlanden!', 39653),
(194305, 'deDE', 'Meine trotzige Anklägerin und ihr armer Sterblicher.', '', 39653),
(194304, 'deDE', '', 'Mein Graf?', 39653),
(194303, 'deDE', 'Na, was haben wir denn hier?', '', 39653),
(194302, 'deDE', '', 'Aber Meister, ich...', 39653),
(194301, 'deDE', 'Unser Freund... wird ungeduldig.', '', 39653),
(194300, 'deDE', '', 'Wie ich schon sagte, Graf, lässt sich so ein heikler Prozess nicht beschleunigen.', 39653),
(194152, 'deDE', '', 'Die Zeit vergeht, der Wald bleibt.', 39653),
(194151, 'deDE', '', 'Der Boden gepflügt, die Seelen wachsen.', 39653),
(194150, 'deDE', '', 'Wie Ranken werden sich unsere Pfade wieder kreuzen.', 39653),
(194149, 'deDE', '', 'Auch der größte Sturm legt sich.', 39653),
(194148, 'deDE', '', 'Findet Frieden in den Blättern auf dem Strom.', 39653),
(194147, 'deDE', '', 'Jeder Moment ist eine Chance zu wachsen.', 39653),
(194146, 'deDE', '', 'Früchte der Weisheit reifen in den Kronen.', 39653),
(194145, 'deDE', '', 'Lernen. Wachsen.', 39653),
(194144, 'deDE', '', 'Sterne schimmern über ruhigen Gärten.', 39653),
(194143, 'deDE', '', 'Glück schwebt auf sanfter Brise.', 39653),
(194142, 'deDE', '', 'Ein Hain in Not. Seelen, die schlummern.', 39653),
(194141, 'deDE', '', 'Regen fällt, erweckt das tote Gras.', 39653),
(194138, 'deDE', '', 'Wind kommt auf, umfängt die Bäume.', 39653),
(194136, 'deDE', '', 'Der Zyklus geht weiter.', 39653),
(193976, 'deDE', '', 'Hört auf, auf mir herumzuhacken!', 39653),
(193975, 'deDE', '', 'Wir sehen uns dann.', 39653),
(193974, 'deDE', '', 'Auf bald.', 39653),
(193973, 'deDE', '', 'Lebt wohl... mein Freund!', 39653),
(193972, 'deDE', '', 'Ich habe immer Zeit für Freunde.', 39653),
(193969, 'deDE', '', 'Was wollen wir heute tun?', 39653),
(193968, 'deDE', '', 'Hallo!', 39653),
(193967, 'deDE', '', 'Glaubt Ihr, so macht man sich Freunde?', 39653),
(193713, 'deDE', 'Wie wär\' es dann mit etwas Rache, hmm? Den uralten Geist aus dem Schlund rett\'n... und sicher zur Winterkönigin bring\'n.', '', 39653),
(193712, 'deDE', 'Ich war\'s, der Sylvans zum Kriegshäuptling gemacht hat. Aber Mueh\'zala und der Kerkermeister... steckt\'n die ganze Zeit dahinter.', '', 39653),
(193700, 'deDE', 'Ihr trefft Euer Ziel.', '', 39653),
(193699, 'deDE', 'Seid gegrüßt!', '', 39653),
(193696, 'deDE', 'Ich diene der Wilden Jagd.', '', 39653),
(193690, 'deDE', 'Lasst uns reden.', '', 39653),
(193687, 'deDE', 'Der Ardenwald wird überdauern.', '', 39653),
(193686, 'deDE', 'Für Königin und Hain.', '', 39653),
(193684, 'deDE', 'Jagt mit Stolz.', '', 39653),
(193682, 'deDE', 'Cenarius hat mich mit einem Geweih gesegnet... nicht mit Geduld.', '', 39653),
(193680, 'deDE', 'Gemeinsam sind wir stark.', '', 39653),
(193679, 'deDE', '', 'Bewahrt Eure Geheimnisse.', 39653),
(193678, 'deDE', 'Glaubt Ihr, Ihr könnt Euch jetz\' losreiß\'n, Mueh\'zala? Hmpf.', '', 39653),
(193677, 'deDE', 'Ich locker\' die Fesseln von Mueh\'zala. Ihr sorgt dafür, dass meine Leute nich\' an seine Macht verlor\'n geh\'n.', '', 39653),
(193667, 'deDE', '', 'Unser Haus wird gerächt werden.', 39653),
(193665, 'deDE', '', 'Geht vorsichtig und in Stille.', 39653),
(193664, 'deDE', '', 'Die Augen sind immer wachsam.', 39653),
(193663, 'deDE', '', 'Euer Name wird geflüstert.', 39653),
(193662, 'deDE', '', 'Ihr wandelt im Schatten.', 39653),
(193661, 'deDE', '', 'Bringt Ihr mir Geheimnisse?', 39653),
(193659, 'deDE', '', 'Was habt Ihr gesehen?', 39653),
(193579, 'deDE', 'Euern alten Freund Bwonsamdi.', '', 39653),
(193578, 'deDE', 'Aber keine Sorge! Ihr habt jetzt \'nen neu\'n Meister...', '', 39653),
(193576, 'deDE', 'Ihr langweilt uns, Mueh\'zala! Es is\' Zeit, Euch wieder auf die Andre Seite zu verbann\'n.', '', 39653),
(193573, 'deDE', 'Oh, ihr mögt mein Flüstern, kleiner Häuptling? Wollte Eure Seele selbst in den Schlund schick\'n... Aber Euer Band zu dieser Welt is\' zu stark.', '', 39653),
(193571, 'deDE', 'Die Stimme... flüstert, während Gift in meinen Adern brennt... Windläufer...', '', 39653),
(193570, 'deDE', 'Der Krieg hat die ganze Welt zerstört... un\' alles wegen \'nem... kleinen... Flüstern zu diesem dummen Troll.', '', 39653),
(193569, 'deDE', 'Den Kerkermeister hält nichts auf! Hat lange an \'nem Plan gearbeitet. Seeeeehr lange.', '', 39653),
(193567, 'deDE', 'Ach was? Zum Glück hat Bwonsamdi \'ne Abmachung mit jemandem, der da reinspring\'n kann... un\' wieder raus!', '', 39653),
(193564, 'deDE', 'ARGH! Ihr seid zu spät! Hab \'nem uralten Geist die Chance gegeben, an meiner Seite zu steh\'n. Hat schleeeeecht gewählt, und jetz\' ist er im Schlund!', '', 39653),
(193560, 'deDE', 'Tss. So\'n grummeliger Loa! Ich... hab gesagt... REDET!', '', 39653),
(193558, 'deDE', 'Pah! Eure billigen Tricks interessier\'n mich nich\'!', '', 39653),
(193555, 'deDE', 'Hah! Jetzt hab ich das Sagen! Also sagt mir besser, was Ihr dem Ardenwald Schlimmes angetan habt.', '', 39653),
(193496, 'deDE', 'Revendreth muss überdauern, ich nicht.', '', 39653),
(193495, 'deDE', 'Was ist unser nächstes Ziel?', '', 39653),
(193494, 'deDE', 'Ich habe Welten in Flammen gesetzt. Ich habe ganze Nachleben zu Staub zermalmt. Ich habe mich gegen die Kräfte von Tod und Licht gestemmt. Und jetzt werde ich hier von einem übereifrigen Sterblichen gepiesackt.', '', 39653),
(193493, 'deDE', 'Die Realität ist unendlich in ihren Möglichkeiten. Meine Geduld eher nicht.', '', 39653),
(193492, 'deDE', 'Unsere Allianz beruht auf gemeinsamen Feinden und Interessen. Stellt sie nicht auf die Probe.', '', 39653),
(193491, 'deDE', 'Meinesgleichen benötigen einen Zweck, keinen Frieden.', '', 39653),
(193490, 'deDE', 'Wir müssen denen, die dem Meister noch folgen, eine bessere Alternative bieten.', '', 39653),
(193487, 'deDE', 'Revendreth muss wiederhergestellt werden!', '', 39653),
(193486, 'deDE', 'Grüße, Schlundgänger.', '', 39653),
(193484, 'deDE', 'Retah.', '', 39653),
(193453, 'deDE', 'Dummer Loa. Ihr haltet mich nich\' auf. Ich labe mich an Euren Anhängern... dann an Euch!', '', 39653),
(193442, 'deDE', '', 'Die Zeit läuft uns davon.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(193440, 'deDE', '', 'Wir haben einen Zeitplan einzuhalten!', 39653),
(193439, 'deDE', '', 'Hmm... Ich kann Euch einschieben. Was braucht Ihr?', 39653),
(193438, 'deDE', '', 'Wie kann ich helfen?', 39653),
(193437, 'deDE', '', 'Ich helfe.', 39653),
(193430, 'deDE', '', 'Dient gut.', 39653),
(193429, 'deDE', '', 'Behandelt Euch selbst mit Güte.', 39653),
(193428, 'deDE', '', 'Ein im Dienst verbrachtes Leben ist ein gut verbrachtes Leben.', 39653),
(193427, 'deDE', '', 'Meine Hilfe gehört Euch.', 39653),
(193426, 'deDE', '', 'Benötigt Ihr meine Hand?', 39653),
(193425, 'deDE', '', 'Erlaubt mir, zu helfen.', 39653),
(193424, 'deDE', 'Denkt immer dran: Staub abklopfen und nochmal versuchen.', '', 39653),
(193423, 'deDE', 'Wir alle straucheln.', '', 39653),
(193422, 'deDE', 'Unterstützt jene um Euch herum und sie werden Euch unterstützen.', '', 39653),
(193421, 'deDE', 'Ich kann bei jedem Problem helfen, egal wie klein.', '', 39653),
(193419, 'deDE', 'Mein Leben im Dienst.', '', 39653),
(193418, 'deDE', '', 'Geht mit Mut.', 39653),
(193417, 'deDE', '', 'Steht erhobenen Hauptes.', 39653),
(193416, 'deDE', '', 'Niemals wanken.', 39653),
(193415, 'deDE', '', 'Wie kann ich Euch helfen?', 39653),
(193414, 'deDE', '', 'Meine Äxte gehören Euch.', 39653),
(193413, 'deDE', '', 'Wollt Ihr üben?', 39653),
(193412, 'deDE', '', 'Ich werde darüber nachdenken.', 39653),
(193411, 'deDE', '', 'Es gibt viel zu lernen.', 39653),
(193410, 'deDE', '', 'Wir folgen dem Weg.', 39653),
(193409, 'deDE', '', 'Wonach sucht Ihr?', 39653),
(193408, 'deDE', '', 'Ich höre.', 39653),
(193407, 'deDE', '', 'Ja?', 39653),
(193406, 'deDE', 'Bleibt standhaft.', '', 39653),
(193405, 'deDE', 'Loyalität leite Eure Schritte.', '', 39653),
(193404, 'deDE', 'Wir dienen der Bastion.', '', 39653),
(193403, 'deDE', 'Meine Hilfe gehört Euch.', '', 39653),
(193402, 'deDE', 'Welchen Herausforderungen steht Ihr gegenüber?', '', 39653),
(193401, 'deDE', 'Unser Ziel ist klar.', '', 39653),
(193400, 'deDE', '', 'Danke, mein Schatz!', 39653),
(193399, 'deDE', '', 'Ich liebe dich!', 39653),
(193398, 'deDE', '', 'Auf bald.', 39653),
(193397, 'deDE', '', 'Wie läuft dein Tag?', 39653),
(193396, 'deDE', '', 'Ich habe nach dir gesucht!', 39653),
(193395, 'deDE', '', 'Guten Morgen, Liebling!', 39653),
(193394, 'deDE', 'Ich muss meine Familie wiedersehen.', '', 39653),
(193393, 'deDE', 'Ich bin nicht bereit.', '', 39653),
(193392, 'deDE', 'Ihr müsst mich zurückschicken!', '', 39653),
(193391, 'deDE', 'Was ist hier los?', '', 39653),
(193390, 'deDE', 'Ihr versteht nicht...', '', 39653),
(193389, 'deDE', 'Bitte... meine Zeit ist noch nicht gekommen!', '', 39653),
(193388, 'deDE', '', 'Die Kyrianer sind für ihre große Geduld und Ruhe unter Druck berühmt. Ihr stellt mich gerade auf die Probe.', 39653),
(193386, 'deDE', '', 'Eins hätte ich bei Flügeln nie erwartet: Wie schwer es ist, damit zu SITZEN. Habt Ihr mal einen Aufgestiegenen auf einem Stuhl sitzen sehen? Dachte ich mir.', 39653),
(193384, 'deDE', '', 'Manchmal kommt mir in den Sinn, wie diese Dürre genau dann eingesetzt hat, als ich für den Aufstieg bereit war. Unfassbar! Also hocke ich am Boden, anstatt zu fliegen. FLIEGEN. MIT FLÜGELN. ICH WILL DOCH NUR... <holt tief Luft> Schon gut, Kleia... beruhige dich... Wir bekommen das hin.', 39653),
(193381, 'deDE', '', 'Habt Ihr schon mal einen Provost gebeten, NICHT zu helfen? Ich habe sogar mal einen zum Weinen gebracht. Lasst sie einfach nur machen.', 39653),
(193379, 'deDE', '', 'Ich werde für alles kämpfen, woran wir glauben.', 39653),
(193378, 'deDE', '', 'Eine Aufgestiegene zu sein... war alles, was ich mir je erhofft hatte.', 39653),
(193377, 'deDE', '', 'Die Weisheit der Archon triumphiert.', 39653),
(193376, 'deDE', '', 'Wir sind jeder Herausforderung ebenbürtig!', 39653),
(193374, 'deDE', '', 'Unsere Vorsehung ist zu dienen.', 39653),
(193373, 'deDE', '', 'Bewahrt einen ruhigen Geist.', 39653),
(193372, 'deDE', '', 'Ich werde aufsteigen.', 39653),
(193371, 'deDE', '', 'Wir werden diese Dürre beheben – wir müssen einfach.', 39653),
(193370, 'deDE', '', 'Tief durchatmen.', 39653),
(193369, 'deDE', '', 'Meine Waffe – und meine Schwingen – gehören Euch.', 39653),
(193368, 'deDE', '', 'Änderungen kommen und wir müssen uns anpassen.', 39653),
(193367, 'deDE', '', 'Womit kann ich zu Diensten sein?', 39653),
(193366, 'deDE', '', 'Ich diene nicht nur der Bastion, sondern den gesamten Schattenlanden.', 39653),
(193365, 'deDE', '', 'Was beschäftigt Euch?', 39653),
(193364, 'deDE', '', 'Die Dürre hält sich hartnäckig. Wir müssen eine Lösung finden.', 39653),
(193362, 'deDE', '', 'Ihr seid ein Vorbote der Veränderung.', 39653),
(193361, 'deDE', '', 'Gestattet mir, Euch den Weg zu zeigen.', 39653),
(193360, 'deDE', '', 'Die Zukunft der Bastion liegt in unseren Händen.', 39653),
(193359, 'deDE', 'Seid gegrüßt.', '', 39653),
(193358, 'deDE', 'Und schließlich, drittens! Ein Korb voller Purian! Perfekt gereift. Keine grünen Stellen! Dann kann ich vielleicht arbeiten.', '', 39653),
(193357, 'deDE', 'Zweitens! Hilfsschmiede. Und zwar drei. Äußerst geschickte Finger. Gehorsam. Keine Widerworte!', '', 39653),
(193356, 'deDE', 'Erstens! Brauche eine Schmiede. Muss exakt fünfzehnhundertvierunddreißig Komma drei zwei Grad heiß sein.', '', 39653),
(193355, 'deDE', 'Ihr erwartet, dass ich so arbeite? Ich habe Bedürfnisse!', '', 39653),
(193354, 'deDE', 'Manche sagen, ich bin pingelig. Ich sage... gründlich.', '', 39653),
(193353, 'deDE', 'Räumt hinter Euch auf.', '', 39653),
(193352, 'deDE', 'Kehrt mit neuen Ideen zurück.', '', 39653),
(193351, 'deDE', 'Ich verlange einfach Perfektion.', '', 39653),
(193350, 'deDE', 'Überlasst mich meiner Arbeit.', '', 39653),
(193349, 'deDE', 'Ihr besitzt Wert... Aber ich besitze mehr!', '', 39653),
(193348, 'deDE', 'Ich habe hohe Ansprüche. Ihr müsst ihnen gerecht werden.', '', 39653),
(193347, 'deDE', 'Welche Wunder gibt es auf Eurer Welt?', '', 39653),
(193346, 'deDE', 'Faszinierende Waffe. Darf ich mal sehen?', '', 39653),
(193345, 'deDE', 'Neue Aufwertungsideen für Zenturionen?', '', 39653),
(193344, 'deDE', 'Ihr hab interessante Handwerkskunst? Zeigt her!', '', 39653),
(193343, 'deDE', 'Nur gute Fragen.', '', 39653),
(193342, 'deDE', 'Ihr sprecht mit dem Ersten Schmied! Meister der Entwicklung in der Bastion!', '', 39653),
(193341, 'deDE', 'Beim letzten Mal hat sie mich, glaube ich, gebissen! Kleia musste meine Wunden versorgen. Aber nächstes Mal... Nächstes Mal läutere ich sie bestimmt!', '', 39653),
(193340, 'deDE', 'Beim zweiten Mal hab ich die Augen geöffnet und sie klebte wirklich an mir. Leibhaftig! Das hat mir solche Angst gemacht, dass ich weggelaufen bin.', '', 39653),
(193339, 'deDE', 'Beim ersten Mal hat es sich so angefühlt, als ob sie an mir klebt. Ich konnte sie einfach nicht abschütteln.', '', 39653),
(193338, 'deDE', 'Ich habe Mühe, eine bestimmte Erinnerung zu läutern.', '', 39653),
(193337, 'deDE', 'Vor Euch liegt ein weiter Weg.', '', 39653),
(193336, 'deDE', 'Wenn\'s beim ersten Mal nicht klappt, aufrappeln und nochmal versuchen.', '', 39653),
(193335, 'deDE', 'Ich glaube an Euch.', '', 39653),
(193334, 'deDE', 'Richtet alle um Euch herum auf.', '', 39653),
(193333, 'deDE', 'Gemeinsam können wir alles erreichen.', '', 39653),
(193332, 'deDE', 'Ich helfe gern.', '', 39653),
(193331, 'deDE', 'Braucht Ihr einen Trainingspartner?', '', 39653),
(193330, 'deDE', 'Habt Ihr in letzter Zeit etwas Interessantes gelesen?', '', 39653),
(193329, 'deDE', 'Es tut gut, Euch zu sehen.', '', 39653),
(193328, 'deDE', 'Ich bin für Euch da.', '', 39653),
(193327, 'deDE', 'Ich bin ganz Ohr.', '', 39653),
(193326, 'deDE', 'Teilt Eure Weisheit mit mir.', '', 39653),
(193231, 'deDE', '', 'Findet die Wahrheit. Zahlt es unseren Feinden heim.', 39653),
(193230, 'deDE', '', 'Für Markgraf Akarek.', 39653),
(193229, 'deDE', '', 'Geht in Stille.', 39653),
(193228, 'deDE', '', 'Die Augen sind immer wachsam.', 39653),
(193227, 'deDE', '', 'Das Flüstern sagt viel.', 39653),
(193226, 'deDE', '', 'Nennt Euer Anliegen.', 39653),
(193225, 'deDE', '', 'Welche Geheimnisse verbergt Ihr?', 39653),
(193224, 'deDE', '', 'Wir sehen Euch.', 39653),
(193206, 'deDE', '', 'Wir sehen uns wieder.', 39653),
(193205, 'deDE', '', 'Ich wünsche Euch noch viel Glück.', 39653),
(193204, 'deDE', '', 'Schön, Euch zu sehen, Rekrut.', 39653),
(193203, 'deDE', '', 'Wir haben einiges zusammen durchgemacht.', 39653),
(193196, 'deDE', 'Ich suche den endgültigen Tod.', '', 39653),
(193195, 'deDE', 'Beendet mein Leiden.', '', 39653),
(193194, 'deDE', 'Seid Ihr hier, um mich herauszufordern?', '', 39653),
(193193, 'deDE', 'Sprecht, Krieger.', '', 39653),
(193192, 'deDE', 'Seid vorsichtig!', '', 39653),
(193191, 'deDE', 'Jrokgar jetzt gehen.', '', 39653),
(193190, 'deDE', 'Hm, Ihr kein Oger...', '', 39653),
(193189, 'deDE', 'Jrokgar sagen hallo.', '', 39653),
(193188, 'deDE', '', 'Es gibt immer noch zu tun.', 39653),
(193187, 'deDE', '', 'Das Ritual muss gestoppt werden.', 39653),
(193186, 'deDE', '', 'Ich schulde Euch mein Leben.', 39653),
(193185, 'deDE', '', 'Viel Glück.', 39653),
(193184, 'deDE', 'Mögt Ihr immer treffen.', '', 39653),
(193183, 'deDE', 'Die Jagd geht weiter.', '', 39653),
(193181, 'deDE', 'Kopf hoch.', '', 39653),
(193180, 'deDE', 'Diese Expedition zählt auf uns.', '', 39653),
(193179, 'deDE', 'Ihr habt meine Aufmerksamkeit.', '', 39653),
(193177, 'deDE', 'Was kann ich für Euch tun?', '', 39653),
(193176, 'deDE', '', 'Ab an die Arbeit!', 39653),
(193175, 'deDE', '', 'Diese Oger werden sich noch gewaltig wundern!', 39653),
(193173, 'deDE', '', 'Bleibt mit beiden Füßen auf dem Boden!', 39653),
(193163, 'deDE', '', 'Bei Nekromantie ist einmal einmal zu viel.', 39653),
(193162, 'deDE', '', 'Etwas Magie gefällig?', 39653),
(193161, 'deDE', '', 'Was beschäftigt Euch?', 39653),
(193160, 'deDE', '', 'Beharrlichkeit ist Eure beste Waffe.', 39653),
(193159, 'deDE', '', 'Bleibt ruhig im Angesicht der Gefahr.', 39653),
(193158, 'deDE', '', 'Bleibt wachsam.', 39653),
(193157, 'deDE', '', 'Wir werden das durchstehen.', 39653),
(193156, 'deDE', '', 'Habt Geduld.', 39653),
(193155, 'deDE', '', 'Kommt, unterhalten wir uns!', 39653),
(193153, 'deDE', 'Wenn ich etwas für Euch tun kann, lasst es mich bitte wissen.', '', 39653),
(193152, 'deDE', 'Ich bin ein sehr beschäftigter Provost.', '', 39653),
(193118, 'deDE', '', 'Die Wildnis ruft.', 39653),
(193117, 'deDE', '', 'Mögen die Sterne Euch leiten.', 39653),
(193116, 'deDE', '', 'Elune-Adore.', 39653),
(193114, 'deDE', '', 'Die Insel schreit vor Schmerzen.', 39653),
(193113, 'deDE', '', 'Ihr höre zu.', 39653),
(193112, 'deDE', '', 'Ishnu-alah.', 39653),
(193108, 'deDE', '', 'Geht mit dem Licht.', 39653),
(193107, 'deDE', '', 'Lebt wohl.', 39653),
(193106, 'deDE', '', 'Dioniss aca.', 39653),
(193105, 'deDE', '', 'Es tut gut, Euch zu sehen.', 39653),
(193104, 'deDE', '', 'Seid gegrüßt.', 39653),
(193103, 'deDE', '', 'Archenon poros.', 39653),
(193037, 'deDE', '', 'Renathal, hättet Ihr doch schon früher solche Leidenschaft gezeigt! Ich finde es absolut bezaubernd.', 39653),
(193036, 'deDE', '', 'Ich setze meine Steingeborenen keinem weiteren Leid aus.', 39653),
(193035, 'deDE', 'Es reicht. Der Thronräuber verlangt unsere Medaillons, bietet aber nichts im Gegenzug.', '', 39653),
(193034, 'deDE', '', 'Aber die anderen haben recht. Euch fehlt ein... Druckmittel.', 39653),
(193033, 'deDE', '', 'Eure großen Worte sind wertlos. Ihr könnt weder den Kerkermeister noch unseren Meister besiegen.', 39653),
(193030, 'deDE', 'Ihr meint, IHR könnt es beherrschen. Das ist das Gerede eines selbstsüchtigen Prinzen, der zu altem Glanz zurück will.', '', 39653),
(193029, 'deDE', 'Unser Daseinszweck soll überleben. Wenn das Selbstsucht ist, dann hoffe ich, Ihr alle habt sie auch.', '', 39653),
(193028, 'deDE', 'Der Pakt zwischen Denathrius und dem Kerkermeister wirft uns alle dem Schlund zum Fraß vor.', '', 39653),
(193026, 'deDE', 'Mit den vereinten Medaillons könnten wir Revendreth beherrschen.', '', 39653),
(192915, 'deDE', '', 'Ihr taugt nicht mal als Mahlzeit.', 39653),
(192914, 'deDE', '', 'Ihr wagt es, den Adel zu behelligen?', 39653),
(192912, 'deDE', '', 'Ihr dürft wegtreten.', 39653),
(192907, 'deDE', '', 'Im Zweifelsfall einfache alle töten.', 39653),
(192903, 'deDE', '', 'Seid schnell und wendig. Wie ich.', 39653),
(192900, 'deDE', '', 'Kommt Ihr tribut zollen?', 39653),
(192899, 'deDE', '', 'Ihr habt sicherlich etwas anderes zu erledigen.', 39653),
(192888, 'deDE', '', 'Keine Enthauptungen heute.', 39653),
(192886, 'deDE', '', 'Wisst Ihr, wie viele Rivalen ich getötet habe?', 39653),
(192865, 'deDE', 'Kennt die Seele, nicht das Konstrukt.', '', 39653),
(192864, 'deDE', 'Es gibt viel zu tun.', '', 39653),
(192862, 'deDE', 'Gemeinsam sind wir stark.', '', 39653),
(192861, 'deDE', 'Unsere Mühen sind Belohnung genug.', '', 39653),
(192858, 'deDE', 'Ich freue mich darauf, mit Euch zu arbeiten.', '', 39653),
(192857, 'deDE', 'Ich grüße Euch.', '', 39653),
