(191876, 'deDE', 'Sagt mir, falls Ihr etwas hört.', '', 39653),
(191875, 'deDE', 'Wie sollen wir letzten Gluthof übertreffen?', '', 39653),
(191874, 'deDE', 'Das Fest hat begonnen!', '', 39653),
(191873, 'deDE', 'Habt Ihr die Gerüchte gehört? ...Über den Meister?', '', 39653),
(191872, 'deDE', 'Habt Ihr die Gerüchte gehört? ...Über die Anklägerin?', '', 39653),
(191871, 'deDE', 'Habt Ihr die Gerüchte gehört? ...Über den Prinzen?', '', 39653),
(191870, 'deDE', 'Wärt Ihr tot, würde ich jetzt laut Eure Sünden verkünden...', '', 39653),
(191869, 'deDE', 'IHR SEID GEMEINT!!!', '', 39653),
(191868, 'deDE', 'Ein Tipp: Die Hälfte der Sünden auf dem Stein hat mit der Belästigung unschuldiger Steinscheusale zu tun.', '', 39653),
(191867, 'deDE', 'Fragespiel: Wer hat den größten Sündenstein aller Zeiten in Revendreth?', '', 39653),
(191866, 'deDE', 'Irgendwann werde ich Euren Sündenstein finden...', '', 39653),
(191865, 'deDE', 'Was sagt die Gerüchteküche?', '', 39653),
(191864, 'deDE', 'Habt Ihr Sündensteine?', '', 39653),
(191863, 'deDE', '', 'Fasst Ihr an... seid Ihr dran... Schmerzen dann.', 39653),
(191861, 'deDE', '', 'Lasst Trübsal verklingen, tanzen und singen!', 39653),
(191859, 'deDE', '', 'Nichts gesagt. Nie versagt. Nie beklagt.', 39653),
(191857, 'deDE', '', 'Sehen ist leicht, verpacken nicht gleich.', 39653),
(191856, 'deDE', '', 'Vollbringt Wunder, vermeidet Wunden.', 39653),
(191853, 'deDE', '', 'Nutzt List, schnell der Sieg ist!', 39653),
(191852, 'deDE', '', 'Gruß ist wertlos, ein Märchen bloß.', 39653),
(191850, 'deDE', 'Aus dem Weg.', '', 39653),
(191849, 'deDE', 'Ausrücken.', '', 39653),
(191848, 'deDE', 'Hört zu. Ich werde mich nicht wiederholen.', '', 39653),
(191847, 'deDE', 'Endlich.', '', 39653),
(191845, 'deDE', 'Ihr seid spät dran.', '', 39653),
(191844, 'deDE', 'Hmpf. IHR seid der Schlundgänger?', '', 39653),
(191778, 'deDE', 'Vielleicht gehört Ihr hierher. Für immer.', 'Vielleicht gehört Ihr hierher. Für immer.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(191742, 'deDE', '', 'Was habt Ihr entdeckt, Schlundgänger? Ist es... wertvoll?', 39653),
(191738, 'deDE', '', 'Ein Rätsel will gelüftet werden. Vielleicht enttäuscht Ihr mich doch nicht.', 39653),
(191732, 'deDE', 'Alle Seelen gehören mir.', '', 39653),
(191730, 'deDE', 'Jede Seele hat ihren Platz.', '', 39653),
(191722, 'deDE', '', 'Wisst Ihr... nicht alle meine Partner sind dem Kerkermeister zum Opfer gefallen.', 39653),
(191721, 'deDE', '', 'Unbegrenzte Zeit bedeutet nicht, dass auch meine Geduld endlos ist.', 39653),
(191720, 'deDE', '', 'Lange beobachte ich schon, wie die Schlundgebundenen ihre Opfer foltern. Kostprobe gefällig?', 39653),
(191719, 'deDE', '', 'Beschafft etwas von Wert.', 39653),
(191718, 'deDE', '', 'Wäre das alles, Schlundgänger?', 39653),
(191717, 'deDE', '', 'Ich werde Euch nicht länger aufhalten.', 39653),
(191716, 'deDE', '', 'Entdeckt weitere Geheimnisse. Dann sprechen wir.', 39653),
(191715, 'deDE', '', 'Kehrt nur zurück, wenn Ihr müsst.', 39653),
(191714, 'deDE', '', 'Traut nichts, was Ihr im Schlund seht.', 39653),
(191713, 'deDE', '', 'Erregt nicht die Aufmerksamkeit des Kerkermeisters.', 39653),
(191712, 'deDE', '', 'Ah, mein neuer Partner. Mal sehen, wie lang Ihr durchhaltet.', 39653),
(191711, 'deDE', '', 'Wollt Ihr handeln? Oder Euren Atem verschwenden?', 39653),
(191710, 'deDE', '', 'Alle Mysterien werden gelüftet.', 39653),
(191709, 'deDE', '', 'Meine Zeit ist unbegrenzt. Eure nicht.', 39653),
(191708, 'deDE', '', 'Spürt Ihr, wie der Schlund an Eurem Verstand zerrt?', 39653),
(191707, 'deDE', '', 'Habt Ihr etwas von Interesse gefunden, Schlundgänger?', 39653),
(191706, 'deDE', '', 'Ihr wurdet hoffentlich nicht verfolgt.', 39653),
(191699, 'deDE', 'Ihr wollt schon gehen?', 'Ihr wollt schon gehen?', 39653),
(191698, 'deDE', 'Bis Eure Bedürfnisse Euch wieder zu mir führen.', 'Bis Eure Bedürfnisse Euch wieder zu mir führen.', 39653),
(191697, 'deDE', 'Sonst nichts?', 'Sonst nichts?', 39653),
(191696, 'deDE', 'Ich warte auf Eure Rückkehr.', 'Ich warte auf Eure Rückkehr.', 39653),
(191695, 'deDE', 'Was ist Euer Begehr?', 'Was ist Euer Begehr?', 39653),
(191694, 'deDE', 'Gönnt Euch etwas, eine Sünde mehr ist doch nichts.', 'Gönnt Euch etwas, eine Sünde mehr ist doch nichts.', 39653),
(191685, 'deDE', 'Sammelt die Truppen für den Angriff. Ich habe einen Plan, aber wir müssen handeln, bevor Denathrius von meiner Flucht erfährt.', '', 39653),
(191684, 'deDE', 'Es sind deutlich weniger von uns als beim letzten Angriff.', '', 39653),
(191683, 'deDE', 'Auf Theotars Bitten haben wir unsere verbleibenden Kräfte nach Sündensturz verlegt.', '', 39653),
(191682, 'deDE', 'Draven! Das ist mehr, als ich erhofft hatte. Berichtet.', '', 39653),
(191680, 'deDE', '', 'Unser Handel ist beendet.', 39653),
(191678, 'deDE', '', 'Meine Geduld und meine Waren sind begrenzt.', 39653),
(191676, 'deDE', '', 'Wir erwarten Eure Rückkehr.', 39653),
(191675, 'deDE', '', 'Nun eilt und kehrt sicher zurück.', 39653),
(191674, 'deDE', '', 'Die Augen des Meisters sind überall.', 39653),
(191673, 'deDE', '', 'Bis der Meister Euch ruft.', 39653),
(191672, 'deDE', 'Ihr habt, was Ihr braucht.', '', 39653),
(191671, 'deDE', 'Dann macht nur.', '', 39653),
(191670, 'deDE', 'Diese Waren werden auf Euch warten.', '', 39653),
(191669, 'deDE', 'Kommt zurück, wenn Ihr etwas braucht.', '', 39653),
(191667, 'deDE', 'Mein Herr.', '', 39653),
(191641, 'deDE', 'Was braucht Ihr?', '', 39653),
(191640, 'deDE', 'Ich schöpfe meine Stärke aus Ehre und Stein.', '', 39653),
(191639, 'deDE', 'Geht mit Ehre, kehrt mit Gold zurück.', '', 39653),
(191638, 'deDE', 'Kommt zurück, wenn Ihr etwas braucht.', '', 39653),
(191637, 'deDE', 'Bis ein andermal.', '', 39653),
(191636, 'deDE', 'Was kann ich für Euch tun?', '', 39653),
(191635, 'deDE', 'Ist dies des Meisters Wunsch?', '', 39653),
(191630, 'deDE', 'Wie der Meister es wünscht.', '', 39653),
(191623, 'deDE', '', 'Es geht schon. Es geht schon...', 39653),
(191622, 'deDE', '', 'Kuratorin...', 39653),
(191621, 'deDE', 'Anklägerin. Danke, dass Ihr uns den Schlundgänger geschickt habt.', '', 39653),
(191620, 'deDE', '', 'Renathal.', 39653),
(191598, 'deDE', 'Ja? Was wollt Ihr?', 'Ja? Was wollt Ihr?', 39653),
(191532, 'deDE', '', 'Welche Reihenfolge hatten die Grabfallen noch mal...?', 39653),
(191525, 'deDE', '', 'Vor dem Schlund ging es mir gut. Jetzt ist alles... unklar.', 39653),
(191523, 'deDE', '', 'Oh, hallo! Ihr werdet erst gequält, wenn Ihr dran seid.', 39653),
(191521, 'deDE', '', 'Schön, Euch kennenzulernen. Oder haben wir das schon?', 39653),
(191475, 'deDE', 'Lebt wohl.', '', 39653),
(191474, 'deDE', 'Bleibt achtsam.', '', 39653),
(191473, 'deDE', 'Ah, die Schönheit des Waldes...', '', 39653),
(191472, 'deDE', 'Eine wundervolle Nacht, nicht wahr?', '', 39653),
(191471, 'deDE', 'Zeit, die Flügel zu strecken.', '', 39653),
(191470, 'deDE', 'Und los geht\'s!', '', 39653),
(191469, 'deDE', 'Zeit für ein Abenteuer?', '', 39653),
(191468, 'deDE', 'Was habt Ihr gehört?', '', 39653),
(191467, 'deDE', 'Uh. Fort mit Euch.', '', 39653),
(191466, 'deDE', 'Zeit für ein Nickerchen.', '', 39653),
(191465, 'deDE', 'Uh. Hallo.', '', 39653),
(191464, 'deDE', 'Hm? Was denn jetzt?', '', 39653),
(191461, 'deDE', 'Ich habe nach allen Überlebenden gerufen. Wir haben hier eine illustre Versammlung.', '', 39653),
(191460, 'deDE', 'So wie Ihr auch. Auf Euren Rippen könnte man Karotten raspeln.', '', 39653),
(191459, 'deDE', 'Theotar! Mein alter Freund. Es freut mich, Euch zu sehen. Und ich sehe, Ihr seid Euer Hemd losgeworden...', '', 39653),
(191458, 'deDE', 'Mein Prinz!', '', 39653),
(191443, 'deDE', 'Oh! Zeit zu gehen.', '', 39653),
(191442, 'deDE', 'Lebt wohl!', '', 39653),
(191441, 'deDE', 'Für die Bäume!', '', 39653),
(191440, 'deDE', 'Hallo!', '', 39653),
(191439, 'deDE', 'Hallo, da!', '', 39653),
(191438, 'deDE', 'Was ist das?', '', 39653),
(191412, 'deDE', '', 'Nicht jetzt, Schätzchen. Vielleicht später. Viel später?', 39653),
(191373, 'deDE', 'Macht keinen Aufstand, geht einfach.', '', 39653),
(191372, 'deDE', 'Kommt zurück, wenn Ihr versorgt werden wollt.', '', 39653),
(191371, 'deDE', 'Wenn es sonst nichts gibt...', '', 39653),
(191370, 'deDE', 'Noch einmal, ja?', '', 39653),
(191369, 'deDE', 'Grau wie Stein, und billig wie Stein.', '', 39653),
(191368, 'deDE', 'Fort mit Euch.', '', 39653),
(191366, 'deDE', 'Dann achtet auf Eure Sachen.', '', 39653),
(191364, 'deDE', 'Kann man nicht ändern.', '', 39653),
(191363, 'deDE', 'Na, wenn das alles war...', '', 39653),
(191359, 'deDE', 'Wenn es nicht kaputt ist... nehme ich es.', '', 39653),
(191357, 'deDE', 'Das Beste, das Ihr Euch leisten könnt.', '', 39653),
(191356, 'deDE', 'Also schön.', 'Also schön.', 39653),
(191352, 'deDE', '', 'Mein Verstand ist ein Erinnerungspalast. Nur leider... habe ich wohl alle Türen darin verschlossen und die Schlüssel verloren.', 39653),
(191350, 'deDE', 'Wir sind fertig, vorläufig.', 'Wir sind fertig, vorläufig.', 39653),
(191349, 'deDE', 'Ihr werdet zurückkommen.', 'Ihr werdet zurückkommen.', 39653),
(191348, 'deDE', 'Es war immer Eure Entscheidung.', 'Es war immer Eure Entscheidung.', 39653),
(191347, 'deDE', 'Euer Verlangen hat mich gerufen.', 'Euer Verlangen hat mich gerufen.', 39653),
(191343, 'deDE', 'Der Preis ist unangenehm, aber fair.', 'Der Preis ist unangenehm, aber fair.', 39653),
(191342, 'deDE', 'Der Meister hat gelogen, hat Anima gehortet und mich in den Schlund geworfen. Das alles kann ich respektieren. Aber den Kerkermeister freizulassen, geht zu weit.', '', 39653),
(191341, 'deDE', 'Sollen wir anfangen?', 'Sollen wir anfangen?', 39653),
(191340, 'deDE', 'Hallo... Schlundgänger.', '', 39653),
(191339, 'deDE', 'Kommt hervor, Bringer der Veränderung.', '', 39653),
(191338, 'deDE', 'Diese Unausweichlichkeit ist erfrischend unkompliziert.', '', 39653),
(191337, 'deDE', 'Es gibt keine Chance auf Sieg. Ist das nicht aufregend?', '', 39653),
(191333, 'deDE', 'Sonst nichts? Wie... bescheiden.', 'Sonst nichts? Wie... bescheiden.', 39653),
(191332, 'deDE', 'Nichts, das Ihr begehrt? Schade.', 'Nichts, das Ihr begehrt? Schade.', 39653),
(191331, 'deDE', 'Ihr werdet zurückkommen. Das tun sie alle.', 'Ihr werdet zurückkommen. Das tun sie alle.', 39653),
(191330, 'deDE', 'Alles, was Ihr braucht, wenn der Preis stimmt.', 'Alles, was Ihr braucht, wenn der Preis stimmt.', 39653),
(191328, 'deDE', 'Sichere Wege.', 'Sichere Wege.', 39653),
(191320, 'deDE', 'Wir haben ewig Zeit, Euch kennenzulernen.', 'Wir haben ewig Zeit, Euch kennenzulernen.', 39653),
(191316, 'deDE', 'Kommt gern näher.', 'Kommt gern näher.', 39653),
(191187, 'deDE', 'Ihr werdet zurückkehren, wenn die Richterin es will.', 'Ihr werdet zurückkehren, wenn die Richterin es will.', 39653),
(191186, 'deDE', 'Lasst die Vorsehung Eure Geschäfte leiten.', 'Lasst die Vorsehung Eure Geschäfte leiten.', 39653),
(191185, 'deDE', 'Möge das Glück Euch gewogen sein.', 'Möge das Glück Euch gewogen sein.', 39653),
(191184, 'deDE', 'Setzt Eure Einkäufe sinnvoll ein.', 'Setzt Eure Einkäufe sinnvoll ein.', 39653),
(191183, 'deDE', 'Alles hat seinen Nutzen.', 'Alles hat seinen Nutzen.', 39653),
(191182, 'deDE', 'Alles wird der Vorsehung gerecht.', 'Alles wird der Vorsehung gerecht.', 39653),
(191181, 'deDE', 'Seht nur, was Euch alles erwartet.', 'Seht nur, was Euch alles erwartet.', 39653),
(191180, 'deDE', 'Seht die Antiquitäten von Oribos.', 'Seht die Antiquitäten von Oribos.', 39653),
(191179, 'deDE', 'Einige Nervensägen sollten für alle Zeiten eingesperrt BLEIBEN!', 'Einige Nervensägen sollten für alle Zeiten eingesperrt BLEIBEN!', 39653),
(191177, 'deDE', 'Gehorcht der Vorsehung.', 'Gehorcht der Vorsehung.', 39653),
(191176, 'deDE', 'Die Ordnung wird bewahrt.', 'Die Ordnung wird bewahrt.', 39653),
(191175, 'deDE', 'Vertraut auf die Richterin.', 'Vertraut auf die Richterin.', 39653),
(191174, 'deDE', 'Alle Seelen haben ihren Platz.', 'Alle Seelen haben ihren Platz.', 39653),
(191173, 'deDE', 'Diese Krise wird vorübergehen.', 'Diese Krise wird vorübergehen.', 39653),
(191172, 'deDE', 'Alle werden ihrem Willen dienen.', 'Alle werden ihrem Willen dienen.', 39653),
(191171, 'deDE', 'Haltet Euch an den Weg.', 'Haltet Euch an den Weg.', 39653),
(191170, 'deDE', 'Die Vorsehung offenbart unseren Weg.', 'Die Vorsehung offenbart unseren Weg.', 39653),
(191169, 'deDE', 'Die Richterin sieht alle Wahrheiten.', 'Die Richterin sieht alle Wahrheiten.', 39653),
(191168, 'deDE', 'Stört die Ewige Stadt nicht.', 'Stört die Ewige Stadt nicht.', 39653),
(191167, 'deDE', 'Sprecht ruhig, sterbliches Wesen.', 'Sprecht ruhig, sterbliches Wesen.', 39653),
(191166, 'deDE', 'Was sucht Ihr?', 'Was sucht Ihr?', 39653),
(191165, 'deDE', 'Ich werde ihre Urteile vollstrecken.', 'Ich werde ihre Urteile vollstrecken.', 39653),
(191164, 'deDE', 'Seid gegrüßt.', 'Seid gegrüßt.', 39653),
(191114, 'deDE', '', 'Wir werden diese Rituale unterbinden, bevor die Oger sie abschließen können. Los!', 39653),
(191113, 'deDE', '', 'Dann müssen wir schnell sein. Rekrut, Gefreiter Garrick, die Allianz gibt nie die Hoffnung auf, auch nicht im Angesicht einer Katastrophe!', 39653),
(191103, 'deDE', 'Wir stellen uns der endlosen, unbesiegbaren Dunkelheit... gemeinsam.', '', 39653),
(191087, 'deDE', 'Wir müssen uns um andere Rituale kümmern. Genießt Eure letzten Momente!', '', 39653),
(191055, 'deDE', '', 'Der Tog mag für manche ein Rückschlag sein... jedenfalls wenn es einem an Ambition mangelt.', 39653),
(191054, 'deDE', '', 'Die Jahrtausende als Naga haben mich diese Form schätzen gelehrt. Aber über diesen verdammten Schwanz stolpere ich immer noch.', 39653),
(191053, 'deDE', '', 'Eure Zeit wird knapp, Sterblicher.', 39653),
(191052, 'deDE', '', 'Wie sehr ich unsere Unterhaltungen doch genieße.', 39653),
(191051, 'deDE', '', 'Die Schatten können meine Pracht nicht verschleiern.', 39653),
(191050, 'deDE', '', 'Ihr seid entweder eine Ressource... oder ein Risiko.', 39653),
(191049, 'deDE', '', 'In Akareks Namen.', 39653),
(191048, 'deDE', '', 'Schießt nicht am Ziel vorbei.', 39653),
(191047, 'deDE', '', 'Ich werde nicht ewig hierbleiben.', 39653),
(191046, 'deDE', '', 'Die Macht gehört dem, der sie sich nimmt.', 39653),
(191045, 'deDE', '', 'Trauer führt zu nichts.', 39653),
(191044, 'deDE', '', 'Aus Zwietracht erwachsen Gelegenheiten.', 39653),
(191043, 'deDE', '', 'Vergeltung wartet.', 39653),
(191042, 'deDE', '', 'Mit mir ist nicht zu spaßen.', 39653),
(191041, 'deDE', '', 'Unser Wille geschehe.', 39653),
(191040, 'deDE', '', 'Fasst Euch kurz.', 39653),
(191039, 'deDE', '', 'Ich bin bereit.', 39653),
(190955, 'deDE', 'Ein Sturm kommt auf uns zu. Ich spüre es in den Knochen.', 'Ein Sturm kommt auf uns zu. Ich spüre es in den Knochen.', 39653),
(190954, 'deDE', 'Ihr habt jetzt das Beste, also werdet zum Besten.', 'Ihr habt jetzt das Beste, also werdet zum Besten.', 39653),
(190953, 'deDE', 'Denkt daran, wer Euch beliefert hat.', 'Denkt daran, wer Euch beliefert hat.', 39653),
(190952, 'deDE', 'Kümmert Euch gut darum. Es wird Euch wahrscheinlich überdauern.', 'Kümmert Euch gut darum. Es wird Euch wahrscheinlich überdauern.', 39653),
(190951, 'deDE', 'Das sollte Euch einen Vorteil verschaffen.', 'Das sollte Euer Vorteil sein.', 39653),
(190950, 'deDE', 'Kein Sieg ohne gute Waffe.', 'Kein Sieg ohne gute Waffe.', 39653),
(190949, 'deDE', 'Alles klar, handeln wir.', 'Alles klar, handeln wir.', 39653),
(190948, 'deDE', 'Seht Ihr etwas Nützliches?', 'Seht Ihr etwas Nützliches?', 39653),
(190947, 'deDE', 'Nur los. Sucht Euch etwas aus.', 'Nur los. Sucht Euch etwas aus.', 39653),
(190946, 'deDE', 'Seid unvergesslich.', 'Seid unvergesslich.', 39653),
(190945, 'deDE', 'Die Waffe schwingt sich nicht selbst.', 'Die Waffe schwingt sich nicht selbst.', 39653),
(190944, 'deDE', 'Ich werde an Euch denken, wenn ich berüchtigt bin.', 'Ich werde an Euch denken, wenn ich berüchtigt bin.', 39653),
(190943, 'deDE', 'Durch Siege erhält man Ansehen.', 'Durch Siege erhält man Ansehen.', 39653),
(190942, 'deDE', 'Passt gut auf, sonst nehme ich vielleicht Euren Platz ein.', 'Passt gut auf, sonst nehme ich vielleicht Euren Platz ein.', 39653),
(190941, 'deDE', 'Tötet oder werdet getötet.', 'Tötet oder werdet getötet.', 39653),
(190939, 'deDE', 'Bleibt wachsam da draußen.', 'Bleibt wachsam da draußen.', 39653),
(190938, 'deDE', 'Und was habt Ihr so gemacht?', 'Und was habt Ihr so gemacht?', 39653),
(190937, 'deDE', 'Kenne ich Euch? Sollte ich?', 'Kenne ich Euch? Sollte ich?', 39653),
(190936, 'deDE', 'Ihr habt schon Fleisch auf den Knochen, hm?', 'Ihr habt schon Fleisch auf den Knochen, hm?', 39653),
(190935, 'deDE', 'Jeder muss irgendwo anfangen, nicht wahr?', 'Jeder muss irgendwo anfangen, nicht wahr?', 39653),
(190934, 'deDE', 'Braucht Ihr etwas? Ich muss Ruhm erringen.', 'Braucht Ihr etwas? Ich muss Ruhm erringen.', 39653),
(190933, 'deDE', 'Seid Ihr neu hier?', 'Seid Ihr neu hier?', 39653),
(190932, 'deDE', 'Seid Ihr auf einen Kampf aus?', 'Seid Ihr auf einen Kampf aus?', 39653),
(190925, 'deDE', 'Seid glücklich!', '', 39653),
(190924, 'deDE', 'Gubbins vermisst Euch.', '', 39653),
(190923, 'deDE', 'Gubbins gut gemacht?', '', 39653),
(190922, 'deDE', 'Ich mag glücklich!', '', 39653),
(190921, 'deDE', 'Gubbins macht gut!', '', 39653),
(190920, 'deDE', 'Ihr glücklich?', '', 39653),
(190919, 'deDE', 'Tubbins müde...', '', 39653),
(190918, 'deDE', 'Ich hab auch zu tun!', '', 39653),
(190917, 'deDE', 'Mir dröhnt der Kopp.', '', 39653),
(190916, 'deDE', 'Tubbins weiß am besten!', '', 39653),
(190915, 'deDE', 'Tubbins und Gubbins können richten!', '', 39653),
(190914, 'deDE', 'Ich bin der Hübsche!', '', 39653),
(190913, 'deDE', 'Na gut. Bin nicht einsam.', '', 39653),
(190912, 'deDE', 'Bringt nächstes Mal Häppchen.', '', 39653),
(190911, 'deDE', 'Seid kein Bösewicht.', '', 39653),
(190909, 'deDE', 'Habt Ihr Häppchen?', '', 39653),
(190908, 'deDE', 'Seid Ihr gut oder böse?', '', 39653),
(190905, 'deDE', 'Wechselt den Pfad... bevor es zu spät ist.', 'Ändert Euch... bevor es zu spät ist.', 39653),
(190904, 'deDE', 'Die Venthyr wissen alles. Alles.', 'Die Venthyr wissen alles. Einfach alles.', 39653),
(190898, 'deDE', 'Ihr könnt Untaten nicht vor den Venthyr verbergen.', 'Keine Untat lässt sich vor den Venthyr verbergen.', 39653),
(190897, 'deDE', 'Ich war einst von Bedeutung. Ich werde es wieder sein.', 'Ich war einst von Bedeutung. Ich werde es wieder sein.', 39653),
(190896, 'deDE', 'Seid Ihr auch gekommen, um mich zu quälen?', 'Seid Ihr auch hier, um mich zu quälen?', 39653),
(190895, 'deDE', 'Der Meister sieht alles.', 'Der Meister sieht alles.', 39653),
(190857, 'deDE', 'Vielleicht war ich... zu stolz...', 'Vielleicht war ich... zu stolz...', 39653),
(190854, 'deDE', 'Vesiphone... es tut mir leid...', 'Vesiphone... es tut mir leid...', 39653),
(190853, 'deDE', 'Ich bin... vom Weg abgekommen...', 'Ich bin... vom Weg abgekommen...', 39653),
(190848, 'deDE', 'Ich fürchte... nichts.', 'Ich fürchte... nichts.', 39653),
(190826, 'deDE', 'Mein Schwert gehört Euch. Und meine Axt. Und der Rest. Ich habe viele Waffen.', 'Mein Schwert gehört Euch. Und meine Axt. Und der Rest. Ich habe viele Waffen.', 39653),
(190825, 'deDE', 'Alles will verdient sein.', 'Alles will verdient sein.', 39653),
(190824, 'deDE', 'Geht hinaus und beansprucht Euren Ruhm.', 'Geht hinaus und beansprucht Euren Ruhm.', 39653),
(190818, 'deDE', 'Meine Waren werden gut dienen.', 'Meine Waren werden gut dienen.', 39653),
(190817, 'deDE', 'Akzeptiert nichts außer Sieg.', 'Akzeptiert nichts außer Sieg.', 39653),
(190800, 'deDE', 'Mein Arsenal steht Euch zur Verfügung.', 'Mein Arsenal steht Euch zur Verfügung.', 39653),
(190799, 'deDE', 'Das ist alles kampferprobt.', 'Das ist alles kampferprobt.', 39653),
(190798, 'deDE', 'Ich halte alles in gepflegtem Zustand.', 'Ich halte alles in gepflegtem Zustand.', 39653),
(190797, 'deDE', 'Seid Ihr für eine Inspektion hier?', 'Seid Ihr für eine Inspektion hier?', 39653),
(190795, 'deDE', 'Mögen Eure Feinde zerspringen.', 'Mögen Eure Feinde zerspringen.', 39653),
(190794, 'deDE', 'Für die Auserwählten.', 'Für die Auserwählten.', 39653),
(190793, 'deDE', 'Nur die Starken überleben.', 'Nur die Starken überleben.', 39653),
(190792, 'deDE', 'Jeder wird meinen Namen kennen.', 'Jeder wird meinen Namen kennen.', 39653),
(190791, 'deDE', 'Körper zerbrechen. Ruhm ist ewig.', 'Körper zerbrechen. Ruhm ist ewig.', 39653),
(190790, 'deDE', 'Kämpfen, um zu siegen.', 'Kämpfen, um zu siegen.', 39653),
(190789, 'deDE', 'Das Schlachtfeld wartet.', 'Das Schlachtfeld wartet.', 39653),
(190788, 'deDE', 'Ich dürste nach Kampf.', 'Ich dürste nach Kampf.', 39653),
(190787, 'deDE', 'Niemand bezwingt mich.', 'Niemand bezwingt mich.', 39653),
(190784, 'deDE', 'Ich schicke Euch in den Glutdistrikt!', 'Ich schicke Euch in den Glutdistrikt!', 39653),
(190783, 'deDE', 'Bleibt in der Nähe.', 'Bleibt in der Nähe.', 39653),
(190782, 'deDE', 'Wir beobachten.', 'Wir beobachten.', 39653),
(190781, 'deDE', 'Schaut, Dinge! Mich ignorieren.', 'Schaut, Dinge! Mich ignorieren.', 39653),
(190780, 'deDE', 'Nächstes Mal finde ich für Euch was Besseres.', 'Nächstes Mal finde ich für Euch was Besseres.', 39653),
(190779, 'deDE', 'Bleibt in den Schatten.', 'Bleibt in den Schatten.', 39653),
(190778, 'deDE', 'Beobachtet. Beobachtet immer...', 'Beobachtet. Beobachtet immer...', 39653),
(190777, 'deDE', 'Haltet Euch vom Grafen fern.', 'Haltet Euch vom Grafen fern.', 39653),
(190776, 'deDE', 'Ich verjage! Oh, nein...', 'Ich verjage! Oh, nein...', 39653),
(190775, 'deDE', 'Graf wird zahlen... Ja, zahlen!', 'Graf wird zahlen... Ja, zahlen!', 39653),
(190774, 'deDE', 'Durchs Licht zur Dunkelheit.', 'Durchs Licht zur Dunkelheit.', 39653),
(190773, 'deDE', 'Ich war mal hübsch...', 'Ich war mal hübsch...', 39653),
(190772, 'deDE', 'Ihr beginnt Kampf, ich beende Kampf.', 'Ihr beginnt Kampf, ich beende Kampf.', 39653),
(190771, 'deDE', 'Für den Prinzen.', 'Für den Prinzen.', 39653),
(190770, 'deDE', 'Ich helfe! Ich verkaufe!', 'Ich helfe! Ich verkaufe!', 39653),
(190769, 'deDE', 'Kauft mehr! Kauft bald!', 'Kauft mehr! Kauft bald!', 39653),
(190768, 'deDE', 'Seid gegrüßt... geschätzter... Schlundgänger...', 'Seid gegrüßt... geschätzter... Schlundgänger...', 39653),
(190767, 'deDE', 'Hasse Licht. Liebe Schlundgänger.', 'Hasse Licht. Liebe Schlundgänger.', 39653),
(190766, 'deDE', 'Ihr mächtig... Beendet Schmerz, ja?', 'Ihr mächtig... Beendet Schmerz, ja?', 39653),
(190765, 'deDE', 'Kein Kampf? Kein Kampf.', 'Kein Kampf? Kein Kampf.', 39653),
(190764, 'deDE', 'Grässlich. Grässlich!', 'Grässlich. Grässlich!', 39653),
(190763, 'deDE', 'Verzeiht... mein Aussehen...', 'Verzeiht... mein Aussehen...', 39653),
(190762, 'deDE', 'Ihr freundlich?', 'Ihr freundlich?', 39653),
(190753, 'deDE', 'Mein Meister hat mir DAS aber nicht befohlen.', '', 39653),
(190749, 'deDE', 'Noch ein zufriedener Kunde.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(190748, 'deDE', 'Denkt dran, ein sicherer Flug ist ein langweiliger Flug!', '', 39653),
(190747, 'deDE', 'Kommt jederzeit wieder! Ich werde... ewig hier sein.', '', 39653),
(190746, 'deDE', 'Oh! Sagt meinem Meister, ich war gut!', '', 39653),
(190742, 'deDE', 'Warum geht überhaupt irgendjemand zu Fuß?', '', 39653),
(190740, 'deDE', 'Hmm, mein Meister sagt, ich soll jedem dienen...', '', 39653),
(190736, 'deDE', 'Alles ist zum Verkauf... sogar ich! Sprecht mit meinem Meister darüber.', '', 39653),
(190735, 'deDE', 'Ich hab das ganze Glitzerzeug!', '', 39653),
(190734, 'deDE', 'Ich habe viele widersprüchliche Informationen erhalten. Läutert Eure Vergangenheit, aber lernt daraus! Lernt, so viel Ihr könnt, aber Ihr werdet nie alles verstehen. Seid standhaft im Glauben, aber folgt dem Pfad vor Euch. Ehrlich, ich bin verwirrt. <Seufzt> Aspirant zu sein ist schwer.', 'Ich habe viele widersprüchliche Informationen erhalten. Läutert Eure Vergangenheit, aber lernt daraus! Lernt, so viel Ihr könnt, aber Ihr werdet nie alles verstehen. Seid standhaft im Glauben, aber folgt dem Pfad vor Euch. Ehrlich, ich bin verwirrt. <Seufzt> Aspirantin zu sein ist schwer.', 39653),
(190733, 'deDE', 'Eine interessante Aufgabe ist nicht zu viel verlangt.', '', 39653),
(190732, 'deDE', 'Diese Arbeit ist doch nicht so schlecht.', '', 39653),
(190731, 'deDE', 'Bis zum nächsten Mal!', '', 39653),
(190730, 'deDE', 'Wir werden niemals alles wissen.', 'Wir werden niemals alles wissen.', 39653),
(190729, 'deDE', 'Danke für Eure Zeit.', '', 39653),
(190728, 'deDE', 'Es gibt so viel zu lernen.', 'Es gibt so viel zu lernen.', 39653),
(190727, 'deDE', 'Ich werde hier sein.', '', 39653),
(190726, 'deDE', 'Ihr wisst, wo Ihr mich findet.', '', 39653),
(190725, 'deDE', 'Sagt meinem Meister, ich bin hier!... Hat er wohl vergessen.', '', 39653),
(190724, 'deDE', 'Mögen wir aus Vergangenem lernen.', 'Mögen wir aus Vergangenem lernen.', 39653),
(190723, 'deDE', 'Seid gut zu Euch selbst.', 'Seid gut zu Euch selbst.', 39653),
(190722, 'deDE', 'Der berühmte Schlundgänger!', '', 39653),
(190721, 'deDE', 'Was braucht Ihr? Ich bin verpflichtet, zu gehorchen.', '', 39653),
(190720, 'deDE', 'Ja? Ich bin beschäftigt.', '', 39653),
(190719, 'deDE', 'Ich bin bereit.', '', 39653),
(190718, 'deDE', 'Ihr habt Befehle für mich?', '', 39653),
(190717, 'deDE', 'Ich werde hierüber nachdenken.', 'Ich werde hierüber nachdenken.', 39653),
(190716, 'deDE', 'Wie kann ich dem geschätzten Schlundgänger dienen?', '', 39653),
(190715, 'deDE', 'Bei der Gnade Vesiphones.', 'Bei der Gnade Vesiphones.', 39653),
(190714, 'deDE', 'Redet Ihr mit mir?', '', 39653),
(190713, 'deDE', 'Bleibt aufrecht im Angesicht von Widrigkeit.', 'Bleibt aufrecht im Angesicht von Widrigkeit.', 39653),
(190712, 'deDE', 'Vereint sind wir stärker.', 'Vereint sind wir stärker.', 39653),
(190711, 'deDE', 'Kommt wieder, es gibt noch viel zu entdecken.', 'Kommt wieder, es gibt noch so viel zu entdecken.', 39653),
(190710, 'deDE', 'Möge es Euch eine Hilfe sein.', 'Möge es Euch eine Hilfe sein.', 39653),
(190709, 'deDE', 'Schon die Anwesenheit eines anderen ist ein Segen.', 'Schon die Anwesenheit eines anderen ist ein Segen.', 39653),
(190708, 'deDE', 'Immer gern zu Diensten.', 'Immer gern zu Diensten.', 39653),
(190707, 'deDE', 'Ich wünsche Euch Entschlossenheit.', 'Ich wünsche Euch Entschlossenheit.', 39653),
(190706, 'deDE', 'Mögt Ihr Eure Prüfungen bestehen.', 'Mögt Ihr Eure Prüfungen bestehen.', 39653),
(190704, 'deDE', 'Beim Willen der Archon.', 'Beim Willen der Archon.', 39653),
(190703, 'deDE', 'Geht und dient.', 'Geht und dient.', 39653),
(190702, 'deDE', 'Mögen wir einander helfen.', 'Mögen wir einander helfen.', 39653),
(190701, 'deDE', 'Sprecht, auf dass ich verstehen kann.', 'Sprecht, auf dass ich verstehen kann.', 39653),
(190700, 'deDE', 'Welche Weisheit sucht Ihr?', 'Welche Weisheit sucht Ihr?', 39653),
(190697, 'deDE', 'Ich bin ganz Ohr.', 'Ich bin ganz Ohr.', 39653),
(190691, 'deDE', 'Ich bin nur ein bescheidener Diener.', 'Ich bin nur eine bescheidene Dienerin.', 39653),
(190689, 'deDE', 'Kann ich bei Eurer Meditation helfen?', 'Kann ich bei Eurer Meditation helfen?', 39653),
(190687, 'deDE', 'Erzählt mir Eure Sorgen.', 'Erzählt mir Eure Sorgen.', 39653),
(190686, 'deDE', 'Sucht Ihr einen Sparringspartner?', 'Sucht Ihr einen Sparringspartner?', 39653),
(190685, 'deDE', 'Möchtet Ihr Kampftechniken mit mir austauschen?', 'Möchtet Ihr Kampftechniken mit mir austauschen?', 39653),
(190684, 'deDE', 'Womit kann ich zu Diensten sein?', 'Womit kann ich zu Diensten sein?', 39653),
(190683, 'deDE', 'Seht Euch meine Waren in Ruhe an.', 'Seht Euch meine Waren in Ruhe an.', 39653),
(190682, 'deDE', 'Ich besitze mehr als nur Wissen.', 'Ich besitze mehr als nur Wissen.', 39653),
(190681, 'deDE', 'Ich hoffe, dass ich etwas Nützliches habe.', 'Ich hoffe, dass ich etwas Nützliches habe.', 39653),
(190680, 'deDE', 'Was beschäftigt Euch?', 'Was beschäftigt Euch?', 39653),
(190679, 'deDE', 'Es ist mir eine Ehre.', 'Es ist mir eine Ehre.', 39653),
(190677, 'deDE', 'Was können wir voneinander lernen?', 'Was können wir voneinander lernen?', 39653),
(190676, 'deDE', 'Wir gehen den Weg gemeinsam.', 'Wir gehen den Weg gemeinsam.', 39653),
(190675, 'deDE', 'Welches Wissen bringt Ihr?', 'Welches Wissen bringt Ihr?', 39653),
(190674, 'deDE', 'Gebt mir einen Kampf.', 'Gebt mir einen Kampf.', 39653),
(190673, 'deDE', 'Zeigt mir meinen Feind.', 'Zeigt mir meinen Feind.', 39653),
(190672, 'deDE', 'Melde mich zum Dienst.', 'Melde mich zum Dienst.', 39653),
(190671, 'deDE', 'Die Vergangenheit ist ein guter Lehrer.', 'Die Vergangenheit ist ein guter Lehrer.', 39653),
(190670, 'deDE', 'Erst denken, dann handeln.', 'Erst denken, dann handeln.', 39653),
(190669, 'deDE', 'Es gibt viele Wege. Welcher ist Eurer?', 'Es gibt viele Wege. Welcher ist Eurer?', 39653),
(190668, 'deDE', 'Unter der Archon sind wir alle eins.', 'Unter der Archon sind wir alle eins.', 39653),
(190667, 'deDE', 'Dient gut.', 'Dient gut.', 39653),
(190666, 'deDE', 'Bleibt bescheiden.', 'Bleibt bescheiden.', 39653),
(190665, 'deDE', 'Willkommen!', 'Willkommen!', 39653),
(190664, 'deDE', 'Eure Gegenwart ehrt mich.', 'Eure Gegenwart ehrt mich.', 39653),
(190663, 'deDE', 'Reinheit in allen Dingen.', 'Reinheit in allen Dingen.', 39653),
(190662, 'deDE', 'Für Euch ist es noch nicht Zeit.', 'Für Euch ist es noch nicht Zeit.', 39653),
(190661, 'deDE', 'Eure Taten eilen Euch voraus.', 'Eure Taten eilen Euch voraus.', 39653),
(190660, 'deDE', 'Entblößt Eure Seele für mich.', 'Entblößt Eure Seele für mich.', 39653),
(190656, 'deDE', 'Ich glaube an Euch.', 'Ich glaube an Euch.', 39653),
(190655, 'deDE', 'Es gibt nichts zu fürchten, nur die Furcht selbst.', 'Es gibt nichts zu fürchten, nur die Furcht selbst.', 39653),
(190654, 'deDE', 'Unsere Schwingen tragen alle Seelen.', 'Unsere Schwingen bringen alle Seelen hierher.', 39653),
(190653, 'deDE', 'Ich werde Euer Schild sein.', 'Ich werde Euer Schild sein.', 39653),
(190652, 'deDE', 'Wie lauten meine Befehle?', 'Wie lauten meine Befehle?', 39653),
(190651, 'deDE', 'Bereit zum Zuschlagen.', 'Bereit zum Zuschlagen.', 39653),
(190650, 'deDE', '', 'Was habt Ihr erbeutet?', 39653),
(190649, 'deDE', '', 'Kommt mit Logistikfragen zu mir.', 39653),
(190645, 'deDE', 'Ich habe... alles gegeben...', 'Ich habe... alles gegeben...', 39653),
(190644, 'deDE', 'Ich werde niemals... fliegen...', 'Ich werde niemals... fliegen...', 39653),
(190642, 'deDE', 'War ich nicht... genug?', 'War ich nicht... genug?', 39653),
(190634, 'deDE', 'Wie lange bin ich jetzt hier und ich bin IMMER noch nicht aufgestiegen! Immer heißt es \'keine Anima\', \'Ihr besteht keine Eurer Prüfungen\', \'die Schattenlande zerfallen\'. Darüber hab ich doch keine Kontrolle!', 'Wie lange bin ich jetzt hier und ich bin IMMER noch nicht aufgestiegen! Immer heißt es \'keine Anima\', \'Ihr besteht keine Eurer Prüfungen\', \'die Schattenlande zerfallen\'. Darüber hab ich doch keine Kontrolle!', 39653),
(190633, 'deDE', 'Eure Kundschaft ehrt mich.', 'Eure Kundschaft ehrt mich.', 39653),
(190632, 'deDE', 'Ein würdiger Austausch.', 'Ein würdiger Austausch.', 39653),
(190631, 'deDE', 'Es ist ein Vergnügen, zu dienen.', 'Es ist ein Vergnügen, zu dienen.', 39653),
(190629, 'deDE', 'Möge es Euch von Nutzen sein.', 'Möge es Euch von Nutzen sein.', 39653),
(190628, 'deDE', 'Wie kann ich behilflich sein?', 'Wie kann ich behilflich sein?', 39653),
(190627, 'deDE', 'Wonach sucht Ihr?', 'Wonach sucht Ihr?', 39653),
(190626, 'deDE', 'Ich habe Sachen, die interessant sein könnten.', 'Ich habe Sachen, die interessant sein könnten.', 39653),
(190625, 'deDE', 'Ich habe vieles zu bieten.', 'Ich habe vieles zu bieten.', 39653),
(190624, 'deDE', 'Vertraut dem Ablauf.', 'Vertraut dem Ablauf.', 39653),
(190623, 'deDE', 'Wie es sein muss.', 'Wie es sein muss.', 39653),
(190622, 'deDE', 'Geht und dient.', 'Geht und dient.', 39653),
(190621, 'deDE', 'Ein volles Herz gewinnt immer.', 'Ein volles Herz gewinnt immer.', 39653),
(190620, 'deDE', 'Mut begleite Euch.', 'Mut begleite Euch.', 39653),
(190619, 'deDE', 'Die Archon leite Euch.', 'Die Archon leite Euch.', 39653),
(190617, 'deDE', 'Wir alle beschreiten den Pfad.', 'Wir alle beschreiten den Pfad.', 39653),
(190616, 'deDE', 'In welchem Tempel trainiert Ihr?', 'In welchem Tempel trainiert Ihr?', 39653),
(190615, 'deDE', 'Willkommen.', 'Willkommen.', 39653),
(190614, 'deDE', 'Es ist mir eine Ehre.', 'Es ist mir eine Ehre.', 39653),
(190611, 'deDE', 'Ich habe Waren zum Verkauf ergattert.', '', 39653),
(190609, 'deDE', 'Treibgut des Schlachtfelds.', '', 39653),
(190595, 'deDE', 'Euer fortgesetztes Verhalten ist nichts Neues oder Originelles und Ihr solltet Euch schämen, es überhaupt zu versuchen.', '', 39653),
(190594, 'deDE', 'Ich wurde gemeißelt, lange bevor Euresgleichen Sprechen gelernt hat.', '', 39653),
(190593, 'deDE', 'Wenn Ihr sterbt, sorgt dafür, dass es aufrecht mit einer Waffe in der Hand, einem Lächeln auf dem Gesicht und zwischen den Leichen Eurer Feinde geschieht.', '', 39653),
(190592, 'deDE', '', 'Ich weiß, ich sehe klasse aus, aber könntet Ihr später starren?', 39653),
(190591, 'deDE', '', 'Ich habe keinen Auftrag, Euch zu töten... noch nicht.', 39653),
(190590, 'deDE', '', 'Der Tod ist geduldig, ich auch.', 39653),
(190589, 'deDE', '', 'Mögt Ihr Euer Ende kommen sehen.', 39653),
(190588, 'deDE', '', 'Haltet die Augen offen, immer.', 39653),
(190576, 'deDE', '', 'Glaubt nie, dass Ihr allein seid.', 39653),
(190574, 'deDE', '', 'Wir warten, wir beobachten, wir schlagen zu.', 39653),
(190573, 'deDE', '', 'Blickt gen Himmel.', 39653),
(190572, 'deDE', '', 'Ein flammendes Herz kann nur in Stein wohnen.', 39653),
(190571, 'deDE', '', 'Haltet Eure Krallen scharf.', 39653),
(190570, 'deDE', '', 'Ich bin der Fangzahn des Meisters.', 39653),
(190569, 'deDE', '', 'Wir sind die Augen und Ohren des Meisters.', 39653),
(190568, 'deDE', '', 'Die Vorräte sind begrenzt.', 39653),
(190567, 'deDE', '', 'Welche Munition benötigt Ihr?', 39653),
(190566, 'deDE', '', 'Haltet Eure Waffen scharf und Eure Sinne schärfer.', 39653),
(190565, 'deDE', '', 'Wurdet Ihr verfolgt?', 39653),
(190564, 'deDE', '', 'Seid immer kampfbereit.', 39653),
(190563, 'deDE', '', 'Die Steinhauerin segne Euch, Sterblicher.', 39653),
(190562, 'deDE', '', 'Revendreth wird überleben.', 39653),
(190561, 'deDE', '', 'Retah.', 39653),
(190560, 'deDE', '', 'Ich habe Euch beobachtet.', 39653),
(190543, 'deDE', 'Also, Euch würde ich gern vergessen.', 'Also, Euch würde ich gern vergessen.', 39653),
(190542, 'deDE', 'Darf nicht... vergessen...', 'Darf nicht... vergessen...', 39653),
(190541, 'deDE', 'So sei es.', 'So sei es.', 39653),
(190540, 'deDE', 'Ich muss nachdenken...', 'Ich muss nachdenken...', 39653),
(190539, 'deDE', 'So allein...', 'So allein...', 39653),
(190537, 'deDE', 'Ich will mich nur erinnern...', 'Ich will mich nur erinnern...', 39653),
(190536, 'deDE', 'Bitte... geht nicht.', 'Bitte... geht nicht.', 39653),
(190535, 'deDE', 'Warum muss ich das tun?', 'Warum muss ich das tun?', 39653),
(190532, 'deDE', 'Ich spüre... Zweifel...', 'Ich spüre... Zweifel...', 39653),
(190531, 'deDE', 'Gibt es keine Hoffnung?', 'Gibt es keine Hoffnung?', 39653),
(190529, 'deDE', 'Sind wir alle verloren?', 'Sind wir alle verloren?', 39653),
(190528, 'deDE', 'Ich weiß nicht, was ich tun soll...', 'Ich weiß nicht, was ich tun soll...', 39653),
(190527, 'deDE', 'Das kann... nicht richtig sein...', 'Das kann... nicht richtig sein...', 39653),
(190526, 'deDE', 'Bitte... Helft mir...', 'Bitte... Helft mir...', 39653),
(190525, 'deDE', 'Ich kann... nicht loslassen...', 'Ich kann... nicht loslassen...', 39653),
(190523, 'deDE', 'Fegen. Schrubben. Reparieren. Bauen. Nie beschweren. Nie! Aber eines Tages vielleicht fliegen. Fliegen klingt gut.', 'Fegen. Schrubben. Reparieren. Bauen. Nie beschweren. Nie! Aber eines Tages vielleicht fliegen. Fliegen klingt gut.', 39653),
(190522, 'deDE', 'Lebt wohl!', 'Lebt wohl!', 39653),
(190521, 'deDE', 'Bis zum nächsten Mal!', 'Bis zum nächsten Mal!', 39653),
(190520, 'deDE', 'Nächstes Mal hab ich mehr!', 'Nächstes Mal hab ich mehr!', 39653),
(190519, 'deDE', 'Kommt bald zu-huu-rück!', 'Kommt bald zu-huu-rück!', 39653),
(190518, 'deDE', 'Lasst Euch ruhig Zeit!', 'Lasst Euch ruhig Zeit!', 39653),
(190517, 'deDE', 'Ich hoffe, etwas davon ist nützlich.', 'Ich hoffe, etwas davon ist nützlich.', 39653),
(190516, 'deDE', 'Meine Waren, für Eu-heuch!', 'Meine Waren, für Eu-heuch!', 39653),
(190515, 'deDE', 'Braucht Ihr Nahrung? Verbände? Ein feuchtes Tuch?', 'Braucht Ihr Nahrung? Verbände? Ein feuchtes Tuch?', 39653),
(190514, 'deDE', 'Der Boden hier fegt sich nicht von selbst!', 'Der Boden hier fegt sich nicht von selbst!', 39653),
(190513, 'deDE', 'Bis dann!', 'Bis dann!', 39653),
(190512, 'deDE', 'Geht und dient.', 'Geht und dient.', 39653),
(190511, 'deDE', 'Sehr gern.', 'Sehr gern.', 39653),
(190510, 'deDE', 'An die Arbeit!', 'An die Arbeit!', 39653),
(190509, 'deDE', 'Gehabt Euch wohl!', 'Gehabt Euch wohl!', 39653),
(190508, 'deDE', 'Die Arbeit eines Provosten ist nie getan!', 'Die Arbeit eines Provosten ist nie getan!', 39653),
(190507, 'deDE', 'Gibt es Arbeit zu tun?', 'Gibt es Arbeit zu tun?', 39653),
(190506, 'deDE', 'Hu-hocherfreut.', 'Hocherfreut.', 39653),
(190505, 'deDE', 'Erlaubt mir, zu helfen.', 'Erlaubt mir, zu helfen.', 39653),
(190504, 'deDE', 'Seid willkommen.', 'Seid willkommen.', 39653),
(190503, 'deDE', 'Ja?', 'Ja?', 39653),
(190502, 'deDE', 'Hu-huu!', 'Hu-huu!', 39653),
(190501, 'deDE', 'Hallo!', 'Hallo!', 39653),
(190500, 'deDE', 'Meißelt Euer eigenes Schicksal.', '', 39653),
(190499, 'deDE', 'Ich bin zu alt hierfür.', '', 39653),
(190498, 'deDE', 'Meine Steinbrüder und ich stehen Euch zur Seite.', '', 39653),
(190497, 'deDE', 'Ich stehe bereit!', '', 39653),
(190496, 'deDE', 'Euer Geist ist stark. Bewacht ihn gut.', '', 39653),
(190495, 'deDE', 'Ich mag Euch. Sterbt bitte nicht.', '', 39653),
(190494, 'deDE', 'Seid hier immer auf der Hut.', '', 39653),
(190492, 'deDE', 'Was sind Eure Anforderungen?', '', 39653),
(190491, 'deDE', 'Ich habe Kriegswaren zum Tausch.', '', 39653),
(190490, 'deDE', 'Soll ich etwas zerstören?', '', 39653),
(190489, 'deDE', 'Meine Ehre für Revendreth.', '', 39653),
(190488, 'deDE', 'Bericht.', '', 39653),
(190487, 'deDE', 'Was bringt Ihr für Neuigkeiten?', '', 39653),
(190486, 'deDE', 'Sterblicher.', '', 39653),
(190485, 'deDE', 'Schlundgänger.', '', 39653),
(190484, 'deDE', 'Die Steinhauerin segne Euch, Sterblicher.', '', 39653),
(190468, 'deDE', 'Meldet alles Verdächtige.', '', 39653),
(190467, 'deDE', 'Der Wille des Meisters ist Gesetz.', '', 39653),
(190466, 'deDE', 'Der Meister sieht alles.', '', 39653),
(190465, 'deDE', 'Haltet Eure Waffen eng bei Euch und Eure Verbündeten noch enger.', '', 39653),
(190464, 'deDE', 'Dient ehrenhaft, aber nur den Ehrenhaften.', '', 39653),
(190463, 'deDE', 'Gedenkt den Gefallenen.', '', 39653),
(190462, 'deDE', 'Der Sieg wird unser sein.', '', 39653),
(190461, 'deDE', 'Vergesst nicht, nach oben zu schauen.', '', 39653),
(190460, 'deDE', 'Möge die Steinhauerin Euer Schicksal meißeln.', '', 39653),
(190459, 'deDE', 'Für Pflicht und Tapferkeit.', '', 39653),
(190458, 'deDE', 'Kommerz ist notwendig, wenn wir überleben wollen.', '', 39653),
(190457, 'deDE', 'Ressourcen sind knapp, aber wir haben ein paar Vorräte.', '', 39653),
(190455, 'deDE', 'Krieg... ändert sich nie.', 'Krieg... ändert sich nie.', 39653),
(190454, 'deDE', 'Kommt wieder, wenn nötig.', 'Kommt wieder, wenn nötig.', 39653),
(190453, 'deDE', 'Behaltet Euren Vorteil.', 'Behaltet Euren Vorteil.', 39653),
(190452, 'deDE', 'Keine Waffe kann Erfahrung ersetzen.', 'Keine Waffe kann Erfahrung ersetzen.', 39653),
(190451, 'deDE', 'Prüft Eure Ausrüstung.', 'Prüft Eure Ausrüstung.', 39653),
(190450, 'deDE', 'Die sind ganz neu.', 'Die sind ganz neu.', 39653),
(190449, 'deDE', 'Mein Arsenal steht Euch zur Verfügung.', 'Mein Arsenal steht Euch zur Verfügung.', 39653),
(190448, 'deDE', 'Braucht Ihr Ausrüstung?', 'Braucht Ihr Ausrüstung?', 39653),
(190447, 'deDE', 'Wollt Ihr etwas anfordern?', 'Wollt Ihr etwas anfordern?', 39653),
(190446, 'deDE', 'Ihr habt Eure Befehle.', 'Ihr habt Eure Befehle.', 39653),
(190445, 'deDE', 'Wegtreten.', 'Wegtreten.', 39653),
(190444, 'deDE', 'Zurück auf Euren Posten.', 'Zurück auf Euren Posten.', 39653),
(190443, 'deDE', 'Ruhm wird verdient, nicht verschenkt.', 'Ruhm wird verdient, nicht verschenkt.', 39653),
(190442, 'deDE', 'Feiert Siege. Lernt aus Niederlagen.', 'Feiert Siege. Lernt aus Niederlagen.', 39653),
(190441, 'deDE', 'Man braucht Mumm, um so weit zu kommen.', 'Man braucht Mumm, um so weit zu kommen.', 39653),
(190440, 'deDE', 'Kämpft tapfer.', 'Kämpft tapfer.', 39653),
(190439, 'deDE', 'Erklärt Eure Absichten.', 'Erklärt Eure Absichten.', 39653),
(190438, 'deDE', 'Wie laufen Eure Kämpfe?', 'Wie laufen Eure Kämpfe?', 39653),
(190437, 'deDE', 'Rührt Euch.', 'Rührt Euch.', 39653),
(190436, 'deDE', 'Heraus mit der Sprache.', 'Heraus mit der Sprache.', 39653),
(190435, 'deDE', 'Lasst hören.', 'Lasst hören.', 39653),
(190434, 'deDE', 'Berichtet.', 'Berichtet.', 39653),
(190433, 'deDE', 'Sprecht deutlich, Soldat!', 'Sprecht deutlich, Soldat!', 39653),
(190417, 'deDE', 'Ich stehe bereit.', '', 39653),
(190409, 'deDE', 'Wie es sein wird.', 'Wie es sein wird.', 39653),
(190408, 'deDE', 'Erinnert Euch.', 'Erinnert Euch.', 39653),
(190407, 'deDE', 'Devos sieht Euch.', 'Devos sieht Euch.', 39653),
(190406, 'deDE', 'Bereitet Euch auf Kämpfe vor.', 'Bereitet Euch auf Kämpfe vor.', 39653),
(190405, 'deDE', 'Aufopferung weist den Weg.', 'Aufopferung weist den Weg.', 39653),
(190404, 'deDE', 'Bis die Archon fällt.', 'Bis die Archon fällt.', 39653),
(190403, 'deDE', 'Erforscht Eure Gefühle.', 'Erforscht Eure Gefühle.', 39653),
(190402, 'deDE', 'Devos leite uns.', 'Devos leite uns.', 39653),
(190401, 'deDE', 'Ein neuer Weg.', 'Ein neuer Weg.', 39653),
(190400, 'deDE', 'Wir kämpfen um eine Zukunft.', 'Wir kämpfen um eine Zukunft.', 39653),
(190399, 'deDE', 'Durch Eure Führung.', 'Durch Eure Führung.', 39653),
(190398, 'deDE', 'Erinnerung hilft.', 'Erinnerung hilft.', 39653),
(190397, 'deDE', 'Möge unser Ziel Euch erheben.', 'Möge unser Ziel Euch erheben.', 39653),
(190396, 'deDE', 'Eine neue Sonne geht auf.', 'Eine neue Sonne geht auf.', 39653),
(190395, 'deDE', 'Ihr sucht Zwiesprache.', 'Ihr sucht Zwiesprache.', 39653),
(190394, 'deDE', 'Unsere Loyalität bindet.', 'Unsere Loyalität bindet.', 39653),
(190393, 'deDE', 'Sprecht schnell, unsere Feinde warten.', 'Sprecht schnell, unsere Feinde warten.', 39653),
(190392, 'deDE', 'Ihr steht vor einem Aufgestiegenen.', 'Ihr steht vor einer Aufgestiegenen.', 39653),
(190391, 'deDE', 'Ein neuer Morgen.', 'Ein neuer Morgen.', 39653),
(190390, 'deDE', 'Eine Zukunft für uns.', 'Eine Zukunft für uns.', 39653),
(190389, 'deDE', 'Ich möchte dienen.', 'Ich möchte dienen.', 39653),
(190388, 'deDE', 'Noch ein Suchender, hallo.', 'Noch ein Suchender, hallo.', 39653),
(190387, 'deDE', 'Seid mir gegrüßt.', 'Seid mir gegrüßt.', 39653),
(190386, 'deDE', 'Was kann ich tun?', 'Was kann ich tun?', 39653),
(190381, 'deDE', 'Für den Meister!', '', 39653),
(190361, 'deDE', 'Für die wahren Venthyr.', '', 39653),
(190360, 'deDE', 'Ich werde meinen Schwur halten.', '', 39653),
(190359, 'deDE', 'Es ist an mir, zu dienen.', '', 39653),
(190358, 'deDE', 'Für Revendreth.', '', 39653),
(190265, 'deDE', 'Nächstes Mal bringt einen Hocker mit, auf den Ihr Euch stellen könnt. Ha ha ha.', '', 39653),
(190264, 'deDE', 'Haut ab, Stöpsel!', '', 39653),
(190263, 'deDE', 'Tschöhö. Ha ha.', '', 39653),
(190262, 'deDE', 'Wie immer ein Vergnügen.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(190261, 'deDE', 'Ab jetzt mit Euch. Und lasst Euch nicht zertrampeln.', '', 39653),
(190260, 'deDE', 'Und tschüss.', '', 39653),
(190259, 'deDE', 'Passt auf, dass man Euch nicht zertrampelt. Hihi.', '', 39653),
(190258, 'deDE', 'Mein Zeh ist größer als Euer Kopf.', '', 39653),
(190257, 'deDE', 'Wie\'s Wetter da unten? Hehe.', '', 39653),
(190256, 'deDE', 'Ich war auch mal so klein wie Ihr.', '', 39653),
(190255, 'deDE', 'Habt Ihr was zum Knabbern? Ich knabbere gern.', '', 39653),
(190254, 'deDE', 'Solltet Ihr hier sein?', '', 39653),
(190253, 'deDE', 'Na, sieh mal an, noch ganz lebendig. Das ist so süß.', '', 39653),
(190252, 'deDE', 'Hey, da.', '', 39653),
(190245, 'deDE', 'Besser ich töte Euch, als die Fangzähne.', '', 39653),
(190242, 'deDE', 'Tschüss.', '', 39653),
(190241, 'deDE', 'Wir sehen uns. Wenn Ihr überlebt.', '', 39653),
(190240, 'deDE', 'Ihr habt da \'ne Menge Waffen. Geht\'s in den Krieg?', '', 39653),
(190232, 'deDE', 'Häh. Dachte, Ihr wärt... fleischiger.', '', 39653),
(190228, 'deDE', 'Was? Eure Leute nennen uns \'Geistheiler\'? Wirklich? Etwas Besseres ist Euch nicht eingefallen? Wenn das hier vorbei ist, sagt Euresgleichen bitte, dass man uns kyrianische Beobachter nennt. Ich habe nicht äonenlang trainiert, um Geistheiler genannt zu werden.', 'Was? Eure Leute nennen uns \'Geistheiler\'? Wirklich? Etwas Besseres ist Euch nicht eingefallen? Wenn das hier vorbei ist, sagt Euresgleichen bitte, dass man uns kyrianische Beobachter nennt. Ich habe nicht zehn Eurer Millennia trainiert, um Geistheiler genannt zu werden.', 39653),
(190227, 'deDE', 'Die Paragons hatten recht mit Euch.', 'Die Paragons hatten recht mit Euch.', 39653),
(190226, 'deDE', 'Unsere Einheit gibt uns Kraft.', 'Unsere Einheit gibt uns Kraft.', 39653),
(190225, 'deDE', 'Wir kämpfen gemeinsam.', 'Wir kämpfen gemeinsam.', 39653),
(190224, 'deDE', 'Eure Gegenwart stärkt uns.', 'Eure Gegenwart stärkt uns.', 39653),
(190223, 'deDE', 'Hab die besten Waren, die Ihr finden könnt. Stellt nur nicht zu viele Fragen.', '', 39653),
(190222, 'deDE', 'Nutzt es weise.', 'Nutzt es weise.', 39653),
(190221, 'deDE', 'Ich erwarte unser nächstes Treffen.', 'Ich erwarte unser nächstes Treffen.', 39653),
(190220, 'deDE', 'Möge Euer Weg rechtschaffen bleiben.', 'Möge Euer Weg rechtschaffen bleiben.', 39653),
(190219, 'deDE', 'Bis sich unsere Schicksale wieder kreuzen.', 'Bis sich unsere Schicksale wieder kreuzen.', 39653),
(190218, 'deDE', 'Ich erwarte Euer Angebot.', 'Ich erwarte Euer Angebot.', 39653),
(190217, 'deDE', 'Demütig präsentiere ich diese Waren.', 'Demütig präsentiere ich diese Waren.', 39653),
(190216, 'deDE', 'Wir haben viel zu besprechen.', 'Wir haben viel zu besprechen.', 39653),
(190215, 'deDE', 'Betrachtet meine Waren.', 'Betrachtet meine Waren.', 39653),
(190214, 'deDE', 'Wir werden nicht wanken.', 'Wir werden nicht wanken.', 39653),
(190213, 'deDE', 'Wie es sein muss.', 'Wie es sein muss.', 39653),
(190212, 'deDE', 'Möge Weisheit Euren Weg leiten.', 'Möge Weisheit Euren Weg leiten.', 39653),
(190211, 'deDE', 'Vertraut dem Weg.', 'Vertraut dem Weg.', 39653),
(190210, 'deDE', 'Fliegt von Euren Bürden befreit.', 'Fliegt von Euren Bürden befreit.', 39653),
(190209, 'deDE', 'Unsere Wache geht weiter.', 'Unsere Wache geht weiter.', 39653),
(190208, 'deDE', 'Geht und dient.', 'Geht und dient.', 39653),
(190206, 'deDE', 'Ihr habt viel erlebt.', 'Ihr habt viel erlebt.', 39653),
(190205, 'deDE', 'Unser Ziel ist klar.', 'Unser Ziel ist klar.', 39653),
(190204, 'deDE', 'Friede sei mit Euch.', 'Friede sei mit Euch.', 39653),
(190203, 'deDE', 'Ihr werdet gesehen.', 'Ihr werdet gesehen.', 39653),
(190202, 'deDE', 'Das Schicksal eint uns.', 'Das Schicksal eint uns.', 39653),
(190201, 'deDE', 'Willkommen.', 'Willkommen.', 39653),
(190200, 'deDE', 'Ich habe die besten Preise, die Ihr hier draußen finden werdet.', '', 39653),
(190199, 'deDE', 'Wenn Ihr noch anderen Krimskrams findet, bringt ihn mir.', '', 39653),
(190198, 'deDE', 'GRÄBER, VEREINIGT EUCH! Gleiches Recht für unterdrückte Diener!', '', 39653),
(190197, 'deDE', 'Das reicht! Ich sage es nochmal. Es wird langsam Zeit für eine Gewerkschaft.', '', 39653),
(190196, 'deDE', 'Macht so weiter und wir sprechen über eine Gefahrenzulage.', '', 39653),
(190195, 'deDE', 'Worum geht\'s denn?', '', 39653),
(190185, 'deDE', 'Ich falle... damit die Bastion steht...', 'Ich falle... damit die Bastion steht...', 39653),
(190182, 'deDE', 'Das... kann nicht sein...', 'Das... kann nicht sein...', 39653),
(190178, 'deDE', 'Unser Pakt hält zusammen.', 'Unser Pakt hält zusammen.', 39653),
(190177, 'deDE', 'Bis zum nächsten Mal, Schlundgänger.', 'Bis zum nächsten Mal, Schlundgänger.', 39653),
(190176, 'deDE', 'Reizt nicht die Fangzähne. Die sind nicht die nettesten Bosse.', '', 39653),
(190175, 'deDE', 'Die Elysische Feste heißt Euch willkommen.', 'Die Elysische Feste heißt Euch willkommen.', 39653),
(190174, 'deDE', 'Ich bin geehrt, dass Ihr zu den Kyrianern steht.', 'Ich bin geehrt, dass Ihr zu den Kyrianern steht.', 39653),
(190169, 'deDE', 'Erzählt den Bossen nichts von unserem Gespräch.', '', 39653),
(190168, 'deDE', 'Ihr braucht was gebaut oder zerstört? Dann bin ich Euer Gräber.', '', 39653),
(190167, 'deDE', 'Kommt vorbei, wenn ich etwas bauen oder zerstören soll.', '', 39653),
(190166, 'deDE', 'Immer einen Blick über die Schulter werfen. Und zum Himmel. Und auf alles.', '', 39653),
(190165, 'deDE', 'Können wir Eure Zähne haben, wenn Ihr sterbt?', '', 39653),
(190158, 'deDE', 'Passt auf Eure Sachen auf. Viel zwielichtiges Volk hier.', '', 39653),
(190154, 'deDE', 'Der Meister sieht zu. Also reitet uns in nichts rein.', '', 39653),
(190150, 'deDE', 'Beste Handwerkskunst.', '', 39653),
(190149, 'deDE', 'Ich habe ein paar neue Waren hier. Einige funktionieren sogar.', '', 39653),
(190148, 'deDE', 'Ey!', '', 39653),
(190147, 'deDE', 'Wo habt Ihr denn all die Zähne her?', '', 39653),
(190146, 'deDE', 'Ihr wart also im Schlund. Wie riecht\'s denn da?', '', 39653),
(190119, 'deDE', 'Talismane, Schmuckstücke, Folterwerkzeug. Alles im Angebot.', 'Talismane, Schmuckstücke, Folterwerkzeug. Alles im Angebot.', 39653),
(190116, 'deDE', 'Finden wir heraus, wie gut Ihr feilschen könnt.', 'Finden wir heraus, wie gut Ihr feilschen könnt.', 39653),
(190115, 'deDE', 'Der Meister beobachtet.', 'Der Meister beobachtet.', 39653),
(190114, 'deDE', 'Ihr habt immer noch Zeit.', 'Ihr habt immer noch Zeit.', 39653),
(190113, 'deDE', 'Mögen die Schatten über Euch wachen.', 'Mögen die Schatten über Euch wachen.', 39653),
(190112, 'deDE', 'Revendreth kann sehr gefährlich sein. Wollt Ihr etwas kaufen, das dabei hilft?', 'Revendreth kann sehr gefährlich sein. Wollt Ihr etwas kaufen, das dabei hilft?', 39653),
(190110, 'deDE', 'Ihr braucht das, was ich habe.', 'Ihr braucht das, was ich habe.', 39653),
(190109, 'deDE', 'Ihr müsst zu meinem Schneider. Der kann Euch etwas anfertigen, das wirklich passt.', 'Ihr müsst zu meinem Schneider. Der kann Euch etwas anfertigen, das wirklich passt.', 39653),
(190107, 'deDE', 'Ihr wollt schon gehen?', 'Ihr wollt schon gehen?', 39653),
(190106, 'deDE', 'Denkt an mich, wenn Ihr etwas... Exotisches findet.', 'Denkt an mich, wenn Ihr etwas... Exotisches findet.', 39653),
(190105, 'deDE', 'Seht! Die besten und seltensten Waren der ganzen Schattenlande.', 'Seht! Die besten und seltensten Waren der ganzen Schattenlande.', 39653),
(190104, 'deDE', 'Könnt Ihr Euch meine Waren denn überhaupt leisten?', 'Könnt Ihr Euch meine Waren denn überhaupt leisten?', 39653),
(190091, 'deDE', '', 'Wir alle werden zu etwas. Ich werde gerade... ungeduldig.', 39653),
(190086, 'deDE', '', 'Wandert wohl im Wald.', 39653),
(190085, 'deDE', '', 'Gehabt Euch wohl, Freund des Blätterdachs.', 39653),
(190083, 'deDE', '', 'Ihr wart immer Teil des Zyklus.', 39653),
(190081, 'deDE', 'Eure Zähne würden ein hübsche Halskette abgeben...', 'Eure Zähne würden ein hübsche Halskette abgeben...', 39653),
(190080, 'deDE', '<Leicht unheilvolles Gelächter>', '<Leicht unheilvolles Gelächter>', 39653),
(190079, 'deDE', 'Ich hoffe, der Tag verläuft, wie Ihr es verdient.', 'Ich hoffe, der Tag verläuft, wie Ihr es verdient.', 39653),
(190078, 'deDE', 'Habt acht... wenn Ihr könnt.', 'Habt acht... wenn Ihr könnt.', 39653),
(190077, 'deDE', 'Keine Sorge, irgendwann werdet Ihr großartig sein!', 'Keine Sorge, irgendwann werdet Ihr großartig sein!', 39653),
(190076, 'deDE', 'Sterbt bloß nicht da draußen!', 'Sterbt bloß nicht da draußen!', 39653),
(190075, 'deDE', 'Ihr habt viel länger überlebt als gedacht!', 'Ihr habt viel länger überlebt als gedacht!', 39653),
(190074, 'deDE', 'Mögt Ihr ernten, was Ihr gesät habt.', 'Mögt Ihr ernten, was Ihr gesät habt.', 39653),
(190073, 'deDE', 'Ha! Trottel!', 'Ha! Trottel!', 39653),
(190072, 'deDE', 'Auf bald!', 'Auf bald!', 39653),
(190071, 'deDE', 'Wir müssen das irgendwann wiederholen!', 'Wir müssen das irgendwann wiederholen!', 39653),
(190070, 'deDE', 'Jeder zahlt irgendwann.', 'Jeder zahlt irgendwann.', 39653),
(190069, 'deDE', 'Nähert Euch im Verborgenen.', 'Nähert Euch im Verborgenen.', 39653),
(190068, 'deDE', 'Gebt auf die Schatten acht.', 'Gebt auf die Schatten acht.', 39653),
(190067, 'deDE', 'Wir sehen uns wieder.', 'Wir sehen uns wieder.', 39653),
(190066, 'deDE', 'Für Königin und Hain.', 'Für Königin und Hain.', 39653),
(190065, 'deDE', 'Ich diene der Königin.', 'Ich diene der Königin.', 39653),
(190064, 'deDE', 'Schlagt zu, wo man es zuletzt erwartet!', 'Schlagt zu, wo man es zuletzt erwartet!', 39653),
(190063, 'deDE', 'Eindringlinge sind nicht die einzige Gefahr im Wald.', 'Eindringlinge sind nicht die einzige Gefahr im Wald.', 39653),
(190062, 'deDE', 'Bleibt wachsam.', 'Bleibt wachsam.', 39653),
(190061, 'deDE', 'Wollt Ihr handeln?', 'Wollt Ihr handeln?', 39653),
(190060, 'deDE', 'Ihr könnt mir vertrauen.', 'Ihr könnt mir vertrauen.', 39653),
(190059, 'deDE', 'Meine Preise sind sehr vernünftig. Wirklich.', 'Meine Preise sind sehr vernünftig. Wirklich.', 39653),
(190058, 'deDE', 'Alles hat seinen Preis. Alles.', 'Alles hat seinen Preis. Alles.', 39653),
(190057, 'deDE', 'Oh, ich wette, das wird gut!', 'Oh, ich wette, das wird gut!', 39653),
(190056, 'deDE', 'Ihr traut Euch aber was.', 'Ihr traut Euch aber was.', 39653),
(190055, 'deDE', 'Aha. Ihr seid schlauer, als Ihr ausseht!', 'Aha. Ihr seid schlauer, als Ihr ausseht!', 39653),
(190054, 'deDE', 'Ihr habt immer noch Euren Kopf! Interessant...', 'Ihr habt immer noch Euren Kopf! Interessant...', 39653),
(190052, 'deDE', 'Verratet Ihr mir Euren Namen?', 'Verratet Ihr mir Euren Namen?', 39653),
(190051, 'deDE', 'Hmmm... Mit Euch würd\'s gehen.', 'Hmmm... Mit Euch würd\'s gehen.', 39653),
(190050, 'deDE', 'Hatte nicht erwartet, dass Ihr so... sauber seid.', '', 39653),
(190049, 'deDE', 'Na, Ihr seid ja interessant!', 'Na, Ihr seid ja interessant!', 39653),
(190048, 'deDE', 'Rendel sagt, Ihr seid grau wie Stein.', '', 39653),
(190047, 'deDE', 'Die Jagd wurde ausgerufen, ich habe geantwortet.', 'Die Jagd wurde gerufen, ich habe geantwortet.', 39653),
(190046, 'deDE', 'Hey! Schlundgänger.', '', 39653),
(190041, 'deDE', 'Wo schlagen wir zu?', 'Wo schlagen wir zu?', 39653),
(190040, 'deDE', 'Mein Zeug ist das beste!', 'Mein Zeug ist das beste!', 39653),
(190039, 'deDE', 'Hallo! Braucht Ihr etwas?', 'Hallo! Braucht Ihr etwas?', 39653),
(190037, 'deDE', 'Für Königin und Hain!', 'Für Königin und Hain!', 39653),
(190031, 'deDE', '', 'Wir bringen Geschenke des Waldes.', 39653),
(190028, 'deDE', 'Schicke Schuhe. Kann ich die haben, wenn Ihr sterbt?', '', 39653),
(190027, 'deDE', 'Mir entgeht Euer Mangel an Schwingen nicht, Sterblicher. Es wäre sehr schade, wenn ich Euch in den Himmel über die Wolken trage, nur um Euch fallen zu lassen, bis Ihr der harten Erde begegnet. Nicht, dass ich das tun würde.', 'Mir entgeht Euer Mangel an Schwingen nicht, sterbliches Wesen. Es wäre sehr schade, wenn ich Euch in den Himmel über die Wolken trage, nur um Euch fallen zu lassen, bis Ihr der harten Erde begegnet. Nicht, dass ich das tun würde.', 39653),
(190026, 'deDE', 'Ihr findet nichts Besseres.', 'Ihr findet nichts Besseres.', 39653),
(190025, 'deDE', 'Nutzt es weise.', 'Nutzt es weise.', 39653),
(190024, 'deDE', 'Schwingen sollen Euch tragen.', 'Schwingen sollen Euch tragen.', 39653),
(190023, 'deDE', 'Ein würdiger Austausch.', 'Ein würdiger Austausch.', 39653),
(190022, 'deDE', '', 'Was würdet Ihr zurücklassen?', 39653),
(190021, 'deDE', 'Ich lebe, um zu dienen.', 'Ich lebe, um zu dienen.', 39653),
(190020, 'deDE', 'Ein Füllhorn an Waren für Euch.', 'Ein Füllhorn an Waren für Euch.', 39653),
(190019, 'deDE', 'Seht Euch in Ruhe um.', 'Seht Euch in Ruhe um.', 39653),
(190018, 'deDE', 'Wie kann ich zu Diensten sein?', 'Wie kann ich zu Diensten sein?', 39653),
(190017, 'deDE', '', 'Junger Sprössling, benötigt Ihr Nährstoffe?', 39653),
(190016, 'deDE', '', 'Man muss sich dem Wind beugen.', 39653),
(190015, 'deDE', 'Seh\' ich für Euch wie ein Schmutzfuß aus, der gepikst und geschubst werden muss? Ich kenne meinen Platz, kennt Ihr Euren?', '', 39653),
(190014, 'deDE', 'Haltet Eure Zähne scharf!', 'Haltet Eure Zähne scharf!', 39653),
(190013, 'deDE', 'Hört zu, Zahnnahrung. Haltet die Nase unten und die Füße still, oder wir enden beide im Morast.', '', 39653),
(190012, 'deDE', 'Mein Herz für den Ardenwald.', 'Mein Herz für den Ardenwald.', 39653),
(190011, 'deDE', 'Trefft immer ins Schwarze.', 'Trefft immer ins Schwarze.', 39653),
(190010, 'deDE', 'Tschühüüss!', 'Tschühüüss!', 39653),
(190009, 'deDE', 'Gebt auf die Schatten acht.', 'Gebt auf die Schatten acht.', 39653),
(190008, 'deDE', 'Für Königin und Hain.', 'Für Königin und Hain.', 39653),
(190007, 'deDE', 'Wo schlagen wir zu?', 'Wo schlagen wir zu?', 39653),
(190006, 'deDE', 'Was ist Eure Beute?', 'Was ist Eure Beute?', 39653),
(190005, 'deDE', 'Die Jagd muss weitergehen.', 'Die Jagd muss weitergehen.', 39653),
(190004, 'deDE', 'Sprecht frei heraus.', 'Sprecht frei heraus.', 39653),
(190003, 'deDE', 'Mein Herz für den Ardenwald.', 'Mein Herz für den Ardenwald.', 39653),
(190002, 'deDE', 'Mögt Ihr immer treffen.', 'Mögt Ihr immer treffen.', 39653),
(190001, 'deDE', 'Gebt auf die Schatten acht.', 'Gebt auf die Schatten acht.', 39653),
(190000, 'deDE', 'Für Königin und Hain.', 'Für Königin und Hain.', 39653),
(189999, 'deDE', 'Bis zum nächsten Mal!', 'Bis zum nächsten Mal!', 39653),
(189998, 'deDE', 'Wo schlagen wir zu?', 'Wo schlagen wir zu?', 39653),
(189997, 'deDE', 'Habt Ihr den Feind gewittert?', 'Habt Ihr den Feind gewittert?', 39653),
(189996, 'deDE', 'Ich jage für den Ardenwald.', 'Ich jage für den Ardenwald.', 39653),
(189995, 'deDE', 'Sprecht frei heraus.', 'Sprecht frei heraus.', 39653),
(189994, 'deDE', 'Fangt keinen Ärger an und der Stein bleibt grau.', '', 39653),
(189993, 'deDE', 'Zieht lieber keine Aufmerksamkeit auf Euch. Oder mich.', '', 39653),
(189992, 'deDE', 'Meister beobachtet. Beobachtet immer.', '', 39653),
(189991, 'deDE', 'Für den Meister!', '', 39653),
(189990, 'deDE', 'Es heißt, Ihr seid ein Schlundgänger. Wie ist das denn so?', '', 39653),
(189989, 'deDE', 'Habt Ihr schon einen Sündenstein?', '', 39653),
(189988, 'deDE', 'Wie viel für Eure Zähne?', '', 39653),
(189987, 'deDE', 'Hey, hier ist jemand Lebendiges.', '', 39653),
(189986, 'deDE', 'Der Meister beobachtet. Beobachtet immer.', 'Der Meister beobachtet. Beobachtet immer.', 39653),
(189985, 'deDE', 'Verschwindet hier, bevor es zu spät ist.', 'Verschwindet hier, bevor es zu spät ist.', 39653),
(189984, 'deDE', 'Mir fehlt so vieles, was Ihr für selbstverständlich haltet.', 'Mir fehlt so vieles, was Ihr für selbstverständlich haltet.', 39653),
(189983, 'deDE', 'Niemand kommt zufällig nach Revendreth.', 'Niemand kommt zufällig nach Revendreth.', 39653),
(189982, 'deDE', 'Genießt jetzt Eure Zeit. Der Tod kann vieles ändern...', 'Genießt jetzt Eure Zeit. Der Tod kann vieles ändern...', 39653),
(189981, 'deDE', 'Nur noch ein paar Jahrhunderte und ich verdiene meinen Platz im Schloss.', 'Nur noch ein paar Jahrhunderte und ich verdiene meinen Platz im Schloss.', 39653),
(189980, 'deDE', 'Vergesst nie: Wie Ihr lebt, bestimmt Eure Ewigkeit.', 'Vergesst nie: Wie Ihr lebt, bestimmt Eure Ewigkeit.', 39653),
(189979, 'deDE', 'Zählt Eure Sünden, bevor ein anderer es tut.', 'Zählt Eure Sünden, bevor ein anderer es tut.', 39653),
(189978, 'deDE', 'Bei Eurem Anblick vermisse ich meinen sterblichen Körper.', 'Bei Eurem Anblick vermisse ich meinen sterblichen Körper.', 39653),
(189977, 'deDE', 'Lebendige im Land der Toten. Finstere Zeiten.', 'Lebendige im Land der Toten. Finstere Zeiten.', 39653),
(189976, 'deDE', 'Seht Euch an, so voller Leben und freiem Willen.', 'Seht Euch an, so voller Leben und freiem Willen.', 39653),
(189975, 'deDE', 'Finsterste Grüße.', 'Finsterste Grüße.', 39653),
(189974, 'deDE', 'War klar. Die erste Seele seit Langem lebt auch noch.', 'War klar. Die erste Seele seit Langem lebt auch noch.', 39653),
(189973, 'deDE', 'Ich hörte, Ihr wart beim Meister. Hat er mich erwähnt?', 'Ich hörte, Ihr wart beim Meister. Hat er mich erwähnt?', 39653),
(189972, 'deDE', '', 'Das war ein bereicherndes Gespräch.', 39653),
(189971, 'deDE', '', 'Der Wald beobachtet Euch.', 39653),
(189970, 'deDE', '', 'Kultiviert Euren Geist.', 39653),
(189968, 'deDE', '', 'Der Zyklus ist ewig.', 39653),
(189967, 'deDE', '', 'Ihr werdet wachsen. Und blühen. Und dann...', 39653),
