(188931, 'deDE', 'Jetzt ist wohl kaum die Zeit für Geplauder.', 'Jetzt ist wohl kaum die Zeit für Geplauder.', 39653),
(188930, 'deDE', 'Was könnt Ihr für mich tun?', 'Was könnt Ihr für mich tun?', 39653),
(188929, 'deDE', 'Möge das Wohlwollen der Markgräfin mit Euch sein.', 'Möge das Wohlwollen der Markgräfin mit Euch sein.', 39653),
(188928, 'deDE', 'Wieso habt Ihr mich unterbrochen?', 'Wieso habt Ihr mich unterbrochen?', 39653),
(188927, 'deDE', 'Der Zyklus ist ewig.', 'Der Zyklus ist ewig.', 39653),
(188926, 'deDE', 'Möge Euer Pfad nicht in den Schlund führen.', 'Möge Euer Pfad nicht in den Schlund führen.', 39653),
(188924, 'deDE', 'Möge der Primus Euch gewogen sein.', 'Möge der Primus Euch gewogen sein.', 39653),
(188923, 'deDE', 'Durch Reanimation kommt Ewigkeit.', 'Durch Reanimation kommt Ewigkeit.', 39653),
(188922, 'deDE', 'Für die Markgräfin und Maldraxxus.', 'Für die Markgräfin und Maldraxxus.', 39653),
(188921, 'deDE', 'Vertraut auf den Zyklus.', 'Vertraut auf den Zyklus.', 39653),
(188920, 'deDE', 'Suchen, streben, siegreich sein.', 'Suchen, streben, siegreich sein.', 39653),
(188919, 'deDE', 'Der Zyklus hat Euch zu mir geführt.', 'Der Zyklus hat Euch zu mir geführt.', 39653),
(188911, 'deDE', 'Ihr seht heute seltsam gesund aus.', 'Ihr seht heute seltsam gesund aus.', 39653),
(188909, 'deDE', 'Die Luft war einst voller Anima, als wäre sie Staub.', 'Die Luft war einst voller Anima, als wäre sie Staub.', 39653),
(188900, 'deDE', 'Haltet Ihr auch schön Eure Rituale ab?', 'Haltet Ihr auch schön Eure Rituale ab?', 39653),
(188898, 'deDE', 'Ihr wärt ein überaus angemessenes Gefäß.', 'Ihr wärt ein überaus angemessenes Gefäß.', 39653),
(188897, 'deDE', 'Ah, der süße Geruch der Verwesung.', 'Ah, der süße Geruch der Verwesung.', 39653),
(188896, 'deDE', 'Wie dient Ihr der Markgräfin?', 'Wie dient Ihr der Markgräfin?', 39653),
(188873, 'deDE', 'Ich bin... ruiniert...', 'Ich bin... ruiniert...', 39653),
(188857, 'deDE', 'Vieles geht in den Hallen von Oribos verloren. Viele... nervtötende... Dinge.', 'Vieles geht in den Hallen von Oribos verloren. Viele... nervtötende... Dinge.', 39653),
(188856, 'deDE', 'Ich hoffe, Ihr habt, was Ihr braucht.', 'Ich hoffe, Ihr habt, was Ihr braucht.', 39653),
(188855, 'deDE', 'Eine zufriedenstellende Vereinbarung.', 'Eine zufriedenstellende Vereinbarung.', 39653),
(188854, 'deDE', 'Ich liebe lukrative Begegnungen.', 'Ich liebe lukrative Begegnungen.', 39653),
(188853, 'deDE', 'Einen geschlossenen Handel macht man nicht rückgängig.', 'Einen geschlossenen Handel macht man nicht rückgängig.', 39653),
(188852, 'deDE', 'Ich handle mit Waren, die andere... geschmacklos finden.', 'Ich handle mit Waren, die andere... geschmacklos finden.', 39653),
(188851, 'deDE', 'Alles ist Verhandlungssache.', 'Alles ist Verhandlungssache.', 39653),
(188850, 'deDE', 'Seht Euch um... aber seid diskret.', 'Seht Euch um... aber seid diskret.', 39653),
(188849, 'deDE', 'Mein Angebot ist exotisch.', 'Mein Angebot ist exotisch.', 39653),
(188848, 'deDE', 'Die Schattenlande können gefährlich sein.', 'Die Schattenlande können gefährlich sein.', 39653),
(188847, 'deDE', 'War das alles?', 'War das alles?', 39653),
(188846, 'deDE', 'Wir sprechen uns wieder... wenn es sein muss.', 'Wir sprechen uns wieder... wenn es sein muss.', 39653),
(188845, 'deDE', 'Gebt gut auf Euch acht.', 'Gebt gut auf Euch acht.', 39653),
(188844, 'deDE', 'Betrachtet unser Geschäft als abgeschlossen.', 'Betrachtet unser Geschäft als abgeschlossen.', 39653),
(188843, 'deDE', 'Gibt es sonst noch etwas?', 'Gibt es sonst noch etwas?', 39653),
(188842, 'deDE', 'Wir sind hier fertig.', 'Wir sind hier fertig.', 39653),
(188748, 'deDE', 'Beginnt zu verhandeln.', 'Beginnt zu verhandeln.', 39653),
(188746, 'deDE', 'Meine Zeit ist wertvoll, wisst Ihr?', 'Meine Zeit ist wertvoll, wisst Ihr?', 39653),
(188745, 'deDE', 'Was habt Ihr zu bieten?', 'Was habt Ihr zu bieten?', 39653),
(188744, 'deDE', 'Sollen wir die Bedingungen besprechen?', 'Sollen wir die Bedingungen besprechen?', 39653),
(188741, 'deDE', 'Was genau benötigt Ihr?', 'Was genau benötigt Ihr?', 39653),
(188740, 'deDE', 'Sagt, seid Ihr geschäftlich hier?', 'Sagt, seid Ihr geschäftlich hier?', 39653),
(188739, 'deDE', 'Meine Hilfe hat ihren Preis.', 'Meine Hilfe hat ihren Preis.', 39653),
(188664, 'deDE', 'Es ist eine Ehre, Euch zu helfen.', 'Es ist eine Ehre, Euch zu helfen.', 39653),
(188663, 'deDE', 'Möge das Schicksal Euch hold sein.', 'Möge das Schicksal Euch hold sein.', 39653),
(188662, 'deDE', 'Lasst die Vorsehung Eure Geschäfte leiten.', 'Lasst die Vorsehung Eure Geschäfte leiten.', 39653),
(188661, 'deDE', 'Ihr werdet zurückkehren, wenn die Richterin es will.', 'Ihr werdet zurückkehren, wenn die Richterin es will.', 39653),
(188643, 'deDE', 'Seht die Antiquitäten von Oribos.', 'Seht die Antiquitäten von Oribos.', 39653),
(188642, 'deDE', 'Seht nur, was Euch alles erwartet.', 'Seht nur, was Euch alles erwartet.', 39653),
(188641, 'deDE', 'Alles wird der Vorsehung gerecht.', 'Alles wird der Vorsehung gerecht.', 39653),
(188640, 'deDE', 'Alles hat seinen Nutzen.', 'Alles hat seinen Nutzen.', 39653),
(188639, 'deDE', 'Habt Ihr... überhaupt IRGENDEINEN Zweck? ', 'Habt Ihr... überhaupt IRGENDEINEN Zweck? ', 39653),
(188638, 'deDE', 'Haltet Euch an den Weg.', 'Haltet Euch an den Weg.', 39653),
(188636, 'deDE', 'Diese Krise wird vorübergehen.', 'Diese Krise wird vorübergehen.', 39653),
(188635, 'deDE', 'Alle Seelen haben ihren Platz.', 'Alle Seelen haben ihren Platz.', 39653),
(188634, 'deDE', 'Vertraut der Richterin.', 'Vertraut der Richterin.', 39653),
(188633, 'deDE', 'Ordnung wird wiederhergestellt.', 'Ordnung wird wiederhergestellt.', 39653),
(188631, 'deDE', 'Willkommen in der Ewigen Stadt.', 'Willkommen in der Ewigen Stadt.', 39653),
(188630, 'deDE', 'Wie kann ich dienen?', 'Wie kann ich dienen?', 39653),
(188629, 'deDE', 'Was sucht Ihr?', 'Was sucht Ihr?', 39653),
(188627, 'deDE', 'Ihr seid hier willkommen.', 'Ihr seid hier willkommen.', 39653),
(188626, 'deDE', 'Die Richterin sieht alle Wahrheiten.', 'Die Richterin sieht alle Wahrheiten.', 39653),
(188625, 'deDE', 'Die Vorsehung offenbart unseren Weg.', 'Die Vorsehung offenbart unseren Weg.', 39653),
(188548, 'deDE', 'Besser ein Mittler als die Mittellosigkeit, was?', 'Besser ein Mittler als die Mittellosigkeit, was?', 39653),
(188547, 'deDE', 'Denkt dran: Alles hat einen Wert.', 'Denkt dran: Alles hat einen Wert.', 39653),
(188546, 'deDE', 'Ihr seid immer ein geschätzter Kunde.', 'Ihr seid immer ein geschätzter Kunde.', 39653),
(188545, 'deDE', 'Bis zur nächsten Transaktion.', 'Bis zur nächsten Transaktion.', 39653),
(188544, 'deDE', 'Ihr habt ein Schnäppchen gemacht. Gut gefeilscht!', 'Ihr habt ein Schnäppchen gemacht. Gut gefeilscht!', 39653),
(188543, 'deDE', 'Alles ist verhandelbar.', 'Alles ist verhandelbar.', 39653),
(188542, 'deDE', 'Für Euch habe ich nur das Beste.', 'Für Euch habe ich nur das Beste.', 39653),
(188541, 'deDE', 'Kann ich Euch mit meinen Waren in Versuchung bringen?', 'Kann ich Euch mit meinen Waren in Versuchung bringen?', 39653),
(188540, 'deDE', 'Alle Waren und Dienste erhältlich.', 'Alle Waren und Dienste erhältlich.', 39653),
(188521, 'deDE', 'Ich weiß, unsere Geschäfte werden lukrativ sein.', 'Ich weiß, unsere Geschäfte werden lukrativ sein.', 39653),
(188519, 'deDE', 'Glück und Reichtum für Euch.', 'Glück und Reichtum für Euch.', 39653),
(188517, 'deDE', 'Kommt wieder, wenn Ihr etwas braucht.', 'Kommt wieder, wenn Ihr etwas braucht.', 39653),
(188515, 'deDE', 'Tod ist die ultimative Transaktion.', 'Tod ist die ultimative Transaktion.', 39653),
(188514, 'deDE', 'Dieses Reich bietet unendliche Möglichkeiten.', 'Dieses Reich bietet unendliche Möglichkeiten.', 39653),
(188513, 'deDE', 'Immer ein Vergnügen.', 'Immer ein Vergnügen.', 39653),
(188512, 'deDE', 'Bitte, besucht mich wieder.', 'Bitte, besucht mich wieder.', 39653),
(188511, 'deDE', 'Ihr ehrt mich mit Eurer Aufmerksamkeit!', 'Ihr ehrt mich mit Eurer Aufmerksamkeit!', 39653),
(188510, 'deDE', 'Ihr verdient eindeutig nur das Beste.', 'Ihr verdient eindeutig nur das Beste.', 39653),
(188509, 'deDE', 'Ihr habt meine volle Aufmerksamkeit.', 'Ihr habt meine volle Aufmerksamkeit.', 39653),
(188508, 'deDE', 'Es wäre mir ein Vergnügen, Euch zu helfen.', 'Es wäre mir ein Vergnügen, Euch zu helfen.', 39653),
(188507, 'deDE', 'Ich lebe um zu dienen, Schlundgänger.', 'Ich lebe um zu dienen, Schlundgänger.', 39653),
(188506, 'deDE', 'Sagt mir einfach, was Ihr braucht.', 'Sagt mir einfach, was Ihr braucht.', 39653),
(188505, 'deDE', 'Wie kann ich helfen?', 'Wie kann ich helfen?', 39653),
(188266, 'deDE', 'Sackgasse! Zeit, herauszufinden, ob dieses Amulett funktioniert.', '', 39653),
(188262, 'deDE', 'LAUFT!!!', '', 39653),
(188077, 'deDE', '', 'Das ist ein harter Kampf, $n. Wir können Eure Talente dringend brauchen.', 39653),
(187557, 'deDE', 'Weidenblüte... Danke. Die Bastion wird Eure Hilfe nie vergessen. Dafür werde ich sorgen.', '', 39653),
(187556, 'deDE', '', 'Trauert nicht um mich, Pelagos. Ich habe mein Leben lang dem Wald gedient. Das hier ist meine Chance, allen Schattenlanden zu helfen.', 39653),
(187555, 'deDE', 'Nein! Es muss doch anders gehen!', '', 39653),
(187554, 'deDE', 'Weidenblüte... IHR seid das Gefäß?!', '', 39653),
(187553, 'deDE', '', 'Nur ein Gefäß des Ardenwalds kann die Macht des Hains in sich fassen.', 39653),
(187552, 'deDE', 'Bevor Ihr geht? Wie meint Ihr das?', '', 39653),
(187550, 'deDE', '', 'Larvi, wie schön, dich zu sehen, bevor ich gehe. Leb wohl, mein lieber kleiner Freund.', 39653),
(186838, 'deDE', 'Zerschmettert!', 'Zerschmettert!', 39653),
(186503, 'deDE', 'So sehen wir uns wieder. Bedauerlicherweise.', '', 39653),
(186141, 'deDE', 'Keine Ausreden mehr. Der Meister erhält seinen Animazehnt oder ich verbanne alle in diesem erbärmlichen Dorf in den Glutdistrikt.', '', 39653),
(184548, 'deDE', 'Hah! Unser Drache wird sie zermalmen!', '', 39653),
(184516, 'deDE', 'Wisst Ihr was? Ihr gewinnt. Pikst einfach drauflos.', '', 39653),
(184515, 'deDE', 'Könnt Ihr das nicht einfach bleiben lassen?', '', 39653),
(184514, 'deDE', 'Heute ist einfach nicht mein Tag, was?', '', 39653),
(184513, 'deDE', 'Ich heb Euch einen Humpen auf, wenn Ihr möchtet.', '', 39653),
(184512, 'deDE', 'Bleibt wachsam da draußen.', '', 39653),
(184511, 'deDE', 'Hoffe, Ihr kommt heil wieder zurück.', '', 39653),
(184510, 'deDE', 'Ich will doch nur zurück aufs Festland.', '', 39653),
(184509, 'deDE', 'Wenn das hier vorbei ist, genehmige ich mir erstmal einen.', '', 39653),
(184508, 'deDE', 'Hätte ich Eisenschmiede bloß nie verlassen!', '', 39653),
(184507, 'deDE', 'Ich wette, ich kann das automatisieren, was Ihr da macht. Wollen wir es testen?', '', 39653),
(184506, 'deDE', 'Braucht Ihr was? Ich suche hier nach Geistesblitzen!', '', 39653),
(184505, 'deDE', 'Soll das etwa ein Scherz sein?', '', 39653),
(184504, 'deDE', 'Lasst mich wissen, wie es läuft!', '', 39653),
(184503, 'deDE', 'Bringt mir was Interessantes mit!', '', 39653),
(184502, 'deDE', 'Bleibt entspannt und sammelt immer Proben!', '', 39653),
(184501, 'deDE', 'Diesen Ogern zeigen wir schon noch die Macht der Wissenschaft!', '', 39653),
(184500, 'deDE', 'Gegen Technologie ist Nekromantie gar nichts!', '', 39653),
(184499, 'deDE', 'Es gibt kein Problem, das die Ingenieurskunst nicht lösen kann!', '', 39653),
(184498, 'deDE', 'Vielleicht wäre ich besser bei den Ogern geblieben.', '', 39653),
(184497, 'deDE', 'Meine Mutter hat mich vor Rekruten wie Euch gewarnt.', '', 39653),
(184495, 'deDE', 'Seid Ihr den ganzen Weg gekommen, um mich zu piksen?', '', 39653),
(184491, 'deDE', 'Haltet Euch von dunkler Magie fern.', '', 39653),
(184487, 'deDE', 'Vorsicht vor Ogern.', '', 39653),
(184485, 'deDE', 'Seid vorsichtig da draußen.', '', 39653),
(184484, 'deDE', 'Ihr seid ein echter Held.', '', 39653),
(184483, 'deDE', 'Ich werde nach besten Kräften helfen.', '', 39653),
(184482, 'deDE', 'Wir müssen meine Freunde retten.', '', 39653),
(184481, 'deDE', 'Das merke ich mir fürs nächste Training.', '', 39653),
(184480, 'deDE', 'Jetzt reicht es aber mit der Stupserei. Gönnt Euch mal eine Pause!', '', 39653),
(184479, 'deDE', 'Ist das alles, was höhere Offiziere so tun?', '', 39653),
(184478, 'deDE', 'Für die Allianz!', '', 39653),
(184477, 'deDE', 'Vereint werden wir stärker.', '', 39653),
(184476, 'deDE', 'Macht weiter so!', '', 39653),
(184473, 'deDE', 'Diese Expedition retten wir im Handumdrehen!', '', 39653),
(184472, 'deDE', 'Ich bin hier, um zu helfen. Egal wie.', '', 39653),
(184471, 'deDE', 'Gefreiter Cole, melde mich zum Dienst!', '', 39653),
(184469, 'deDE', '', 'Zusammen werden wir dies meistern.', 39653),
(184465, 'deDE', '', 'Dieses muss Ritual aufgehalten werden.', 39653),
(184463, 'deDE', '', 'Oger und Nekromantie. Eine gefährliche Kombination.', 39653),
(184462, 'deDE', '', 'Ich kann mich noch an meine Rekrutenzeit erinnern. Ich war genau wie Ihr... und dann wurde ich erwachsen.', 39653),
(184461, 'deDE', '', 'Benötigt Ihr irgendwas? Vielleicht einen riesigen Hammer in die Visage?', 39653),
(184460, 'deDE', '', 'Gut gemacht, Ihr irritiert mich meisterlich.', 39653),
(184459, 'deDE', '', 'Bleibt aufmerksam und konzentriert.', 39653),
(184458, 'deDE', '', 'Lasst Euren Posten niemals außer Acht.', 39653),
(184455, 'deDE', '', 'Passt gut auf. Von uns hängen Leben ab.', 39653),
(184454, 'deDE', '', 'Wir haben eine Mission zu erfüllen.', 39653),
(184453, 'deDE', '', 'Die Allianz lässt niemanden zurück.', 39653),
(184452, 'deDE', '', 'Wir finden die Expedition.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(184451, 'deDE', '', 'Erhebt Euch, $p von Azeroth, als Jäger der Wilden Jagd, Champion des Hofs der Nacht und Beschützer des Ardenwalds.', 39653),
(184450, 'deDE', '', '[DNT] By oath, we stand beside you.', 39653),
(184449, 'deDE', '', 'Und so segnen wir Euch, bei der Anima. Wir halten Euch, im Geiste. Wir sind bei Euch, im Schwur.', 39653),
(184448, 'deDE', '', 'Ihr habt in der Spanne eines sterblichen Lebens viel erreicht. Wir können stolz sein, Euch zu haben.', 39653),
(184430, 'deDE', 'Dieser Sterbliche wird keine weitere Marionette des Meisters!', '', 39653),
(184166, 'deDE', 'Ihr seid dem Meister im Weg!', 'Ihr seid dem Meister im Weg!', 39653),
(184011, 'deDE', 'Gute Arbeit, wie Ihr diese Leute gerettet habt... und das mit den Spinnen.', '', 39653),
(184010, 'deDE', '', 'Beim Licht, Ihr lebt!', 39653),
(184009, 'deDE', '', 'Diese armen Kreaturen... Wir können nicht anhalten, um ihnen zu helfen.', 39653),
(183971, 'deDE', '', 'Aus dem Weg, kleine Spinnen!', 39653),
(183927, 'deDE', 'Konstrukte! Stellung halten! Unser Sieg ist nahe!', 'Konstrukte! Stellung halten! Unser Sieg ist nahe!', 39653),
(183793, 'deDE', '', 'UNUSED', 39653),
(182903, 'deDE', '', 'Kein Grund zur Sorge. Wie Ihr sehen könnt, sind meine Wachen angewiesen, Euch als Gast zu behandeln.', 39653),
(182902, 'deDE', '', 'Kommt, suchen wir einen netteren Ort zum Plaudern.', 39653),
(182901, 'deDE', '', 'Ich habe Euch erwartet.', 39653),
(182496, 'deDE', 'Bis zum nächsten Mal. Falls Ihr überlebt.', '', 39653),
(182495, 'deDE', 'Ihr wurdet noch nicht getötet. Beeindruckend.', '', 39653),
(180243, 'deDE', 'Was habt Ihr anzubieten?', '', 39653),
(179772, 'deDE', 'Wie Ihr wünscht, Oberster Kämmerer.', '', 39653),
(179770, 'deDE', 'Er ist auch Euer Meister, Verräter! Lasst uns sofort frei.', '', 39653),
(179769, 'deDE', 'Aaaaaaaah!', '', 39653),
(179768, 'deDE', 'Aaaaaaaaah!', '', 39653),
(179767, 'deDE', 'Aaaaaaaah!', '', 39653),
(179766, 'deDE', 'Rebellen. Fahrt über oder durch sie hindurch. Sie würden nicht wagen... Aah!', '', 39653),
(179765, 'deDE', 'Oberster Kämmerer! Da vorn ist Tumult. Sieht aus wie ein Kampf.', '', 39653),
(179764, 'deDE', 'Gerüchte über eine Rebellion sind stark übertrieben. Alles ist unter Kontrolle.', '', 39653),
(179763, 'deDE', 'Sie werfen ihm vor, er hortet Anima, aber in Wahrheit muss er das Wenige rationieren, was noch übrig ist.', '', 39653),
(179761, 'deDE', '[DEPRECATED] My Master, the supreme Sire Denathrius, has a plan to see us through these dark times.', '', 39653),
(179758, 'deDE', '[DEPRECATED] You two, dredgers, leave that mortal alone. They are under the protection of the Master.', '', 39653),
(179519, 'deDE', 'Ich lebe, um das Reich vor jenen zu schützen, die ihm schaden wollen. Selbst dem Meister.', '', 39653),
(179518, 'deDE', 'Ich bin Revendreth verpflichtet, nicht dem Meister.', '', 39653),
(179517, 'deDE', 'Wir tun was nötig ist.', '', 39653),
(179516, 'deDE', 'Ein sicherer Tod und ewige Qual sind kein Grund, die Pflicht zu vernachlässigen.', '', 39653),
(179515, 'deDE', 'Willkommen bei der Rebellion.', '', 39653),
(179514, 'deDE', 'Für die Pflichterfüllung ist Hoffnung keine Voraussetzung.', '', 39653),
(179513, 'deDE', 'Der Meister muss gestoppt werden.', '', 39653),
(179512, 'deDE', '', 'Meine Truppen beherrschen den Himmel. Wir haben die Kontrolle.', 39653),
(179511, 'deDE', '', 'Ihr wandelt im Reich des Meisters. Seid vorsichtig.', 39653),
(179510, 'deDE', '', 'Hmpf. Der Schlundgänger.', 39653),
(179509, 'deDE', '', 'Wir behalten Euch immer im Auge.', 39653),
(179508, 'deDE', '', 'Befehle werden ausgeführt, nicht hinterfragt.', 39653),
(179507, 'deDE', '', 'Meine Treue ist unerschütterlich.', 39653),
(179506, 'deDE', '', 'Ich diene dem Meister.', 39653),
(179292, 'deDE', 'Bringt die Expeditionsmitglieder sicher nach Hause. Für die Allianz!', '', 39653),
(179290, 'deDE', 'Der Worgenfluch mag Euer Königreich Gilneas verwüstet haben, doch Ihr habt Eure wilde Wut gebändigt und richtet sie jetzt gegen Eure Feinde.', '', 39653),
(179289, 'deDE', 'Als Pandaren habt Ihr ein harmonisches Leben auf der wandernden Insel Shen-zin Su genossen, doch Euer furchtloser Geist sehnt sich nach Abenteuer.', '', 39653),
(179288, 'deDE', 'Auf der Flucht aus Eurer fernen Heimatwelt vor dämonischer Verderbnis hat Euer Volk, die Draenei, bei tapferen Verbündeten ein neues Zuhause gefunden.', '', 39653),
(179287, 'deDE', 'Ihr mögt klein sein, doch mit dem Einfallsreichtum und der Entschlossenheit der Gnome seid Ihr Euren Verbündeten ebenbürtig.', '', 39653),
(179286, 'deDE', 'Ihr gehört dem uralten Volk der Nachtelfen an und habt die heiligen Wälder verlassen, um für Eure Verbündeten und die Wildnis zu kämpfen.', '', 39653),
(179285, 'deDE', 'Ihr repräsentiert die tapferen Zwerge von Eisenschmiede, seid aus dem Berg hervorgetreten und bereit für jede Herausforderung.', '', 39653),
(179282, 'deDE', 'Sturmwind, eins der mächtigsten Menschenkönigreiche, ist berühmt für seine tapferen Ritter und legendären Helden.', '', 39653),
(178922, 'deDE', '', 'Elune, bitte schütze uns vor Schaden!', 39653),
(178905, 'deDE', 'Plünderer und Diebe. Stoppt sie, bevor sie die letzten Animareserven stehlen.', '', 39653),
(178904, 'deDE', 'Entschuldigt, Meister.', '', 39653),
(178902, 'deDE', 'Doch wenn Ihr uns unterstützt, dann gebe ich Euch gern die gewünschte Hilfe.', '', 39653),
(178901, 'deDE', 'Diese Dürre lässt mein Volk verzweifeln...', '', 39653),
(178899, 'deDE', 'Ah! Der Sterbliche, der dem ausbruchsicheren Gefängnis entkommen ist. Eine lebende Seele, die den ewigen Reichen Hoffnung gibt.', '', 39653),
(178898, 'deDE', 'Ich fürchte, weitere Opfer sind nötig, wenn Revendreth diese Krise überstehen soll.', '', 39653),
(178897, 'deDE', 'Der Animamangel und das Fehlen neuer Seelen haben uns allen fürchterlich zugesetzt.', '', 39653),
(178896, 'deDE', 'Meine Kinder, ich weiß um das Leid, das Ihr ertragen musstet.', '', 39653),
(178796, 'deDE', 'Es hat schon begonnen... Sie wollen den Drachen mit der gesammelten Lebenskraft reanimieren!', '', 39653),
(178794, 'deDE', 'Für ihre Magie brauchen sie Opfer wie uns. Sie sind dabei, ein Ritual zu beginnen, das...', '', 39653),
(178793, 'deDE', 'Ja, Mutter... Kapitänin Garrick! Die Oger verwendeten Nekromantie, um einen Drachen zu erwecken.', '', 39653),
(178668, 'deDE', 'Schnell, macht Euch vorzeigbar. Der Oberste Kämmerer ist hier.', '', 39653),
(178667, 'deDE', 'Haltet ein. Das ist ein Gast, kein Angeklagter.', '', 39653),
(178652, 'deDE', 'Das Letzte Urteil fällt der Meister. Er hat hier das Sagen. Er heißt die Seelen willkommen, die zu Venthyr werden sollen, den Peinigern und Fressern der Sünden.', '', 39653),
(178651, 'deDE', 'Jeder dieser Sündensteine steht für eine Seele, die zu uns gekommen ist, sich von ihren Sünden gereinigt hat und dann weitergezogen oder uns als Venthyr beigetreten ist.', '', 39653),
(178645, 'deDE', 'Nur keine Angst. Wie Ihr an all den Sündensteinen seht, ist der Weg zur Erlösung erreichbar.', '', 39653),
(178644, 'deDE', 'Als neu eingetroffene Seele müsst Ihr wissen, dass dies ein Ort der Peinigung und Sühne ist.', '', 39653),
(178545, 'deDE', 'Die geballte Macht der Allianz wird Euch treffen!', '', 39653),
(178544, 'deDE', 'Wir werden Euch die Seele nehmen und den Drachen wecken!', '', 39653),
(176877, 'deDE', 'Wir werden den Drachen beschäftigen! Ihr geht jetzt besser zum Lager Bronzebart, Eure Hilfe wird dort gebraucht!', '', 39653),
(176876, 'deDE', 'Nicht, wenn ich ein Wort mitzureden hab, überdimensionierte Echse!', '', 39653),
(176727, 'deDE', 'Abgemacht. Und jetzt gut festhalten!', '', 39653),
(176725, 'deDE', 'Haltet Euch fest!', '', 39653),
(176724, 'deDE', 'Wer immer für den Schild verantwortlich ist, lässt uns hoffentlich auch rein. Ansonsten wird das eine kurze Angelegenheit!', '', 39653),
(176723, 'deDE', 'Die Rekruten in Sturmwind werden das nie und nimmer glauben!', '', 39653),
(176722, 'deDE', 'Ich gehe voraus, um sicherzustellen, dass es im Lager Bronzebart auch sicher ist. Für die Allianz!', '', 39653),
(176721, 'deDE', 'Wir werden von den Greifen abspringen müssen, wenn wir das Lager erreichen... und uns dann schnellstmöglich mit denen an die Arbeit machen, die dort noch übrig sind.', '', 39653),
(176720, 'deDE', 'Ich will erst mal im Lager Bronzebart nach dem Rechten sehen. Ich stoße dann später zu Euch!', '', 39653),
(176719, 'deDE', 'Haltet Euch an den Greifen fest! Sie sind dafür ausgebildet, allen möglichen Gefahren auszuweichen. Hoffentlich gilt das auch für das Feuer aus dem Artefakt eines Drachen!', '', 39653),
(176256, 'deDE', 'Und jetzt werdet Ihr sterben. Keine Sorge, ich werde sicherstellen, dass Euren Verbündeten das gleiche Schicksal widerfährt.', '', 39653),
(176255, 'deDE', 'Hah! Ich weiß genau, wie ich Eure kleinen Zauber aufheben kann. Wenn ich wiederkomme, werde ich Euch zu Asche verbrennen.', '', 39653),
(175796, 'deDE', 'Erlebt die wahre Macht des Auges des Feuers!', '', 39653),
(175226, 'deDE', '', 'Seid wachsam. Er bewegt sich langsam, aber wenn Ihr zu lange verweilt, wird er Euch finden!', 39653),
(175225, 'deDE', '', 'Der Tarragrue? Ich hoffte, Ihr würdet tiefer in den Schlund hineinkommen, bevor die Bestie Eure Witterung aufnimmt.', 39653),
(174800, 'deDE', 'Ihr steht noch. Euer kleines Ritual hat mich tatsächlich geschwächt.', '', 39653),
(174799, 'deDE', '', 'Übergebt uns das Auge des Feuers, damit wir nicht gezwungen sind, es uns gewaltsam zu holen.', 39653),
(174783, 'deDE', 'Seid wachsam. Er bewegt sich langsam, aber wenn Ihr zu lange verweilt, wird er Euch finden!', '', 39653),
(174781, 'deDE', 'Der Tarragrue? Ich hoffte, Ihr würdet tiefer in den Schlund hineinkommen, bevor die Bestie Eure Witterung aufnimmt.', '', 39653),
(174778, 'deDE', 'Dummköpfe! Dachtet Ihr wirklich, ich würde mich nach Eurem erbärmlichen Ritual einfach so zurückziehen?', '', 39653),
(170512, 'deDE', 'Als neuer Rekrut seid Ihr Teil einer Rettungsmission, die von Sturmwind aufbricht.', '', 39653),
(170509, 'deDE', 'Kürzlich ist eine Allianzexpedition zu einer unerforschten Insel verschollen.', '', 39653),
(170508, 'deDE', 'Ihr seid ein Soldat der edlen Allianz, einer Koalition aus Königreichen, die Ideale wie Mut und Gerechtigkeit in ganz Azeroth bewahren.', '', 39653);
